INSERT INTO `Item` VALUES (1,'Heart0006','video','2011-08-30 19:16:15','2014-06-09 18:00:09','Heart0006-Functional-Right-Atrium-Right-Atrial-Appendage','View of the right atrial appendage.  The pectinate muscles are shown as well as the very thin membranous region between.  The crista terminalis is the upside down U-shaped structure at the top of the screen.',1,1,1,0,0),(2,'Heart0008','still','2011-08-30 19:16:15','2012-09-05 21:44:34','Heart0008-Functional-Right-Atrium-Right-Atrial-Appendage','In this image, the camera is sitting in the right atrial chamber and pointing slightly upward in order to view the inside of the appendage. Pectinate muscles can be seen in the lower left hand corner, while the light colored areas in the distance are the appendage wall.  The crista terminalis is seen traversing the upper right corner of the screen, while the sagittal band travels from the upper left corner of the image through the middle of the image.\n',0,1,0,0,0),(3,'Heart0009','video','2011-08-30 19:16:15','2012-09-05 21:44:34','Heart0009-Functional-Right-Atrium-Right-Atrial-Appendage','View of the right atrial free wall.  The pectinate muscles can be seen as well as the very thin membranous regions between.  The right atrial appendage is off the screen to the upper left.\n',1,1,1,0,0),(4,'Heart0013','video','2011-08-30 19:16:15','2012-09-05 21:44:34','Heart0013-Functional-Right-Atrium-Right-Atrial-Appendage','View of the right atrial appendage showing the pectinate muscles and the very thin membranous regions in between.  A Medtronic business card can clearly be read through the wall.\n',1,1,1,0,0),(5,'Heart0014','video','2011-08-30 19:16:15','2012-09-05 21:44:34','Heart0014-Functional-Right-Atrium-Right-Atrial-Appendage','View of the central portion of the crista terminalis as well as the anterior portion of the right atrial free wall.  The atrial appendage is off the screen to the upper left.  Pectinate muscles can be seen, as well as the very thin membranous regions between.\n',1,1,1,0,0),(6,'Heart0015','video','2011-08-30 19:16:15','2012-09-05 21:44:34','Heart0015-Functional-Right-Atrium-Right-Atrial-Appendage','View of the anterior free wall of the right atrium.  The crista terminalis can be seen at the very top of the screen.  The right atrial appendage is located to the left and upper left of the screen and continues off the screen.\n',1,1,1,0,0),(7,'Heart0017','video','2011-08-30 19:16:15','2012-09-05 21:44:34','Heart0017-Functional-Right-Atrium-Right-Atrial-Appendage','Rotated view of the RAA, with the top of the image being the anterior aspect of the RAA. In this view, the sagittal band is the large structure in the middle of the screen.  The crista terminalis is off the screen on the right hand side.\n',1,1,1,0,0),(8,'Heart0023','video','2011-08-30 19:16:15','2012-09-05 21:44:34','Heart0023-Functional-Right-Atrium-Right-Atrial-Appendage','In this image, the camera is sitting in the right atrial chamber and pointing slightly upward in order to view the inside of the appendage. In this image, the sagittal band travels from the upper left hand corner to the center of the RAA.  The RAA freewall is on the right and the crista terminalis is above this image, travelling parallel to the free wall and perpindicular to the sagittal band.\n',1,1,1,0,0),(9,'Heart0026','video','2011-08-30 19:16:15','2012-09-05 21:44:34','Heart0026-Functional-Right-Atrium-Right-Atrial-Appendage','Atrial fibrillation can be seen on the appendage wall.  Crista terminalis on the upper right, fibrillation observed in the pectinate muscles on the left.\n',1,1,1,0,0),(10,'Heart0037-1','video','2011-08-30 19:16:15','2012-09-05 21:44:34','Heart0037-Functional-Right-Atrium-Right-Atrial-Appendage-1','Atrial fibrillation in RA appendage; crista terminalis on upper right.\n',1,1,1,0,0),(11,'Heart0037-2','video','2011-08-30 19:16:15','2012-09-05 21:44:34','Heart0037-Functional-Right-Atrium-Right-Atrial-Appendage-2','Atrial fibrillation in RA appendage pectinate muscles; note how thin walled the RA is between pectinate muscles.\n',1,1,1,0,0),(12,'Heart0048-1','video','2011-08-30 19:16:15','2012-09-05 21:44:34','Heart0048-Functional-Right-Atrium-Right-Atrial-Appendage-1','Right atrial appendage is backlit in contracting heart; backlit is turned off during the clip. The tricuspid valve is to the left of the screen; note how thin walled the RA is between pectinate muscles.\n',1,1,1,0,0),(13,'Heart0048-2','video','2011-08-30 19:16:15','2014-06-09 19:21:32','Heart0048-Functional-Right-Atrium-Right-Atrial-Appendage-2','Contracting right atrial appendage; note how thin walled the RA is between pectinate muscles; text on Dr. Iaizzos business card can be read through the wall.',1,1,1,0,0),(14,'Heart0049','video','2011-08-30 19:16:15','2012-09-05 21:44:34','Heart0049-Functional-Right-Atrium-Right-Atrial-Appendage','Contracting right atrial appendage, but noted flutter in pectinate muscles.\n',1,1,1,0,0),(15,'Heart0053','video','2011-08-30 19:16:15','2012-09-05 21:44:34','Heart0053-Functional-Right-Atrium-Right-Atrial-Appendage','Right atrial appendage and sagittal band. Sagittal band seen in the center of the screen.\n',1,1,1,0,0),(16,'Heart0058-1','video','2011-08-30 19:16:15','2012-12-27 22:12:10','Heart0058-Functional-Right-Atrium-Right-Atrial-Appendage-1','View of the right atrial appendage - the pectinate muscles alternate with thin walls. The crista terminalis is just off the top of the screen.\n',0,1,1,0,0),(17,'Heart0058-2','video','2011-08-30 19:16:15','2012-12-27 22:12:10','Heart0058-Functional-Right-Atrium-Right-Atrial-Appendage-2','View of right atrial appendage wall with pectinate muscles.  Septomarginal trabeculations can be seen to the left of the view.\n',0,1,1,0,0),(18,'Heart0073','video','2011-08-30 19:16:15','2012-12-27 22:19:17','Heart0073-Functional-Right-Atrium-Right-Atrial-Appendage','View of right atrial appendage with pectinate muscles; anterior of heart is to the left.\n',0,1,1,0,0),(19,'Heart0076','video','2011-08-30 19:16:15','2012-12-27 22:21:39','Heart0076-Functional-Right-Atrium-Right-Atrial-Appendage','View of the right atrial appendage.\n',0,1,1,0,0),(20,'Heart0077','video','2011-08-30 19:16:15','2012-12-27 22:29:49','Heart0077-Functional-Right-Atrium-Right-Atrial-Appendage','View of the right atrial appendage with a close-up of the crista terminalis.\n',0,1,1,0,0),(21,'Heart0083-fib','video','2011-08-30 19:16:15','2012-12-27 22:42:37','Heart0083-Functional-Right-Atrium-Right-Atrial-Appendage-fib','View of the right atrial appendage from inside the right atrium during the onset of atrial fibrillation, characterized by a wave motion.\n',0,1,1,0,0),(22,'Heart0085-1','video','2011-08-30 19:16:15','2012-12-27 22:44:14','Heart0085-Functional-Right-Atrium-Right-Atrial-Appendage-1','Close up view of the right atrial appendage showing the pectinate muscles.\n',0,1,1,0,0),(23,'Heart0085-2','video','2011-08-30 19:16:15','2012-12-27 22:44:14','Heart0085-Functional-Right-Atrium-Right-Atrial-Appendage-2','The extremely thin walls of the right atrium are demonstrated in this clip of a business card seen through the appendage.  This anatomical phenomenon exemplifies the caution required when placing active fixation leads in the appendage.\n',0,1,1,0,0),(24,'Heart0086','video','2011-08-30 19:16:15','2012-12-27 22:47:12','Heart0086-Functional-Right-Atrium-Right-Atrial-Appendage','The right atrial appendage can be seen displaying the pectinate muscles and the start of the crista terminalis, to the top right of the image.  The quivering of the appendage is most probably due to the fact that the reanimated heart is not supported externally, as by the pericardium in the body.\n',0,1,1,0,0),(25,'Heart0120','video','2011-08-30 19:16:15','2012-12-27 22:49:25','Heart0120-Functional-Right-Atrium-Right-Atrial-Appendage','View of the right atrial appendage showing the pectinate muscles of the endocardial surface.  The tricuspid valve can be seen to the bottom left and the crista terminalis to the upper right.\n',0,1,1,0,0),(26,'Heart0126','video','2011-08-30 19:16:15','2012-12-27 22:51:19','Heart0126-Functional-Right-Atrium-Right-Atrial-Appendage','The right atrial appendage with pectinate muscle.\n',0,1,1,0,0),(27,'Heart0136-1','video','2011-08-30 19:16:15','2013-07-10 21:15:17','Heart0136-Functional-Right-Atrium-Right-Atrial-Appendage-1','The right atrial appendage is seen with light from the exterior of the heart shining through it\'s thin epicardium. Trebeculations are also prominent within the appendage.\n',0,1,1,0,0),(28,'Heart0136-2','video','2011-08-30 19:16:15','2013-07-10 21:15:17','Heart0136-Functional-Right-Atrium-Right-Atrial-Appendage-2','The right atrial appendage is seen with the free wall on the right side of the video. External light can be seen though the free wall in between the trebeculae due to its thin and semi-translucent nature of the atrium.',0,1,1,0,0),(29,'Heart0005','still','2011-08-30 19:16:15','2012-09-05 21:47:45','Heart0005-Perfusion-Fixed-Right-Atrium-Right-Atrial-Appendage','In this image, the camera is sitting in the right atrial chamber and pointing slightly upward in order to view the inside of the appendage.  View of the RAA with many trabeculations present.  Crista terminalis travels along the tops of the screen.\n',0,1,0,0,0),(30,'Heart0005-LW','still','2011-08-30 19:16:15','2012-09-05 21:47:45','Heart0005-Perfusion-Fixed-Right-Atrium-Right-Atrial-Appendage-LW','Looking towards the RAA freewall, with the crista terminalis in the upper right hand corner.\n',0,1,0,0,0),(31,'Heart0007','still','2011-08-30 19:16:15','2012-09-05 21:47:45','Heart0007-Perfusion-Fixed-Right-Atrium-Right-Atrial-Appendage','Rotated view of the RAA, the top of the image being the posterior aspect of the RAA and the left of the image being the crista terminalis.\n',0,1,0,0,0),(32,'Heart0016','still','2011-08-30 19:16:15','2012-09-05 21:47:45','Heart0016-Perfusion-Fixed-Right-Atrium-Right-Atrial-Appendage','Rotated view of the RAA, the bottom of the image being the crista terminalis.  Excellent example of networked pectinate muscles forming a trabeculated surface very similar in appearance to the ventricles.\n',0,1,0,0,0),(33,'Heart0018-1','still','2011-08-30 19:16:15','2012-09-05 21:47:45','Heart0018-Perfusion-Fixed-Right-Atrium-Right-Atrial-Appendage-1','View into the right atrial appendage/auricle. Excellent example of networked pectinate muscles forming a trabeculated surface very similar in appearance to the ventricles.\n',0,1,0,0,0),(34,'Heart0018-2','still','2011-08-30 19:16:15','2012-09-05 21:47:45','Heart0018-Perfusion-Fixed-Right-Atrium-Right-Atrial-Appendage-2','In this image, the camera is sitting in the right atrial chamber and pointing slightly upward in order to view the inside of the appendage. Crista terminalis travelling along the upper right portion of the image, with the sagittal band traversing down the RAA in the distance.\n',0,1,0,0,0),(35,'Heart0018-3','still','2011-08-30 19:16:15','2012-09-05 21:47:45','Heart0018-Perfusion-Fixed-Right-Atrium-Right-Atrial-Appendage-3','View into the right atrial appendage/auricle. Excellent example of networked pectinate muscles forming a trabeculated surface very similar in appearance to the ventricles.\n',0,1,0,0,0),(36,'Heart0019','still','2011-08-30 19:16:15','2012-09-05 21:47:45','Heart0019-Perfusion-Fixed-Right-Atrium-Right-Atrial-Appendage','Rotated view of the RAA, the top of the image being the posterior aspect of the RAA and the left of the image being the crista terminalis.\n',0,1,0,0,0),(37,'Heart0020','still','2011-08-30 19:16:15','2012-09-05 21:47:45','Heart0020-Perfusion-Fixed-Right-Atrium-Right-Atrial-Appendage','In this image, the camera is sitting in the right atrial chamber and pointing slightly upward in order to view the inside of the appendage. Crista terminalis travelling along the upper right portion of the image, with the sagittal band traversing down the RAA in the distance.\n',0,1,0,0,0),(38,'Heart0022','still','2011-08-30 19:16:15','2012-09-05 21:47:45','Heart0022-Perfusion-Fixed-Right-Atrium-Right-Atrial-Appendage','In this image, the camera is sitting in the right atrial chamber and pointing slightly upward in order to view the inside of the appendage. Crista terminalis travelling along the left edge of the image, with the sagittal band traversing from the left to the middle of the image.\n',0,1,0,0,0),(39,'Heart0024','still','2011-08-30 19:16:15','2012-09-05 21:47:45','Heart0024-Perfusion-Fixed-Right-Atrium-Right-Atrial-Appendage','Upclose view of an unique pectinate muscle in the right atrial appendage.',0,1,0,0,0),(40,'Heart0000','still','2011-08-30 19:16:15','2015-05-05 18:20:35','appendh','\n',0,0,0,0,0),(41,'Heart0005-acute-margin','sectioned','2011-08-30 19:16:15','2011-08-30 19:19:26','Heart0005-acute-margin','\n',0,0,0,0,0),(42,'Heart0010-Ant-Post','sectioned','2011-08-30 19:16:15','2012-09-14 20:00:52','Heart0010-Sectioned-Ant-Post','\n',0,0,0,0,0),(43,'Heart0010-Int-Ant-Post','sectioned','2011-08-30 19:16:15','2012-09-14 20:00:52','Heart0010-Sectioned-Int-Ant-Post','\n',0,0,0,0,0),(45,'Heart0013_ant_epi','sectioned','2011-08-30 19:16:15','2012-08-20 14:41:09','Heart0013-ant-epi','\n',0,0,0,0,0),(46,'Heart0015-Ant','sectioned','2011-08-30 19:16:15','2012-09-14 20:00:52','Heart0015-Sectioned-Ant','\n',0,0,0,0,0),(47,'Heart0015-Int-Right','sectioned','2011-08-30 19:16:15','2012-09-14 20:00:52','Heart0015-Sectioned-Int-Right','\n',0,0,0,0,0),(48,'Heart0015-Post','sectioned','2011-08-30 19:16:15','2012-09-14 20:00:52','Heart0015-Sectioned-Post','\n',0,0,0,0,0),(49,'Heart0017_acute_margin','sectioned','2011-08-30 19:16:15','2015-05-14 21:47:01','Heart0017-acute-margin','A right margin view of a heart in which the pericardium was removed.',0,0,0,0,0),(50,'Heart0020-Ant','sectioned','2011-08-30 19:16:15','2012-09-14 20:00:52','Heart0020-Sectioned-Ant','\n',0,0,0,0,0),(51,'Heart0020-Right','sectioned','2011-08-30 19:16:15','2012-09-14 20:00:52','Heart0020-Sectioned-Right','\n