 this image\n',0,0,0,0,0),(262,'Heart0022-Low','still','2011-08-30 19:16:18','2014-08-12 16:16:34','Heart0022-Perfusion-Fixed-Right-Atrium-Interatrial-Septum-Low','Interatrial septum seen in the upper portion of the image.  The tricuspid valve is seen in the lower right corner.\n',0,1,0,0,0),(263,'Heart0024-High','still','2011-08-30 19:16:18','2012-09-05 21:47:45','Heart0024-Perfusion-Fixed-Right-Atrium-Interatrial-Septum-High','High portion of the interatrial septum seen in this image.\n',0,0,0,0,0),(264,'Heart0024-Low','still','2011-08-30 19:16:18','2014-08-12 16:16:34','Heart0024-Perfusion-Fixed-Right-Atrium-Interatrial-Septum-Low','Interatrial septum covers the upper half of the image, the tricuspid valve can be seen in the lower right portion of the image.',0,1,0,0,0),(265,'Heart0005-4chamber','sectioned','2011-08-30 19:16:18','2011-08-30 19:19:26','Heart0005-4chamber','\n',0,0,0,0,0),(269,'Heart0003-1','video','2011-08-30 19:16:18','2012-09-20 16:36:08','Heart0003-Functional-Right-Atrium-Lateral-Wall-1','The lateral wall can be seen fibrillating in this footage; some residual air bubbles from the reanimation process are present. The pectinate muscle (musculi pectinati) can be clearly seen with thin regions visible between the muscular ridges. This muscle is generally described as looking like the teeth of a comb.',1,1,1,0,0),(270,'Heart0003-2','video','2011-08-30 19:16:18','2012-09-20 16:36:08','Heart0003-Functional-Right-Atrium-Lateral-Wall-2','The lateral wall can be seen fibrillating in a more coordinated fashion in this clip.  This is often a result of the rewarming process as the myocardial tissue changes from the initial uncoordinated contractions.',1,1,1,0,0),(271,'Heart0003-3','video','2011-08-30 19:16:18','2012-09-20 16:36:08','Heart0003-Functional-Right-Atrium-Lateral-Wall-3','Lateral wall fibrillation; tricuspid valve is to the left of the screen and the body of a pacing lead can be seen in the upper left corner. The footage shows the atrial wall contracting out of sync with the paced ventricle, as evidenced by the function of the tricuspid valve, indicating that the heart is not generating a native sinus rhythm.',1,1,1,0,0),(272,'Heart0011-1','video','2011-08-30 19:16:18','2012-09-20 16:36:08','Heart0011-Functional-Right-Atrium-Lateral-Wall-1','The anterior region of the right atrial lateral wall; the crista terminalis can be seen at the top of the screen. Note how thin walled the RA is between pectinate muscles.',1,1,1,0,0),(273,'Heart0011-2','video','2011-08-30 19:16:18','2012-09-20 16:36:08','Heart0011-Functional-Right-Atrium-Lateral-Wall-2','Close up view of the lateral wall of the right atrium. . The pectinate muscle (musculi pectinati) can be seen clearly. This muscle is generally described as looking like the teeth of a comb. Note how thin walled the atrial wall is between pectinate muscles.',1,1,1,0,0),(274,'Heart0014','video','2011-08-30 19:16:18','2012-09-20 16:36:08','Heart0014-Functional-Right-Atrium-Lateral-Wall','View of the lateral wall of the right atrium. Pectinate muscles can be seen spanning the entire region. The coronary sinus ostium can be seen late in the clip near the upper right corner. The inferior vena cava cannula is just off the top of the screen. ',1,1,1,0,0),(275,'Heart0017','video','2011-08-30 19:16:18','2012-09-20 16:36:08','Heart0017-Functional-Right-Atrium-Lateral-Wall','Footage of the superior region of the right atrial lateral wall taken with a camera pointing in a superior-posterior direction. The pectinate muscles of the lateral wall can be seen traveling vertically, along surface of the wall. The superior vena cava cannula can be seen in the upper right portion of the image.',1,1,1,0,0),(276,'Heart0017-AW','video','2011-08-30 19:16:18','2012-09-20 16:36:08','Heart0017-Functional-Right-Atrium-Lateral-Wall-Anterior-Wall','Up close view of pectinate muscles (musculi pectinati) coursing across the endocardial surface of the lateral wall. This muscle is generally described as looking like the teeth of a comb. Note how thin walled the RA is between pectinate muscles.',1,1,1,0,0),(277,'Heart0023','video','2011-08-30 19:16:18','2012-09-20 16:36:08','Heart0023-Functional-Right-Atrium-Lateral-Wall','Camera is positioned to view the anterior lateral aspect of the lateral wall, often labeled the free wall. This image, taken from inside the right atrium, demonstrates the extremely thin nature of the wall by viewing a ruler on the exterior of the heart.',1,1,1,0,0),(278,'Heart0048','video','2011-08-30 19:16:18','2012-09-20 16:36:08','Heart0048-Functional-Right-Atrium-Lateral-Wall','Lateral wall of the right atrium; the tricuspid valve can be seen to the left of the screen. The end of the footage is an excellent example of how thin the lateral wall can be, evidenced by the darker windows between the pectinate muscles.',1,1,1,0,0),(279,'Heart0049','video','2011-08-30 19:16:18','2012-09-20 16:36:08','Heart0049-Functional-Right-Atrium-Lateral-Wall','The lateral wall of the right atrium covered in pectinate muscles; the crista terminalis can be seen in the upper right corner.',1,1,1,0,0),(280,'Heart0058','video','2011-08-30 19:16:18','2012-09-20 16:36:08','Heart0058-Functional-Right-Atrium-Lateral-Wall','Up close view of pectinate muscles (musculi pectinati) travelling along the endocardial surface of the right atrial lateral wall. This muscle is generally described as looking like the teeth of a comb.',1,1,1,0,0),(281,'Heart0083','video','2011-08-30 19:16:18','2012-12-27 22:42:37','Heart0083-Functional-Right-Atrium-Lateral-Wall','Close-up of the inferior portion of the right atrial lateral wall; pectinate muscles of the appendage can be seen in the background with the tricuspid vale to the lower left. A mapping electrode catheter is threaded into the right atrial appendage. The footage ends with a shot of the inferior vena cava cannula.',0,1,1,0,0),(282,'Heart0086','video','2011-08-30 19:16:18','2012-12-27 22:47:12','Heart0086-Functional-Right-Atrium-Lateral-Wall','The lateral wall is viewed with a side-view camera entering the right atrium through the superior vena cava.',0,1,1,0,0),(283,'Heart0053','video','2011-08-30 19:16:18','2012-09-20 16:36:08','Heart0053-Functional-Right-Atrium-Lateral-Wall','Right atrial lateral wall; pectinate muscles of the anterior aspect of the wall can be seen in the background with the crista terminalis in the upper right.',1,0,1,0,0),(284,'Heart0005','still','2011-08-30 19:16:18','2012-09-20 16:40:40','Heart0005-Perfusion-Fixed-Right-Atrium-Lateral-Wall','Camera is positioned to view the lateral wall of the right atrium. The anterior region of the right atrium can be seen in the left portion of this image, evident by the pectinate muscle traveling along the wall. In the center of the image is the ridge which separates the free wall from the septal wall, which is seen in the right portion of the image.',0,1,0,0,0),(285,'Heart0007-2','still','2011-08-30 19:16:18','2012-09-20 16:39:52','Heart0007-Perfusion-Fixed-Right-Atrium-Lateral-Wall-2','Camera is positioned to view the anterior lateral aspect of the lateral wall. The lateral wall of this heart is highly trabeculated. The V-shaped structure at the top of the screen is the beginning of the crista terminalis, which will travel along the roof of the RA, separating the RA appendage from the rest of the chamber.',0,1,0,0,0),(286,'Heart0007-AW-App','still','2011-08-30 19:16:18','2012-09-20 16:38:36','Heart0007-Perfusion-Fixed-Right-Atrium-Lateral-Wall-Anterior-Wall-App','The anterior portion of the right atrial lateral wall can be seen I this image.  The crista terminalis can be seen to the upper right of the image.',0,1,0,0,0),(287,'Heart0018','still','2011-08-30 19:16:18','2012-09-20 16:38:36','Heart0018-Perfusion-Fixed-Right-Atrium-Lateral-Wall','Camera pointing in an inferior-posterior direction to view a portion of the lateral wall of the right atrium. The inferior vena cava is tied off in the upper right portion of this image