ed-Right-Atrium-Tricuspid-Valve','To view the tricuspid valve in the RA, the camera enters through the superior vena cava and points apically.  This tricuspid valve appears to have four leaflets.  Off of the septal leaflet (left portion of the valve) the coronary sinus can be seen.\n',0,1,0,0,0),(355,'Heart0020','still','2011-08-30 19:16:19','2012-09-05 21:47:45','Heart0020-Perfusion-Fixed-Right-Atrium-Tricuspid-Valve','To view the tricuspid valve in the RA, the camera enters through the superior vena cava and points apically.  Tricuspid valve seen with a large septal leaflet (on left) and leaflets about 2/3s and 1/3 the size opposite it.  To the left of the septal leaflet is the coronary sinus.\n',0,1,0,0,0),(356,'Heart0022','still','2011-08-30 19:16:19','2012-09-05 21:47:45','Heart0022-Perfusion-Fixed-Right-Atrium-Tricuspid-Valve','To view the tricuspid valve in the RA, the camera enters through the superior vena cava and points apically.  Tricuspid valve seen here, bordered by the RA free wall on the anterior portion of the valve.',0,1,0,0,0),(358,'Heart0005-2chamber-post','sectioned','2011-08-30 19:16:19','2011-08-30 19:19:26','Heart0005-2chamber-post','\n',0,0,0,0,0),(367,'Heart0017_sections_2','sectioned','2011-08-30 19:16:19','2012-08-20 14:41:09','Heart0017-sections-2','\n',0,0,0,0,0),(371,'Heart0003','video','2011-08-30 19:16:19','2012-09-05 21:44:34','Heart0003-Functional-Right-Ventricle-Apex','The trabeculations in the right ventricular apex can be seen here. The muscular trabeculae can be seen contracting in synchrony.  The white connective tissues are conduction bands and allow the stimulation signal to travel from one portion of the heart to another.\n',1,1,1,0,0),(372,'Heart0009','video','2011-08-30 19:16:19','2012-09-05 21:44:34','Heart0009-Functional-Right-Ventricle-Apex','View of the right ventricular apex.  The posterior papillary muscle is to the left, the septal wall to the top and center, and the anterior papillary muscle off screen to the lower right.\n',1,1,1,0,0),(373,'Heart0014','video','2011-08-30 19:16:19','2012-09-05 21:44:34','Heart0014-Functional-Right-Ventricle-Apex','View of the right ventricular apex.  A high degree of trabeculation can be seen.  The small white bands are presumably conduction fibers.\n',1,1,1,0,0),(374,'Heart0015','video','2011-08-30 19:16:19','2012-09-05 21:44:34','Heart0015-Functional-Right-Ventricle-Apex','The right ventricular apex is shown.  The base of the posterior papillary muscle is on the tops of the screen, and the base of the anterior papillary muscle is on the lower right corner of the screen.\n',1,1,1,0,0),(375,'Heart0017','still','2011-08-30 19:16:19','2012-09-05 21:44:34','Heart0017-Functional-Right-Ventricle-Apex','In this view, the camera is placed through under the tricuspid valve, peering into the RV apex.  The white bands are chordae tendinae, which prevent the valve leaflets they are attached to above (tricuspid valve) from prolasping.  From below, the chordae tendinae are attached to papillary muscles, which can be seen in this image and look like little bumps.\n',0,1,0,0,0),(376,'Heart0023','video','2011-08-30 19:16:19','2012-09-05 21:44:34','Heart0023-Functional-Right-Ventricle-Apex','Camera is looking into the right ventricular apex with the septal wall on the left and top and the free wall on the right and bottom\n',1,1,1,0,0),(377,'Heart0046','video','2011-08-30 19:16:19','2012-09-05 21:44:34','Heart0046-Functional-Right-Ventricle-Apex','The extent of trabeculation (muscular tissue) as well as the different morphologies of the conduction bands (white strings) can be seen in this video from the right ventricular apex.\n',1,1,1,0,0),(378,'Heart0048-1','video','2011-08-30 19:16:19','2012-09-05 21:44:34','Heart0048-Functional-Right-Ventricle-Apex-1','The RV apex is seen here as you look across the base of the apex. The moderator band can be seen clearly in the middle of the image spanning from one wall to the other. Also fatty deposits can be seen lining the trabeculae in various areas.\n',1,1,1,0,0),(379,'Heart0048-2','video','2011-08-30 19:16:19','2012-09-05 21:44:34','Heart0048-Functional-Right-Ventricle-Apex-2','This video shows a close-up of a conduction band in the foreground with the trabeculations of the RV apex in the background. Also in the background you can see small connections from the cardiac conduction bands spanning from muscle to muscle.\n',1,1,1,0,0),(380,'Heart0049-1','video','2011-08-30 19:16:19','2012-09-05 21:44:34','Heart0049-Functional-Right-Ventricle-Apex-1','The RV apex is seen here with various sizes of trabeculae. The thin white lines are conduction bands and the variety of ways they can be connected can be seen in this video.\n',1,1,1,0,0),(381,'Heart0049-2','video','2011-08-30 19:16:19','2012-09-05 21:44:34','Heart0049-Functional-Right-Ventricle-Apex-2','The apex of the RV can be seen here. Large movements from the ventricular walls can be seen here. The amount of trabeculation in this specimen is less than others that can be seen on this site.\n',1,1,1,0,0),(382,'Heart0049-3','video','2011-08-30 19:16:19','2012-09-05 21:44:34','Heart0049-Functional-Right-Ventricle-Apex-3','A view of the apex from deep within the trabeculae. The camera begins with a close-up of some trabeculae and conduction bands then pans backwards to see more of the ventricular walls and papillary muscles.\n',1,1,1,0,0),(383,'Heart0053','video','2011-08-30 19:16:19','2012-09-05 21:44:34','Heart0053-Functional-Right-Ventricle-Apex','A view of the right ventricular apex showing a significant number of trabeculations and conduction bands.\n',1,1,1,0,0),(384,'Heart0058','video','2011-08-30 19:16:20','2012-09-05 21:44:34','Heart0058-Functional-Right-Ventricle-Apex','View of the right ventricular apex with conduction bands (thin white string-like structures) and trabeculations.  The base of the posterior papillary muscle can be seen to the top right of the screen.\n',1,1,1,0,0),(385,'Heart0073','video','2011-08-30 19:16:20','2012-09-05 21:44:34','Heart0073-Functional-Right-Ventricle-Apex','View of trabeculations and conduction bands throughout RV. Unique conduction band from the tricuspid valve to the anterior right ventricular wall. The tricuspid valve is to the upper right of the screen.\n',1,1,1,0,0),(386,'Heart0076','video','2011-08-30 19:16:20','2012-12-27 22:21:40','Heart0076-Functional-Right-Ventricle-Apex','In this video the right ventricular apex is shown with trabeculae and connection bands situated against the walls of the ventricle. The camera then pans out to show more of the right ventricle.\n',0,1,1,0,0),(387,'Heart0077-1','video','2011-08-30 19:16:20','2012-12-27 22:29:49','Heart0077-Functional-Right-Ventricle-Apex-1','The elaborate and intricate layout of the trabeculations and connection bands is visible here along with the shortening of the trabeculae and tissue during contractions.\n',0,1,1,0,0),(388,'Heart0077-2','video','2011-08-30 19:16:20','2012-12-27 22:29:49','Heart0077-Functional-Right-Ventricle-Apex-2','The camera is viewing the walls of the right ventricle as well as the right ventricular apex. Two conduction bands can be distinguished in this video, one at the top left of the image and one just inside of the left side of the image.\n',0,1,1,0,0),(389,'Heart0083','video','2011-08-30 19:16:20','2012-12-27 22:42:37','Heart0083-Functional-Right-Ventricle-Apex','View of the right ventricular apex.  This image displays the significant number of trabeculations and conduction bands in the apex of the right ventricle.\n',0,1,1,0,0),(390,'Heart0086','video','2011-08-30 19:16:20','2012-12-27 22:47:12','Heart0086-Functional-Right-Ventricle-Apex','The right ventricular apex is seen with the anterior papillary muscle at the top of the screen initially.The shot zooms in on three different sections of the apex and shows the trabeculations.',0,1,1,0,0),(391,'Heart0005','still','2011-08-30 19:16:20','2012-09-05 21:47:45','Heart0005-Perfusion-Fixed-Right-Ventricle-Apex','In this image, the camera is sticking through the tricuspid valve and very near to the apex of the heart.  This apex is heavily trabeculated (dainty weblike structures) and thicker conduction bands can be seen connecting one side of the RV to the other, facilitating the fast conduction of electrical pulses throughout the chamber.\n',0,1,0,0,0),(392,'Heart0005-Trab-1','still','2011-08-30 19:16:20','2014-07-22 19:44:34','Heart0005-Perfusion-Fixed-Right-Ventricle-Apex-Trab-1','Perfusion fixed heart.  Camera advances towards right ventricular apex and into trabeculations.\n',0,1,0,0,0),(393,'Heart0005-Trab-2','still','2011-08-30 19:16:20','2014-07-22 19:44:34','Heart0005-Perfusion-Fixed-Right-Ventricle-Apex-Trab-2','Perfusion fixed heart.  Camera advances towards right ventricular apex and into trabeculations.\n',0,1,0,0,0),(394,'Heart0007-1','still','2011-08-30 19:16:20','2012-09-05 21:47:45','Heart0007-Perfusion-Fixed-Right-Ventricle-Apex-1','Another view of the apex of the RV.  The trabeculations seem to form along the wall of the RV, leaving the center open.\n',0,1,0,0,0),(395,'Heart0007-2','still','2011-08-30 19:16:20','2012-09-05 21:47:45','Heart0007-Perfusion-Fixed-Right-Ventricle-Apex-2','Peering toward the apex, with trabeculations seen along the wall of the ventricle and a large conduction band spanning the upper right corner of the image.\n',0,1,0,0,0),(396,'Heart0016','still','2011-08-30 19:16:20','2012-09-05 21:47:45','Heart0016-Perfusion-Fixed-Right-Ventricle-Apex','In this view, the camera is placed just through the tricuspid valve, peering into the RV apex.  Trabeculations seen in the apex of the right ventricle.  Larger, thicker conduction bands can be seen in the foreground of the picture.\n',0,1,0,0,0),(397,'Heart0018-1','still','2011-08-30 19:16:20','2012-09-05 21:47:45','Heart0018-Perfusion-Fixed-Right-Ventricle-Apex-1','Cardiac Trabeculae is seen in this image with their tortuous alignment. From the trabeculae cardiac conduction bands, white lines, can be seen connecting throughout the apex.\n',0,1,0,0,0),(398,'Heart0018-3','still','2011-08-30 19:16:20','2012-09-05 21:47:45','Heart0018-Perfusion-Fixed-Right-Ventricle-Apex-3','In this view, the camera is placed just through the tricuspid valve, peering into the RV apex.  Large conduction band spanning the RV apex in the upper right corner of the image.  In the lower left corner of the image a tricuspid leaflet can be seen reaching into the ventricle.\n',0,1,0,0,0),(399,'Heart0019-1','still','2011-08-30 19:16:20','2014-07-22 19:44:34','Heart0019-Perfusion-Fixed-Right-Ventricle-Apex-1','In this view, the camera is placed just through the tricuspid valve, peering into the RV apex.  View of a highly trabeculated apex, note the thicker conduction bands reaching across the ventricle.\n',0,1,0,0,0),(400,'Heart0019-2','still','2011-08-30 19:16:20','2012-09-05 21:47:45','Heart0019-Perfusion-Fixed-Right-Ventricle-Apex-2','A close-up view of the trabeculation within the RV apex. The yellow markings that are seen on the wall and trabeculae are fatty deposits that can be seen as the yellow spots on the muscular tissue.\n',0,1,0,0,0),(401,'Heart0020','still','2011-08-30 19:16:20','2012-09-05 21:47:45','Heart0020-Perfusion-Fixed-Right-Ventricle-Apex','In this view, the camera is placed just through the tricuspid valve, peering into the RV apex.  Trabeculations begin sparsely in the foreground and become much more dense within the deep apex.\n',0,1,0,0,0),(402,'Heart0022','still','2011-08-30 19:16:20','2012-09-05 21:47:45','Heart0022-Perfusion-Fixed-Right-Ventricle-Apex','Camera is deep within the apex of the heart.  In the lower left corner of the image is the heart wall and trabeculations can be seen growing off of the wall and across the apex of the RV.\n',0,1,0,0,0),(403,'Heart0024','still','2011-08-30 19:16:20','2012-09-05 21:47:45','Heart0024-Perfusion-Fixed-Right-Ventricle-Apex','Camera is deep within the apex of the heart.  Trabeculations seen in this image are much thicker than those viewed in previous hearts-- less occurance of the fine, weblike structure.',0,1,0,0,0),(404,'Heart000','sectioned','2011-08-30 19:16:20','2011-08-30 19:19:26','apexh','\n',0,0,0,0,0),(405,'Heart000','sectioned','2011-08-30 19:16:20','2011-08-30 19:19:26','rvoth','A view of a transected unfixed heart in which one can see the right ventricle, the ventricular septum, the anterior papillary muscle and a portion of the moderator band.\n',0,0,0,0,0),(429,'Heart0058','video','2011-08-30 19:16:20','2012-09-05 21:44:34','Heart0058-Functional-Right-Ventricle-Inflow-Tract','The tricuspid valve is seen here with the large anterior leaflet on the right side, the septal leaflet on the left side and the posterior leaflet is not seen here. Both of the visible leaflets are attached to the septal wall via chordae tendineae.\n',1,1,1,0,0),(430,'Heart0076','video','2011-08-30 19:16:20','2012-12-27 22:21:40','Heart0076-Functional-Right-Ventricle-Inflow-Tract','The right ventricular outflow tract is seen here with the septal wall on the right side and the free wall on the left. The tricuspid valve can be seen with the chordae tendineae attaching to the papillary muscles.\n',0,1,1,0,0),(431,'Heart0083','video','2011-08-30 19:16:20','2012-12-27 22:42:37','Heart0083-Functional-Right-Ventricle-Inflow-Tract','View of the right ventricular inflow tract.  The tricuspid valve is at the top left of the image connected to all three right ventricular papillary muscles via the chordae tendinae.  The anterior papillary muscle can be seen to the left of the image, the septal papillary muscle can be seen on the left connected to the septal wall and the posterior papillary muscle can be seen in the background.\n',0,1,1,0,0),(432,'Heart0014','video','2011-08-30 19:16:20','2012-09-05 21:44:34','Heart0014-Functional-Right-Ventricle-Inflow-Tract','The right ventricle is shown with the septal wall on the right, anterior papillary muscle in the middle of the screen, posterior papillary muscle in the back, and tricuspid valve off the top of the screen. A muscular moderator band can been easily observed connecting the anterior papillary muscle to the septal wall.',1,0,1,0,0),(433,'Heart0005-HIS','still','2011-08-30 19:16:20','2014-07-22 19:44:34','Heart0005-Perfusion-Fixed-Right-Ventricle-Inflow-Tract-HIS','Perfusion fixed heart.  View of tricuspid valve from below, showing septal wall and location of His bundle approach from the right ventricle.\n',0,1,0,0,0),(434,'Heart0005-LW-AW','still','2011-08-30 19:16:20','2012-09-14 16:25:53','Heart0005-Perfusion-Fixed-Right-Ventricle-Inflow-Tract-LW-Anterior-Wall','Image taken from within the RVA, looking laterally.  Here, the anterior-lateral wall can be seen, which is part of the right ventricular inflow tract.  Notice the trabeculations along the wall, as well as the papillary muscles in the foreground.\n',0,1,0,0,0),(435,'Heart0005-SW','still','2011-08-30 19:16:20','2012-09-14 16:27:36','Heart0005-Perfusion-Fixed-Right-Ventricle-Inflow-Tract-Septal-Wall','This image is taken from within the RVA, peering upward towards the tricuspid valve, which can be seen in the upper left corner of the image.  The chordae tendinae can be seen reaching off of the tricuspid leaflets and attaching to the septal wall papillaries.  Notice how the septal wall of the right ventricular inflow tract is very smooth in comparison with the lateral-anterior wall.\n',0,1,0,0,0),(436,'Heart0007','still','2011-08-30 19:16:20','2012-09-05 21:47:45','Heart0007-Perfusion-Fixed-Right-Ventricle-Inflow-Tract','Looking through the tricuspid valve toward the posterior wall of the RVIT.  Note the level of trabeculations on the posterior wall vs. the smooth surface of the septal wall seen on the right hand side of the image.  Reaching up through the middle of the image is a septal papillary muscle.\n',0,1,0,0,0),(437,'Heart0007-AW','still','2011-08-30 19:16:20','2012-09-14 16:25:53','Heart0007-Perfusion-Fixed-Right-Ventricle-Inflow-Tract-Anterior-Wall','The anterior wall is seen behind the anterior papillary muscles. Above the papillary muscles the anterior leaflet of the tricuspid valve can be seen.\n',0,1,0,0,0),(438,'Heart0007-HIS','still','2011-08-30 19:16:20','2012-09-05 21:47:45','Heart0007-Perfusion-Fixed-Right-Ventricle-Inflow-Tract-HIS','In the left half of this image is a leaflet from the tricuspid valve.  The chordae tendinae are seen attaching to the septal papillary muscles.  Note the smooth surface of the septal wall.  The His bundle is just beneath the leaflet on the border of the septal wall and the right atrium.\n',0,1,0,0,0),(439,'Heart0007-SW','still','2011-08-30 19:16:20','2012-09-14 16:27:36','Heart0007-Perfusion-Fixed-Right-Ventricle-Inflow-Tract-Septal-Wall','View of papillary muscles and trabeculations on the septal wall, near the apex of the inflow tract.  The thin, white structures are the bottoms of the chordae tendinae attaching to the papillary muscles.\n',0,1,0,0,0),(440,'Heart0016-HIS','still','2011-08-30 19:16:20','2012-09-05 21:47:45','Heart0016-Perfusion-Fixed-Right-Ventricle-Inflow-Tract-HIS','In this view, the camera is sitting in the ventricle, looking up toward the tricuspid valve (top of the screen) and the pulmonary valve (right edge of the screen).  The inflow tract of the ventricle is in the foreground of the image.\n',0,1,0,0,0),(441,'Heart0016-LW','still','2011-08-30 19:16:20','2012-09-05 21:47:45','Heart0016-Perfusion-Fixed-Right-Ventricle-Inflow-Tract-LW','Trabeculations seen when peering toward the apex along the lateral wall of the ventricle.  The papillary muscles are in view, with the chordae tendinae reaching off of them and attaching to the tricuspid valve leaflets.\n',0,1,0,0,0),(442,'Heart0016-SW','still','2011-08-30 19:16:20','2012-09-14 16:27:36','Heart0016-Perfusion-Fixed-Right-Ventricle-Inflow-Tract-Septal-Wall','View from within the right ventricle, peering toward the septal wall.  In the upper portion of the image, a tricuspid leaflet can be seen, along with the chordae tendinae reaching down to attach to the papillary muscles below.\n',0,1,0,0,0),(443,'Heart0018-HIS','still','2011-08-30 19:16:20','2012-09-05 21:47:45','Heart0018-Perfusion-Fixed-Right-Ventricle-Inflow-Tract-HIS','In this view, the leaflet form the tricuspid valve is completely open and is pressed against the septal wall.  The His bundle is within the high septal wall, just inferior to the atrial chamber. \n',0,1,0,0,0),(444,'Heart0018-SW','still','2011-08-30 19:16:20','2012-09-14 16:27:36','Heart0018-Perfusion-Fixed-Right-Ventricle-Inflow-Tract-Septal-Wall','Camera is in the right ventricle, looking toward the septal wall.  Near the top of the image, one of the tricuspid valve leaflets can be seen with the chordae tendinae reaching down to attach to the septal papillary muscles, which are not very prominent in this specimen.\n',0,1,0,0,0),(445,'Heart0019','still','2011-08-30 19:16:20','2014-07-22 19:44:34','Heart0019-Perfusion-Fixed-Right-Ventricle-Inflow-Tract','In this movie, the camera begins in the high right ventricle, where the smooth wall of the septum can be seen.  It slowly moves through the tricuspid valve, where the white structure in the foreground is the septal leaflet.  Once through the valve, the floor of the atrium can be seen.\n',0,1,0,0,0),(446,'Heart0019-HIS','still','2011-08-30 19:16:20','2012-09-05 21:47:45','Heart0019-Perfusion-Fixed-Right-Ventricle-Inflow-Tract-HIS','In this image, the camera is deep within the right ventricle, peering upward toward the tricuspid valve.  On the right side of the image is the septal wall/inflow tract-- note the rather smooth surface. To the left of this image, the right ventricular chamber opens up. The His bundle is positioned high and deep in the septal wall, just under the floor of the right atrium. \n',0,1,0,0,0),(447,'Heart0019-SW','still','2011-08-30 19:16:20','2012-09-14 16:27:36','Heart0019-Perfusion-Fixed-Right-Ventricle-Inflow-Tract-Septal-Wall','The septal wall of the right ventricle is seen here. The trabeculae can be seen throughout the tissue. The septal papillary can be located by following the chordae tendineae coming from the tricuspid down and connecting to the musculature.\n',0,1,0,0,0),(448,'Heart0020-HIS','still','2011-08-30 19:16:20','2012-09-05 21:47:45','Heart0020-Perfusion-Fixed-Right-Ventricle-Inflow-Tract-HIS','In this shot, the camera is right at the level of the tricuspid annulus.  Here, another view of the septal leaflet of the tricuspid valve is seen, underneath which, deep within the septal wall, is the His bundle.  Note the many branches of chordae tendinae attaching to the septal wall.\n',0,1,0,0,0),(449,'Heart0020-LW-AW','still','2011-08-30 19:16:20','2012-09-14 16:25:53','Heart0020-Perfusion-Fixed-Right-Ventricle-Inflow-Tract-LW-Anterior-Wall','This image is taken from the middle of the RV chamber, looking at the anterior-lateral surface.  In the foreground of the image, a papillary muscle is seen, with chordae tendinae reaching upward toward the leaflets of the tricuspid valve.\n',0,1,0,0,0),(450,'Heart0020-SW','still','2011-08-30 19:16:20','2012-09-14 16:27:36','Heart0020-Perfusion-Fixed-Right-Ventricle-Inflow-Tract-Septal-Wall','The tricuspid valve is just above the upper left hand corner of this image.  The smooth septal wall is seen straight ahead.\n',0,1,0,0,0),(451,'Heart0022-HIS','still','2011-08-30 19:16:20','2012-09-05 21:47:45','Heart0022-Perfusion-Fixed-Right-Ventricle-Inflow-Tract-HIS','This image is take from deep within the right ventricle, looking upward toward the tricuspid valve from below.  Just outside of the upper left corner of the image is the right ventricular outflow tract, meaning that the inflow tract travels along the lower right corner of the image.\n',0,1,0,0,0),(452,'Heart0022-SW','still','2011-08-30 19:16:20','2012-09-14 16:27:36','Heart0022-Perfusion-Fixed-Right-Ventricle-Inflow-Tract-Septal-Wall','Great view of the septal wall/inflow tract.  This image is captured from just beneath the tricuspid annulus.  The septal leaflet can be seen in the upper left corner of the image and the anterior leaflet can barely been seen in the upper right corner of the image.\n',0,1,0,0,0),(453,'Heart0024-HIS','still','2011-08-30 19:16:20','2012-09-05 21:47:45','Heart0024-Perfusion-Fixed-Right-Ventricle-Inflow-Tract-HIS','Here, the inflow tract of the RV is seen, along the septal wall.  Also, in front of the septal wall are the chordae tendinae attaching to the septal leaflet of the tricuspid valve at the top and the septal papillary muscle at the bottom.  A bit of loose tissue is seen caught on one of the chordae.\n',0,1,0,0,0),(454,'Heart0024-LW-AW','still','2011-08-30 19:16:20','2012-09-14 16:25:53','Heart0024-Perfusion-Fixed-Right-Ventricle-Inflow-Tract-LW-Anterior-Wall','Peering through a chordae tendinae on the septal wall, the anterior/lateral wall of the RV can be seen-- much more trabeculated than the smooth septal wall.  The pulmonary valve can be seen from below in the upper left corner of the image.\n',0,1,0,0,0),(455,'Heart0024-SW','still','2011-08-30 19:16:20','2012-09-14 16:27:36','Heart0024-Perfusion-Fixed-Right-Ventricle-Inflow-Tract-Septal-Wall','In this view of the septal wall of the right ventricular inflow tract, the anterior papillary (bottom right) septal papillary (top right) and the posterior papillary muscle (middle left) can be seen in this image. The discernable attribute of the papillary muscles are the chordae tendineae that attach to the tops of the muscles and assist in proper valve closure.',0,1,0,0,0),(457,'Heart0003','video','2011-08-30 19:16:20','2012-09-05 21:44:34','Heart0003-Functional-Right-Ventricle-Moderator-Band','A view of the moderator band connecting the  APM to the septal wall (right).  Note the yellowish fat deposits on the endocardial surfaces.\n',1,1,1,0,0),(458,'Heart0009','video','2011-08-30 19:16:20','2012-09-05 21:44:34','Heart0009-Functional-Right-Ventricle-Moderator-Band','View of the moderator band originating on the septal wall (right) and terminating at the base of the anterior papillary muscle (upper left).\n',1,1,1,0,0),(459,'Heart0013','video','2011-08-30 19:16:20','2012-09-05 21:44:34','Heart0013-Functional-Right-Ventricle-Moderator-Band','View of the moderator band originating on the septal wall (right) and terminating at the base of the anterior papillary muscle (center).\n',1,1,1,0,0),(460,'Heart0014','video','2011-08-30 19:16:20','2012-09-05 21:44:34','Heart0014-Functional-Right-Ventricle-Moderator-Band','Close-up view of the moderator band in the right ventricle connecting the septal wall to the base of the anterior papillary muscle.  The septal wall is located to the right of the image and the anterior papillary muscle to the upper left.\n',1,1,1,0,0),(461,'Heart0015','video','2011-08-30 19:16:20','2012-09-05 21:44:34','Heart0015-Functional-Right-Ventricle-Moderator-Band','View of the moderator band of the right ventricle.  The septal wall is to the center and top, the free wall to the bottom, and the base of the anterior papillary muscle to the left.  The moderator band can be seen running from the septal wall to the anterior papillary muscle.\n',1,1,1,0,0),(462,'Heart0023','video','2011-08-30 19:16:20','2012-09-05 21:44:34','Heart0023-Functional-Right-Ventricle-Moderator-Band','A thick moderator band can be spanning between the anterior and septal walls of the right ventricle here. On the lower portion of the screen a conduction band can be seen coming from the moderator band and continuing off screen.\n',1,1,1,0,0),(463,'Heart0049','video','2011-08-30 19:16:20','2012-09-05 21:44:34','Heart0049-Functional-Right-Ventricle-Moderator-Band','A close up view of a muscular moderator band extending from the anterior papillary muscle (above) to the septal wall (below).\n',1,1,1,0,0),(464,'Heart0053','video','2011-08-30 19:16:20','2012-09-05 21:44:34','Heart0053-Functional-Right-Ventricle-Moderator-Band','A view from the RV apex with trabeculations; one can see the moderator band and the RVOT to the pulmonary valve.  There are significant trabeculations in the RVOT (a few bubbles can also be observed).\n',1,1,1,0,0),(465,'Heart0058','video','2011-08-30 19:16:20','2012-09-05 21:44:34','Heart0058-Functional-Right-Ventricle-Moderator-Band','The moderator band runs behind the posterior papillary muscle in this clip, connecting the septal wall (left) to the free wall (right).\n',1,1,1,0,0),(466,'Heart0077','video','2011-08-30 19:16:21','2012-12-27 22:29:49','Heart0077-Functional-Right-Ventricle-Moderator-Band','View of the moderator band connected to the anterior papilllary muscle, seen on the right, in the right ventricle.\n',0,1,1,0,0),(467,'Heart0083','video','2011-08-30 19:16:21','2012-12-27 22:42:37','Heart0083-Functional-Right-Ventricle-Moderator-Band','View of the right ventricle showing the trabeculations.  The moderator band can be seen to the bottom right of the screen.\n',0,1,1,0,0),(468,'Heart0073','video','2011-08-30 19:16:21','2015-05-18 19:32:19','Heart0073-Functional-Right-Ventricle-Moderator-Band','View of anterior papillary muscle and the moderator band.',1,1,1,0,0),(469,'Heart0005','still','2011-08-30 19:16:21','2012-09-05 21:47:45','Heart0005-Perfusion-Fixed-Right-Ventricle-Moderator-Band','From deep within the right ventricle, in the foreground, the moderator band can be seen stretching between the anterior/lateral wall and septal wall.  Near the top of the image, the tricuspid valve can be seen in the open position.\n',0,1,0,0,0),(470,'Heart0007','still','2011-08-30 19:16:21','2012-09-05 21:47:45','Heart0007-Perfusion-Fixed-Right-Ventricle-Moderator-Band','From deep within the right ventricle, in the foreground, the moderator band can be seen stretching between the anterior/lateral wall (lower left corner) and septal wall (upper right corner).  Near the top, left corner of the image, the tricuspid valve can be seen in the open position.\n',0,1,0,0,0),(471,'Heart0016-1','still','2011-08-30 19:16:21','2012-09-05 21:47:45','Heart0016-Perfusion-Fixed-Right-Ventricle-Moderator-Band-1','The thick horizontal structure reaching across the image is the moderator band.  The vertical structure in the foreground is a papillary muscle, near the top of which attaches to chordae tendinae.\n',0,1,0,0,0),(472,'Heart0016-2','still','2011-08-30 19:16:21','2012-09-05 21:47:45','Heart0016-Perfusion-Fixed-Right-Ventricle-Moderator-Band-2','The thick horizontal structure reaching across the image in the foreground is the moderator band.  The vertical structure in the background is a papillary muscle, near the top of which attaches to chordae tendinae.  This is a view coming from the opposite side of the ventricle from clip Heart0016-1.\n',0,1,0,0,0),(473,'Heart0018-1','still','2011-08-30 19:16:21','2012-09-05 21:47:45','Heart0018-Perfusion-Fixed-Right-Ventricle-Moderator-Band-1','In this image the moderator band can be seen stretching from the interventricular septum (right side) to the anterior papillary muscle (left side). This is a good illustration of the complexities that can be found in such specimens. The Anterior papillary muscle seems to originate from both the moderator band as well as the anterior wall of the right ventricle.\n',0,1,0,0,0),(474,'Heart0018-2','still','2011-08-30 19:16:21','2012-09-05 21:47:45','Heart0018-Perfusion-Fixed-Right-Ventricle-Moderator-Band-2','Seen in the upper left corner of this image is a leaflet of the tricuspid valve.  Reaching across the width of the ventricle, beginning at the lower right corner of the image, is the moderator band.\n',0,1,0,0,0),(475,'Heart0019','still','2011-08-30 19:16:21','2012-09-05 21:47:45','Heart0019-Perfusion-Fixed-Right-Ventricle-Moderator-Band','In the upper left corner of this image is the tricuspid valve, as seen from below, in the open position.  The thick vertical band near the right edge of the image is the moderator band.  In its anatomically correct positioning, the moderator band is horizontal and spans across the right ventricle.\n',0,1,0,0,0),(476,'Heart0020','still','2011-08-30 19:16:21','2012-09-05 21:47:45','Heart0020-Perfusion-Fixed-Right-Ventricle-Moderator-Band','This image is captured from deep within the right ventricle, looking up toward the tricuspid valve, as is seen at the top edge of the image.  The moderator band is the structure that is reaching horizontally across the ventricle.  From the moderator band, a papillary muscle can be seen growing upward and attaching to one of the tricuspid leaflets.\n',0,1,0,0,0),(477,'Heart0022','still','2011-08-30 19:16:21','2012-09-05 21:47:45','Heart0022-Perfusion-Fixed-Right-Ventricle-Moderator-Band','Here, the moderator band can be seen attaching to one wall of the right ventricle, spanning the width of the ventricle and attaching to the opposing wall.\n',0,1,0,0,0),(478,'Heart0024','still','2011-08-30 19:16:21','2012-09-05 21:47:45','Heart0024-Perfusion-Fixed-Right-Ventricle-Moderator-Band','A very thick moderator band can be seen spanning the width of the right ventricle, off which, a papillary muscle grows vertically (see on the left edge of the image).',0,1,0,0,0),(481,'Heart0005-4chamber-vent','sectioned','2011-08-30 19:16:21','2011-08-30 19:19:26','Heart0005-4chamber-vent','\n',0,0,0,0,0),(484,'Heart0003-Anterior','video','2011-08-30 19:16:21','2012-09-05 21:44:34','Heart0003-Functional-Right-Ventricle-Anterior-Papillary-Muscle','APM in middle, PPM behind it, moderator band at bottom of APM, septal wall top and right, free wall lower left\n',1,1,1,0,0),(485,'Heart0009-Anterior','video','2011-08-30 19:16:21','2012-09-05 21:44:34','Heart0009-Functional-Right-Ventricle-Anterior-Papillary-Muscle','View of the anterior papillary muscle in the right ventricle.  The chordae tendinae can be seen arising from the top of the muscle.\n',1,1,1,0,0),(486,'Heart0009-Posterior','video','2011-08-30 19:16:21','2012-09-05 21:44:34','Heart0009-Functional-Right-Ventricle-Posterior-Papillary-Muscle','View of the posterior papillary muscles of the right ventricle.  The tricuspid valve is to the top of the screen.  The anterior papillary muscle is seen on the left of the screen.  The moderator band can be seen at the very end of the clip towards the bottom right.\n',1,1,1,0,0),(487,'Heart0009-Septal','video','2011-08-30 19:16:21','2012-09-05 21:44:34','Heart0009-Functional-Right-Ventricle-Septal-Papillary-Muscle','View of the right ventricular apex.  The posterior papillary muscle is to the left, the septal wall and papillary muscles to the top and center, and the anterior papillary muscle off screen to the lower right.\n',1,1,1,0,0),(488,'Heart0009-Septal-Posterior','video','2011-08-30 19:16:21','2012-09-05 21:44:34','Heart0009-Functional-Right-Ventricle-Septal-Papillary-Muscle-Posterior-Papillary-Muscle','View of the right ventricular inflow tract.  The tricuspid valve is to the upper left, the septum is in the middle of the screen to upper right, and the posterior papillary muscles to the bottom.  A pacemaker lead is passing through the tricuspid valve from the right atrium.\n',1,1,1,0,0),(489,'Heart0011-Septal','video','2011-08-30 19:16:21','2012-09-05 21:44:34','Heart0011-Functional-Right-Ventricle-Septal-Papillary-Muscle','View of the right ventricular inflow tract.  The tricuspid valve is to the upper left off the screen, the septal wall and papillary muscles are in the middle of the screen and the upper right, and the anterior papillary muscle to the lower left.\n',1,1,1,0,0),(490,'Heart0013-Anterior','video','2011-08-30 19:16:21','2012-09-05 21:44:34','Heart0013-Functional-Right-Ventricle-Anterior-Papillary-Muscle','View of the right ventricular inflow tract.  The tricuspid valve is to the upper right, the anterior papillary muscle to the bottom/bottom right, the septal papillary muscles to the upper right, and the posterior papillary muscle behind the anterior papillary muscle. \n',1,1,1,0,0),(491,'Heart0014-Anterior','video','2011-08-30 19:16:21','2012-09-05 21:44:34','Heart0014-Functional-Right-Ventricle-Anterior-Papillary-Muscle','View of the right ventricular inflow tract.   The septal wall is to the right of the image, the anterior papillary muscle in the center, and the posterior papillary muscles in the background.  The chordae tendinae connecting the papillary muscles to the tricuspid valve can be seen.  Also visible is the moderator band in the lower central portion of the image, connecting the septal wall to the base of the anterior papillary muscle.\n',1,1,1,0,0),(492,'Heart0014-Anterior-FW','video','2011-08-30 19:16:21','2012-09-05 21:44:34','Heart0014-Functional-Right-Ventricle-Anterior-Papillary-Muscle-FW','View of the right ventricular inflow tract.  The anterior papillary muscle can be seen in the foreground of the lower right corner and the posterior papillary muscle in the background with two distinct heads.  The free wall of the right ventricle is located on the left and center of the image.\n',1,1,1,0,0),(493,'Heart0014-Septal','video','2011-08-30 19:16:21','2012-09-05 21:44:34','Heart0014-Functional-Right-Ventricle-Septal-Papillary-Muscle','Close-up view of the septal papillary muscle of the right ventricle.  The tricuspid valve is located to the center and left of the image and the septal wall to the center and right of the image.  The supraventricular crest is located to the upper right of the image.\n',1,1,1,0,0),(494,'Heart0014-Septal-SW','video','2011-08-30 19:16:21','2012-09-14 16:27:36','Heart0014-Functional-Right-Ventricle-Septal-Papillary-Muscle-Septal-Wall','Close-up view of the septal wall of the right ventricular outflow tract.  The septal papillary muscle and tricuspid valve are located to the left and the pulmonic valve is located to the upper right off the screen.  The trabeculations that are visible in the bottom right of the image are located in the border between the septal wall and free wall.\n',1,1,1,0,0),(495,'Heart0015','video','2011-08-30 19:16:21','2012-09-05 21:44:34','Heart0015-Functional-Right-Ventricle-Papillary-Muscle','View of the apex of the right ventricle.  A small conduction fiber can be seen in the foreground of the image, along with a high degree of trabeculation.\n',1,1,1,0,0),(496,'Heart0015-Anterior','video','2011-08-30 19:16:21','2012-09-05 21:44:34','Heart0015-Functional-Right-Ventricle-Anterior-Papillary-Muscle','View of the anterior papillary muscle of the right ventricle.  Chordae tendinae can be seen connecting the head of the muscle to the tricuspid valve.  A septal papillary muscle can also be seen on the left side of the screen.  The right ventricular outflow tract is to the upper left corner of the image.\n',1,1,1,0,0),(497,'Heart0015-Anterior-2','video','2011-08-30 19:16:21','2012-09-05 21:44:34','Heart0015-Functional-Right-Ventricle-Anterior-Papillary-Muscle-2','View of the anterior papillary muscles of the right ventricle.  The tricuspid valve is off the screen to the top.  Chordae tendinae connecting the papillary muscle to the valve can be seen.  The free wall is to the left.\n',1,1,1,0,0),(498,'Heart0015-Septal','video','2011-08-30 19:16:21','2012-09-05 21:44:34','Heart0015-Functional-Right-Ventricle-Septal-Papillary-Muscle','View of the septal wall of the right ventricular inflow tract.  Many small septal papillary muscles can be seen.  Chordae tendinae can be seen arising from the heads of these muscles as well as from the septal wall itself.  The anterior papillary muscle can be seen to the lower right of the image.\n',1,1,1,0,0),(499,'Heart0017-Septal','video','2011-08-30 19:16:21','2012-09-05 21:44:34','Heart0017-Functional-Right-Ventricle-Septal-Papillary-Muscle','In this movie, a very small papillary muscle can be seen on the septal wall of the right ventricle.  The papillary muscle can be identified by the chordae tendinae attached to the top of it.\n',1,1,1,0,0),(500,'Heart0023-Anterior','video','2011-08-30 19:16:21','2012-09-05 21:44:34','Heart0023-Functional-Right-Ventricle-Anterior-Papillary-Muscle','Here, the camera is positioned within the annulus of the tricuspid valve, peering downward upon the anterior papillary muscle (left edge of the image), which is attached to the tricuspid leaflet.\n',1,1,1,0,0),(501,'Heart0023-Posterior','video','2011-08-30 19:16:21','2012-09-05 21:44:34','Heart0023-Functional-Right-Ventricle-Posterior-Papillary-Muscle','In this movie, multiple papillary muscles can be seen with multiple chodae tendinae reaching off the top of them.  The papillary against the wall near the center of the picture is a posterior papillary muscle.\n',1,1,1,0,0),(502,'Heart0023-Septal','video','2011-08-30 19:16:21','2012-09-05 21:44:34','Heart0023-Functional-Right-Ventricle-Septal-Papillary-Muscle','Here a low profile papillary muscle can be seen against the septal wall of the right ventricle.  The white fixture near the top of the papillary muscle is the chordae tendinae.  The very thin bands seen in this movie are conduction bands, which help to carry the electrical impulses throughout the myocardium.\n',1,1,1,0,0),(503,'Heart0037-Anterior','video','2011-08-30 19:16:21','2012-09-05 21:44:34','Heart0037-Functional-Right-Ventricle-Anterior-Papillary-Muscle','The chordae tendinae can be seen connecting to the heads of the anterior papillary muscle complex. The heart is in ventricular fibrillation, as evidenced by the fact that there is no co-ordinated contraction of the myocardium.\n',1,1,1,0,0),(504,'Heart0037-Posterior','video','2011-08-30 19:16:21','2012-09-05 21:44:34','Heart0037-Functional-Right-Ventricle-Posterior-Papillary-Muscle','The posterior muscle complex of the right ventricle.  Due to the fact that the heart is in ventricular fibrillation there is no movement of fluid through the chamber and hence the tricuspid valve is not functioning.  As the valve is not closing the chordae attached to the papillary complex lie slack and are not functioning as they should.\n',1,1,1,0,0),(505,'Heart0037-Septal','video','2011-08-30 19:16:21','2012-09-05 21:44:34','Heart0037-Functional-Right-Ventricle-Septal-Papillary-Muscle','The septal papillary muscle complex of the right ventricle can be seen in the center of the footage with the tricuspid valve to th3e right. Due to the heart being in ventricular fibrillation the subvalvular apparatus is not functioning correctly.\n',1,1,1,0,0),(506,'Heart0046-Anterior','video','2011-08-30 19:16:21','2012-09-05 21:44:34','Heart0046-Functional-Right-Ventricle-Anterior-Papillary-Muscle','Close-up of papillary muscle; note the conduction bands connecting the ventricular walls to the papillary muscles.\n',1,1,1,0,0),(507,'Heart0046-Posterior','video','2011-08-30 19:16:21','2012-09-05 21:44:34','Heart0046-Functional-Right-Ventricle-Posterior-Papillary-Muscle','A view of the posterior papillary muscle; in this movie, the camera pans towards the tricuspid valve near the end of the clip.  The heart is beating irregularly.\n',1,1,1,0,0),(508,'Heart0048-Posterior','video','2011-08-30 19:16:21','2012-09-05 21:44:34','Heart0048-Functional-Right-Ventricle-Posterior-Papillary-Muscle','A good view of the posterior papillary muscle in RV (on the left, with the cordae above).  One can also observe conduction bands and the septal papillary muscle in the upper middle of this view; the base of the anterior papillary muscle is in the foreground to the right.\n',1,1,1,0,0),(509,'Heart0048-Septal-1','video','2011-08-30 19:16:21','2012-09-05 21:44:34','Heart0048-Functional-Right-Ventricle-Septal-Papillary-Muscle-1','A view through the RVOT with the septal papillary muscles to the left; chordae tendinae are coming out of the bottom of the muscle.  A bifurcated anterior papillary muscle can be seen contracting in the foreground to the lower right.  The pulmonary valve can be observed closing in the background.\n',1,1,1,0,0),(510,'Heart0048-Septal-2','video','2011-08-30 19:16:21','2012-09-05 21:44:34','Heart0048-Functional-Right-Ventricle-Septal-Papillary-Muscle-2','A close-up view of the base of the septal and anterior papillary muscles; the anterior one which is bifurcated is in the middle of the screen and the pulmonary valve can be observed in the background in the upper right.\n',1,1,1,0,0),(511,'Heart0049-Anterior-Posterior','video','2011-08-30 19:16:21','2012-09-05 21:44:34','Heart0049-Functional-Right-Ventricle-Anterior-Papillary-Muscle-Posterior-Papillary-Muscle','The anterior (to the right) and posterior (to the left) muscle complexes of the right ventricle showing the connection bands and trabeculation at the base of the muscles and the multiple chordae tendinae reaching up to the tricuspid valve (above the image) from the muscle heads.\n',1,1,1,0,0),(512,'Heart0049-Posterior','video','2011-08-30 19:16:21','2012-09-05 21:44:34','Heart0049-Functional-Right-Ventricle-Posterior-Papillary-Muscle','A view from the level of  the tricuspid valve looking down on posterior papillary muscle and into RV apex.\n',1,1,1,0,0),(513,'Heart0049-Septal-1','video','2011-08-30 19:16:21','2012-09-05 21:44:34','Heart0049-Functional-Right-Ventricle-Septal-Papillary-Muscle-1','The septal papillary muscle complex in this heart shows three distinct papillary heads that connect to the tricuspid valve leaflets via the chordae tendinae.  The chordae from the main muscle head is fenestrated, an anatomical feature that can inhibit the placement of devices in the right ventricular apex.\n',1,1,1,0,0),(514,'Heart0049-Septal-2','video','2011-08-30 19:16:21','2012-09-05 21:44:34','Heart0049-Functional-Right-Ventricle-Septal-Papillary-Muscle-2','A view of the papillary muscles from the annulus of the tricuspid valve.  The septal papillary muscle is to the left and is shown surrounded by trabeculations in the RV apex. The posterior papillary muscle can be seen to the lower right and the anterior one is to the middle right.\n',1,1,1,0,0),(515,'Heart0053-Anterior-1','video','2011-08-30 19:16:21','2012-09-05 21:44:34','Heart0053-Functional-Right-Ventricle-Anterior-Papillary-Muscle-1','Papillary muscle; tricuspid valve is to the top of the screen.  Note the high degree of trabeculation.\n',1,1,1,0,0),(516,'Heart0053-Anterior-2','video','2011-08-30 19:16:21','2012-09-05 21:44:34','Heart0053-Functional-Right-Ventricle-Anterior-Papillary-Muscle-2','The anterior papillary muscle complex of the right ventricle can be seen toward the rear of this clip with the posterior muscle in the foreground of the image.  Notice the bifurcation of the anterior muscle complex with the extensive trabeculations around the base and the network of conduction bands between the two muscle heads of the bifurcation.\n',1,1,1,0,0),(517,'Heart0053-Posterior','video','2011-08-30 19:16:21','2012-09-05 21:44:34','Heart0053-Functional-Right-Ventricle-Posterior-Papillary-Muscle','A view of the posterior papillary muscle; trabeculations in RV apex can be seen in the background, the free wall is to the right.\n',1,1,1,0,0),(518,'Heart0058-Anterior-1','video','2011-08-30 19:16:21','2012-09-05 21:44:34','Heart0058-Functional-Right-Ventricle-Anterior-Papillary-Muscle-1','The camera is positioned in the right ventricular outflow tract and provides a view of the anterior papillary muscle. The motion of the tricuspid valve can be observed in the movement of the chordae tendinae. \n',1,1,1,0,0),(519,'Heart0058-Anterior-2','video','2011-08-30 19:16:21','2012-09-05 21:44:34','Heart0058-Functional-Right-Ventricle-Anterior-Papillary-Muscle-2','The camera is just below the tricuspid valve in the right ventricle. The anterior papillary muscle is slightly to the right of the screen. The thin white string-like structures are chordae tendinae that connect the papillary muscles to the valve leaflets to prevent the leaflets from prolapsing.\n',1,1,1,0,0),(520,'Heart0058-Posterior','video','2011-08-30 19:16:21','2012-09-05 21:44:34','Heart0058-Functional-Right-Ventricle-Posterior-Papillary-Muscle','The posterior papillary muscle in the right ventricle is in the center of the screen. The moderator band can be seen in the background, connecting the septal wall (left) with the free wall (right).\n',1,1,1,0,0),(521,'Heart0058-Septal','video','2011-08-30 19:16:21','2012-09-05 21:44:34','Heart0058-Functional-Right-Ventricle-Septal-Papillary-Muscle','View of the septal papillary muscle from its base (towards the left of the screen). At the top of the papillary muscle, the chordae tendinae can be seen; the pulmonary valve can also be seen.\n',1,1,1,0,0),(522,'Heart0073-Anterior','video','2011-08-30 19:16:21','2015-05-18 19:32:19','Heart0073-Functional-Right-Ventricle-Anterior-Papillary-Muscle','Footage of the anterior papillary muscle complex showing a unique anatomical configuration whereby two muscles, with separate connections to the ventricle wall, join near the muscle heads and display conduction bands reaching across to the posterior complex.  The intricate trabeculation of the endocardial surface of the right ventricle can be seen at the base of the image.\n',1,1,1,0,0),(523,'Heart0073-Posterior','video','2011-08-30 19:16:21','2012-09-05 21:44:34','Heart0073-Functional-Right-Ventricle-Posterior-Papillary-Muscle','The posterior muscle complex of this heart displays a maze of muscular and tendinous connections between he individual muscle heads.  The footage starts at the base of the complex and moves to the heads where the chordae tendinae attach to the leaflets of the tricuspid valve.\n',1,1,1,0,0),(524,'Heart0073-Septal','video','2011-08-30 19:16:21','2012-09-05 21:44:34','Heart0073-Functional-Right-Ventricle-Septal-Papillary-Muscle','The septal papillary complex (to the left of the image) of the right ventricle shows many fenestrated chordae tendinae branching from small papillary heads to the tricuspid valve.  The smooth septal wall of the right ventricle can be seen in the background of the footage.\n',1,1,1,0,0),(525,'Heart0076-Anterior','video','2011-08-30 19:16:21','2012-12-27 22:21:40','Heart0076-Functional-Right-Ventricle-Anterior-Papillary-Muscle','View of anterior papillary muscle with moderator band, seen on the left side, connecting papillary to septal wall.\n',0,1,1,0,0),(526,'Heart0076-Posterior','video','2011-08-30 19:16:21','2012-12-27 22:21:40','Heart0076-Functional-Right-Ventricle-Posterior-Papillary-Muscle','The posterior papillary muscle complex with two unique muscle heads can be seen in this footage with chordae tendinae connecting the papillary heads to the tricuspid valve. This video clearly shows how the muscles tether the leaflets of the tricuspid maintain good leaflet coaptation and stop regurgitation.\n',0,1,1,0,0),(527,'Heart0077-Anterior','video','2011-08-30 19:16:21','2012-12-27 22:29:49','Heart0077-Functional-Right-Ventricle-Anterior-Papillary-Muscle','The anterior papillary muscle complex can be seen  in this footage with a bifurcated muscle to the left of the image and a series of conduction bands branching off the base of the complex.\n',0,1,1,0,0),(528,'Heart0077-Posterior','video','2011-08-30 19:16:21','2012-12-27 22:29:49','Heart0077-Functional-Right-Ventricle-Posterior-Papillary-Muscle','View fo the posterior papillary muscle in the right ventricle with a nice view of the chordae tendonae.\n',0,1,1,0,0),(529,'Heart0077-Septal','video','2011-08-30 19:16:21','2012-12-27 22:29:49','Heart0077-Functional-Right-Ventricle-Septal-Papillary-Muscle','The posterior muscle complex can be seen in this footage that shows a series of muscle heads stemming form the ventricular wall and connecting to the valve via chordae tendinae.  This footage exemplifies the movement of the muscle during ventricular contraction and how each muscle is key to tethering the leaflets of the tricuspid valve to avoid regurgitation into the atrium.\n',0,1,1,0,0),(530,'Heart0083-Anterior','video','2011-08-30 19:16:21','2012-12-27 22:42:37','Heart0083-Functional-Right-Ventricle-Anterior-Papillary-Muscle','View of the anterior papillary muscle of the right ventricle. Chordae tendinae can be seen connecting the head of the muscle to the tricuspid valve. A septal papillary muscle can also be seen on the left side of the screen.\n',0,1,1,0,0),(531,'Heart0083-Septal','video','2011-08-30 19:16:21','2012-12-27 22:42:37','Heart0083-Functional-Right-Ventricle-Septal-Papillary-Muscle','View of the septal papillary muscle of the right ventricle connected to the septal wall to the right of the image. The tricuspid valve is at the top left of the image connected to all three right ventricular papillary muscles via the chordate tendinae.  The anterior papillary muscle can be seen to the left of the image and the posterior papillary muscle can be seen in the background.\n',0,1,1,0,0),(532,'Heart0086-Anterior-1','video','2011-08-30 19:16:21','2012-12-27 22:47:12','Heart0086-Functional-Right-Ventricle-Anterior-Papillary-Muscle-1','A close up shot of the anterior papillary complex.  This footage shows a singular muscle head with multiple chordal connections to the valve above.\n',0,1,1,0,0),(533,'Heart0086-Anterior-2','video','2011-08-30 19:16:21','2012-12-27 22:47:12','Heart0086-Functional-Right-Ventricle-Anterior-Papillary-Muscle-2','A close up of the base of the anterior papillary muscle complex showing the moderator band and a chordae tendinae branching off half way up the papillary muscle.',0,1,1,0,0),(534,'Heart0005-Anterior','still','2011-08-30 19:16:21','2014-07-22 19:44:34','Heart0005-Perfusion-Fixed-Right-Ventricle-Anterior-Papillary-Muscle','Perfusion fixed heart.  Camera shows the anterior papillary muscle and attachment to right ventricular endocardium before panning up to show the chordae tendinae and attachment to the tricuspid valve.\n',0,1,0,0,0),(535,'Heart0005-Posterior','still','2011-08-30 19:16:21','2012-09-05 21:47:45','Heart0005-Perfusion-Fixed-Right-Ventricle-Posterior-Papillary-Muscle','A posterior papillary muscle is seen in the image, with chordae tendinae reaching upward and attaching to leaflets of the tricuspid valve.\n',0,1,0,0,0),(536,'Heart0005-Septal','still','2011-08-30 19:16:21','2014-07-22 19:4