.\n',0,1,0,0,0),(553,'Heart0022-Septal','still','2011-08-30 19:16:21','2012-09-05 21:47:45','Heart0022-Perfusion-Fixed-Right-Ventricle-Septal-Papillary-Muscle','A small, singular papillary can be seen growing outward from the septal wall of the right ventricle.\n',0,1,0,0,0),(554,'Heart0024-Anterior','still','2011-08-30 19:16:21','2012-09-05 21:47:45','Heart0024-Perfusion-Fixed-Right-Ventricle-Anterior-Papillary-Muscle','A very upright anterior papillary muscle is seen in this image, which was captured from deep within the right ventricle.\n',0,1,0,0,0),(555,'Heart0024-Posterior','still','2011-08-30 19:16:21','2012-09-05 21:47:45','Heart0024-Perfusion-Fixed-Right-Ventricle-Posterior-Papillary-Muscle','Multiple papillary muscles can be seen from this view in the deep right ventricle.  In the foreground, toward the middle of the image is an anterior papillary.  On the right edge of the image is another anterior papillary muscle, whereas, in the background of the image, a posterior papillary muscle is seen.  At the upper edge of the image, the leaflets of the tricuspid valve can just be seen.\n',0,1,0,0,0),(556,'Heart0024-Septal-1','still','2011-08-30 19:16:21','2012-09-05 21:47:45','Heart0024-Perfusion-Fixed-Right-Ventricle-Septal-Papillary-Muscle-1','Here, a septal papillary muscle, with two heads can be seen, with chordae tendinae reaching upward toward the tricuspid leaflet.\n',0,1,0,0,0),(557,'Heart0024-Septal-2','still','2011-08-30 19:16:21','2012-09-05 21:47:45','Heart0024-Perfusion-Fixed-Right-Ventricle-Septal-Papillary-Muscle-2','This angle allows a glimpse at the septal papillary muscle from above, looking downward from just inside the tricuspid valve.  The chordae tendinae attach to the tricuspid leaflet just out of the upper right corner of this shot.',0,1,0,0,0),(569,'Heart0013_RV_RA_tricuspidvalve','sectioned','2011-08-30 19:16:22','2012-08-20 14:41:09','Heart0013-RV-RA-tricuspidvalve','\n',0,0,0,0,0),(577,'Heart0037-Right','sectioned','2011-08-30 19:16:22','2012-09-14 20:00:52','Heart0037-Sectioned-Right','\n',0,0,0,0,0),(579,'Heart0003-1','video','2011-08-30 19:16:22','2012-09-05 21:44:34','Heart0003-Functional-Right-Ventricle-Outflow-Tract-1','A view of the RVOT; the pulmonary valve is to the left and the tricuspid valve moves into view from above.  Note that significant trabeculations extend through the RVOT.  Note an abnormal polyp-like structure on the lower right.\n',1,1,1,0,0),(580,'Heart0003-2','video','2011-08-30 19:16:22','2012-09-05 21:44:34','Heart0003-Functional-Right-Ventricle-Outflow-Tract-2','A good view of the high RVOT with well functional pulmonary (semi-lunar) valve; trabeculations in the outflow tract can be seen.  The septal wall is to the left.\n',1,1,1,0,0),(581,'Heart0006','video','2011-08-30 19:16:22','2012-09-05 21:44:34','Heart0006-Functional-Right-Ventricle-Outflow-Tract','View of the right ventricular outflow tract from below the tricuspid valve.    The interventricular septal wall is to the left with the septal papillary muscle, the pulmonic valve to the bottom, and the free wall to the right.\n',1,1,1,0,0),(582,'Heart0009','video','2011-08-30 19:16:22','2012-09-05 21:44:34','Heart0009-Functional-Right-Ventricle-Outflow-Tract','View of the right ventricular outflow tract.  The pulmonic valve is shown to the left of center, the septal papillary muscle and wall to the left, and the free wall to the right.\n',1,1,1,0,0),(583,'Heart0013','video','2011-08-30 19:16:22','2012-09-05 21:44:34','Heart0013-Functional-Right-Ventricle-Outflow-Tract','View of the right ventricular outflow tract.  The pulmonic valve is shown in the center of the screen.  The septal wall is to the left of the screen and the free wall to the right.\n',1,1,1,0,0),(584,'Heart0014','video','2011-08-30 19:16:22','2012-09-05 21:44:34','Heart0014-Functional-Right-Ventricle-Outflow-Tract','View of the right ventricular outflow tract.  The pulmonic valve can be seen in the center of the image.  The supraventricular crest is located on the top of the image.  The septal wall is located on the left of the image and the free wall to the right.  The junction between the two is located in the central portion of the bottom.  Notice that the free wall is trabeculated, while the septal wall is not.\n',1,1,1,0,0),(585,'Heart0015','video','2011-08-30 19:16:22','2012-09-05 21:44:34','Heart0015-Functional-Right-Ventricle-Outflow-Tract','View of the right ventricular outflow tract and pulmonic valve.  The valve is not functioning very well.  The septal wall can be seen to the upper left and top, and the free wall to the bottom and lower right.\n',1,1,1,0,0),(586,'Heart0017','video','2011-08-30 19:16:22','2012-09-05 21:44:34','Heart0017-Functional-Right-Ventricle-Outflow-Tract','The pulmonic valve is seen in the center of this movie, it is not functioning well.  The chordae tendinae for the tricuspid valve can be seen near to top of the image.  The anterior wall of the right ventricle lines the right portion of the movie, whereas the septal wall lines the left.\n',1,1,1,0,0),(587,'Heart0023','video','2011-08-30 19:16:22','2012-09-05 21:44:34','Heart0023-Functional-Right-Ventricle-Outflow-Tract','Footage of the functioning pulmonary valve from the right ventricle.  This footage shows the anatomy of the right ventricular outflow tract (RVOT) with the smooth infundibulum to the top of the image and the free wall to the bottom.\n',1,1,1,0,0),(588,'Heart0026','video','2011-08-30 19:16:22','2012-09-05 21:44:34','Heart0026-Functional-Right-Ventricle-Outflow-Tract','A wide angle view of RV outflow tract; the septal wall is to the left and the pulmonary valve is to the upper middle left and is functioning well.\n',1,1,1,0,0),(589,'Heart0046-1','video','2011-08-30 19:16:22','2012-09-05 21:44:34','Heart0046-Functional-Right-Ventricle-Outflow-Tract-1','A good view of the RVOT and one can observe the pulmonary valve to the left; chordae tendinae from the septal papillary muscle can be seen to the upper right of the screen.  The heart rate is quite slow.\n',1,1,1,0,0),(590,'Heart0046-2','video','2011-08-30 19:16:22','2012-09-05 21:44:34','Heart0046-Functional-Right-Ventricle-Outflow-Tract-2','View of high RV outflow tract; the pulmonary valve is to the upper right and the tricuspid valve is off the screen to the right.  The septal wall is to the right.  A few air bubbles can be observed as well.\n',1,1,1,0,0),(591,'Heart0048-1','video','2011-08-30 19:16:22','2012-09-05 21:44:34','Heart0048-Functional-Right-Ventricle-Outflow-Tract-1','This footage shows the very start of the right ventricular outflow tract and exemplifies the trabeculations of the endocardial surface of the right ventricular free wall.  The anterior papillary muscle can also be seen functioning in the foreground.\n',1,1,1,0,0),(592,'Heart0048-2','video','2011-08-30 19:16:22','2012-09-05 21:44:34','Heart0048-Functional-Right-Ventricle-Outflow-Tract-2','A nice view of the whole RVOT and pulmonary valve; the septal wall is to the left of the screen.\n',1,1,1,0,0),(593,'Heart0048-3','video','2011-08-30 19:16:22','2012-09-05 21:44:34','Heart0048-Functional-Right-Ventricle-Outflow-Tract-3','View from the level of the pulmonary valve back through the RVOT.  One can see the leaflets of the tricuspid valve closing and the anterior papillary muscle in the foreground, the posterior one behind and the septal to the right.\n',1,1,1,0,0),(594,'Heart0049-1','video','2011-08-30 19:16:22','2012-09-05 21:44:34','Heart0049-Functional-Right-Ventricle-Outflow-Tract-1','A view of the high RVOT with pulmonary valve to the left of the screen.  Note the lack of trabeculations.  The septal wall is to the left.\n',1,1,1,0,0),(595,'Heart0049-3','video','2011-08-30 19:16:22','2012-09-05 21:44:34','Heart0049-Functional-Right-Ventricle-Outflow-Tract-3','View from pulmonary valve annulus (pulmonary valve leaflets can be seen surrounding the screen); trabeculations in the RV apex can be seen in the background\n',1,1,1,0,0),(596,'Heart0053','v