e, the tricuspid valve can be seen from below, from within the right ventricle.  The anterior leaflet is along the left edge of the valve, with the anterior papillary muscle seen attaching to the leaflet by way of chordae tendinae.  The septal wall is on the right edge of the image.\n',0,1,0,0,0),(685,'Heart0022','still','2011-08-30 19:16:23','2012-09-05 21:47:45','Heart0022-Perfusion-Fixed-Right-Ventricle-Tricuspid-Valve','The septal leaflet is seen on the right edge of the tricuspid valve, adjacent to the septal wall of the right ventricle.  The anterior leaflet appears most prominent in this image, on the left edge of the valve.\n',0,1,0,0,0),(686,'Heart0005','still','2011-08-30 19:16:23','2014-08-12 18:02:21','Heart0005-Perfusion-Fixed-Right-Ventricle-Tricuspid-Valve','A view of the tricuspid valve in the open position from below, in the right ventricle.  The septal wall can be seen on the right edge of the image, with the free/anterior wall wrapping along the left edge of the image.\n',0,1,0,0,0),(687,'Heart0024','still','2011-08-30 19:16:23','2014-08-12 18:02:21','Heart0024-Perfusion-Fixed-Right-Ventricle-Tricuspid-Valve','An up-close view of the leaflets of the tricuspid valve from below.  The septal leaflet is on the upper right portion of the valve, adjacent to the septal wall of the right ventricle.  The large leaflet in the foreground is the anterior leaflet, off of which, chordae tendinae are reaching downward toward the anterior papillary muscle.  The posterior leaflet is positioned on the bottom edge of the valve.',0,1,0,0,0),(704,'Heart0058','video','2011-08-30 19:16:23','2012-09-05 21:44:34','Heart0058-Functional-Pulmonary-Artery-Pulmonary-Trunk','View of the pulmonary trunk. This video is taken from the location where the pulmonary artery bifurcates into the left and right pulmonary arteries. In this video the pulmonary valve can be seen in the background.\n',1,1,1,0,0),(705,'Heart0086','video','2011-08-30 19:16:23','2012-12-27 22:47:12','Heart0086-