ntricle-Aortic-Valve','View of the aortic valve from the left ventricle.  The non-coronary cusp is in the central portion of the top of the screen, the left coronary cusp to the upper left, and the right coronary cusp below that.\n',1,1,1,0,0),(898,'Heart0014','video','2011-08-30 19:16:26','2012-09-05 21:44:34','Heart0014-Functional-Left-Ventricle-Aortic-Valve','View of the aortic valve from the left ventricle.  The non-coronary cusp is in the central portion of the screen, the right coronary cusp to the left, and the left coronary cusp to the upper left.  The valve is not functioning because the heart is in Langendorff mode (retrograde perfusion).  The light source is in the atrium and is illuminating the aortic (anterior) leaflet of the mitral valve.\n',1,1,1,0,0),(899,'Heart0046-1','video','2011-08-30 19:16:26','2012-09-05 21:44:34','Heart0046-Functional-Left-Ventricle-Aortic-Valve-1','View of the aortic and mitral valves from the LV.  The heart is initially in Langendorff mode (only mitral valve is functioning), but is switched to working mode midway through the clip (both valves functional).  The interventricular septum is to the upper left and left of the clip and the free wall of the LV to the upper right, right, and bottom.\n',1,1,1,0,0),(900,'Heart0046-2','video','2011-08-30 19:16:26','2012-09-05 21:44:34','Heart0046-Functional-Left-Ventricle-Aortic-Valve-2','View of the aortic valve from the LV, with the heart in Langendorff mode.  The aortic leaflet of the mitral valve is located to the bottom right of the clip.  A small nodule of calcium (presumably) can be seen on the right side of the screen.  The interventricular septum is located to the top and left of the screen.\n',1,1,1,0,0),(901,'Heart0046-3','video','2011-08-30 19:16:26','2012-09-05 21:44:34','Heart0046-Functional-Left-Ventricle-Aortic-Valve-3','View of the aortic valve from the LV, with the heart in working mode.  The aortic leaflet of the mitral valve is located to the bottom right of the clip.  A small nodule of calcium (presumably) can be seen on the right side of the screen.  The interventricular septum is located to the top and left of the screen.\n',1,1,1,0,0),(902,'Heart0049','video','2011-08-30 19:16:26','2012-09-05 21:44:34','Heart0049-Functional-Left-Ventricle-Aortic-Valve','View of the aortic valve from the LV, with the heart in working mode.  The aortic (anterior) leaflet of the mitral valve is located to the bottom right of the clip.\n',1,1,1,0,0),(903,'Heart0053-1','video','2011-08-30 19:16:26','2012-09-05 21:44:34','Heart0053-Functional-Left-Ventricle-Aortic-Valve-1','View of the aortic and mitral valves from the LV, with the heart in working mode.  The aortic valve is functioning; however, the mitral valve is not closing properly.  The interventricular septum is to the left side of the screen and the free wall of the LV to the top, right, and bottom.\n',1,1,1,0,0),(904,'Heart0053-2','video','2011-08-30 19:16:26','2012-09-05 21:44:34','Heart0053-Functional-Left-Ventricle-Aortic-Valve-2','View of the aortic valve from the LV.  The heart is initally in Langendorff mode and is switched to working mode near the end of the clip, as evidenced by the aortic valve opening.  The aortic (anterior) leaflet of the mitral valve is located to the right of the screen and the interventricular septum to the left and lower left.\n',1,1,1,0,0),(905,'Heart0073','video','2011-08-30 19:16:26','2012-09-14 16:38:12','Heart0073-Functional-Left-Ventricle-Aortic-Valve-Mitral-Valve','View from left ventricular apex of mitral (right) and aortic (left) valves during working mode.\n',0,1,1,0,0),(906,'Heart0083','video','2011-08-30 19:16:26','2012-12-27 22:34:55','Heart0083-Functional-Left-Ventricle-Aortic-Valve','View of the aortic valve from the left ventricular apex in working mode.  The mitral valve can be seen to the lower right of the image.  The effect of the atrial kick can be seen in the double movement of the mitral valve.\n',0,1,1,0,0),(907,'Heart0126-Mitral','