es of the papillary muscles can be seen to the top of the screen (anterior to the left, posterior to the right).\n',0,1,1,0,0),(929,'Heart0073','video','2011-08-30 19:16:26','2012-12-27 22:19:17','Heart0073-Functional-Left-Ventricle-Apex','The video initially shows a close-up view of the left ventricle with trabeculae and conduction bands. As the camera pans back you will be able to see a conduction band that stretches across the entire base of the ventricle.\n',0,1,1,0,0),(930,'Heart0076','video','2011-08-30 19:16:26','2012-12-27 22:21:39','Heart0076-Functional-Left-Ventricle-Apex','The video shows the left ventricular apex. The trabeculae can be seen on the walls of the ventricle along with some conduction bands.\n',0,1,1,0,0),(931,'Heart0077','video','2011-08-30 19:16:26','2012-12-27 22:29:49','Heart0077-Functional-Left-Ventricle-Apex','View of the left ventricular apex with trabeculations and anterior papillary muscle in the upper right.\n',0,1,1,0,0),(932,'Heart0083','video','2011-08-30 19:16:26','2012-12-27 22:34:55','Heart0083-Functional-Left-Ventricle-Apex','View of apex of the left ventricle showing the trabeculations and conduction bands. A Millar pressure catheter used to take left ventricular pressures can be seen in the image.\n',0,1,1,0,0),(933,'Heart0026','video','2011-08-30 19:16:26','2012-09-05 21:44:34','Heart0026-Functional-Left-Ventricle-Apex','View of the trabeculated left ventricular apex in a poorly functioning heart.  The posterior papillary muscle is seen initially on the right of the screen.  For the remainder of the clip, the interventricular septum is located to the center and top of the screen.\n',1,0,1,0,0),(934,'Heart0085','video','2011-08-30 19:16:26','2012-12-27 22:44:14','Heart0085-Functional-Left-Ventricle-Apex','The trabeculation and conduction bands of the endocardial surface of the left ventricular apex.\n',0,1,1,0,0),(935,'Heart0126','video','2011-08-30 19:16:26','2012-12-27 22:51:19','Heart0126-Functional-Left-Ventricle-Apex',