m portions of papillary muscles.\n',0,1,0,0,0),(941,'Heart0019-2','still','2011-08-30 19:16:26','2012-09-05 21:47:45','Heart0019-Perfusion-Fixed-Left-Ventricle-Apex-2','A panned out view of Heart0019-1. In this view, it is possible to see both papillary muscle complexes of the left ventricle; the posterior (right) and the anterior (left). At the papillary heads chordae tendinae branch upward toward the leaflets of the mitral valve.\n',0,1,0,0,0),(942,'Heart0020 ','still','2011-08-30 19:16:26','2012-09-05 21:47:45','Heart0020-Perfusion-Fixed-Left-Ventricle-Apex','The trabeculae are seen in this image with conduction bands (white lines) amidst the musculature. At the top of the image there are two thicker pieces of muscle of which are bases of the papillary muscles.\n',0,1,0,0,0),(943,'Heart0020-trab','still','2011-08-30 19:16:26','2012-09-05 21:47:45','Heart0020-Perfusion-Fixed-Left-Ventricle-Apex-trab','Another view of the trabeculations found in the apex of the left ventricle.\n',0,1,0,0,0),(944,'Heart0022','still','2011-08-30 19:16:26','2012-09-05 21:47:45','Heart0022-Perfusion-Fixed-Left-Ventricle-Apex','Peering into the apex of the left ventricle from near the mitral valve.  The thick structures amidst the trabeculations are papillary muscles.\n',0,1,0,0,0),(945,'Heart0024','still','2011-08-30 19:16:26','2012-09-05 21:47:45','Heart0024-Perfusion-Fixed-Left-Ventricle-Apex','Deep apex of the left ventricle, with trabeculations found in the apex and smoother myocardium found along the walls.',0,1,0,0,0),(947,'Heart000','sectioned','2011-08-30 19:16:26','2011-08-30 19:19:26','lvapexh','\n',0,0,0,0,0),(953,'Heart0005-post-ext-peric','sectioned','2011-08-30 19:16:26','2011-08-30 19:19:26','Heart0005-post-ext-peric','\n',0,0,0,0,0),(959,'Heart0015-Int-LV','sectioned','2011-08-30 19:16:26','2012-09-14 20:00:52','Heart0015-Sectioned-Int-LV','\n',0,0,0,0,0),(967,'Heart0051-Post','sectioned','2011-08-30 19:16:26','2012-09-14 20:00:52','Heart0051-Sectioned-Post','',0,0,0,0,