-30 19:16:27','2014-08-22 19:46:49','Heart0005-Perfusion-Fixed-Left-Ventricle-Free-Wall','Perfusion fixed heart.  View of left ventricular free wall.  A high degree of trabeculation is present.  Camera pans from base of anterior papillary muscle to include base of posterior papillary muscle.\n',0,1,0,0,0),(975,'Heart0007','still','2011-08-30 19:16:27','2014-08-22 19:46:49','Heart0007-Perfusion-Fixed-Left-Ventricle-Free-Wall','Free wall of the left ventricle with a papillary muscle in the center of the screen, as well as one in the foreground, in the lower left corner of the image.\n',0,1,0,0,0),(976,'Heart0018','still','2011-08-30 19:16:27','2014-08-22 19:46:49','Heart0018-Perfusion-Fixed-Left-Ventricle-Free-Wall','In this image, the left ventricular free wall can be seen with multiple papillary muscles reaching upward from it.\n',0,1,0,0,0),(977,'Heart0019-AW','still','2011-08-30 19:16:27','2014-08-22 19:46:49','Heart0019-Perfusion-Fixed-Left-Ventricle-Free-Wall-Anterior-Wall','Anterior freewall of the left ventricle.  The anterior papillary muscle is in focus in this image.\n',0,1,0,0,0),(978,'Heart0020','still','2011-08-30 19:16:27','2014-08-22 19:46:49','Heart0020-Perfusion-Fixed-Left-Ventricle-Free-Wall','Trabeculated free wall of the left ventricle, with a papillary muscle at the left edge of the image.\n',0,1,0,0,0),(979,'Heart0022','still','2011-08-30 19:16:27','2014-08-22 19:46:49','Heart0022-Perfusion-Fixed-Left-Ventricle-Free-Wall','Upclose image of a papillary muscle reaching off of the free wall of the left ventricle.\n',0,1,0,0,0),(980,'Heart0024-SW','still','2011-08-30 19:16:27','2014-08-22 19:46:49','Heart0024-Perfusion-Fixed-Left-Ventricle-Free-Wall-Septal-Wall','Border region of the left ventricular free wall (on the right) and septal wall (on the left).',0,1,0,0,0),(983,'Heart0014','video','2011-08-30 19:16:27','2012-09-05 21:44:34','Heart0014-Functional-Left-Ventricle-Left-Ventricle-Bands','View of LV apex with trabeculations and LV bands visible.  The APM is to the left of the screen and the PPM to the bottom and right.\n',1,1,1,0,0),(984,'Heart0048','video','2011-08-30 19:16:27','2012-09-05 21:44:34','Heart0048-Functional-Left-Ventricle-Left-Ventricle-Bands','Close-up view of LV bands.\n',1,1,1,0,0),(985,'Heart0049-1','video','2011-08-30 19:16:27','2012-09-05 21:44:34','Heart0049-Functional-Left-Ventricle-Left-Ventricle-Bands-1','Close-up view of LV bands.\n',1,1,1,0,0),(986,'Heart0076','video','2011-08-30 19:16:27','2012-12-27 22:21:39','Heart0076-Functional-Left-Ventricle-Left-Ventricle-Bands','Close-up view of left ventricular bands.\n',0,1,1,0,0),(987,'Heart0077','video','2011-08-30 19:16:27','2012-12-27 22:29:49','Heart0077-Functional-Left-Ventricle-Left-Ventricle-Bands','Close-up view of the left ventricular bands.\n',0,1,1,0,0),(988,'Heart0083','video','2011-08-30 19:16:27','2012-12-27 22:34:55','Heart0083-Functional-Left-Ventricle-Left-Ventricle-Bands','View of trabeculations and conduction bands in left ventricle. A Millar pressure catheter used to take left ventricular pressures can be seen in the image.\n',0,1,1,0,0),(989,'Heart0049-2','video','2011-08-30 19:16:27','2012-09-05 21:44:34','Heart0049-Functional-Left-Ventricle-Left-Ventricle-Bands-2','Close-up view of LV band.\n',1,0,1,0,0),(990,'Heart0058','video','2011-08-30 19:16:27','2012-12-27 22:12:10','Heart0058-Functional-Left-Ventricle-Left-Ventricle-Bands','View of trabeculations and conduction bands in left ventricle. The mitral valve is to the left of the screen.',0,0,1,0,0),(991,'Heart0005','still','2011-08-30 19:16:27','2012-09-05 21:47:45','Heart0005-Perfusion-Fixed-Left-Ventricle-Left-Ventricle-Bands','Thin white ventricular bands can be seen in this image, reaching from one side of the ventricle to the other or between trabeculations to help synchronize conduction throughout the myocardium.\n',0,1,0,0,0),(992,'Heart0007','still','2011-08-30 19:16:27','2012-09-05 21:47:45','Heart0007-Perfusion-Fixed-Left-Ventricle-Left-Ventricle-Bands','Seen in this image is a ventricular band reaching from the wall of the ventricle (on the left) to a papillary muscle (on the right).\n',0,1,0,0,0),(993,'Heart0018','still','2011-08-30 19:16:27','2012-09-05 21:47:45','Heart0018-Perfusion-Fixed-Left-Ventricle-Left-Ventricle-Bands','A thin ventricular band is seen spanning the apex of the LV and conneting between the free wall and septal wall of the ventricle.\n',0,1,0,0,0),(994,'Heart0019','still','2011-08-30 19:16:27','2012-09-05 21:47:45','Heart0019-Perfusion-Fixed-Left-Ventricle-Left-Ventricle-Bands','A multitude of ventricular bands spanning the apex of the LV.\n',0,1,0,0,0),(995,'Heart0020','still','2011-08-30 19:16:27','2012-09-05 21:47:45','Heart0020-Perfusion-Fixed-Left-Ventricle-Left-Ventricle-Bands','A fairly organized array of LV bands.\n',0,1,0,0,0),(996,'Heart0022','still','2011-08-30 19:16:27','2012-09-05 21:47:45','Heart0022-Perfusion-Fixed-Left-Ventricle-Left-Ventricle-Bands','Two LV bands can be seen reaching off of a papillary muscle and attaching to the LV wall.\n',0,1,0,0,0),(997,'Heart0024','still','2011-08-30 19:16:27','2012-09-05 21:47:45','Heart0024-Perfusion-Fixed-Left-Ventricle-Left-Ventricle-Bands','A quite substantial LV band, spanning between a trabeculation and the LV wall.',0,1,0,0,0),(1000,'Heart0002','video','2011-08-30 19:16:27','2012-09-05 21:44:34','Heart0002-Functional-Left-Ventricle-Mitral-Valve','View of the mitral and aortic valves from the LV apex. The heart is in working mode, as evidenced by the functional valves. The septal wall is located to the upper right and right of the screen and the free wall to the left and bottom of the screen.  A Millar pressure transducer catheter can be seen in the aortic valve.\n',1,1,1,0,0),(1001,'Heart0014','video','2011-08-30 19:16:27','2012-09-05 21:44:34','Heart0014-Functional-Left-Ventricle-Mitral-Valve','View of the ventricular aspect of the mitral valve as well as the free wall of the LV located between the anterior papillary muscle and posterior papillary muscle.  The anterior papillary muscle is on the right of the screen and the posterior papillary muscle on the left.\n',1,1,1,0,0),(1002,'Heart0049','video','2011-08-30 19:16:27','2012-09-05 21:44:34','Heart0049-Functional-Left-Ventricle-Mitral-Valve','View of the mitral valve from the ventricle, with the heart in working mode.  The mural (posterior) leaflet of the valve is to the top of the screen, and the aortic (anterior) leaflet is to the bottom.  The APM can be seen in the upper right of the screen.\n',1,1,1,0,0),(1003,'Heart0053-2','video','2011-08-30 19:16:27','2012-09-05 21:44:34','Heart0053-Functional-Left-Ventricle-Mitral-Valve-2','View of the mitral leaflets and chordae tendinae attaching the leaflets to the papillary muscles of the LV.  The PPM can be seen in the center of the screen.  The mural (posterior) leaflet of the valve is to the right and the aortic (anterior) leaflet to the left.\n',1,1,1,0,0),(1004,'Heart0053-3','video','2011-08-30 19:16:27','2012-09-05 21:44:34','Heart0053-Functional-Left-Ventricle-Mitral-Valve-3','View of the mitral valve from the LV.  The valve is not closing completely and is slightly regurgitant.  The mural (posterior) leaflet, PPM, and a third papillary muscle positioned between the PPM and APM are visible in the top and top right of the screen.  The aortic (anterior) leaflet is to the bottom right of the screen.  A large LV band can be seen on the left of the screen traveling to the lower right.  This band attaches to the base of the APM, which is not visible in the clip.\n',1,1,1,0,0),(1005,'Heart0058','video','2011-08-30 19:16:27','2012-09-05 21:44:34','Heart0058-Functional-Left-Ventricle-Mitral-Valve','The mitral valve can be seen as viewed from the left ventricular apex. The posterior papillary muscle is to the right of the screen. Chordae tendinae connect the valves leaflets to the papillary muscles to prevent the leaflets from prolapsing.\n',1,1,1,0,0),(1006,'Heart0073-2','video','2011-08-30 19:16:27','2012-12-27 22:19:17','Heart0073-Functional-Left-Ventricle-Mitral-Valve-2','Mitral valve from left ventricular apex in working mode.\n',0,1,1,0,0),(1007,'Heart0076','video','2011-08-30 19:16:27','2012-12-27 22:21:39','Heart0076-Functional-Left-Ventricle-Mitral-Valve','View of mitral valve in working mode from left ventricle; aortic valve on the left.\n',0,1,1,0,0),(1008,'Heart0077-1','video','2011-08-30 19:16:27','2012-12-27 22:29:49','Heart0077-Functional-Left-Ventricle-Mitral-Valve-1','View of the mitral valve in working mode from below; the aortic valve is seen on the left.\n',0,1,1,0,0),(1009,'Heart0077-2','video','2011-08-30 19:16:27','2012-12-27 22:29:49','Heart0077-Functional-Left-Ventricle-Mitral-Valve-2','View of the mitral valve in Langendorff mode from below; the aortic valve is on the left and the chordae tendonae are visible.\n',0,1,1,0,0),(1010,'Heart0083','video','2011-08-30 19:16:27','2012-12-27 22:34:55','Heart0083-Functional-Left-Ventricle-Mitral-Valve','View of the mitral valve from the left ventricle.  The chordae tendinae of the valve can be clearly seen with the anterior papillary muscle to the right of the image.\n',0,1,1,0,0),(1011,'Heart0086','video','2011-08-30 19:16:27','2012-12-27 22:47:12','Heart0086-Functional-Left-Ventricle-Mitral-Valve','The bottom of the mitral valve as seen from the left ventrical. The aortic valve is seen to the left of the mitral valve. A free floating growth is also seen bouncing around in the cordae tendinae of the mitral valve.\n',0,1,1,0,0),(1015,'Heart0085','video','2011-08-30 19:16:27','2012-12-27 22:44:14','Heart0085-Functional-Left-Ventricle-Mitral-Valve','Footage of the functioning mitral valve viewed from the left ventricle.  The anterior leaflet can be seen to the top of the image and the posterior below.  The complex connections of the leaflets to the papillary muscles via the chordae tendonae of the left ventricle can also be seen.\n',0,1,1,0,0),(1016,'Heart0120','video','2011-08-30 19:16:27','2012-12-27 22:49:25','Heart0120-Functional-Left-Ventricle-Mitral-Valve','The mitral valve as seen from the left ventricle.  The chordae tendineae can be seen connecting the valve leaflets to the papillary muscles on the ventricular wall.\n',0,1,1,0,0),(1018,'Heart0136','video','2011-08-30 19:16:27','2013-07-10 21:15:17','Heart0136-Functional-Left-Ventricle-Mitral-Valve','This clip shows the mitral valve from below. This heart does not have stereotypical anatomy when it comes to the papillary muscles. There are at least three papillary muscles in this left ventricle, one can be seen at the top of the video (anterior papillary) and it may be attached to the other papillary muscle as a complex, bi or tri-fricated papillary complex. The posterior papillary muscle is also a part of a complex that is not seen as well with this video.\n',0,1,1,0,0),(1020,'Heart0005','still','2011-08-30 19:16:27','2014-07-22 19:44:34','Heart0005-Perfusion-Fixed-Left-Ventricle-Mitral-Valve','Perfusion fixed heart.  View of mitral valve from left ventricle.  Camera pans from showing the heads of the anterior and posterior papillary muscles to the chordae tendinae and their attachment to the aortic leaflet of the mitral valve.\n',0,1,0,0,0),(1021,'Heart0007-1','still','2011-08-30 19:16:27','2012-09-05 21:47:45','Heart0007-Perfusion-Fixed-Left-Ventricle-Mitral-Valve-1','View of one of the leaflets of the mitral valve from the LV, as well as the chordae tendinae attaching it to the papillary muscles.\n',0,1,0,0,0),(1022,'Heart0007-2','still','2011-08-30 19:16:27','2012-09-05 21:47:45','Heart0007-Perfusion-Fixed-Left-Ventricle-Mitral-Valve-2','A view of both leaflets of the mitral valve and chordae tendinae.\n',0,1,0,0,0),(1023,'Heart0018-1','still','2011-08-30 19:16:27','2012-09-05 21:47:45','Heart0018-Perfusion-Fixed-Left-Ventricle-Mitral-Valve-1','Upclose view of one of the leaflets of the mitral valve.\n',0,1,0,0,0),(1024,'Heart0018-2','still','2011-08-30 19:16:27','2012-09-05 21:47:45','Heart0018-Perfusion-Fixed-Left-Ventricle-Mitral-Valve-2','Looking upward at the mitral valve from below.  The chordae tendinae can be seen attaching the leaflets to the papillary muscles.\n',0,1,0,0,0),(1025,'Heart0019-1','still','2011-08-30 19:16:27','2012-09-05 21:47:45','Heart0019-Perfusion-Fixed-Left-Ventricle-Mitral-Valve-1','Good view of chordae tendinae attached to mitral valve leaflets from within the LV.\n',0,1,0,0,0),(1026,'Heart0019-2','still','2011-08-30 19:16:27','2014-07-22 19:44:34','Heart0019-Perfusion-Fixed-Left-Ventricle-Mitral-Valve-2','Perfusion fixed heart.  View of the mitral valve from the left ventricle.  The camera pans from a view including the posterior papillary muscle to one showing the anterior papillary muscle.  At the start of the clip, the septal wall can be seen on the left hand side of the image.  At the end of the clip, trabeculations can be seen on the free wall of the left ventricle.\n',0,1,0,0,0),(1027,'Heart0020','still','2011-08-30 19:16:27','2012-09-05 21:47:45','Heart0020-Perfusion-Fixed-Left-Ventricle-Mitral-Valve','Image of the mitral valve from below.  Near the bottom of the image on both the left and right sides, a papillary muscle can be seen.\n',0,1,0,0,0),(1028,'Heart0024','still','2011-08-30 19:16:27','2012-09-05 21:47:45','Heart0024-Perfusion-Fixed-Left-Ventricle-Mitral-Valve','Chordae tendinae seen reaching upward and attaching to the leaflets fo the mitral valve (thin white material).',0,1,0,0,0),(1038,'Heart0013-Anterior','video','2011-08-30 19:16:28','2012-09-05 21:44:34','Heart0013-Functional-Left-Ventricle-Anterior-Papillary-Muscle','View of the anterior papillary muscle in the left ventricle.  Chordae tendinae can be seen on the head of the muscle.\n',1,0,1,0,0),(1039,'Heart0014-Anterior','video','2011-08-30 19:16:28','2012-09-05 21:44:34','Heart0014-Functional-Left-Ventricle-Anterior-Papillary-Muscle','View of the anterior papillary muscle in the left ventricle.  Chordae tendinae can be seen on the head of the muscle.  The camera pans to include the posterior wall and part of the posterior papillary muscle towards the end of the clip.\n',1,0,1,0,0),(1040,'Heart0014-Posterior','video','2011-08-30 19:16:28','2012-09-05 21:44:34','Heart0014-Functional-Left-Ventricle-Posterior-Papillary-Muscle','View of the posterior papillary muscle of the left ventricle.  The septal wall is to the left, off the screen.  Chordae tendinae can be seen arising from the two heads of the muscle.\n',1,0,1,0,0),(1041,'Heart0015-Posterior','video','2011-08-30 19:16:28','2012-09-05 21:44:34','Heart0015-Functional-Left-Ventricle-Posterior-Papillary-Muscle','The base of the posterior (center) and the anterior (right) papillary muscles can be seen in this movie sequence. Of particular interest are the trabeculation and conduction bands near the apex where the papillary muscles join the ventricular free wall highlighting the complex anatomy of the left ventricular apex.\n',1,0,1,0,0),(1042,'Heart0017-Anterior','video','2011-08-30 19:16:28','2012-09-05 21:44:34','Heart0017-Functional-Left-Ventricle-Anterior-Papillary-Muscle','View of the anterior papillary muscle in the left ventricle.  The head of the posterior papillary muscle is directly below the camera off the bottom of the screen.  Chordae tendinae can be seen arising from both papillary muscles and heading off the top of the screen.\n',1,0,1,0,0),(1043,'Heart0017-Posterior','video','2011-08-30 19:16:28','2012-09-05 21:44:34','Heart0017-Functional-Left-Ventricle-Posterior-Papillary-Muscle','View of the posterior papillary muscle of the left ventricle.  There are two heads which are connected by a short fibrous band.  Chordae tendinae can be seen arising from both heads and heading towards the mitral valve, which is off the screen to the top.\n',1,0,1,0,0),(1044,'Heart0023-Anterior','video','2011-08-30 19:16:28','2012-09-05 21:44:34','Heart0023-Functional-Left-Ventricle-Anterior-Papillary-Muscle','View of the anterior papillary muscle in the left ventricle.  The head of the posterior papillary muscle is to the lower left of the screen.  Chordae tendinae can be seen arising from both muscles and heading off the top of the screen, towards the mitral valve.  Trabeculations on the free wall of the left ventricle can also be seen surrounding the anterior papillary muscle.\n',1,0,1,0,0),(1045,'Heart0023-Posterior-Anterior','video','2011-08-30 19:16:28','2012-09-05 21:44:34','Heart0023-Functional-Left-Ventricle-Posterior-Papillary-Muscle-Anterior-Papillary-Muscle','View of the papillary muscles in the left ventricle.  A bifurcated posterior papillary muscle can be seen on the right of the image.  The base of the anterior papillary muscle can be seen on the upper left of the image.\n',1,0,1,0,0),(1046,'Heart0026-Posterior','video','2011-08-30 19:16:28','2012-09-05 21:44:34','Heart0026-Functional-Left-Ventricle-Posterior-Papillary-Muscle','View of the posterior papillary muscles (there are 2) of the Left ventricle.  The camera initially shows the head of the muscles along with the associated chordae tendinae, and then pans to the body and base of the muscles.\n',1,0,1,0,0),(1047,'Heart0046-Anterior','video','2011-08-30 19:16:28','2012-09-05 21:44:34','Heart0046-Functional-Left-Ventricle-Anterior-Papillary-Muscle','View of the posterior papillary muscle of the LV, through the mitral valve.  The aortic (anterior) leaflet of the mitral valve is to the right and the mural (posterior) is to the left.\n',1,0,1,0,0),(1048,'Heart0048-Posterior','video','2011-08-30 19:16:28','2012-09-05 21:44:34','Heart0048-Functional-Left-Ventricle-Posterior-Papillary-Muscle','The posterior papillary muscle complex in this heart has a bifurcated head with chordae attaching to both anterior and posterior leaflets of the mitral valve.\n',1,0,1,0,0),(1049,'Heart0049-Posterior','video','2011-08-30 19:16:28','2012-09-05 21:44:34','Heart0049-Functional-Left-Ventricle-Posterior-Papillary-Muscle','Close-up view of the head of the PPM of the LV.\n