t\n',1,0,0,0,0),(1433,'Heart0048','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0048-MRI-Short-Axis-Valve-Level','Short axis slice of the heart at valve level. The axes are labeled as follows: S=superior, I=inferior, A=anterior, P=posterior, R=right, L=left\n',1,0,0,0,0),(1434,'Heart0050','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0050-MRI-Short-Axis-Valve-Level','This short axis image of the heart shows the close proximity of the mitral, tricuspid and aortic valves.  The leaflets of the pulmonary and tricuspid valves can be seen within their respective valve annuli.\n',1,0,0,0,0),(1435,'Heart0051','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0051-MRI-Short-Axis-Valve-Level','Short axis slice of the heart at valve level. The axes are labeled as follows: S=superior, I=inferior, A=anterior, P=posterior, R=right, L=left\n',1,0,0,0,0),(1436,'Heart0053','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0053-MRI-Short-Axis-Valve-Level','This short axis slice of the specimen beautifully shows the annulus of the mitral valve. Additionally, the left circumflex artery can be seen curving around heart above the mitral annulus and the left anterior descending artery diving down into the myocardium adjacent to the pulmonary valve annulus.\n',1,0,0,0,0),(1437,'Heart0054','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0054-MRI-Short-Axis-Valve-Level','This valvular level short axis slice depicts the leaflets of the aortic valve and displays the proximity of the aortic valve to the mitral.\n',1,0,0,0,0),(1438,'Heart0055','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0055-MRI-Short-Axis-Valve-Level','Short axis slice of the heart at valve level. The axes are labeled as follows: S=superior, I=inferior, A=anterior, P=posterior, R=right, L=left\n',1,0,0,0,0),(1439,'Heart0056','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0056-MRI-Short-Axis-Valve-Level','This MR slice shows the mitral and aortic valve annuli in the cardiac skeleton.  The three cusps of the aortic valve can also be seen in the center of the image.\n',1,0,0,0,0),(1440,'Heart0057','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0057-MRI-Short-Axis-Valve-Level','The tri leaflet structure of the aortic valve can be seen in the center of this short axis slice of the heart at the valve level.  The annulus of the mitral valve is also clearly identifiable.\n',1,0,0,0,0),(1441,'Heart0059','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0059-MRI-Short-Axis-Valve-Level','The pulmonary valve of this heart seems to be heavily dilated, possibly due to pulmonary hypertension.\n',1,0,0,0,0),(1442,'Heart0060','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0060-MRI-Short-Axis-Valve-Level','The three cusps and the commissures of the aortic valve can be clearly seen in this short axis slice of the heart.\n',1,0,0,0,0),(1443,'Heart0061','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0061-MRI-Short-Axis-Valve-Level','Short axis slice of the heart at valve level. The axes are labeled as follows: S=superior, I=inferior, A=anterior, P=posterior, R=right, L=left\n',1,0,0,0,0),(1444,'Heart0062','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0062-MRI-Short-Axis-Valve-Level','The proximity of the aortic and mitral valves is displayed in this short axis MR image showing how each valve annulus makes up part of the cardiac skeleton.\n',1,0,0,0,0),(1445,'Heart0063','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0063-MRI-Short-Axis-Valve-Level','The relationship between the mitral, aortic and tricuspid valve annulus can be seen in this short axis MR slice.\n',1,0,0,0,0),(1446,'Heart0064','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0064-MRI-Short-Axis-Valve-Level','The short axis MR slice at the valve level clearly shows the orientation of the leaflets of the aortic valve and the proximity of the aortic valve to the mitral annulus.\n',1,0,0,0,0),(1447,'Heart0069','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0069-MRI-Short-Axis-Valve-Level','Short axis slice of the heart at valve level. The axes are labeled as follows: S=superior, I=inferior, A=anterior, P=posterior, R=right, L=left\n',1,0,0,0,0),(1448,'Heart0070','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0070-MRI-Short-Axis-Valve-Level','The short axis valve level slice displays the tricuspid nature of both semilunar valves.  The right atrial appendage can also be seen in to the right of the image.\n',1,0,0,0,0),(1449,'Heart0074','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0074-MRI-Short-Axis-Valve-Level','This MR slice of the heart shows the position of the aortic valve in relation to the mitral valve. Additionally the positioning of the aortic leaflets can be made out with the right coronary artery branching off the aorta to the right of the sinus of valsalva.\n',1,0,0,0,0),(1450,'Heart0075','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0075-MRI-Short-Axis-Valve-Level','The coronary sinus can clearly be seen wrapping around the annulus of the mitral valve in the posterior region of the left ventricle in this short axis slice.  \n',1,0,0,0,0),(1451,'Heart0076','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0076-MRI-Short-Axis-Valve-Level','The relative positions of the aortic and mitral valve annulus can be clearly seen in this short axis image.\n',1,0,0,0,0),(1452,'Heart0077','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0077-MRI-Short-Axis-Valve-Level','The orientation of the leaflets of the aortic valve are shown in the center of this short axis MR slice.  One should also note the positioning of the mitral valve annulus in relation to the coronary sinus to the posterior portion of the heart and to the aortic valve in the center of the heart\\.\n',1,0,0,0,0),(1453,'Heart0078','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0078-MRI-Short-Axis-Valve-Level','The walls of the right atrium and the left atrial appendage (to the far left of the image) are clearly defined in this short axis slice. Additionally, the walls of the pulmonary artery and the aorta are clearly recognizable as an example of how vascular tissue is imaging differently to myocardial tissue.\n',1,0,0,0,0),(1454,'Heart0083','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0083-MRI-Short-Axis-Valve-Level','The short axis slice clearly displays the interaction of the four valve through the cardiac skeleton with the aortic valve in the center, the pulmonary valve to the top, the mitral to the left and the edge of the tricuspid (below the right atrium (RA)).\n',1,0,0,0,0),(1455,'Heart0084','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0084-MRI-Short-Axis-Valve-Level','This MR slice of the heart clearly shows the junction of the cardiac skeleton between the aortic, mitral and tricuspid valves.\n',1,0,0,0,0),(1456,'Heart0088','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0088-MRI-Short-Axis-Valve-Level','In this short axis slice the right coronary artery can clearly be seen branching off the aorta from the right coronary cusp.\n',1,0,0,0,0),(1457,'Heart0089','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0089-MRI-Short-Axis-Valve-Level','The leaflets of the tricuspid, mitral aortic valve can be seen in this short axis slice. Additionally, it is possible to make out some of the coronary vessels within the myocardial fat around the heart.\n',1,0,0,0,0),(1458,'Heart0090','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0090-MRI-Short-Axis-Valve-Level','This short axis MR slice at the level of the cardiac valves beautifully shows that this heart has a bicuspid aortic valve.  This congenital defect is clearly indicated in the image by the way the two valve leaflets form a figure of eight shape in the aortic annulus.  Bicuspid aortic valves occur in approximately 1-2% of the population and are usually treated by surgically replacing the valve. \n',1,0,0,0,0),(1459,'Heart0092','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0092-MRI-Short-Axis-Valve-Level','This short axis slice clearly depicts the three leaflets of the aortic valve.  The gap in the inter atrial septum was caused when the heart was excised due to a large portion of the inferior vena cava being removed with the liver to aid in attachment of that organ to a recipient.\n',1,0,0,0,0),(1460,'Heart0093','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0093-MRI-Short-Axis-Valve-Level','This MR short axis slice is slightly higher in the heart than many of the others, just above the cardiac skeleton.  The coronary sinus can clearly be seen curving around the mitral valve annulus and ending at the ostium in the right atrium.\n',1,0,0,0,0),(1461,'Heart0094','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0094-MRI-Short-Axis-Valve-Level','This short axis MR slice nicely shows the mitral valve annulus and the close proximity of the aortic, mitral and tricuspid valves.\n',1,0,0,0,0),(1462,'Heart0096','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0096-MRI-Short-Axis-Valve-Level','The pulmonary artery can clearly be recognized in this short axis slice to the top of the image.  Additionally, part of the left atrial appendage can be seen just to the upper left of the mitral and aortic valves.\n',1,0,0,0,0),(1463,'Heart0097','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0097-MRI-Short-Axis-Valve-Level','This short axis slice clearly shows the tri-leaflet nature of the pulmonary valve, to the top of the image.  Interestingly, due to the orientation of the heart in the scanner this short axis slice shows the aortic annulus to be almost the size of the mitral annulus.  Such an image exemplifies the importance of ensuring your scan in in the plane of the annulus when you are imaging to take measurements.\n',1,0,0,0,0),(1464,'Heart0102','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0102-MRI-Short-Axis-Valve-Level','A short axis MR slice of the heart just above the cardiac skeleton.\n',1,0,0,0,0),(1465,'Heart0108','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0108-MRI-Short-Axis-Valve-Level','This short axis slice of the heart nicely shows the tri-leaflet orientation of the aortic valve. Additionally, to the bottom of the image the coronary sinus can be seen sweeping around the mitral annulus and connecting to the right atrium at the ostium.\n',1,0,0,0,0),(1466,'Heart0109','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0109-MRI-Short-Axis-Valve-Level','This MR slice shows the tricuspid, mitral and aortic valve annuli in the cardiac skeleton.  The dark spots are due to air in the coronary vessels affecting the MR scans.\n',1,0,0,0,0),(1467,'Heart0110','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0110-MRI-Short-Axis-Valve-Level','The tri leaflet structure of the aortic valve can be clearly seen in this short axis slice.  The dark patches in the pectinate muscles of the right atrium are trapped pockets of air that affect the MR imaging process.\n',1,0,0,0,0),(1468,'Heart0111','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0111-MRI-Short-Axis-Valve-Level','The proximity of the aortic and mitral valves is evidenced in this short axis MR image showing how each valve annulus makes up part of the cardiac skeleton.\n',1,0,0,0,0),(1469,'Heart0112','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0112-MRI-Short-Axis-Valve-Level','This short axis slice of the heart shows the aortic valve in the center of the image with the two branches of the left coronary artery, the left anterior descending artery and the left circumflex artery.  Additionally, the leaflets of the pulmonary valve can be seen at the top of the image and the coronary sinus can be seen connecting to the right atrium at the base of the image.  Interestingly the thebesian valve, at the coronary sinus ostium, can also be seen on this MR slice due to the high resolution of the image.\n',1,0,0,0,0),(1470,'Heart0118','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0118-MRI-Short-Axis-Valve-Level','This short axis slice art the level of the valves shows the close proximity of all four cardiac valves, (the tricuspid valve lies slightly inferior to this MR slice below the right atrium).\n',1,0,0,0,0),(1471,'Heart0119','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0119-MRI-Short-Axis-Valve-Level','The left circumflex artery can be seen in this image curving from where it branches from the left coronary artery (to the upper left of the aortic valve) around the mitral valve annulus adjacent to the coronary sinus before diving down into the myocardium of the left ventricular free wall (below the mitral annulus).\n',1,0,0,0,0),(1472,'Heart0121','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0121-MRI-Short-Axis-Valve-Level','Due to the fact that this short axis slice is not in the plane of the aortic valve annulus the valve is depicted as having an oval shape.  This is not the case and such images reinforce the need to be certain that you are imaging in the plane of the anatomical feature you are analyzing when taking anatomical measurements.\n',1,0,0,0,0),(1473,'Heart0125','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0125-MRI-Short-Axis-Valve-Level','In this short axis slice the non coronary leaflet of the aortic valve can be seen in the plane of the slice (the grey colored leaflet toward the base of the image). Additionally, the coronary sinus ostium can be seen where the coronary sinus dumps the venous return from the myocardium back into the right atrium (at the base of the image).\n',1,0,0,0,0),(1474,'Heart0130','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0130-MRI-Short-Axis-Valve-Level','This short axis slice of the specimen beautifully shows the annulus of the mitral valve. Additionally, the right coronary artery can be seen branching off from the right coronary cusp of the aortic valve (just above the tricuspid valve annulus).\n',1,0,0,0,0),(1475,'Heart0131','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0131-MRI-Short-Axis-Valve-Level','The short axis slice at the valve level displays the orientation of the valves in relation to each other.  This specimen shows how the annuli of the mitral and aortic valves are linked and displays the way the cardiac skeleton can be identified using MR imaging.\n',1,0,0,0,0),(1476,'Heart0132','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0132-MRI-Short-Axis-Valve-Level','The tri-leaflet structure of the aortic valve can be seen in the center of this short axis slice.  Additionally, the right coronary artery can be seen branching off the right coronary cusp of the aortic valve and the close interaction of the aortic and mitral valves can be seen.\n',1,0,0,0,0),(1477,'Heart0138','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0138-MRI-Short-Axis-Valve-Level','The proximity of the aortic, mitral and tricuspid valves is displayed in this short axis MR image showing how each valve annulus makes up part of the cardiac skeleton.\n',1,0,0,0,0),(1478,'Heart0139','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0139-MRI-Short-Axis-Valve-Level','This short axis slice of the heart nicely shows two of the coronary vessels: the right coronary artery branching off the aorta (to the right of the image) and the coronary sinus wrapping around the back of the mitral annulus (to the left of the image).\n',1,0,0,0,0),(1479,'Heart0140','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0140-MRI-Short-Axis-Valve-Level','The tri leaflet structure of the aortic valve can be seen in the center of this short axis slice of the heart at the valve level.  The annulus of the mitral valve is also clearly identifiable.\n',1,0,0,0,0),(1480,'Heart0141','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0141-MRI-Short-Axis-Valve-Level','This MR slice of the heart clearly shows the junction of the cardiac skeleton between the aortic, mitral and tricuspid valves.\n',1,0,0,0,0),(1481,'Heart0142','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0142-MRI-Short-Axis-Valve-Level','The short axis slice of the heart can be used to compare the four annuli of the cardiac valves.  In this specimen we can also see the right coronary artery wrap around the back of the right atrium.\n',1,0,0,0,0),(1482,'Heart0143','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0143-MRI-Short-Axis-Valve-Level','Part of the non coronary cusp of the aortic valve (in the center of the image) can be seen in this short axis slice of the heart.  This specimen also exhibits a significant amount of epicardial fat on the right side of the heart, to the right of the image.\n',1,0,0,0,0),(1483,'Heart0145','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0145-MRI-Short-Axis-Valve-Level','This MR slice of the heart clearly shows the junction of the cardiac skeleton between the aortic, mitral and tricuspid valves.\n',1,0,0,0,0),(1484,'Heart0153','still','2011-08-30 19:16:34','2012-09-05 21:42:45','Heart0153-MRI-Short-Axis-Valve-Level','The short axis image shown here exemplifies the mitral valve annulus and it\'s proximity to the aortic valve.  This particular specimen also exhibits a large coronary sinus ostium, seen to the left of the right atrium.',1,0,0,0,0),(1485,'Heart0019','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0019-MRI-Short-Axis-Mid-Ventricular-Level','Short axis view of the heart. The axes are labeled as follows: S=superior, I=inferior, A=anterior, P=posterior, R=right, L=left\n',1,0,0,0,0),(1486,'Heart0035','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0035-MRI-Short-Axis-Mid-Ventricular-Level','Short axis view of the heart. The axes are labeled as follows: S=superior, I=inferior, A=anterior, P=posterior, R=right, L=left\n',1,0,0,0,0),(1487,'Heart0046','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0046-MRI-Short-Axis-Mid-Ventricular-Level','The short axis slice of the heart depicts the varying wall thickness between the left and the right side of the heart.\n',1,0,0,0,0),(1488,'Heart0047','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0047-MRI-Short-Axis-Mid-Ventricular-Level','Short axis view of the heart. The axes are labeled as follows: S=superior, I=inferior, A=anterior, P=posterior, R=right, L=left\n',1,0,0,0,0),(1489,'Heart0048','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0048-MRI-Short-Axis-Mid-Ventricular-Level','Short axis view of the heart. The axes are labeled as follows: S=superior, I=inferior, A=anterior, P=posterior, R=right, L=left\n',1,0,0,0,0),(1490,'Heart0050','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0050-MRI-Short-Axis-Mid-Ventricular-Level','This ventricular short axis slice exhibits the distinct differences between the endocardial surfaces of the right and left ventricles.  Additionally the papillary muscle complexes of the left ventricle can be clearly identified.  The dark area at the top of the interventricular septum within the epicardial fat is caused by an air pocket in the great cardiac vein.\n',1,0,0,0,0),(1491,'Heart0051','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0051-MRI-Short-Axis-Mid-Ventricular-Level','Short axis view of the heart. The axes are labeled as follows: S=superior, I=inferior, A=anterior, P=posterior, R=right, L=left\n',1,0,0,0,0),(1492,'Heart0053','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0053-MRI-Short-Axis-Mid-Ventricular-Level','Heart 53 was reanimated in the Visible Heart apparatus and hence shows distinct edema (thickening due to the absorption of water) of the ventricular walls.\n',1,0,0,0,0),(1493,'Heart0054','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0054-MRI-Short-Axis-Mid-Ventricular-Level','The effects of left ventricular hypertrophy can be seen in the short axis slice depicting the tick walled, low volume left ventricle.\n',1,0,0,0,0),(1494,'Heart0055','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0055-MRI-Short-Axis-Mid-Ventricular-Level','Short axis view of the heart. The axes are labeled as follows: S=superior, I=inferior, A=anterior, P=posterior, R=right, L=left\n',1,0,0,0,0),(1495,'Heart0056','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0056-MRI-Short-Axis-Mid-Ventricular-Level','The very thick walls of the left ventricle are typical of ventricular hypertrophy.  The small volume and thick walls limits the hearts ability to move blood whilst pumping.  This specimen also displays a large amount of epicardial fat on the free wall of the right ventricle.\n',1,0,0,0,0),(1496,'Heart0057','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0057-MRI-Short-Axis-Mid-Ventricular-Level','This short axis slice of the heart shows some slight dilation of the ventricles emphasized by the large chamber size and relatively thin ventricular walls.  The image also exemplifies the differences between the papillary muscle complexes of the left and right ventricles.\n',1,0,0,0,0),(1497,'Heart0059','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0059-MRI-Short-Axis-Mid-Ventricular-Level','This specimen shows severe hypertrophy of the left ventricle as evidenced by the thick ventricular walls and the small chamber volume.  This anatomical shape is usually the result of end stage cardiac disease possibly brought on by hypertension or other myocardial diseases.\n',1,0,0,0,0),(1498,'Heart0060','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0060-MRI-Short-Axis-Mid-Ventricular-Level','The inferior and superior papillary muscles of the left ventricle can clearly be seen in this short axis slice that shows dilation of the ventricles.\n',1,0,0,0,0),(1499,'Heart0061','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0061-MRI-Short-Axis-Mid-Ventricular-Level','Short axis view of the heart. The axes are labeled as follows: S=superior, I=inferior, A=anterior, P=posterior, R=right, L=left\n',1,0,0,0,0),(1500,'Heart0062','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0062-MRI-Short-Axis-Mid-Ventricular-Level','The hypertrophy of the left ventricle and the dilation of the right ventricle can be seen in this short axis mid-ventricular slice.  Such thickening of the left side only is often due to overloading of the left side caused by hypertension or aortic stenosis.\n',1,0,0,0,0),(1501,'Heart0063','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0063-MRI-Short-Axis-Mid-Ventricular-Level','The mid-ventricular MR slice of the heart displays the dilation of the left and right ventricles as well as the papillary muscles of the mitral valve.\n',1,0,0,0,0),(1502,'Heart0064','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0064-MRI-Short-Axis-Mid-Ventricular-Level','This short axis MR slice displays the significant hypertrophy of the left ventricle resulting in a small ventricular volume and a large wall thickness.  By contrast the right ventricle displays thin walls and a large volume indicating some dilation of the chamber.\n',1,0,0,0,0),(1503,'Heart0069','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0069-MRI-Short-Axis-Mid-Ventricular-Level','Short axis view of the heart. The axes are labeled as follows: S=superior, I=inferior, A=anterior, P=posterior, R=right, L=left\n',1,0,0,0,0),(1504,'Heart0070','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0070-MRI-Short-Axis-Mid-Ventricular-Level','The short axis slice shows the difference between right and left ventricular papillary muscles.  Additionally, the effects of left ventricular hypertrophy can be seen evidencing the thick walls and low volume of the left ventricle.\n',1,0,0,0,0),(1505,'Heart0074','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0074-MRI-Short-Axis-Mid-Ventricular-Level','The papillary muscles of the left and right ventricle can be seen in this short axis slice of the heart.  The change in tissue properties along the inferior portion of the left ventricle may be due to degradation of the myocardium either via an infarct or a myocardial infection.\n',1,0,0,0,0),(1506,'Heart0075','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0075-MRI-Short-Axis-Mid-Ventricular-Level','The small volume of the right ventricle in relation to the left in this short axis slice is slightly misleading due to the fact that the slice cuts through the right ventricle close to the apex of the chamber.\n',1,0,0,0,0),(1507,'Heart0076','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0076-MRI-Short-Axis-Mid-Ventricular-Level','The difference between the wall thickness of the left and right ventricle can clearly be identified in this short axis image.  Additionally, the difference in the size and positioning of the left and the right papillary muscles can be seen.\n',1,0,0,0,0),(1508,'Heart0077','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0077-MRI-Short-Axis-Mid-Ventricular-Level','This short axis MR slice displays the slight hypertrophy of the left ventricle and shows the difference between the papillary muscle of each ventricle.  Additionally the trabeculations of the right ventricle can be seen.\n',1,0,0,0,0),(1509,'Heart0078','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0078-MRI-Short-Axis-Mid-Ventricular-Level','The size and wall thickness of the ventricles of this heart could be considered healthy  However, although wall thickness and chamber volume is a good indication of cardiac health, it does not necessarily guarantee a good cardiac output.\n',1,0,0,0,0),(1510,'Heart0083','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0083-MRI-Short-Axis-Mid-Ventricular-Level','The short axis slice through the ventricles clearly indicates the difference in wall thickness between the left and the right chambers.\n',1,0,0,0,0),(1511,'Heart0084','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0084-MRI-Short-Axis-Mid-Ventricular-Level','The papillary muscles of the left and right ventricle can be seen in this short axis slice of the heart.\n',1,0,0,0,0),(1512,'Heart0088','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0088-MRI-Short-Axis-Mid-Ventricular-Level','This short axis slice of the heart at the ventricular level displays the anatomical differences between the papillary muscles of the left and the right ventricles.  The right ventricular papillary muscles are generally smaller in cross-sectional area due to the lower forces required to tether the tricuspid valve. \n',1,0,0,0,0),(1513,'Heart0089','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0089-MRI-Short-Axis-Mid-Ventricular-Level','Short axis slice of the right and left ventricle.  A large amount of epicardial fat can be seen on this specimen.\n',1,0,0,0,0),(1514,'Heart0090','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0090-MRI-Short-Axis-Mid-Ventricular-Level','This short axis slice of the left and right ventricles shows slight enlargement of the left side.  This can be attributed to the extra work required to push blood through the bicuspid aortic valve.\n',1,0,0,0,0),(1515,'Heart0092','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0092-MRI-Short-Axis-Mid-Ventricular-Level','The short axis slice through the ventricles shows  two areas of relatively thick epicardial fat.  These run along the anterior interventricular sulcus, to the top of the image, and down the free wall of the right ventricle, to the right of the image.  These fat layers are designed to protect the coronary vessels serving the ventricles.\n',1,0,0,0,0),(1516,'Heart0093','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0093-MRI-Short-Axis-Mid-Ventricular-Level','The hypertrophy of the left ventricle can clearly be seen in this image in addition to significant amount of epicardial fat, particularly on the right side.\n',1,0,0,0,0),(1517,'Heart0094','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0094-MRI-Short-Axis-Mid-Ventricular-Level','The heart shown here is from a patient diagnosed with hypertension and coronary artery disease.  These pathologies have led to the slight hypertrophy of the left ventricle and the dilation of the right, as evidenced in this short axis MR slice of the ventricles.\n',1,0,0,0,0),(1518,'Heart0096','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0096-MRI-Short-Axis-Mid-Ventricular-Level','This heart is from a patient diagnosed with hypertension and diabetes.  Consequently the extra stress on the left side of the heart has led to hypertrophy of the left ventricle as evidenced by its wall thickness when compared to the right.\n',1,0,0,0,0),(1519,'Heart0097','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0097-MRI-Short-Axis-Mid-Ventricular-Level','The papillary muscles of the left and right ventricle can be seen in this short axis slice of the heart.\n',1,0,0,0,0),(1520,'Heart0102','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0102-MRI-Short-Axis-Mid-Ventricular-Level','This specimen show the signs of some ventricular dilation possibly due to cardiomyopathy or congestive heart failure.  The papillary muscle of both the left and the right ventricle can be clearly seen in the image.\n',1,0,0,0,0),(1521,'Heart0108','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0108-MRI-Short-Axis-Mid-Ventricular-Level','The short axis slice at the mid ventricular level shows the differences between the ventricular walls and the papillary muscles of the left and the right side of the heart.\n',1,0,0,0,0),(1522,'Heart0109','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0109-MRI-Short-Axis-Mid-Ventricular-Level','The short axis mid ventricular slice of the heart shows the significant differences between the endocardial surfaces of the left and the right ventricles.\n',1,0,0,0,0),(1523,'Heart0110','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0110-MRI-Short-Axis-Mid-Ventricular-Level','The ventricles of this heart show the distinct differences between the endocardial surfaces and papillary muscles of the left and right ventricles.  The change in gray scale between the myocardial tissue of the left and the right ventricle may be a result of the prolonged duration of asystole (causing the tissue to become ischemic) that this patient underwent before stabilizing.\n',1,0,0,0,0),(1524,'Heart0111','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0111-MRI-Short-Axis-Mid-Ventricular-Level','The dilation of both the left and the right ventricle can be seen in this short axis slice of the heart.  This dilation results in a large chamber size that requires more muscular force to contract and therefore produce a meaningful cardiac output.\n',1,0,0,0,0),(1525,'Heart0112','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0112-MRI-Short-Axis-Mid-Ventricular-Level','The difference between the wall thickness of the left and right ventricle can clearly be identified in this short axis image.  In this specimen the left side of the heart is showing some signs of ventricular hypertrophy as evidenced by the ratio of the chamber volume to the wall thickness.\n',1,0,0,0,0),(1526,'Heart0118','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0118-MRI-Short-Axis-Mid-Ventricular-Level','The papillary muscles of the left ventricle are nicely defined in this short axis MR slice through the ventricles.  The image nicely demonstrates the varied anatomy of the endocardial surface of both left and right chambers.\n',1,0,0,0,0),(1527,'Heart0119','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0119-MRI-Short-Axis-Mid-Ventricular-Level','The cross sectional view of the left and right ventricles, as displayed in this short axis MR slice, shows slight hypertrophy of the left ventricular free wall, potentially due to increased afterload on the left ventricle.\n',1,0,0,0,0),(1528,'Heart0121','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0121-MRI-Short-Axis-Mid-Ventricular-Level','The circular cross-sectional shape of the left ventricle in this specimen indicates some slight dilation of the chamber.  This is confirmed when looking at the chamber volume to wall thickness ratio in both the short and long axis views.\n',1,0,0,0,0),(1529,'Heart0125','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0125-MRI-Short-Axis-Mid-Ventricular-Level','The two papillary complexes of the left ventricle can be clearly identified in this short axis slice of the ventricles.  The image also depicts the difference in the wall thickness and ventricular volumes of the left and right side of the heart.\n',1,0,0,0,0),(1530,'Heart0130','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0130-MRI-Short-Axis-Mid-Ventricular-Level','This heart is from a patient diagnosed with hypertension.  Although the systemic disease is usually associated with hypertrophy, in this patient it has chronically stressed the heart causing the ventricles to dilate as evidenced by the round cross-sectional shape of the left ventricle and the large cross-sectional area of the right.\n',1,0,0,0,0),(1531,'Heart0131','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0131-MRI-Short-Axis-Mid-Ventricular-Level','This short axis ventricular slice shows the differences between the endocardial anatomy of the left and right ventricles with the two papillary complexes of the left ventricle clearly visible.\n',1,0,0,0,0),(1532,'Heart0132','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0132-MRI-Short-Axis-Mid-Ventricular-Level','The ventricular short axis slice of this heart shows slight dilation of the chambers. The ventricular walls are relatively thick indicating that although dilated the heart may have been able to move a significant amount of blood around the body. However, this anatomical shape indicates the onset of congestive heart failure and over time the increasing volume of the chambers will effectively reduce the cardiac output.  This situation is exaggerated by the fact that the patient was listed as being hypertensive.\n',1,0,0,0,0),(1533,'Heart0138','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0138-MRI-Short-Axis-Mid-Ventricular-Level','The epicardial fat layers in the anterior and posterior interventricular sulci can be seen in the short axis slice of the ventricles.  This fat layer is there to protect the cardiac vessels serving the lower regions of the ventricles.\n',1,0,0,0,0),(1534,'Heart0139','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0139-MRI-Short-Axis-Mid-Ventricular-Level','This short axis slice of the ventricles shows the significant hypertrophy of the left ventricle and the dilation of the right.  It can be seen that the  wall thickness of the left side is comparable to the chamber diameter, this ratio results in a very strong ventricle moving a small volume of blood, usually against a large ventricular afterload.  The patient was diagnosed with chronic pulmonary obstruction and hypertension which over time have caused the dilation of the right ventricle and the hypertrophy of the left.\n',1,0,0,0,0),(1535,'Heart0140','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0140-MRI-Short-Axis-Mid-Ventricular-Level','This short axis slice from a heart with no medically recorded cardiac pathologies shows some slight dilation to the chambers.  This is most probably due to the age of the patient and shows how a heart can exhibit some of the anatomical symptoms of the early stages of cardiac disease without effecting the global organ function. Interestingly, this heart shows a relatively large epicardial fat pad on the anterior surface of the heart (to the top of the image).\n',1,0,0,0,0),(1536,'Heart0141','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0141-MRI-Short-Axis-Mid-Ventricular-Level','This specimen show the signs of some ventricular dilation possibly due to cardiomyopathy or congestive heart failure.  The intricate trabeculation of the left and right ventricles can be clearly seen in the image.\n',1,0,0,0,0),(1537,'Heart0142','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0142-MRI-Short-Axis-Mid-Ventricular-Level','The papillary muscles of the left ventricle are clearly defined in this short axis MR slice through the ventricles.\n',1,0,0,0,0),(1538,'Heart0143','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0143-MRI-Short-Axis-Mid-Ventricular-Level','The cross sectional view of the left and right ventricles, as displayed in this short axis MR slice, highlights the differences between the left and the right sides of the heart.\n',1,0,0,0,0),(1539,'Heart0145','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0145-MRI-Short-Axis-Mid-Ventricular-Level','The differences in the papillary muscles of the left and right ventricles are clearly defined in this short axis MR slice.\n',1,0,0,0,0),(1540,'Heart0153','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0153-MRI-Short-Axis-Mid-Ventricular-Level','Significant hypertrophy of the left ventricle can be seen in this short axis slice of the heart.  Such an increase in the ventricular wall thickness results in the enlargement of the papillary complexes and the stiffening of the ventricular walls.',1,0,0,0,0),(1541,'Heart0019','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0019-MRI-4-Chamber','Four-chamber view of the heart. The axes are labeled as follows: S=superior, I=inferior, A=anterior, P=posterior, R=right, L=left\n',1,0,0,0,0),(1542,'Heart0035','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0035-MRI-4-Chamber','Four-chamber view of the heart. The axes are labeled as follows: S=superior, I=inferior, A=anterior, P=posterior, R=right, L=left\n',1,0,0,0,0),(1543,'Heart0046','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0046-MRI-4-Chamber','The four chamber view of the heart displays the softball shape of this particular heart indicating the possibility of dilated cardiomyopathy.  The MR slice displays the distinct differences between the left and right sides of the heart.\n',1,0,0,0,0),(1544,'Heart0047','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0047-MRI-4-Chamber','Four-chamber view of the heart. The axes are labeled as follows: S=superior, I=inferior, A=anterior, P=posterior, R=right, L=left\n',1,0,0,0,0),(1545,'Heart0048','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0048-MRI-4-Chamber','Four-chamber view of the heart. The axes are labeled as follows: S=superior, I=inferior, A=anterior, P=posterior, R=right, L=left\n',1,0,0,0,0),(1546,'Heart0050','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0050-MRI-4-Chamber','The four chamber slice of the heart shows the differences between the wall thickness of the right and left ventricles.\n',1,0,0,0,0),(1547,'Heart0051','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0051-MRI-4-Chamber','Four-chamber view of the heart. The axes are labeled as follows: S=superior, I=inferior, A=anterior, P=posterior, R=right, L=left\n',1,0,0,0,0),(1548,'Heart0053','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0053-MRI-4-Chamber','Heart 53 was reanimated in the Visible Heart apparatus and hence shows distinct edema (thickening due to the absorption of water) of the ventricular walls.\n',1,0,0,0,0),(1549,'Heart0054','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0054-MRI-4-Chamber','The four chamber scan for this specimen shows the hypertrophic left ventricle.  However, due to the atrial walls collapsing during the scanning process the anatomic features of the atria are not readily viewable.\n',1,0,0,0,0),(1550,'Heart0055','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0055-MRI-4-Chamber','Four-chamber view of the heart. The axes are labeled as follows: S=superior, I=inferior, A=anterior, P=posterior, R=right, L=left\n',1,0,0,0,0),(1551,'Heart0056','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0056-MRI-4-Chamber','The four chamber view of the current specimen displays the large volume of the atria in this specimen.  The heart displays the ventricular anatomy of a hypertrophic heart and consequently may have partially distended atrial anatomy, as evidenced by the MR image.  The slice shows the papillary muscles of both ventricles and the leaflets of the tricuspid and mitral valves.\n',1,0,0,0,0),(1552,'Heart0057','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0057-MRI-4-Chamber','The long axis view of this specimen shows all four chambers of the heart and beautifully exhibits the two atrioventricular valves, the mitral and the tricuspid.  The trabeculation of the endocardial surface of the right ventricle is also clearly visible as well as the papillary muscle complexes of both ventricles.\n',1,0,0,0,0),(1553,'Heart0059','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0059-MRI-4-Chamber','The left ventricular hypertrophy of this specimen is clearly viewed in this four chamber long axis slice. The volume to wall thickness ratio of the left side is significantly different to the right indicating the  left side has increased in size in order to push blood against the high blood pressure.\n',1,0,0,0,0),(1554,'Heart0060','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0060-MRI-4-Chamber','The four chamber view of this heart shows the dilation of the ventricles in this specimen.  The dilation of the chambers due to certain cardiac pathologies eventually results in the reduced cardiac output of the heart and can lead to cardiac death.\n',1,0,0,0,0),(1555,'Heart0061','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0061-MRI-4-Chamber','Four-chamber view of the heart. The axes are labeled as follows: S=superior, I=inferior, A=anterior, P=posterior, R=right, L=left\n',1,0,0,0,0),(1556,'Heart0062','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0062-MRI-4-Chamber','The MR image displays the significant hypertrophy of the left ventricle and the dilation of the right ventricle as evidenced by the wall thickness of both.  This pathology is usually the result of the left heart working hard against hypertension or a stenotic aortic valve.\n',1,0,0,0,0),(1557,'Heart0063','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0063-MRI-4-Chamber','The four chamber MR slice of this specimen show the distinct dilation of the chambers resulting a thin walls and a reduction in the cardiac output.  Of particular interest is the thickness of the right ventricle at the apex.\n',1,0,0,0,0),(1558,'Heart0064','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0064-MRI-4-Chamber','The four chamber view of the heart displays the hypertrophy of the left ventricle in relation to the right and shows the large amount of epicardial fat surrounding the heart.\n',1,0,0,0,0),(1559,'Heart0069','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0069-MRI-4-Chamber','Four-chamber view of the heart. The axes are labeled as follows: S=superior, I=inferior, A=anterior, P=posterior, R=right, L=left\n',1,0,0,0,0),(1560,'Heart0070','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0070-MRI-4-Chamber','This four chamber slice depicts the sinus of valsalva, the area of the aorta immediately after the aortic valve, and hence would clinically be considered a five chamber view.  The mitral valve can be clearly seen between the left atrium and ventricle.  The contrast between the muscle, fat and blood vessels of the myocardium can be seen in this high definition MR slice.\n',1,0,0,0,0),(1561,'Heart0074','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0074-MRI-4-Chamber','The four chamber of this specimen indicates an un-natural anatomy of the high interventricular septum.  The thinning of the septum as you move away from the apex is due to the repair of a ventricular septal defect.  The mitral and tricuspid valve leaflets and subvalvular apparatus can also be seen in the image.\n',1,0,0,0,0),(1562,'Heart0075','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0075-MRI-4-Chamber','The four chamber view shows the left and the right side of this heart simultaneously and allows cardiologists to compare the size and features of the two sides during diagnosis.\n',1,0,0,0,0),(1563,'Heart0076','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0076-MRI-4-Chamber','The left and the right chambers of the heart are clearly visible in this long axis image.\n',1,0,0,0,0),(1564,'Heart0077','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0077-MRI-4-Chamber','The leaflets and the sub valvular apparatus of the mitral and tricuspid valves can be clearly identified in this four chamber image.\n',1,0,0,0,0),(1565,'Heart0078','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0078-MRI-4-Chamber','The four chamber view of this specimen displays the left and right chambers of the heart. Size and proportions of this heart could be considered healthy, although it must be noted that this does not always relate to good cardiac heath.\n',1,0,0,0,0),(1566,'Heart0083','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0083-MRI-4-Chamber','The four chamber long axis view shows the anatomy of the interventricular septum.  This image displays how thin the septum can be as it approaches the cardiac skeleton (at the very top of the left ventricular outflow tract, just below the aortic valve).  This area of the heart is known as the membranous septum and is of particular interest to researchers and clinicians working with the aortic valve.\n',1,0,0,0,0),(1567,'Heart0084','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0084-MRI-4-Chamber','The mitral and tricuspid valves can be clearly seen in this four chamber image.  The dark areas at the top of the atria are due to air pockets within the heart when the specimen wad scanned.\n',1,0,0,0,0),(1568,'Heart0088','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0088-MRI-4-Chamber','This long axis slice of the heart clearly show all four chambers and the two atrio-ventricular valves.  The dense trabeculation at the apex of the right ventricle of this heart may increase the difficulty of implanting a RV apex pacing lead.\n',1,0,0,0,0),(1569,'Heart0089','still','2011-08-30 19:16:35','2012-09-05 21:42:45','Heart0089-MRI-4-Chamber','The four chamber long axis view of this heart shows the right ventricular anterior papillary muscle and the chordae tendinae reaching up to the tricuspid valve. This particular specimen also displays a thin membranous septum, at the top of the interventricular septum.\n',1,0,0,0,0),(1570,'Heart0090','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0090-MRI-4-Chamber','The long axis four chamber slice of this heart exhibits the hypertrophy of the left side in relation to the right, caused by the work required to move blood through the bicuspid aortic valve.  This particular patient also suffered a myocardial infarction and received three coronary artery stents, both factors which can contribute to overall hypertrophy of the ventricles.\n',1,0,0,0,0),(1571,'Heart0092','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0092-MRI-4-Chamber','The four chamber long axis image of this heart clearly shows the differences between the left and the right ventricles with a beautiful image of a right ventricular papillary muscle.  Of particular interest in this image is the poor structural anatomy of the interventricular septum, this may have been caused by the myocardial infarction suffered by the patient.\n',1,0,0,0,0),(1572,'Heart0093','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0093-MRI-4-Chamber','The four chamber long axis slice shows the distinct hypertrophy of the left ventricle and the significant thickness of the epicardial fat layer around the right ventricle.\n',1,0,0,0,0),(1573,'Heart0094','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0094-MRI-4-Chamber','This four chamber MR slice clearly show the hypertrophy of the left ventricle and the dilation of the right ventricle and both atria. These symptoms are often the result of systemic hypertension, as this patient was diagnosed with.\n',1,0,0,0,0),(1574,'Heart0096','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0096-MRI-4-Chamber','The hypertrophy of the left ventricle and the dilation of the right side are clearly evidenced in this four chamber view.  Additionally the anatomical structure of the membranous septum can be seen just below the mitral valve at the top of the interventricular septum.\n',1,0,0,0,0),(1575,'Heart0097','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0097-MRI-4-Chamber','This long axis slice of the heart exemplifies the difference between the left and the right sides of the heart.  It also shows the trabeculation of the right ventricular apex and how the endocardial surface of the right ventricle is highly complex.\n',1,0,0,0,0),(1576,'Heart0102','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0102-MRI-4-Chamber','The four chamber long axis view clearly shows the dilation of the atria and of the two ventricles as evidenced by the chamber size in relation to the annular size of the mitral and tricuspid valves.  Chordae tendinae connecting the respective valves to the ventricular free walls can be seen on each side.\n',1,0,0,0,0),(1577,'Heart0108','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0108-MRI-4-Chamber','The left and the right chambers of the heart are clearly visible in this long axis image.\n',1,0,0,0,0),(1578,'Heart0109','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0109-MRI-4-Chamber','The four chamber view of this heart shows the significant dilation of the two atria as well as some possible scarring to the myocardium of the interventricular septum.\n',1,0,0,0,0),(1579,'Heart0110','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0110-MRI-4-Chamber','This four chamber slice shows the difference between the left and the right sides of the heart and beautifully exhibits the mitral and tricuspid valves that control blood flow between the atria and ventricles. The apparent damage to the right ventricular wall can be seen in this image as evidenced by the different coloration of the myocardial tissue on the right rather than the left.\n',1,0,0,0,0),(1580,'Heart0111','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0111-MRI-4-Chamber','The dilation of the left and right ventricles can be clearly seen in this four chamber long axis image.  Of particular note is the very thin interventricular septum and right ventricular apex.\n',1,0,0,0,0),(1581,'Heart0112','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0112-MRI-4-Chamber','This four chamber long axis view of the heart exemplifies the variability in the anatomy of the right ventricular apex and papillary muscle complexes caused by the distinct trabeculation in that area of the heart.\n',1,0,0,0,0),(1582,'Heart0118','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0118-MRI-4-Chamber','The four chamber view of this specimen displays the left and right chambers of the heart. Size and proportions of this heart could be considered healthy, although it must be noted that the dimensions of the heart alone does not always relate to good cardiac function.\n',1,0,0,0,0),(1583,'Heart0119','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0119-MRI-4-Chamber','This long axis MR slice of the heart shows all four chambers and clearly indicates the hypertrophy of the left ventricular free wall, to the right of the image.\n',1,0,0,0,0),(1584,'Heart0121','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0121-MRI-4-Chamber','The four chamber view shows the left and the right side of this heart simultaneously and allows cardiologists to compare the size and features of the two sides during diagnosis.\n',1,0,0,0,0),(1585,'Heart0125','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0125-MRI-4-Chamber','The mitral valve, tricuspid valve and the left and the right chambers of the heart are clearly visible in this long axis image.\n',1,0,0,0,0),(1586,'Heart0130','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0130-MRI-4-Chamber','The four chamber view of this heart shows the significant dilation of the atria and ventricles as evidenced by the large chamber volumes and the relatively thin walls.\n',1,0,0,0,0),(1587,'Heart0131','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0131-MRI-4-Chamber','The four chamber view of the heart displays the anatomical differences between the left and the right sides of the organ with the two atrio-ventricular valves being clearly identified. This specimen displays significant dilation of the two atria as evidenced by their size relative to the ventricles.\n',1,0,0,0,0),(1588,'Heart0132','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0132-MRI-4-Chamber','As the scale in this four chamber slice suggests this is a large specimen.  The chambers of the heart are slightly dilated, this increases the chamber volume and therefore the filling time, assuming the annuli of the atrio-ventricular valves have remained constant.  In the long run this can significantly reduce cardiac output and be detrimental to the heart.\n',1,0,0,0,0),(1589,'Heart0138','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0138-MRI-4-Chamber','The leaflets and chordae tendinae of the two atrio-ventricular valves can be seen in this long axis four chamber slice. The heart also displays significant dilation to all four chambers due to clinically diagnosed hypertension.\n',1,0,0,0,0),(1590,'Heart0139','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0139-MRI-4-Chamber','The very thick walls and small volume of the left ventricle can be seen in this four chamber view of the heart.  In contrast the right ventricle and atrium show signs of dilation caused by chronic pulmonary obstruction.\n',1,0,0,0,0),(1591,'Heart0140','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0140-MRI-4-Chamber','This four chamber slice of the heart exhibits the dilation of the left atrium.  Additionally, the image beautifully shows one of the papillary heads of a complex in the left ventricle, note that the head of the papillary muscle has two distinctive tips that connect to both the anterior and posterior leaflets of the mitral valve.\n',1,0,0,0,0),(1592,'Heart0141','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0141-MRI-4-Chamber','The four chamber view of this heart shows evidence of ventricular dilation, thin ventricular wall and large chamber volumes.\n',1,0,0,0,0),(1593,'Heart0142','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0142-MRI-4-Chamber','Although not clinically diagnosed the anatomical structure of this large heart indicates the progression of a dilated cardiomyopathy.  This diagnosis is based upon the  ratio of the ventricular wall thickness and the chamber volumes.\n',1,0,0,0,0),(1594,'Heart0143','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0143-MRI-4-Chamber','The four chamber view of the heart shows the differences between the left and the right sides of the heart as well as the significant amounts of epicardial fat on the right side, to the right of the image.  Interestingly, the image also indicates that this heart has a atrial septal defect, a hole between the right and left atrium.\n',1,0,0,0,0),(1595,'Heart0145','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0145-MRI-4-Chamber','The left and the right chambers of the heart as well as the left ventricular outflow tract and the start of the aorta are clearly visible in this long axis image.\n',1,0,0,0,0),(1596,'Heart0153','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0153-MRI-4-Chamber','The hypertrophy of the left ventricle can be seen in this four chamber long axis view as evidenced by the thick walls of the free wall and the septum.  Slight dilation of the left atrium can also be seen in the image.',1,0,0,0,0),(1597,'Heart0019','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0019-MRI-2-Chamber-Left','Two-chamber view of the left side. The axes are labeled as follows: S=superior, I=inferior, A=anterior, P=posterior, R=right, L=left\n',1,0,0,0,0),(1598,'Heart0035','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0035-MRI-2-Chamber-Left','Two-chamber view of the left side. The axes are labeled as follows: S=superior, I=inferior, A=anterior, P=posterior, R=right, L=left\n',1,0,0,0,0),(1599,'Heart0046','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0046-MRI-2-Chamber-Left','The two chamber view of the left side displays the thick walls of the left ventricle and part of the anterior/superior papillary muscle complex connecting the mitral valve to the free wall of the left ventricle.  This particular MR slice depicts the left ventricular outflow tract as the left ventricle narrows in the approach to the aortic valve.\n',1,0,0,0,0),(1600,'Heart0047','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0047-MRI-2-Chamber-Left','Two-chamber view of the left side. The axes are labeled as follows: S=superior, I=inferior, A=anterior, P=posterior, R=right, L=left\n',1,0,0,0,0),(1601,'Heart0048','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0048-MRI-2-Chamber-Left','Two-chamber view of the left side. The axes are labeled as follows: S=superior, I=inferior, A=anterior, P=posterior, R=right, L=left\n',1,0,0,0,0),(1602,'Heart0050','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0050-MRI-2-Chamber-Left','The left atrium and ventricle can be clearly identified in this long axis slice.  Additionally, the mitral valve can clearly be seen between the two chambers.  The area of the myocardium adjacent to the posterior papillary muscle shows significant signs of trauma, this could be due to decomposition of the heart post explant or possible myocardial diseases pre explanation.\n',1,0,0,0,0),(1603,'Heart0051','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0051-MRI-2-Chamber-Left','Two-chamber view of the left side. The axes are labeled as follows: S=superior, I=inferior, A=anterior, P=posterior, R=right, L=left\n',1,0,0,0,0),(1604,'Heart0053','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0053-MRI-2-Chamber-Left','Heart 53 was reanimated in the Visible Heart apparatus and hence shows distinct edema (thickening due to the absorption of water) of the ventricular walls.\n',1,0,0,0,0),(1605,'Heart0054','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0054-MRI-2-Chamber-Left','This specimen has thick left ventricular walls and a relatively small ventricular volume, an indication of left ventricular hypertrophy.\n',1,0,0,0,0),(1606,'Heart0055','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0055-MRI-2-Chamber-Left','Two-chamber view of the left side. The axes are labeled as follows: S=superior, I=inferior, A=anterior, P=posterior, R=right, L=left\n',1,0,0,0,0),(1607,'Heart0056','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0056-MRI-2-Chamber-Left','Both anterior/superior and posterior/inferior papillary muscles can be seen in this two chamber view of the left side of the heart.  Additionally the coronary sinus, part of the cardiac venous system, can be clearly seen at the base of the heart.\n',1,0,0,0,0),(1608,'Heart0057','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0057-MRI-2-Chamber-Left','This two chamber view of the heart exhibits the slight dilation of the chambers of the left side.  The coronary sinus and the left circumflex artery can be seen either side of the mitral valve annulus.\n',1,0,0,0,0),(1609,'Heart0059','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0059-MRI-2-Chamber-Left','The hypertrophy of the left ventricle and the dilation of the pulmonary artery can be clearly seen in this long axis two chamber slice.\n',1,0,0,0,0),(1610,'Heart0060','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0060-MRI-2-Chamber-Left','The leaflets and sub-valvular apparatus of the left ventricle can be seen in this two chamber view of the left side.  The image also shows significant dilation of the ventricle which can lead to a decrease in cardiac output.\n',1,0,0,0,0),(1611,'Heart0061','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0061-MRI-2-Chamber-Left','Two-chamber view of the left side. The axes are labeled as follows: S=superior, I=inferior, A=anterior, P=posterior, R=right, L=left\n',1,0,0,0,0),(1612,'Heart0062','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0062-MRI-2-Chamber-Left','The two chamber view of the left side of this specimens shows significant hypertrophy of the walls of the left ventricle\n',1,0,0,0,0),(1613,'Heart0063','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0063-MRI-2-Chamber-Left','This long axis MR slice of the left side of the heart shows the slight dilation of the ventricle and the resulting change in shape of the chamber.\n',1,0,0,0,0),(1614,'Heart0064','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0064-MRI-2-Chamber-Left','The two chamber slice of the left ventricle shows the hypertrophy of the ventricle.  A large amount of epicardial fat can also be seen outside the muscle and parts of the coronary vasculature are visible, specifically the coronary sinus to the left of the image just above the mitral annulus.\n',1,0,0,0,0),(1615,'Heart0069','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0069-MRI-2-Chamber-Left','Two-chamber view of the left side. The axes are labeled as follows: S=superior, I=inferior, A=anterior, P=posterior, R=right, L=left\n',1,0,0,0,0),(1616,'Heart0070','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0070-MRI-2-Chamber-Left','The left atrium, mitral valve and left ventricular inflow tract can be clearly seen in this two chamber view of the left side.\n',1,0,0,0,0),(1617,'Heart0074','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0074-MRI-2-Chamber-Left','The left side of the specimen has been partially disfigured during the fixation process possibly due to external pressure on the apex.  However, the leaflets of the mitral valve, the superior vena cava and the pulmonary trunk are clearly defined in the image.\n',1,0,0,0,0),(1618,'Heart0075','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0075-MRI-2-Chamber-Left','The long axis two chamber slice of the left atrium and ventricle clearly shows the two chambers and the mitral valve between.  The coronary sinus can be seen to the left of the mitral annulus.\n',1,0,0,0,0),(1619,'Heart0076','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0076-MRI-2-Chamber-Left','The left ventricle, left atrium and mitral valve can clearly be identified in this two chamber slice.\n',1,0,0,0,0),(1620,'Heart0077','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0077-MRI-2-Chamber-Left','The two chamber slice of the left ventricle and atrium shows evidence of slight left sided hypertrophy.\n',1,0,0,0,0),(1621,'Heart0078','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0078-MRI-2-Chamber-Left','The left ventricle, left atrium and mitral valve can clearly be identified in this two chamber slice.\n',1,0,0,0,0),(1622,'Heart0083','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0083-MRI-2-Chamber-Left','The long axis two chamber slice of the ventricle shows the clear difference between the wall thicknesses of the ventricle and atrium.  This heart also displays some trauma at the apex of the ventricle, this is due to the trans-apical insertion of a device post-mortem. \n',1,0,0,0,0),(1623,'Heart0084','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0084-MRI-2-Chamber-Left','The long axis two chamber slice of the left ventricle clearly depicts the mitral valve between the atrium and ventricle.  The wall thickness of the ventricle indicates the possibility of LV hypertrophy and the large left atrium may be due to either mitral valve disease or hypertension.\n',1,0,0,0,0),(1624,'Heart0088','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0088-MRI-2-Chamber-Left','The long axis slice of the left ventricle clearly shows the posterior (or inferior) papillary muscle, the mitral valve and the coronary sinus.  Interestingly, the apex of the left ventricle in this specimen is unusually thin.\n',1,0,0,0,0),(1625,'Heart0089','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0089-MRI-2-Chamber-Left','The two chamber long axis slice of the left side shows a dilated left atrium due to diagnosed atrial fibrillation and hypertension. Additionally, the coronary sinus (to the left of the image) is significantly dilated.  The aorta and pulmonary artery to the right of the image indicate the differences in vessel thickness between the two arteries.\n',1,0,0,0,0),(1626,'Heart0090','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0090-MRI-2-Chamber-Left','The long axis two chamber slice of the left side shows the hypertrophy of the ventricle as well as the significant layer of epicardial fat on the superior surface of the heart, to the right of the image.  Interestingly,  the diaphragmatic surface (inferior) shows no epicardial fat layer and actually exhibits some damage to the myocardium, this damage was most probably caused during excision of the heart.\n',1,0,0,0,0),(1627,'Heart0092','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0092-MRI-2-Chamber-Left','The MR slice through the two chambers of the left side shows the left atrium and ventricle separated by the mitral valve.  Note the thinness of the ventricle wall at the apex and the slightly dilated shape.\n',1,0,0,0,0),(1628,'Heart0093','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0093-MRI-2-Chamber-Left','This long axis slice of the left ventricle displays the hypertrophy of the myocardial wall and beautifully displays a head of the posterior papillary muscle complex.  There is no epicardial fat at the region of the apex due to experimental work done on the heart after excision.\n',1,0,0,0,0),(1629,'Heart0094','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0094-MRI-2-Chamber-Left','The distinct hypertrophy of the left ventricle and the dilation of the left atrium can be seen in this long axis two chamber slice.\n',1,0,0,0,0),(1630,'Heart0096','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0096-MRI-2-Chamber-Left','The hypertrophy of the left ventricle is clearly evidenced in his long axis slice which also shows posterior/inferior papillary muscle connecting to both anterior and posterior leaflets of the mitral valve.  Interestingly, the slightly superior positioning of the coronary sinus to the mitral valve annulus in this particular heart can also be seen.\n',1,0,0,0,0),(1631,'Heart0097','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0097-MRI-2-Chamber-Left','The left side of the heart is imaged here in this long axis slice.  The left atrium can be seen to be slightly dilated, possibly due to increased systemic pressures as a result of the patients diagnosed hypertension.\n',1,0,0,0,0),(1632,'Heart0102','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0102-MRI-2-Chamber-Left','This two chamber long axis slice of the left side shows the large chamber size of the left ventricle and beautifully shows how the papillary muscle complexes of the left side, in this case the posterior/inferior complex, can connect to both leaflets of the mitral valve.\n',1,0,0,0,0),(1633,'Heart0108','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0108-MRI-2-Chamber-Left','The anterior/superior and posterior/inferior papillary muscle complexes of the left ventricle can be easily identified in this two chamber long axis slice of the left side. \n',1,0,0,0,0),(1634,'Heart0109','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0109-MRI-2-Chamber-Left','The dilation of the left atrium and the complexity of the sub-valvular apparatus of the mitral valve are clearly evident in this two chamber MR slice.\n',1,0,0,0,0),(1635,'Heart0110','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0110-MRI-2-Chamber-Left','A papillary muscle head of the posterior papillary muscle complex can be seen, to the left of the ventricle, connecting to the mitral valve leaflet through chordae tendinae.\n',1,0,0,0,0),(1636,'Heart0111','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0111-MRI-2-Chamber-Left','This two chamber slice of the hearts left ventricle and atrium shows the dilation of the ventricle also shows evidence of dilation of the pulmonary artery.  This may be due to pulmonary hypertension causing distension of the vessel over the years.\n',1,0,0,0,0),(1637,'Heart0112','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0112-MRI-2-Chamber-Left','The relationship of the coronary sinus and the mitral valve annulus can be seen in this two chamber long axis view of the heart.  The image also shows the posterior/inferior papillary muscle complex, to the left of the ventricle.\n',1,0,0,0,0),(1638,'Heart0118','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0118-MRI-2-Chamber-Left','The dilation of the left atrium and the posterior/inferior papillary muscle are clearly evident in this two chamber MR slice.\n',1,0,0,0,0),(1639,'Heart0119','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0119-MRI-2-Chamber-Left','Due to the orientation of the heart in the scanner the wall of the left ventricle is made to look thicker in this two chamber long axis slice.  This is due to the fact that the plane of the slice is not aligned with the axis of the left ventricle and consequently the intersection of the myocardium is not perpendicular to the epicardial and endocardial surfaces.\n',1,0,0,0,0),(1640,'Heart0121','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0121-MRI-2-Chamber-Left','The two chamber long axis slice of this heart beautifully show both papillary complexes of the left ventricle, the posterior/inferior complex and the anterior/superior complex.\n',1,0,0,0,0),(1641,'Heart0125','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0125-MRI-2-Chamber-Left','Part of the posterior/inferior muscle complex can be seen to the right of the ventricle in this long axis view of the left side.  The image also shows how the coronary sinus position relative to the mitral valve annulus can change significantly.\n',1,0,0,0,0),(1642,'Heart0130','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0130-MRI-2-Chamber-Left','This two chamber long axis slice of the heart shows the slight dilation of the left ventricle.  Chronic dilation of the chamber slowly reduces the cardiac output of the ventricle over time as the volume increases disproportionately to the thickness of the myocardium, weakening the ventricle walls.\n',1,0,0,0,0),(1643,'Heart0131','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0131-MRI-2-Chamber-Left','The MR slice seen here shows significant dilation of the left atrium.  Part of the posterior/inferior papillary muscle complex connecting to both the anterior and posterior leaflets of the mitral valve can be seen to the left of the ventricle.\n',1,0,0,0,0),(1644,'Heart0132','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0132-MRI-2-Chamber-Left','The large volume of the left ventricle is evidenced in this two chamber left sided MR slice.  Part of the left ventricular outflow tract can also be seen in the image.\n',1,0,0,0,0),(1645,'Heart0138','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0138-MRI-2-Chamber-Left','The dilation of the left atrium and ventricle can be seen in the two chamber image here.  Other significant anatomical features seen in the image include the mitral valve chordae tendinae, the coronary sinus and the comparison of the vessel walls of the aorta and the pulmonary artery.  The dark spots in the image are due to air pockets within the specimen that affect the MR imaging.\n',1,0,0,0,0),(1646,'Heart0139','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0139-MRI-2-Chamber-Left','The severe constriction of the left ventricle can be easily seen in this two chamber left sided slice of the heart.  Additionally, the dilation of the pulmonary artery, caused by the diagnosed pulmonary obstruction, can be seen to the right of the image.\n',1,0,0,0,0),(1647,'Heart0140','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0140-MRI-2-Chamber-Left','This two chamber left sided image shows the dilation of the left atrium as well as a considerable amount of epicardial fat around the ventricles.\n',1,0,0,0,0),(1648,'Heart0141','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0141-MRI-2-Chamber-Left','The rounded shape of the slightly dilated left ventricle can be seen in this two chamber slice. Additionally, the complexity of the posterior/inferior papillary muscle can be seen to the left of the ventricle.\n',1,0,0,0,0),(1649,'Heart0142','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0142-MRI-2-Chamber-Left','This left sided two chamber image is not in the axis of the mitral valve and hence the size of the left atrium, in relation to the ventricle, is misleading.  However, the image clearly shows the large volume of the left ventricle caused by the chronic heart disease.\n',1,0,0,0,0),(1650,'Heart0143','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0143-MRI-2-Chamber-Left','The left atrium, mitral valve and left ventricular inflow tract can be clearly seen in this two chamber view of the left side.\n',1,0,0,0,0),(1651,'Heart0145','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0145-MRI-2-Chamber-Left','This left sided two chamber view of the heart clearly shows the left atrium and ventricle separated by the mitral valve.  Interestingly, in this particular specimen the coronary sinus lies closer to the mitral annulus than usual.\n',1,0,0,0,0),(1652,'Heart0153','still','2011-08-30 19:16:36','2012-09-05 21:42:45','Heart0153-MRI-2-Chamber-Left','The dilated left atrium and the hypertrophic left ventricle are clearly identifiable in this long axis slice, these anatomical variations are often the result of a large left ventricular afterload and possible mitral insufficiency. Part of the left anterior descending artery can be seen, just after branching from the left coronary artery, in the center of the image.',1,0,0,0,0),(1653,'Heart0019','still','2011-08-30 19:16:37','2012-09-05 21:42:45','Heart0019-MRI-2-Chamber-Right','Two-chamber view of the right side. The axes are labeled as follows: S=superior, I=inferior, A=anterior, P=posterior, R=right, L=left\n',1,0,0,0,0),(1654,'Heart0035','still','2011-08-30 19:16:37','2012-09-05 21:42:45','Heart0035-MRI-2-Chamber-Right','Two-chamber view of the right side. The axes are labeled as follows: S=superior, I=inferior, A=anterior, P=posterior, R=right, L=left\n',1,0,0,0,0),(1655,'Heart0046','still','2011-08-30 19:16:37','2012-09-05 21:42:45','Heart0046-MRI-2-Chamber-Right','The orientation of this two chamber MR slice displays the right atrium and ventricle with the tricuspid valve between.  The superior vena cava can also be seen, however, the specimen has had the inferior vena cava removed.  Parts of the cardiac vasculature can be seen in the cardiac fat pads at the base of the heart.\n',1,0,0,0,0),(1656,'Heart0047','still','2011-08-30 19:16:37','2012-09-05 21:42:45','Heart0047-MRI-2-Chamber-Right','Two-chamber view of the right side. The axes are labeled as follows: S=superior, I=inferior, A=anterior, P=posterior, R=right, L=left\n',1,0,0,0,0),(1657,'Heart0048','still','2011-08-30 19:16:37','2012-09-05 21:42:45','Heart0048-MRI-2-Chamber-Right','Two-chamber view of the right side. The axes are labeled as follows: S=superior, I=inferior, A=anterior, P=posterior, R=right, L=left\n',1,0,0,0,0),(1658,'Heart0050','still','2011-08-30 19:16:37','2012-09-05 21:42:45','Heart0050-MRI-2-Chamber-Right','This two chamber slice of the right ventricle shows the anterior papillary muscle complex connecting to the tricuspid valve via chordal attachments.  This slice also shows the superior vena cava and its connection to the right atrium.\n',1,0,0,0,0),(1659,'Heart0051','still','2011-08-30 19:16:37','2012-09-05 21:42:45','Heart0051-MRI-2-Chamber-Right','Two-chamber view of the right side. The axes are labeled as follows: S=superior, I=inferior, A=anterior, P=posterior, R=right, L=left\n',1,0,0,0,0),(1660,'Heart0053','still','2011-08-30 19:16:37','2012-09-05 21:42:45','Heart0053-MRI-2-Chamber-Right','Heart 53 was reanimated in the Visible Heart apparatus and hence shows distinct edema (thickening due to the absorption of water) of the ventricular walls.\n',1,0,0,0,0),(1661,'Heart0054','still','2011-08-30 19:16:37','2012-09-05 21:42:45','Heart0054-MRI-2-Chamber-Right','The two chamber view of the right side shows the relatively small ventricular volume.  Due to the orientation of the heart during the scan the aorta can be seen, the distended nature of the vessel is an indication of cardiac disease.\n',1,0,0,0,0),(1662,'Heart0055','still','2011-08-30 19:16:37','2012-09-05 21:42:45','Heart0055-MRI-2-Chamber-Right','Two-chamber view of the right side. The axes are labeled as follows: S=superior, I=inferior, A=anterior, P=posterior, R=right, L=left\n',1,0,0,0,0),(1663,'Heart0056','still','2011-08-30 19:16:37','2012-09-05 21:42:45','Heart0056-MRI-2-Chamber-Right','Due to the orientation of the heart in the MR scanner the right side of the heart was not readily imaged.\n',1,0,0,0,0),(1664,'Heart0057','still','2011-08-30 19:16:37','2012-09-05 21:42:45','Heart0057-MRI-2-Chamber-Right','The relatively thin walls of the right ventricle are clearly visible in this long axis two chamber view of the heart.  Additionally, the right coronary artery can be seen near the center of the image between the aorta and the right ventricle.\n',1,0,0,0,0),(1665,'Heart0059','still','2011-08-30 19:16:37','2012-09-05 21:42:45','Heart0059-MRI-2-Chamber-Right','This two chamber long axis slice of the right side exhibits the size of the tricuspid annulus in this heart.  Interestingly, this specimen displays a large layer of epicardial fat on what would be the posterior surface of the heart, to the right of the image.\n',1,0,0,0,0),(1666,'Heart0060','still','2011-08-30 19:16:37','2012-09-05 21:42:45','Heart0060-MRI-2-Chamber-Right','Due to the orientation of the heart in the MR scanner this right two chamber image does not cleanly exhibit the right ventricle.  However, the image does show the large annulus of the tricuspid valve and shows the aortic valve and the ascending aorta can be seen to the right.\n',1,0,0,0,0),(1667,'Heart0061','still','2011-08-30 19:16:37','2012-09-05 21:42:45','Heart0061-MRI-2-Chamber-Right','Two-chamber view of the right side. The axes are labeled as follows: S=superior, I=inferior, A=anterior, P=posterior, R=right, L=left\n',1,0,0,0,0),(1668,'Heart0062','still','2011-08-30 19:16:37','2012-09-05 21:42:45','Heart0062-MRI-2-Chamber-Right','The right side of the specimen is not readily visualized in this MR image due to the scan orientation.  The image displays the right atrium and ventricle with the tricuspid valve connecting the two.\n',1,0,0,0,0),(1669,'Heart0063','still','2011-08-30 19:16:37','2012-09-05 21:42:45','Heart0063-MRI-2-Chamber-Right','The long axis MR slice of the right side of the heart shows how the chambers have dilated resulting in a large volume and a relatively small wall thickness.\n',1,0,0,0,0),(1670,'Heart0064','still','2011-08-30 19:16:37','2012-09-05 21:42:45','Heart0064-MRI-2-Chamber-Right','The right side of the specimen displays a significant amount of epicardial fat in relation to the thickness of the walls.  The chambers are also dilated, i.e. they exhibit a large chamber volume in relation to the wall thickness.  The superior vena cava and the ascending aorta can also be seen to the top of the image.\n',1,0,0,0,0),(1671,'Heart0069','still','2011-08-30 19:16:37','2012-09-05 21:42:45','Heart0069-MRI-2-Chamber-Right','Two-chamber view of the right side. The axes are labeled as follows: S=superior, I=inferior, A=anterior, P=posterior, R=right, L=left\n',1,0,0,0,0),(1672,'Heart0070','still','2011-08-30 19:16:37','2012-09-05 21:42:45','Heart0070-MRI-2-Chamber-Right','The right side two chamber slice of this specimen depicts how thin the walls of the right side are in comparison to the left side.  This image depicts both the inflow and outflow tracts of the right ventricle, the flow of blood can be visualized from the superior vena cava through to the pulmonary valve.\n',1,0,0,0,0),(1673,'Heart0074','still','2011-08-30 19:16:37','2012-09-05 21:42:45','Heart0074-MRI-2-Chamber-Right','Due to external forces during the fixation process the ascending aorta and the right atrium and ventricle have not held their true anatomical shape.\n',1,0,0,0,0),(1674,'Heart0075','still','2011-08-30 19:16:37','2012-09-05 21:42:45','Heart0075-MRI-2-Chamber-Right','The posterior papillary muscle of the right ventricle can be seen in this image of the specimen.  Additionally, this heart displays a significant amount of epicardial fat around the ventricles.\n',1,0,0,0,0),(1675,'Heart0076','still','2011-08-30 19:16:37','2012-09-05 21:42:45','Heart0076-MRI-2-Chamber-Right','The right side of the heart is imaged in this two chamber slice showing the smaller wall thickness of the right ventricle in comparison to the left.  The large area to the upper right of the ventricle is the right ventricular outflow tract.\n',1,0,0,0,0),(1676,'Heart0077','still','2011-08-30 19:16:37','2012-09-05 21:42:45','Heart0077-MRI-2-Chamber-Right','This image of the heart displays the trabeculations of the right ventricle on the endocardial surface of the chamber.  Additionally, the ascending aorta can be seen at the top of the image.  The vessel is large in relation to the rest of the heart, often a symptom of a large afterload on the left side possibly due to high blood pressure.\n',1,0,0,0,0),(1677,'Heart0078','still','2011-08-30 19:16:37','2012-09-05 21:42:45','Heart0078-MRI-2-Chamber-Right','This long axis slice of the right side of the heart shows the right atrium, the right ventricle, the right ventricular outflow tract and the aorta.  Additionally, the left atrial appendage can be seen wrapping around the heart at the top left of the image.\n',1,0,0,0,0),(1678,'Heart0083','still','2011-08-30 19:16:37','2012-09-05 21:42:45','Heart0083-MRI-2-Chamber-Right','Due to the orientation of the heart in the MR scanner this right two chamber image does not cleanly exhibit the right ventricle.  However, the ascending aorta and the pulmonary trunk can be seen to the right of the image.\n',1,0,0,0,0),(1679,'Heart0084','still','2011-08-30 19:16:37','2012-09-05 21:42:45','Heart0084-MRI-2-Chamber-Right','This MR long axis slice of the right ventricle displays the relatively thin walls of the right chamber.  This is due to the fact that less force is required to pump blood though the lungs.\n',1,0,0,0,0),(1680,'Heart0088','still','2011-08-30 19:16:37','2012-09-05 21:42:45','Heart0088-MRI-2-Chamber-Right','The right side of the heart can be seen in this two chamber long axis slice.\n',1,0,0,0,0),(1681,'Heart0089','still','2011-08-30 19:16:37','2012-09-05 21:42:45','Heart0089-MRI-2-Chamber-Right','Due to the orientation of the heart in the MR scanner this right two chamber image does not cleanly exhibit the right ventricle.  However, the image does show the large annulus of the tricuspid valve and shows the aortic valve in the center of the image and the right ventricular outflow tract and pulmonary valve to the right.\n',1,0,0,0,0),(1682,'Heart0090','still','2011-08-30 19:16:37','2012-09-05 21:42:45','Heart0090-MRI-2-Chamber-Right','The right side of the heart can be seen in this two chamber long axis slice clearly showing the tricuspid valve between the right atrium and ventricle.\n',1,0,0,0,0),(1683,'Heart0092','still','2011-08-30 19:16:37','2012-09-05 21:42:45','Heart0092-MRI-2-Chamber-Right','The MR slice of the right atrium and ventricle shows the two chambers separated by the tricuspid valve. The right coronary artery can be seen in the epicardial fat between the right atrium and the right ventricular outflow tract.\n',1,0,0,0,0),(1684,'Heart0093','still','2011-08-30 19:16:37','2012-09-05 21:42:45','Heart0093-MRI-2-Chamber-Right','This particular right ventricle displays a significant level of epicardial fat compared to many of the other hearts in the library.\n',1,0,0,0,0),(1685,'Heart0094','still','2011-08-30 19:16:37','2012-09-05 21:42:45','Heart0094-MRI-2-Chamber-Right','Due to the orientation of the heart ion the scanner the right side has been poorly imaged.  However, one can see the right ventricular outflow tract leading to the pulmonary artery through the pulmonary valve to the right of the image.\n',1,0,0,0,0),(1686,'Heart0096','still','2011-08-30 19:16:37','2012-09-05 21:42:45','Heart0096-MRI-2-Chamber-Right','This two chamber slice of the right side clearly shows the path from the right atrium, through the tricuspid valve and the right ventricle to the pulmonary valve before heading to the lungs.\n',1,0,0,0,0),(1687,'Heart0097','still','2011-08-30 19:16:37','2012-09-05 21:42:45','Heart0097-MRI-2-Chamber-Right','Although this two chamber long axis slice is centered on the right ventricle the orientation of the heart in the scanner has caused part of the left atrium to be imaged as well, to the top of the image.\n',1,0,0,0,0),(1688,'Heart0102','still','2011-08-30 19:16:37','2012-09-05 21:42:45','Heart0102-MRI-2-Chamber-Right','The two chamber view of the right side shows the large chamber size of the right atrium and the thin walls of both chambers of the right side.\n',1,0,0,0,0),(1689,'Heart0108','still','2011-08-30 19:16:37','2012-09-05 21:42:45','Heart0108-MRI-2-Chamber-Right','This two chamber slice of the right side exemplifies the thin walls of the right ventricle, when compared to the left, the  dense trabeculation of the right ventricular apex.\n',1,0,0,0,0),(1690,'Heart0109','still','2011-08-30 19:16:37','2012-09-05 21:42:45','Heart0109-MRI-2-Chamber-Right','Due to the orientation of the heart in the MR scanner this right two chamber image does not cleanly exhibit the right ventricle.  However, the image does show the large annulus of the tricuspid valve and the dilated right atrium.\n',1,0,0,0,0),(1691,'Heart0110','still','2011-08-30 19:16:37','2012-09-05 21:42:45','Heart0110-MRI-2-Chamber-Right','Due to the orientation of the heart in the MR scanner this right two chamber image does not cleanly exhibit the right ventricle.  However, the image does show the trabeculation on the endocardial surface of the chamber.\n',1,0,0,0,0),(1692,'Heart0111','still','2011-08-30 19:16:37','2012-09-05 21:42:45','Heart0111-MRI-2-Chamber-Right','The very large chamber size in relation to the wall thickness of the right ventricle can be seen in this two chamber long axis slice and is one of the key factors that is used to determine ventricular dilation using clinical cardiac imaging.\n',1,0,0,0,0),(1693,'Heart0112','still','2011-08-30 19:16:37','2012-09-05 21:42:45','Heart0112-MRI-2-Chamber-Right','This two chamber right sided long axis view nicely shows the right atrium, ventricle and outflow tract as well as the aortic valve and the ascending aorta.\n',1,0,0,0,0),(1694,'Heart0118','still','2011-08-30 19:16:37','2012-09-05 21:42:45','Heart0118-MRI-2-Chamber-Right','The right sided two chamber long axis image of this heart exemplifies the relatively thin walls of the right atrium and ventricle.\n',1,0,0,0,0),(1695,'Heart0119','still','2011-08-30 19:16:37','2012-09-05 21:42:45','Heart0119-MRI-2-Chamber-Right','This two chamber right sided long axis view nicely shows the right atrium, ventricle and outflow tract as well as the ascending aorta.\n',1,0,0,0,0),(1696,'Heart0121','still','2011-08-30 