19:16:39','2012-09-05 21:42:45','Heart0153-MRI-2-Chamber-Stack','Two chamber stack taken at an in plane resolution of 512 x 512 pixels at 1mm slice spacing. This sequence of in vitro images plays from the right of the heart to the left with the front of the heart on the right of the image.  This is similar to taking slices in superior posterior oblique aspect in the patient, perpendicular to the axis of the heart.',1,0,1,0,0),(1868,'Transseptal','video','2011-08-30 19:16:39','2013-03-21 22:23:52','eptransp','Delivery Systems - Porcine heart<p>Electrophysiologic studies require the careful placement of diagnostic electrode catheters within the heart. The use of fluoroscopy and intracardiac EMG recordings verifies the position of the electrode catheters.<p>Three approaches are generally used for advancing the electrode catheter to the heart: 1) femoral venous approach using the inferior vena cava (IVC); 2) subclavian, jugular, or brachial (antecubital) venous approach via the superior vena cave (SVC); or 3) femoral arterial or retrograde approach via the femoral artery.<p>The approach chosen depends upon the targeted area within the heart, the number of electrode catheters used during the electrophysiologic study, and physician experience and preference. The femoral arterial approach may also be used for gaining access to the left ventricle and/or left atrium.<p>As an extension of the IVC approach, an ablation catheter may also be advanced from the right atrium, across the interatrial septum, and into the left atrium using the transseptal approach.<p>During this approach, the interatrial septum must be punctured before a catheter can be advanced to the left atrium. To create an opening, a transseptal needle is advanced through a long sheath positioned at the foramen ovalis, a thin area of tissue in the interatrial septum. When the needle is withdrawn from the sheath, an ablation catheter is advanced through the septum to the left atrium. At this point the patient must be anticoagulated.<p>The ablation catheter may then be positioned for mapping and ablation. This approach is useful for left free-wall accessory pathway and AV nodal ablation (atrial fibrillation), as well as future indications for left atrial and left ventricular procedures (e.g., Wolf-Parkinson-White syndrome).<p>Shown here is a videoscopic view of the transseptal catheterization procedure to access the left atrium through the foramen ovalis (a sheath after a needle puncture).\n',0,0,1,0,0),(1869,'Multi-map-RA','video','2011-08-30 19:16:39','2013-03-21 22:23:52','ep4rap','Delivery Systems - Porcine heart<p>Electrophysiologic studies require the careful placement of diagnostic electrode catheters within the heart. The use of fluoroscopy and intracardiac EMG recordings verifies the position of the electrode catheters.<p>Three approaches are generally used for advancing the electrode catheter to the heart: 1) femoral venous approach using the inferior vena cava (IVC); 2) subclavian, jugular, or brachial (antecubital) venous approach via the superior vena cave (SVC); or 3) femoral arterial or retrograde approach via the femoral artery.<p>The approach chosen depends upon the targeted area within the heart, the number of electrode catheters used during the electrophysiologic study, and physician experience and preference. Typically, the IVC and SVC approaches are used for RA, RV, His bundle, and CS electrode catheters.<p>Shown here is a videoscopic view of four multi-ring mapping/ablation catheters placed into the right heart via the inferior vena cava. These catheters were positioned in the high right atrium, the right ventricular apex, near the His bundle, and within the coronary sinus. This catheter placement is typical during a complex mapping procedure.\n',0,0,1,0,0),(1870,'Transseptal-LA-LV-map','video','2011-08-30 19:16:39','2013-03-21 22:23:52','eptrablp','Delivery Systems - Porcine heart<p>Electrophysiologic studies require the careful placement of diagnostic electrode catheters within the heart. The use of fluoroscopy and intracardiac EMG recordings verifies the position of the electrode catheters.<p>Three approaches are generally used for advancing the electrode catheter to the heart: 1) femoral venous approach using the inferior vena cava (IVC); 2) subclavian, jugular, or brachial (antecubital) venous approach via the superior vena cave (SVC); or 3) femoral arterial or retrograde approach via the femoral artery. As an extension of the IVC approach, an ablation catheter may also be advanced from the right atrium, across the interatrial septum, and into the left atrium using the transseptal approach.<p>During this approach, the interatrial septum must be punctured before a catheter can be advanced to the left atrium. To create an opening, a transseptal needle is advanced through a long sheath positioned at the foramen ovalis, a thin area of tissue in the interatrial septum. When the needle is withdrawn from the sheath, an ablation catheter is advanced through the septum to the left atrium. At this point the patient must be anticoagulated. The ablation catheter may then be positioned for mapping and ablation. This approach is useful for left free-wall accessory pathway and AV nodal ablation (atrial fibrillation) as well as future indications for left atrial and left ventricular procedures (e.g., Wolf-Parkinson-White syndrome).<p>Shown here is a videoscopic view of the transseptal catheterization procedure to access the left atrium through the foramen ovalis. A sheath is placed and then a mapping/ablation catheter is positioned both within the left atrium and ventricle by passing it through the mitral valve.\n',0,0,1,0,0),(1871,'Catheter-CS-1','video','2011-08-30 19:16:39','2012-02-29 23:09:39','6250C','Delivery Systems - Porcine heart<p>Shown here is a close-up videoscopic view of a delivery catheter for left-heart transvenous leads being manipulated within the coronary sinus (CS).\n',0,0,1,0,0),(1872,'Catheter-CS-2','video','2011-08-30 19:16:39','2012-02-29 23:09:40','6250S','Delivery Systems - Porcine heart<p>Shown here is a close-up videoscopic view of a delivery catheter for left-heart transvenous leads being manipulated within the coronary sinus (CS).\n',0,0,1,0,0),(1873,'Catheter-steerable-CS','video','2011-08-30 19:16:39','2012-02-29 23:09:40','Prevail','Delivery Systems - Porcine heart<p>Shown here is a videoscopic view of a steerable delivery catheter for left-heart transvenous leads; it is being manipulated within the coronary sinus (CS).\n',0,0,1,0,0),(1874,'Sub-select-catheter-lead-vein-1','video','2011-08-30 19:16:39','2012-02-29 23:09:39','6238TEL','Delivery Systems - Porcine heart<p>Shown here is an external view of a pre-shaped catheter being advanced into the left anterior descending vein to eventually sub-select a side branch for lead placement.\n',0,0,1,0,0),(1875,'Sub-select-catheter-lead-vein-2','video','2011-08-30 19:16:39','2012-02-29 23:09:39','6248DEL','Delivery Systems - Porcine heart<p>Shown here is an external view of a pre-shaped catheter and a flexible tipped intercatheter being advanced into the left anterior descending vein, and then eventually used to sub-select a side branch for lead placement.',0,0,1,0,0),(1876,'Quad-pole-RAA','video','2011-08-30 19:16:39','2013-03-21 22:23:52','ephrap','Diagnostic Catheters - Porcine heart<p>Electrophysiologic testing of patients to identify arrhythmias involves intracardiac recording using diagnostic catheters and programmed electrical stimulation of the heart, thus facilitating the diagnoses of bradycardias and tachycardias. Generally, on the right side of the heart, catheters are placed in four locations: high right atrium (HRA), right ventricle (RV), His bundle (His or HB), and the coronary sinus (CS).<p> Diagnostic catheters are available with fixed curves and deflectable tips. <p> Cardiac mapping involves the identification of cardiac tissue that is causing the tachycardia. Delivery of radiofrequency current or cryotherapy to create a lesion in the area of interest destroys the selected tissue and prevents arrhythmias.<p> The HRA catheter is typically placed close to the SA node. The RV catheter is usually positioned in the ventricular apex to record right ventricular activity and for right ventricular pacing. The His bundle catheter is placed across the tricuspid valve to record a His bundle electrogram. A multielectrode catheter is placed in the coronary sinus to record electrical activity in the coronary sinus. Placement of a CS catheter is especially helpful when the arrhythmia mechanism may also involve the left atrium.<p> Simultaneous use of additional right atrial mapping multielectrode catheters may be used for mapping tachycardias.<p> Shown here is a videoscopic view of a multi-ring mapping/ablation catheter placed in the high right atrial position which was delivered to the heart via the inferior vena cava.\n',0,0,1,0,0),(1877,'Multi-map-IVC','video','2011-08-30 19:16:39','2013-03-21 22:23:52','eprvap','Diagnostic Catheters - Porcine heart<p>Simultaneous use of several right heart mapping multielectrode catheters may be used for mapping complex tachycardias.<p> Shown here is a videoscopic view of a multi-ring mapping/ablation catheter placed into the right heart via the inferior vena cava. One of these catheters can be viewed as it is being positioned into the right ventricular apex during a mapping procedure.\n',0,0,1,0,0),(1878,'Multi-map-Koch','video','2011-08-30 19:16:39','2013-03-21 22:23:52','ephisp','Diagnostic Catheters - Porcine heart<p>Simultaneous use of several right heart mapping multielectrode catheters may be used for mapping complex tachycardias.<p>Shown here is a videoscopic view of two multi-ring mapping/ablation catheters placed into the right heart via the inferior vena cava. One of these catheters can be viewed as it is being positioned into the area of the right atrium known as the Triangle of Koch, which borders the zone where the AV node and His bundle lie. Once can see the second catheter passing through the tricuspid valve.\n',0,0,1,0,0),(1879,'Deca-pole-CS','video','2011-08-30 19:16:39','2013-03-21 22:23:52','epcsp','Diagnostic Catheters - Porcine heart<p>Simultaneous use of several right heart mapping multielectrode catheters may be used for mapping complex tachycardias.<p>Shown here is a videoscopic view of three multi-ring mapping/ablation catheters placed into the right heart via the inferior vena cava. One of these catheters can be viewed as it is being articulated and directed into the coronary sinus. This is a decapolar, or ten electrode, catheter used for mapping procedures.\n',0,0,1,0,0),(1880,'Duo-deca-pole-RA','video','2011-08-30 19:16:39','2013-03-21 22:23:52','epsmprp','Diagnostic Catheters - Porcine heart<p>Electrophysiologic testing involves intracardiac recording using diagnostic catheters and programmed electrical stimulation of the heart.<p>Shown here is a unique duo-decapolar catheter design, which is being positioned within the right atrium during a mapping procedure.\n',0,0,1,0,0),(1881,'Swan-Ganz','video','2011-08-30 19:16:39','2013-03-21 22:26:10','swanp','Diagnostic Catheters - Porcine heart<p>Right side pressure mapping as a balloon catheter is passed through the Tricuspid and pulmonary valves and finally wedged in the pulmonary trunk.',0,0,1,0,0),(1882,'RF-ablate-RA','video','2011-08-30 19:16:39','2013-03-21 22:23:52','eprfablp','Therapeutic Catheters - Porcine heart<p>Not all arrhythmias identified during electrophysiologic studies can be treated by ablation therapy. Often, the mechanism of the arrhythmia determines which treatment will be most successful. The FDA has approved the following indications for radiofrequency (RF) catheter ablation: <ol> <li>atrioventricular nodal reentrant tachycardia (AVNRT); </li> <li>atrioventricular reentrant tachycardia (AVRT) caused by accessory conduction pathways (also called bypass tracts); </li> <li>atrioventricular nodal tachycardias resulting in inadequate ventricular rate control; </li> <li>ventricular tachycardia (VT) occurring in the absence of cardiovascular disease. </li> </ol> <p>This therapy has also been used to treat tachyarrhythmias including: <ol> <li>atrial tachycardia (atrial flutter, atrial fibrillation, and sinus (SA) node reentry); </li> <li>permanent junctional reciprocating tachycardia (PJRT); </li> <li>ventricular tachycardia occurring in the presence of structural heart disease. </li> </ol> <p>Shown here is the electrode tip of an ablation catheter positioned along the tricuspid annulus, near the ostium of the coronary sinus. The boundaries of the Triangle of Koch guide catheter placement precisely. As the energy is applied, one can observe a color change in the tissue being ablated.\n',0,0,1,0,0),(1883,'RF-ablate-RA-lesion','video','2011-08-30 19:16:39','2013-03-21 15:46:22','RF-burn2','Therapeutic Catheters - Porcine heart<p>Shown here is the videoscopic image of an electrode tip of an ablation catheter positioned along the tricuspid annulus, near the ostium of the coronary sinus. As the energy is applied, one can observe a color change in the tissue being ablated.  The catheter is moved until the proper lesion is created (e.g., in a line for a linear lesion).\n',0,0,1,0,0),(1884,'RA-map-potentials','video','2011-08-30 19:16:39','2013-03-21 22:23:52','epavnp','Therapeutic Catheters - Porcine heart<p>The detection of arrhythmias is a complex process that requires a skilled electrophysiologist so that proper treatment can be provided. Often, the mechanism of the arrhythmia determines which treatment will be most successful.<p>Shown here is a videoscopic view of an ablation procedure in the right atrium. Here the goal is to ablate the slow atrial conduction pathway, therefore the tip electrode of the ablation catheter is positioned along the tricuspid annulus, near the ostium of the coronary sinus. The boundaries of the Triangle of Koch guide catheter placement precisely. One can observe the tricuspid valve below. The fossa ovalis is back lit by placing a videoscope in the left atrium. The inset on the lower right shows electrical signals being recorded (upper signal) as well as left ventricular pressures (lower trace); at times, the heart is being paced through this catheter.\n',0,0,1,0,0),(1885,'Cryoballoon-RA-LA-LAA','video','2011-08-30 19:16:39','2012-08-20 14:41:09','cryoablation-balloon','Therapeutic Catheters - Porcine heart<p>Shown here is a videoscopic view of a transseptal puncture of the fossa ovalis from the right atrium (RA). First the septum is tented and then punctured with a wire, then a dialator is advanced. Next a delivery catheter containing a cryoAblation balloon is advanced; the balloon is inflated, placed within the left atrial appendage (LAA), cooled, deflated, and then retracted.\n',0,0,1,0,0),(1886,'Cryocath-RA','video','2011-08-30 19:16:39','2012-02-29 23:09:40','freezor1','Therapeutic Catheters - Porcine heart<p>Shown here is a videoscopic view of a cryoAblation catheter placed on the septum of the right atrium (RA). The cooling is initiated and ice forms; the clear buffer forms a clear ice block around the catheter. After therapy is complete, the cooling is stopped and the ice quickly thaws, at which time the catheter is then repositioned.\n',0,0,1,0,0),(1887,'Cryocath-RA-tug','video','2011-08-30 19:16:39','2012-02-29 23:09:40','freezor2','Therapeutic Catheters - Porcine heart<p>Shown here is a videoscopic view of a cryoAblation catheter placed on the endocardium (Isthmus) of the right atrium (RA) via the inferior vena cava (IVC). The cooling is initiated and ice forms; the clear buffer forms a clear ice block around the catheter. The distal end of the catheter is then tugged, but the ice formation holds the catheter tight.  After therapy is complete, the cooling is stopped and the ice quickly thaws; the catheter is then manipulated as it was before and it moves easily.',0,0,1,0,0),(1888,'Tined-Defib-RVA-1','video','2011-08-30 19:16:39','2013-03-21 22:26:10','vhvleadp','Right Ventricle Apex - Porcine heart <p>The right ventricular apex is the traditional location for placement of the primary intracardiac electrode to optimize the defibrillation vector, for ease of placement with both passive and active fixation leads and for proven performance as a pacing/sensing site. This lead often incorporates a second electrode positioned in the superior vena cava.<p>Shown here is a videoscopic view of a heart in fibrillation; defibrillation therapy is then administered to reinitiate a normal heart rhythm. A tined defibrillation lead can be viewed from the RV apex.\n',0,0,1,0,0),(1889,'Tined-Defib-RVA-2','video','2011-08-30 19:16:39','2013-03-21 22:26:10','rvfibswh','Right Ventricle Apex - Human heart <p>The right ventricular apex is the traditional location for placement of the primary intracardiac electrode to optimize the defibrillation vector, for ease of placement with both passive and active fixation leads and for proven performance as a pacing/sensing site. This lead often incorporates a second electrode positioned in the superior vena cava.<p>Shown here is a videoscopic view within a reanimated human heart in which fibrillation was induced; defibrillation therapy is then administered to reinitiate a normal heart rhythm. A tined defibrillation lead can be viewed from the RV apex.\n',0,0,1,0,0),(1890,'Active-fix-Defib-RVA-1','video','2011-08-30 19:16:39','2013-03-21 22:17:46','47rvapexp','Right Ventricle Apex - Porcine heart <p>The right ventricular apex is the traditional location for placement of the primary intracardiac electrode to optimize the defibrillation vector, for ease of placement with both passive and active fixation leads and for proven performance as a pacing/sensing site. This lead often incorporates a second electrode positioned in the superior vena cava.<p>Shown here is a videoscopic view of an active fixation defibrillation lead placed in the apex of the right ventricle; the lead can be observed as it passes through the tricuspid valve.\n',0,0,1,0,0),(1891,'Active-fix-Defib-RVA-1-flouro','video','2011-08-30 19:16:39','2013-03-21 22:17:46','47rvapexf','Right Ventricle Apex - Porcine heart <p>The right ventricular apex is the traditional location for placement of the primary intracardiac electrode to optimize the defibrillation vector, for ease of placement with both passive and active fixation leads and for proven performance as a pacing/sensing site. This lead often incorporates a second electrode positioned in the superior vena cava.<p>Shown here is a fluoroscopic view of an active fixation defibrillation lead placed in the right ventricle apex. The simultaneous picture-in-picture videoscopic view (lower right) also shows this implant procedure.\n',0,0,1,0,0),(1892,'Active-fix-Defib-RVA-2','video','2011-08-30 19:16:39','2012-02-29 23:09:40','6947','Right Ventricle Apex - Porcine heart<p>Shown here is a videoscopic view of an active fixation defibrillation lead being placed into the right ventricular apex (RVA). A stylet is used to orient the lead in the desired location in the RVA. Once there, the helix is extended by rotating the proximal pin of the lead which, in turn, extends the helix out of the tip of the lead body and into the tissue. One can see the distal coil of the defibrillation lead.\n',0,0,1,0,0),(1893,'Active-fix-Defib-RVA-3','video','2011-08-30 19:16:39','2012-02-29 23:09:40','6935','Right Ventricle Apex - Porcine heart<p>Shown here is a close-up videoscopic view of an active fixation defibrillation lead being placed into the right ventricular apex (RVA). A stylet is used to orient the lead in the desired location in the RVA. Once there, the helix is extended by rotating the proximal pin of the lead which, in turn, extends the helix out of the tip of the lead body and into the tissue. One can see the coil of the defibrillation lead.\n',0,0,1,0,0),(1894,'Passive-fix-Defib-RVA','video','2011-08-30 19:16:39','2012-02-29 23:09:40','6944','Right Ventricle Apex - Porcine heart<p>Shown here is a videoscopic view of a passive fixation defibrillation lead being placed into the right ventricular apex (RVA). A stylet is used to orient the lead in the desired location in the RVA. One can see how the tines become engaged into the tissue; this lead will eventually become fibrosed into the heart. Also, one can observe the distal coil of the defibrillation lead.',0,0,1,0,0),(1895,'Tined-fixed-RAA','video','2011-08-30 19:16:39','2013-03-21 22:17:46','45raapp','Right Atrial Appendage - Porcine heart<p>The right atrial appendage (RAA) is the traditional implant site for atrial leads because of its trabeculated nature. Shown here is the placement of a passive fixation or tined lead within the RAA.\n',0,0,1,0,0),(1896,'Tined-fixed-RAA-fluoro','video','2011-08-30 19:16:39','2013-03-21 22:17:46','45raapf','Right Atrial Appendage - Porcine heart<p>Shown here is a fluoroscopic image (continuous X-ray) of a tined fixation lead placed in the right atrial appendage (RAA). The large dark structure on seen on fluoro is the video camera entering the right atrium via access through the pulmonary artery and passing retrograde through the tricuspid valve. The inset on the lower right shows the simultaneous videoscopic view of the implant.\n',0,0,1,0,0),(1897,'Tined-Chordae-RV','video','2011-08-30 19:16:39','2013-03-21 22:17:46','40stuckp','Tricuspid Valve - Porcine heart<p>Shown here is a videoscopic view of a tined fixation lead momentarily tangled in the chordae tendinae of the tricuspid valve.\n',0,0,1,0,0),(1898,'Tined-Chordae-RV-fluoro','video','2011-08-30 19:16:39','2013-03-21 22:17:46','40stuckf','Tricuspid Valve - Porcine heart<p>Shown here is a fluoroscopic view (continuous X-ray) of a tined fixation lead momentarily tangled in the chordae tendinae of the tricuspid valve. The inset on the lower right shows the simultaneous videoscopic view.\n',0,0,1,0,0),(1899,'Tined-fixed-RVA','video','2011-08-30 19:16:39','2013-03-21 22:17:46','40rvapexp','RV Apex - Porcine heart<p>Since the first use of the transvenous route for cardiac pacing by Furman and Schwedel in 1959, this site has been used for the vast majority of permanent pacemaker implants. Although the site is relatively easy to access and the rate of dislodgements is low, the RV apex site does not necessarily provide the best acute or chronic hemodynamic effect, a favorable effect on remodeling, long-term survival, or quality of life.<p>Shown here is the videoscopic view of the placement of a tined lead within the apex of the right ventricle; the lead was prolapsed through the tricuspid valve and the lead tip positioned within the apex.\n',0,0,1,0,0),(1900,'Tined-fixed-RVA-fluoro','video','2011-08-30 19:16:39','2013-03-21 22:17:46','40rvapexf','RV Apex - Porcine heart<p>Shown here is the fluoroscopic view (continuous X-ray) of the placement of a tined lead within the apex of the right ventricle; the lead was prolapsed through the tricuspid valve and the lead tip positioned within the apex. The inset on the lower right shows the simultaneous videoscopic view.\n',0,0,1,0,0),(1901,'Dislodged-tined-RAA','video','2011-08-30 19:16:39','2013-03-21 22:17:46','45radisp','Right Atrial Appendage - Porcine heart<p>Shown here is the dislodgement of a tined fixation lead placed in the right atrial appendage (RAA). During placement, the lead can be easily removed and replaced elsewhere by applying retraction force. Clinical dislodgement rarely occurs, for within hours to days this lead will become fibrosed within the RAA.\n',0,0,1,0,0),(1902,'Dislodged-tined-RAA-fluoro','video','2011-08-30 19:16:39','2013-03-21 22:17:46','45radisf','Right Atrial Appendage - Porcine heart<p>Shown here is a fluoroscopic image (continuous X-ray) of a tined dislodgement of a tined fixation lead placed in the right atrial appendage (RAA). During placement, the lead can be easily removed and replaced elsewhere by applying retraction force. Clinical dislodgement rarely occurs, for within hours to days this lead will become fibrosed within the RAA. The inset on the lower right shows the simultaneous videoscopic view.\n',0,0,1,0,0),(1903,'Active-fix-RAA-1','video','2011-08-30 19:16:39','2013-03-21 22:20:58','76raapp','Right Atrial Appendage - Porcine heart<p>The right atrial appendage (RAA) is the traditional implant site for atrial leads.  Shown here is the placement of an active fixation lead (with a helix distal electrode) being placed in the RAA.\n',0,0,1,0,0),(1904,'Active-fix-RAA-1-fluoro','video','2011-08-30 19:16:40','2013-03-21 22:20:58','76raapf','Right Atrial Appendage - Porcine heart<p>Shown here is a fluoroscopic view (continuous X-ray) of the placement of an active fixation lead (with a helix distal electrode) being placed in the RAA. The inset on the lower right shows the simultaneous videoscopic view.\n',0,0,1,0,0),(1905,'Active-fix-RAA-2','video','2011-08-30 19:16:40','2012-02-29 23:09:39','5568','Right Atrial Appendage - Porcine heart<p>Shown here is a videoscopic view of an active fixation lead being placed into the right atrial appendage (RAA). A stylet is used to orient the lead in the desired location in the RAA. Once there, the helix is extended by rotating the proximal pin of the lead which, in turn, extends the helix out of the tip of the lead body and into the tissue.\n',0,0,1,0,0),(1906,'Active-fix-RVOT-fluoro','video','2011-08-30 19:16:40','2013-03-21 22:20:58','76rvapexf','RV Apex - Porcine heart<p>Shown here is the fluoroscopic view (continuous X-ray) of an active fixation lead crossing the tricuspid valve from the superior vena cava (SVC); the lead is passed up the right ventricular outflow tract (RVOT) and is eventually placed in the RV apex. The inset on the lower right shows the simultaneous videoscopic view.\n',0,0,1,0,0),(1907,'Active-fix-7F-RAA-1','video','2011-08-30 19:16:40','2012-02-29 23:09:39','4076-RAA','Right Atrial Appendage - Porcine heart<p>Shown here is a videoscopic view of an active fixation lead being placed into the right atrial appendage (RAA). A stylet is used to orient the lead in the desired location in the RAA. Once there, the helix is extended by rotating the proximal pin of the lead which, in turn, extends the helix out of the tip of the lead body and into the tissue.\n',0,0,1,0,0),(1908,'Active-fix-7F-RAA-2','video','2011-08-30 19:16:40','2012-02-29 23:09:39','5076-RAA','Right Atrial Appendage - Porcine heart<p>Shown here is a close-up videoscopic view of an active fixation lead being placed into the right atrial appendage (RAA). A stylet is used to orient the lead in the desired location in the RAA. Next, the helix (tip electrode) is extended by rotating the proximal pin of the lead which, in turn, extends the helix out of the tip of the lead body and into the tissue. One can see these electrode (helix) movements at the lead tip.\n',0,0,1,0,0),(1909,'Active-fix-7F-RVA-1','video','2011-08-30 19:16:40','2012-02-29 23:09:39','4076-RVA','RV Apex - Porcine heart<p>Shown here is a videoscopic view of an active fixation lead being placed into the right ventricular apex (RVA). A stylet is used to orient the lead in the desired location in the RVA. Once there, the helix is extended by rotating the proximal pin of the lead which, in turn, extends the helix out of the tip of the lead body and into the tissue.\n',0,0,1,0,0),(1910,'Active-fix-7F-RVA-2','video','2011-08-30 19:16:40','2012-02-29 23:09:39','5076-RVA','RV Apex - Porcine heart<p>Shown here is a close-up videoscopic view of an active fixation lead being placed into the right ventricular apex (RVA). A stylet is used to orient the lead in the desired location in the RVA. Next, the helix (tip electrode) is extended by rotating the proximal pin of the lead which, in turn, extends the helix out of the tip of the lead body and into the tissue. One can see these electrode (helix) movements at the lead tip.\n',0,0,1,0,0),(1911,'Dislodged-active-fix-RAA','video','2011-08-30 19:16:40','2013-03-21 22:20:58','76radisp','Right Atrial Appendage - Porcine heart<p>Shown here is the videoscopic view of a dislodgement of an active fixation lead placed in the right atrial appendage (RAA); this requires great force and causes tissue damage thus it is not performed clinically. If clinicians choose to move an active fixation lead, they first retract the helix within the lead body.\n',0,0,1,0,0),(1912,'Dislodged-active-fix-RAA-fluoro','video','2011-08-30 19:16:40','2013-03-21 22:20:58','76radisf','Right Atrial Appendage - Porcine heart<p>Shown here is the fluoroscopic view (continuous X-ray) of a dislodgement of an active fixation lead placed in the right atrial appendage (RAA); this requires great force and causes tissue damage thus it is not performed clinically. If clinicians choose to move an active fixation lead, they first retract the helix within the lead body. The inset on the lower right shows the simultaneous videoscopic view.\n',0,0,1,0,0),(1913,'Chronic-implant-RAA','video','2011-08-30 19:16:40','2013-03-21 22:23:52','chronrac','Leads - Canine heart<p>The pacing lead is a thin insulated wire that carries the electrical impulse to the heart and information about the hearts natural activity back to the pulse generator. One end of the lead is connected to the pulse generator at the connector block. The other end of the lead is connected to the patient, usually inserted through a vein and placed in the right ventricle or the right atrium of the heart.<p>The tip of the pacing lead may contain a steroid which reduces inflammation and helps maintain a better electrode-tissue electrical interface.<p>Shown here is a videoscopic view of a lead that was implanted within a heart 33 weeks prior within the right atrial appendage (RAA); one can visualize a fibrous capsule that has formed over the distal portion of the lead body.\n',0,0,1,0,0),(1914,'Chronic-implants-RVA-RAA','video','2011-08-30 19:16:40','2013-03-21 22:23:52','chronrvc','Leads - Canine heart<p>The pacing lead is a thin insulated wire that carries the electrical impulse to the heart and information about the hearts natural activity back to the pulse generator. One end of the lead is connected to the pulse generator at the connector block. The other end of the lead is connected to the patient, usually inserted through a vein and placed in the right ventricle or the right atrium of the heart.<p>The tip of the pacing lead may contain a steroid which reduces inflammation and helps maintain a better electrode-tissue electrical interface. One or more leads can be used within a given patient, depending on the type of pacemaker prescribed.<p>Shown here is a videoscopic view of two leads that were implanted within a heart 33 weeks prior, one within the right atrial appendage (RAA) and the other within the right ventricle. One can visualize a fibrous capsule that has formed over the distal portion of the lead body. The view begins in the lead in the right ventricular apex, and continues up through the tricuspid valve where one can see the second lead in the right atrium.\n',0,0,1,0,0),(1915,'Fixed-4F-cath-delivered-RAA','video','2011-08-30 19:16:40','2012-02-29 23:09:40','C304-L69','Right Atrial Appendage - Porcine heart<p>Shown here is a videoscopic view of an active fixation, fixed helix, lead being placed between the tricuspid valve annulus and the right atrial appendage (RAA). A steerable delivery catheter is used to place the lead in the proper location; the lead is delivered through the catheter to the myocardium and then fixed into the myocardium. The catheter is then retracted, and a lead is placed near the coronary sinus (CS).\n',0,0,1,0,0),(1916,'Fixed-4F-cath-delivered-RAA-Koch','video','2011-08-30 19:16:40','2012-02-29 23:09:40','C304-S59','Right Atrial Appendage - Porcine heart<p>Shown here is a videoscopic view of an active fixation, fixed helix, lead being placed between the tricuspid valve annulus and the right atrial appendage (RAA). A steerable delivery catheter is used to place the lead in the proper location; the lead is delivered through the catheter to the myocardium and then fixed into the myocardium (close-up view of the helix engaging the myocardium). The catheter is then retracted, and a lead is placed near the septal wall within the Triangle of Koch.\n',0,0,1,0,0),(1917,'Fixed-4F-cath-delivered-RVA','video','2011-08-30 19:16:40','2012-02-29 23:09:40','C304-XL74','RV Apex - Porcine heart<p>Shown here is a videoscopic view of an active fixation, fixed helix, lead being placed in the apex of the right ventricle (RVA). A steerable delivery catheter is used to place the lead in the proper location; the lead is delivered through the catheter to the myocardium and then fixed into the myocardium. Also shown are lead placements within the right atrium.\n',0,0,1,0,0),(1918,'Fixed-cath-delivered-RVA','video','2011-08-30 19:16:40','2012-02-29 23:09:40','C315-H40','RV Apex - Porcine heart<p>Shown here is a close-up videoscopic view of an active fixation lead (this device has a fixed helix). The lead is being placed in the apex of the right ventricle (RVA). A steerable delivery catheter is used to place the lead in the proper location; the lead is delivered through the catheter to the myocardium and then fixed.\n',0,0,1,0,0),(1919,'Fixed-lead-catheter-RAA','video','2011-08-30 19:16:40','2012-02-29 23:09:40','C315-J','Right Atrial Appendage - Porcine heart<p>Shown here is a videoscopic view of a lead being fixed within the pectinate muscle bands of the right atrial appendage (RAA). A fixed-shape (J) delivery catheter is used to place the lead in the proper location in the RAA. The lead is then rotated within the catheter to engage the helix (lead tip) into the myocardium. Next the catheter is retracted and the lead remains fixed.\n',0,0,1,0,0),(1920,'Passive-fix-RAA','video','2011-08-30 19:16:40','2012-02-29 23:09:39','4574','Right Atrial Appendage - Porcine heart<p>Shown here is a videoscopic view of a passive fixation (tined) lead being placed into the right atrial appendage (RAA). A stylet is used to orient the lead in the desired location in the RAA.\n',0,0,1,0,0),(1921,'Passive-fix-RVA','video','2011-08-30 19:16:40','2012-02-29 23:09:39','4074','Right Ventricular Apex - Porcine heart<p>Shown here is a videoscopic view of a passive fixation (tined) lead being placed into the right ventricular apex (RVA). A stylet is used to orient the lead in the desired location in the RVA. One can see how the tines become engaged into the tissue; this lead will eventually become fibrosed into the heart. ',0,0,1,0,0),(1922,'Left-heart-CS-GCV','video','2011-08-30 19:16:40','2013-03-21 22:20:58','87gcvp','Left Heart Sites - Porcine heart<p>Pacing from left heart sites has recently been shown to improve cardiac function in patients with advanced heart failure, dilated cardiomyopathy, and ventricular conduction abnormalities. The coronary sinus (CS) vasculature was found to be adequate in most patients (83%) for placement of a LV pacing lead into the posterior-lateral or lateral positions for cardiac resynchronization. Increased tortuosity or lack of an adequate lateral vein resulted in alternative left-sided lead placement in 17% of patients.<p>Results suggest that LV and RV lead positions are both important in the efficacy of cardiac resynchronization in heart failure patients.<p>Shown here is a videoscopic view of a left heart lead placed in the great cardiac vein via a delivered catheter positioned within the coronary sinus.\n',0,0,1,0,0),(1923,'Left-heart-CS-GCV-fluoro','video','2011-08-30 19:16:40','2013-03-21 22:20:58','87gcvf','Left Heart Sites - Porcine heart<p>Pacing from left heart sites has recently been shown to improve cardiac function in patients with advanced heart failure, dilated cardiomyopathy, and ventricular conduction abnormalities. The coronary sinus (CS) vasculature was found to be adequate in most patients (83%) for placement of a LV pacing lead into the posterior-lateral or lateral positions for cardiac resynchronization. Increased tortuosity or lack of an adequate lateral vein resulted in alternative left-sided lead placement in 17% of patients.<p>Results suggest that LV and RV lead positions are both important in the efficacy of cardiac resynchronization in heart failure patients. Randomized control studies may provide further information regarding optimization of lead position.<p>Shown here is a fluoroscopic view (continuous X-ray) of a left heart lead placed in the great cardiac vein via a delivered catheter in the coronary sinus. Before lead advancement, a contrast is injected retrograde into the cardiac venous system (venogram). The simultaneous picture-in-picture videoscopic view (lower right) also shows this implant procedure.\n',0,0,1,0,0),(1924,'Left-heart-intra-Cvein','video','2011-08-30 19:16:40','2013-03-21 22:20:58','88csp','Left Heart Sites - Porcine heart<p>Pacing from left heart sites has recently been shown to improve cardiac function in patients with advanced heart failure, dilated cardiomyopathy, and ventricular conduction abnormalities. Results suggest that LV and RV lead positions are both important in the efficacy of cardiac resynchronization in heart failure patients.<p>Shown here is a videoscopic view within the cardiac vein of a lead being manipulated to sub-select a branch of choice.\n',0,0,1,0,0),(1925,'Left-heart-intra-Cvein-fluoro','video','2011-08-30 19:16:40','2013-03-21 22:20:58','88csf','Left Heart Sites - Porcine heart<p>Pacing from left heart sites has recently been shown to improve cardiac function in patients with advanced heart failure, dilated cardiomyopathy, and ventricular conduction abnormalities. The coronary sinus (CS) vasculature was found to be adequate in most patients (83%) for placement of a LV pacing lead into the posterior-lateral or lateral positions for cardiac resynchronization. Increased tortuosity or lack of an adequate lateral vein resulted in alternative left-sided lead placement in 17% of patients.<p>Results suggest that LV and RV lead positions are both important in the efficacy of cardiac resynchronization in heart failure patients. Randomized control studies may provide further information regarding optimization of lead position.<p>Shown here is a fluoroscopic view (continuous X-ray) within the cardiac vein of a lead being manipulated to sub-select a branch of choice. The simultaneous picture-in-picture videoscopic view (lower right) also shows this implant procedure.',0,0,1,0,0),(1926,'Active-fix-His','video','2011-08-30 19:16:40','2013-03-21 22:20:58','76hisbvhp','His Bundle - Porcine heart<p>Pacing the His bundle or near the His bundle may provide for more physiological pacing of the heart, by activating the normal ventricular conduction system. This allows a more rapid and normal activation of the ventricles, i.e., provided that the distal conduction system (right and left bundle branches) is normal. Transvenous His stimulation was demonstrated in canines (1969) and humans (1970) using multipolar catheters positioned at the AV junction above the septal leaflet of the tricuspid valve.<p>Shown here is a videoscopic view of a lead positioned and implanted to activate the His Bundle.\n',0,0,1,0,0),(1927,'Active-fix-His-fluoro','video','2011-08-30 19:16:40','2013-03-21 22:20:58','76hisbflp','His Bundle - Porcine heart<p>Pacing the His bundle or near the His bundle may provide for more physiological pacing of the heart, by activating the normal ventricular conduction system. This allows a more rapid and normal activation of the ventricles, i.e., provided that the distal conduction system (right and left bundle branches) is normal. Transvenous His stimulation was demonstrated in canines (1969) and humans (1970) using multipolar catheters positioned at the AV junction above the septal leaflet of the tricuspid valve.<p>Shown here is a fluoroscopic view (continuous X-ray) of a lead positioned and implanted to activate the His Bundle; the inset (lower left) shows the videoscopic view.\n',0,0,1,0,0),(1928,'Active-fix-RA-septum','video','2011-08-30 19:16:40','2013-03-21 22:23:52','aseptvhp','RA Septum - Porcine heart<p>One method to achieve synchronous depolarization of both atria without concern for inter-atrial conduction time is atrial septal pacing.  It is proposed that this pacing system allows an optimal timing of the left-sided atrioventricular delay.<p> Shown here is a videoscopic view of a lead implant into the right atrial septum.\n',0,0,1,0,0),(1929,'Active-fix-RA-Septum-fluoro','video','2011-08-30 19:16:40','2013-03-21 22:23:52','aseptflp','RA Septum - Porcine heart<p>One method to achieve synchronous depolarization of both atria without concern for inter-atrial conduction time is atrial septal pacing. It is proposed that this pacing system allows an optimal timing of the left-sided atrioventricular delay.<p>Shown here is a fluoroscopic view (continuous X-ray) of a lead implant into the right atrial septum; the inset (lower left) shows the videoscopic image.\n',0,0,1,0,0),(1930,'Active-fix-RVOT','video','2011-08-30 19:16:40','2013-03-21 22:20:58','76rvotp','Right Ventricular Outflow Tract (RVOT) - Porcine heart<p>Placement of a lead within the right ventricular outflow tract (RVOT) has shown positive benefits over those positioned in the right ventricular apex.<p>Shown here is a videoscopic view of an active fixation lead crossing the tricuspid valve from the superior vena cava (SVC). Then the lead is passed up the RVOT and eventually placed (helix engaged within the myocardium) in the RVOT.\n',0,0,1,0,0),(1931,'Active-fix-RVOT-fluoro','video','2011-08-30 19:16:40','2013-03-21 22:20:58','76rvotf','Right Ventricular Outflow Tract (RVOT) - Porcine heart<p>Placement of a lead within the right ventricular outflow tract (RVOT) has shown positive benefits over those positioned in the right ventricular apex.<p>Shown here is a fluoroscopic view (continuous X-ray) of an active fixation lead crossing the tricuspid valve from the superior vena cava (SVC). Then the lead is passed up the RVOT and eventually placed (helix engaged within the myocardium) in the RVOT. The simultaneous picture-in-picture videoscopic view (lower left) also shows this implant procedure.\n',0,0,1,0,0),(1932,'Active-fix-RV-low-septum','video','2011-08-30 19:16:40','2013-03-21 22:20:58','76rvlsp','Low Ventricular Septal Wall - Porcine heart<p>Right ventricular septal pacing has been found to produce a more synchronous ventricular activation than right ventricular apex pacing. Although pacing at both sites appears to impair left ventricular function, these effects are less marked with right ventricular septal pacing, suggesting a benefit in the more physiological right ventricular septal pacing mode.<p>Shown here is a videoscopic view of an active fixation lead crossing the tricuspid valve from the superior vena cava (SVC). Then the lead is passed up the RVOT and eventually placed in the RV low septum.\n',0,0,1,0,0),(1933,'Active-fix-RV-low-septum-fluoro','video','2011-08-30 19:16:40','2013-03-21 22:20:58','76rvlsf','Low Ventricular Septal Wall - Porcine heart<p>Right ventricular septal pacing has been found to produce a more synchronous ventricular activation than right ventricular apex pacing. Although pacing at both sites appears to impair left ventricular function, these effects are less marked with right ventricular septal pacing, suggesting a benefit in the more physiological right ventricular septal pacing mode.<p>Shown here is the fluoroscopic view (continuous X-ray) of an active fixation lead crossing the tricuspid valve from the superior vena cava (SVC). Then the lead is passed up the RVOT and eventually placed in the RV low septum. The simultaneous picture-in-picture videoscopic view (lower right) also shows this implant procedure.\n',0,0,1,0,0),(1934,'Active-fix-RV-high-septum','video','2011-08-30 19:16:40','2013-03-21 22:20:58','76rvhsp','High Ventricular Septal Wall - Porcine heart<p>Right ventricular septal pacing has been found to produce a more synchronous ventricular activation than right ventricular apex pacing. Although pacing at both sites appears to impair left ventricular function, these effects are less marked with right ventricular septal pacing, suggesting a benefit in the more physiological right ventricular septal pacing mode.<p>Shown here is a videoscopic view of an active fixation lead crossing the tricuspid valve from the superior vena cava (SVC). Then the lead is passed up the RVOT and eventually placed in the RV high septum. One can see a close-up of the helix of the active fixation lead being deployed and engaging tissue.\n',0,0,1,0,0),(1935,'Active-fix-RV-high-septum-fluoro','video','2011-08-30 19:16:40','2013-03-21 22:20:58','76rvhsf','High Ventricular Septal Wall - Porcine heart<p>Right ventricular septal pacing has been found to produce a more synchronous ventricular activation than right ventricular apex pacing. Although pacing at both sites appears to impair left ventricular function, these effects are less marked with right ventricular septal pacing, suggesting a benefit in the more physiological right ventricular septal pacing mode.<p>Shown here is the fluoroscopic view (continuous X-ray) of an active fixation lead crossing the tricuspid valve from the superior vena cava (SVC). Then the lead is passed up the RVOT and eventually placed in the RV high septum. The simultaneous picture-in-picture videoscopic view (lower right) also shows this implant procedure.\n',0,0,1,0,0),(1936,'Fixed-lead-His-RA','video','2011-08-30 19:16:40','2012-02-29 23:09:40','C315-HIS','His Bundle - Porcine heart<p>Shown here is a videoscopic view of a lead placement near the bundle of His in the right atrium (RA). A fixed-shape delivery catheter is used to place the lead in the proper location, then the lead is delivered through the catheter to the myocardium. The lead is then rotated within the catheter to fix the helix (lead tip) into the myocardium (close-up view of helix engaging the myocardium). The catheter is then retracted, and a lead body is placed near the septal wall.\n',0,0,1,0,0),(1937,'Fixed-lead-catheter-His-1','video','2011-08-30 19:16:40','2012-02-29 23:09:40','C315-S4','His Bundle - Porcine heart<p>Shown here is a videoscopic view of a lead being fixed within the septum of the right atrium (RA), to activate the Bundle of His (the tricuspid valve can be viewed below to the right). A fixed-shape delivery catheter is used to place the lead in the proper location in the RAA. The lead is then rotated within the catheter to engage the helix (lead tip) into the myocardium. The catheter is then retracted and the lead remains fixed.\n',0,0,1,0,0),(1938,'Fixed-lead-catheter-His-2','video','2011-08-30 19:16:40','2012-02-29 23:09:40','C315-S5','His Bundle - Porcine heart<p>Shown here is a close-up videoscopic view of a lead being fixed within the septum of the right atrium (RA), to activate the Bundle of His (the tricuspid valve can be viewed below to the right). A fixed-shape delivery catheter is used to place the lead in the proper location in the RAA. The lead is then rotated within the catheter to engage the helix (lead tip) into the myocardium. The catheter is then retracted and the lead remains fixed.\n',0,0,1,0,0),(1939,'Fixed-lead-catheter-RV','video','2011-08-30 19:16:40','2012-02-29 23:09:40','C315-S10','Right Ventricle - Porcine heart<p>Shown here is a close-up videoscopic view of an active fixation lead being placed in the septal wall for the right ventricle (RV); the moderator band can be viewed behind the placement. The lead is being placed into the septum using a fixed-shape catheter. The lead is then rotated within the catheter to engage the helix (lead tip) into the myocardium. The catheter is then retracted and the lead remains fixed.\n',0,0,1,0,0),(1940,'Trans-vein-lead-LV-1','video','2011-08-30 19:16:40','2013-03-21 15:53:24','GWR4193','Trans-venous lead - Porcine heart<p>Shown here is an external view of a guidewire and lead being advanced into the left anterior descending vein, and then a sub-branch is selected for final placement.\n',0,0,1,0,0),(1941,'Trans-vein-lead-LV-2','video','2011-08-30 19:16:40','2013-03-21 15:53:24','GWR4194','Trans-venous lead - Porcine heart<p>Shown here is an external view of a guidewire and lead being advanced into the left anterior descending vein. The lead itself is then used to identify a sub-branch for final placement.\n',0,0,1,0,0),(1942,'Trans-vein-lead-LV-3','video','2011-08-30 19:16:40','2013-03-21 15:53:24','GWR4195','Trans-venous lead - Porcine heart<p>Shown here is an external view of a guidewire and lead being advanced into the left anterior descending vein, and then a sub-branch is selected for final placement. The guidewire is extended and retracted and the lead advanced until the desired location is identified. This is an active fixation lead, which is fixed into the vein by deploying more proximal lobes which expand in the vessel.\n',0,0,1,0,0),(1943,'Trans-vein-lead-LV-4','video','2011-08-30 19:16:40','2013-03-21 15:53:24','GWR4196','Trans-venous lead - Porcine heart<p>Shown here is an external view of a guidewire and lead being advanced into the left anterior descending vein, and then a sub-branch is selected for final placement. The wire is advanced and retracted until desired branches are found. This lead has distal and more proximal electrodes.\n',0,0,1,0,0),(1944,'Epicardial-lead-lv','video','2011-08-30 19:16:40','2012-02-29 23:09:39','4965','Epicardial lead - Porcine heart<p>Shown here is an external view of an epicardial lead sewn onto the lateral wall of the left ventricle (LV).\n',0,0,1,0,0),(1945,'Epicardial-lead-lv-2','video','2011-08-30 19:16:40','2012-02-29 23:09:39','4968','Epicardial lead - Porcine heart<p>Shown here is an external view of a pair of epicardial leads with a helix that was scewed into the lateral wall of the left ventricle (LV).\n',0,0,1,0,0),(1946,'Epicardial-lead-helix-lv','video','2011-08-30 19:16:40','2012-02-29 23:09:39','5071','Epicardial lead - Porcine heart<p>Shown here is an external view of an active fixation epicardial lead sewn onto the lateral wall of the left ventricle (LV).',0,0,1,0,0),(1947,'Coronary Stent LAD','video','2011-08-30 19:16:40','2013-03-21 22:26:10','stentp','Coronary Stent - Porcine heart<p>For more than a decade, vascular stents have been used to treat atherosclerotic lesions in coronary and/or peripheral arteries. Most stents are manufactured from various metal alloys and premounted on a balloon delivery catheter. Self-expanding stents, another fairly common design, are manufactured primarily from Nitinol or stainless steel and protected by a sheath during delivery and deployment. Biodegradable stents are yet another approach being investigated.<p>Regardless of the design, all stents need to be deliverable, trackable, flexible, conformable, and/or radiopaque (need to be visualized during placement with a given imaging modality). Ideally, a stent placed across a lesion will respect the vessels natural curvature. Most stents are placed in coronary arteries; other vessels include iliac, renal, and carotid arteries. Physicians access the arteries percutaneously using the femoral, radial, or brachial arteries as the entry point.<p>Shown here are simultaneous fiberscopic (using Visible Heart methodologies) and fluoroscopic (inset on lower right) views of a stent being deployed in the left anterior descending (LAD) branch of the left coronary artery. First, the balloon with the loaded stent is positioned in the desired location, then the balloon is inflated until the stent is deployed (seen in the fluoroscopic view or continuous X-rays). The fiberscope (2.5 mm, seen as a solid dark line in the fluoroscopic view) is then passed through two deployed stents in the vessel.',0,0,1,0,0),(1948,'Edge to Edge Repair','video','2011-08-30 19:16:40','2013-03-21 15:48:41','E2E-Repair','Edge-to-Edge Repair (E2E), also known as the Alfieri stitch - Porcine heart<p>Shown here is the normal functioning mitral valve from above or within the left atrium, and then from below or from the left ventricle (one can also see the functional aortic valve to the left). Next, a prolapse of the mitral valve is created by cutting the chordae tendinae of the posterior leaflet (creation of the P2 prolapse). The functional effects of the posterior leaflet are shown from above and then below. Finally, this prolapse is repaired by placing a suture between the A2 and P2 mitral leaflets.',0,0,1,0,0),(1949,'Mitral-Annuloplasty-LA','video','2011-08-30 19:16:40','2013-03-21 22:26:10','mitralap','Annuloplasty Ring - Porcine heart<p>Annuloplasty has been used for more than thirty years to repair and support incompetent mitral and/or tricuspid valves (annuli, or rings). In patients with degenerative heart disease, the surgical placement of a flexible annuloplasty ring is generally preferable to a rigid ring, to subsequently allow the annulus size and configuration to adapt to functional changes that occur throughout the cardiac cycle. It is also considered that a flexible annuloplasty ring permits natural motion of the annulus while preventing annular dilation. <p>Various techniques are used in mitral and tricuspid valve reconstruction, with the goal of improving valve function (minimizing regurgitation). To perform surgical annuloplasty, the surgeon must expose the valve, make a clinical assessment, and then proceed with the surgical procedure. Additionally, any detectable structural lesions are repaired before surrounding the annulus with the annuloplasty ring to prevent future dilation. Typically such rings are impregnated with barium sulfate, so they can be more easily viewed by echocardiography or X-ray.<p>Shown here is a videoscopic view from the left atrium of an annuloplasty ring that is surgically placed on the mitral valve annulus.',0,0,1,0,0),(1950,'Heart0026 Aorta-Mech-Aortic','video','2011-08-30 19:16:40','2013-07-11 15:25:33','Heart0026-Functional-Aorta-Mechanical-Aortic-Valve','Mechanical Valve - Human heart 0026<p>A mechanical valve can be considered as a ring through which blood flows in the heart during desired periods and then closes at appropriate times. Shown here is a bileaflet mechanical valve that was previously surgically implanted in a patient, prior to our laboratory reanimating this heart in vitro. The videoscope is placed within the ascending aorta and directed back towards the heart and the aortic valve. When the mechanical leaflets are open (systole), there is flow through the valve; when they are closed, the ventricle is filling (diastole). ',0,0,1,0,0),(1951,'Heart0026 LV-Mech-Aortic','video','2011-08-30 19:16:40','2013-07-11 15:25:33','Heart0026-Functional-Left-Ventricle-Mechanical-Aortic-Valve','Mechanical Valve - Human heart 0026<p>Today, mechanical valves are the most common type of valve used to replace the hearts natural valves when they have been damaged, diseased, or weakened by age and no longer adequately control the flow of blood within the heart. A mechanical valve can be considered as a ring through which blood flows in the heart during desired periods and then closes at appropriate times. <p>Shown here is a bileaflet mechanical valve that was previously surgically implanted in a patient, prior to our laboratory reanimating this heart in vitro. The videoscope is placed through the apex of the left ventricle. The mitral valve is on the right with a Millar pressure catheter (yellow catheter) positioned through it. One can see the aortic valves working, where the mitral is not moving to a great degree; this heart had poor function and was deemed non-viable for transplant. ',0,0,1,0,0),(1952,'Mech-Aortic-LV','video','2011-08-30 19:16:40','2013-03-21 22:26:10','mechap','Mechanical Valve - Porcine heart<p>Mechanical valves are one type of valve used to replace the hearts natural valves when they have been damaged, diseased, or weakened by age and no longer adequately control the flow of blood within the heart.<p>A mechanical valve is a ring through which blood flows in the heart; it is made of biocompatible materials such as titanium or carbon. Within the device is a single movable disc or two leaflets, which open and close much like a natural heart valve.<p>Mechanical valves are typically used to replace any one of the four valves in the heart. Anticoagulation medication is prescribed for patients with mechanical valves to prevent blood clots.<p>Shown here is a videoscopic view of a mechanical aortic valve from the left ventricle.',0,0,1,0,0),(1953,'Melody Valve Procedure','video','2011-08-30 19:16:40','2013-03-21 15:46:22','Heart0048-Melody-Procedure','Transcatheter Delivered Pulmonic Valve - Human Heart 048<p>This new technology is approved for individuals in which a regular valve surgery is not considered a viable option. The valve is loaded into a catheter and placed under fluoroscopic and/or echocardiography visualization. Once properly positioned, the valve is unsheathed and then expanded into position. The leaflets of the Medtronic Melody valve are from a bovine jugular valve graft.<p>Shown here is a videoscopic view of a transcatheter delivery of a pulmonic valve being expanded into position.\n',0,0,1,0,0),(1954,'Melody Valve Deployed','video','2011-08-30 19:16:40','2013-03-21 15:46:22','Heart0048-Melody-Deployed','Transcatheter Delivered Pulmonic Valve - Human Heart 048<p>Shown here is a videoscopic view of a Melody Transcatheter Pulmonary Valve being deployed in the position of the native pulmonary valve of this human heart. For orientation, the interventricular septum is to the upper left, with the free wall of the RV opposite. A septal papillary muscle of the tricuspid valve can also be seen at the top of the screen.\n',0,0,1,0,0),(1955,'Valve Comparison','video','2011-08-30 19:16:40','2013-03-21 22:26:10','valve-comparison','Valve comparison - Porcine heart<p>Shown here is a comparison of two different valves implanted within an isolated swine heart with the native porcine valve (upper left). The implanted valve shown on the upper right is a Medtronic Freestyle valve; this biologically inert valve is isolated within the native swine aortic tissue. The videoscopic view of the valve in the lower movie clip shows a Medtronic Mosaic valve that is composed of swine aortic leaflets attached to a sewing ring.\n',0,0,1,0,0),(1956,'Tissue-Aortic-AA-LV','video','2011-08-30 19:16:40','2013-03-21 22:26:10','freaortp','Stentless tissue valve - Porcine heart<p>A stentless valve is most often an actual heart valve obtained from a human donor (homograft) or a swine (bioprosthesis, xenograft). The porcine aortic valve anatomy closely matches that of humans. Stentless tissue valves are typically used to replace aortic heart valves, and are considered to have viable performance longevity of 10-15 years.<p>Shown here is a videoscopic view of a stentless bioprosthetic porcine aortic valve that is surgically placed in the aortic position. The videoscope is placed in the ascending aorta and then passed through the valve to obtain a view of the apex of the left ventricle.\n',0,0,1,0,0),(1957,'Tissue-Aortic-coronaries','video','2011-08-30 19:16:40','2013-03-21 22:26:10','freelcap','Stentless tissue valve - Porcine heart<p>A stentless valve is most often an actual heart valve obtained from a human donor (homograft) or a swine (bioprosthesis, xenograft). The porcine aortic valve anatomy closely matches that of humans. Stentless tissue valves are typically used to replace aortic heart valves, and are considered to have viable performance longevity of 10-15 years.<p>Shown here is a videoscopic view of a stentless bioprosthetic porcine tissue valve placed in the aortic position. This view focuses on the left coronary artery ostium and its interaction with the valve.\n',0,0,1,0,0),(1958,'Tissue-Aortic-LV','video','2011-08-30 19:16:40','2013-03-21 22:26:10','freelvp','Stentless tissue valve - Porcine heart<p>A stentless valve is most often an actual heart valve obtained from a human donor (homograft) or a swine (bioprosthesis, xenograft). The porcine aortic valve anatomy closely matches that of humans. Stentless tissue valves are typically used to replace aortic heart valves, and are considered to have viable performance longevity of 10-15 years.<p>Shown here is a videoscopic view of a stentless bioprosthetic porcine tissue valve from below, as viewed from the left ventricle.\n',0,0,1,0,0),(1959,'Heart0083-ALCAOs','video','2011-08-30 19:16:41','2012-09-07 21:04:05','Heart0083-Functional-Comparative-Imaging-Aorta-Left-Coronary-Artery-Ostia','Top left: The left coronary artery ostium is imaged from the ascending aorta using an endoscope. Note: There is a mapping catheter placed in the ostium. <br>Bottom left: Four-chamber, echocardiography view recorded simultaneously <br>Bottom right: The mapping catheter in the left coronary artery can be seen in the anterior/posterior aspect fluoroscopy view.\n',0,0,1,0,0),(1960,'Heart0083-ARCAOs-1','video','2011-08-30 19:16:41','2012-09-07 21:04:05','Heart0083-Functional-Comparative-Imaging-Aorta-Right-Coronary-Artery-Ostia-1','Top left: The right coronary artery ostium is imaged from the ascending aorta using an endoscope. Note: There is a mapping catheter placed in the ostium. <br>Bottom left: A four-chamber, echocardiography view recorded simultaneously <br>Bottom right: The mapping catheter in the right coronary artery can be seen in the anterior/posterior aspect fluoroscopy view.\n',0,0,1,0,0),(1961,'Heart0083-ARCAOs-2','video','2011-08-30 19:16:41','2012-09-07 21:04:05','Heart0083-Functional-Comparative-Imaging-Aorta-Right-Coronary-Artery-Ostia-2','Top left: The right coronary artery ostium is imaged from the ascending aorta using an endoscope. Note: There is a mapping catheter placed 4-5 cm into the right coronary artery. <br>Top right: The mapping catheter placed 4-5 cm into the right coronary artery can be seen in the anterior/posterior aspect fluoroscopy view.\n',0,0,1,0,0),(1962,'Heart0083-AV','video','2011-08-30 19:16:41','2012-09-07 20:54:30','Heart0083-Functional-Comparative-Imaging-Aortic-Valve','The aortic valve is imaged simultaneously from the: <br>-left ventricle using an endoscope with straight lens (top left), <br>-ascending aorta using an endoscope with a right-angle lens (top right), <br>-ventricles using echocardiography (long-axis view) (bottom left), and <br>-anterior/posterior aspect using fluoroscopy (bottom right).\n',0,0,1,0,0),(1963,'Heart0083-LVAx','video','2011-08-30 19:16:41','2012-09-07 21:04:05','Heart0083-Functional-Comparative-Imaging-Left-Ventricle-Apex','Top left: The left ventricular apex is imaged using an endoscope placed through the mitral valve. A mapping catheter placed through the mitral valve, and both an endoscope and pressure sensing millar catheter placed transmurally through the left ventricular apex are in view. <br>Top right: View from the endoscope placed transmurally through the left ventricular apex. The mapping catheter placed across the mitral vale can be seen. <br>Bottom left: Echocardiography view of the left ventricle. The mapping catheter can be seen lying next to the left ventricular septum. <br>Bottom right: Fluoroscopy view of the heart. The endoscopes, echo probe, and mapping catheter can be seen in the left ventricle.\n',0,0,1,0,0),(1964,'Heart0083-MV','video','2011-08-30 19:16:41','2012-09-07 20:57:15','Heart0083-Functional-Comparative-Imaging-Mitral-Valve','The mitral valve is imaged simultaneously from the: <br>-left atrium using an endoscope with a right-angle lens (top left), <br>-left ventricle using an endoscope with straight lens (top right), <br>-apex using echocardiography (4-chamber long-axis view) (bottom left), and <br>-anterior/posterior aspect using fluoroscopy (bottom right).\n',0,0,1,0,0),(1965,'Heart0083-RVAx','video','2011-08-30 19:16:41','2012-09-07 21:04:05','Heart0083-Functional-Comparative-Imaging-Right-Ventricle-Apex','Top left: The right ventricular apex is imaged using an endoscope placed through the tricuspid valve. <br>Top right: View of the tricuspid valve from an endoscope located at the right ventricular apex. <br>Bottom left: Echocardiography four chamber view of the heart. <br>Bottom right: Fluoroscopy view of the heart. The endoscopes can be seen in the right ventricle.\n',0,0,1,0,0),(1966,'Heart0083-PV','video','2011-08-30 19:16:41','2012-09-07 20:55:44','Heart0083-Functional-Comparative-Imaging-Pulmonary-Valve','Top left: View of the pulmonary valve imaged from an endoscope placed in the pulmonary artery. <br>Top right: View of the pulmonary valve and right ventricular outflow tract imaged from an endoscope placed in the right ventricle. <br>Bottom right: Fluoroscope view of the heart showing the placement of the endoscopes.\n',0,0,1,0,0),(1967,'Heart0083-TriV-1','video','2011-08-30 19:16:41','2012-09-07 21:01:19','Heart0083-Functional-Comparative-Imaging-Tricuspid-Valve-1','Top left: The tricuspid valve is imaged from the right atrium using an endoscope.A mapping catheter is placed along the annulus. <br>Top right: A left anterior oblique external view showing placement of an echo probe. <br>Bottom left: An echocardiography view (four-chamber) of the triscupid valve. <br>Bottom right: Anterior/posterior aspect fluoroscopy view. The endoscope, echo probe, and mapping catheter can be seen.\n',0,0,1,0,0),(1968,'Heart0083-TriV-2','video','2011-08-30 19:16:41','2012-09-07 21:01:19','Heart0083-Functional-Comparative-Imaging-Tricuspid-Valve-2','The tricuspid valve is imaged simultaneously from the: <br>-right ventricle using an endoscope with straight lens (top left), <br>-right atrium using an endoscope with a right-angle lens (top right), <br>-apex using echocardiography (4-chamber long-axis view) (bottom left), and <br>-anterior/posterior aspect using fluoroscopy (bottom right).\n',0,0,1,0,0),(1969,'Heart0085-AV-1','video','2011-08-30 19:16:41','2012-09-07 20:54:30','Heart0085-Functional-Comparative-Imaging-Aortic-Valve-1','The aortic valve is imaged simultaneously from the: <br>-ascending aorta using an endoscope with a right-angle lens (top left),<br>-left ventricle using an endoscope with straight lens (top right),<br>-mid-right ventricle using echocardiography (short-axis view) (bottom left), and<br>-anterior/posterior aspect using fluoroscopy (bottom right).\n',0,0,1,0,0),(1970,'Heart0085-AV-2','video','2011-08-30 19:16:41','2012-09-07 20:54:30','Heart0085-Functional-Comparative-Imaging-Aortic-Valve-2','The aortic valve is imaged simultaneously from the: <br>-ascending aorta using an endoscope with a right-angle lens (top left),<br>-left ventricle using an endoscope with straight lens (top right),<br>-apex using echocardiography (4-chamber long-axis view) (bottom left), and<br>-anterior/posterior aspect using fluoroscopy (bottom right).\n',0,0,1,0,0),(1971,'Heart0085-AV node','video','2011-08-30 19:16:41','2012-09-07 21:07:27','Heart0085-Functional-Comparative-Imaging-AV-Node','The atrioventricular node is identified using a MARINR coronary sinus catheter (Medtronic Inc., MN) and imaged simultaneously from the: <br>-right atrium using an endoscope with a right-angle lens (top left),<br>-right ventricle using an endoscope with straight lens (top right),<br>-apex using echocardiography (4-chamber long-axis view) (bottom left), and<br>-anterior/posterior aspect using fluoroscopy (bottom right).\n',0,0,1,0,0),(1972,'Heart0085-MV-1','video','2011-08-30 19:16:41','2012-09-07 20:57:15','Heart0085-Functional-Comparative-Imaging-Mitral-Valve-1','The mitral valve is imaged simultaneously from the: <br>-left atrium using an endoscope with a right-angle lens (top left),<br>-left ventricle using an endoscope with straight lens (top right),<br>-apex using echocardiography (4-chamber long-axis view) (bottom left), and<br>-anterior/posterior aspect using fluoroscopy (bottom right).\n',0,0,1,0,0),(1973,'Heart0085-MV-2','video','2011-08-30 19:16:41','2012-09-07 20:57:15','Heart0085-Functional-Comparative-Imaging-Mitral-Valve-2','The mitral valve is imaged simultaneously from the: <br>-left atrium using an endoscope with a right-angle lens (top left),<br>-left ventricle using an endoscope with straight lens (top right),<br>-mid-right ventricle using echocardiography (short-axis view) (bottom left), and<br>-anterior/posterior aspect using fluoroscopy (bottom right).\n',0,0,1,0,0),(1974,'Heart0085-PFO','video','2011-08-30 19:16:41','2014-07-24 18:32:56','Heart0085-Functional-Comparative-Imaging-Patent-Fossa-Ovalis','A patent forman ovale in the atrial septum is identified using a MARINR coronary sinus catheter (Medtronic Inc., MN) and imaged simultaneously from the:<br>-left atrium using an endoscope with a right-angle lens (top left),<br>-right atrium using an endoscope with straight lens (top right),<br>-apex using echocardiography (4-chamber long-axis view) (bottom left), and<br>-anterior/posterior aspect using fluoroscopy (bottom right). ',0,0,1,0,0),(1975,'Heart0085-PV','video','2011-08-30 19:16:41','2012-09-07 20:55:44','Heart0085-Functional-Comparative-Imaging-Pulmonary-Valve','The right ventricular outflow tract is identified using a MARINR coronary sinus catheter (Medtronic Inc., MN) and imaged simultaneously from the:<br>-pulmonary trunk, distal to the pulmonary valve, using an endoscope with straight lens (top left),<br>-right ventricle using an endoscope with a right-angle lens (top right),<br>-apex using echocardiography (long-axis view) (bottom left), and<br>-anterior/posterior aspect using fluoroscopy (bottom right).\n',0,0,1,0,0),(1976,'Heart0120-AV','video','2011-08-30 19:16:41','2012-12-14 19:08:17','Heart0120-Functional-Comparative-Imaging-Aortic-Valve','The functioning aortic valve imaged simultaneously from the:<br>-ascending aorta using an endoscope with a straight lens (top left),<br>-left ventricle using an endoscope with right-angle lens (top right),<br>-using echocardiography (bottom left), and<br>-anterior/posterior aspect using an external camera (bottom right).',0,0,1,0,0),(1977,'Heart0120-AV Doppler','video','2011-08-30 19:16:41','2012-12-14 19:08:17','Heart0120-Functional-Comparative-Imaging-Aortic-Valve-Doppler','The functioning aortic valve imaged simultaneously from the:<br>-ascending aorta using an endoscope with a straight lens (top left),<br>-left ventricle using an endoscope with right-angle lens (top right),<br>-using doppler echocardiography (bottom left), and<br>-anterior/posterior aspect using an external camera (bottom right).',0,0,1,0,0),(1978,'Heart0126-MV','video','2011-08-30 19:16:41','2012-09-07 20:57:15','Heart0126-Functional-Comparative-Imaging-Mitral-Valve','The functioning mitral valve imaged simultaneously from the:<br>-left atrium using an endoscope with a right angle lens (top left),<br>-left ventricle using an endoscope with a straight lens (top right),<br>-parasternal long axis view using echocardiography (bottom left), and<br>-pressure monitored via EMKA (bottom right).',0,0,1,0,0),(1983,'Laser_Sheath','video','2011-12-07 21:45:04','2012-08-20 14:41:09','Laser-Sheath','This clip was recorded from within the right ventricle.  The laser sheath can be seen burning through the fibrosed encapsulation which surrounds the lead body in order to advance toward the implant site.  The blue, strobe-like flashing occurs when the laser is in use.<br /><br />[Love CJ, et al.: Novel visualization of intracardiac pacing lead extractions: methodologies performed within isolated canine hearts. Journal of Interventional Cardiac Electrophysiology 24: 27-31, 2009.]',0,1,1,0,0),(1984,'Mechanical_Cutting_Sheath','video','2011-12-07 21:45:04','2012-08-20 14:41:09','Mechanical-Cutting-Sheath','This video image was recorded from within the right atrium.  The dilator sheath is completely covering the lead at its implant site in the right atrial wall.  The sheath is twisted until the lead is freed and removed from the endocardial surface.  Near the end of the clip, another lead, implanted in the right atrial appendage, can be seen in the background. <br /><br />[Love CJ, et al.: Novel visualization of intracardiac pacing lead extractions: methodologies performed within isolated canine hearts. Journal of Interventional Cardiac Electrophysiology 24: 27-31, 2009.]',0,1,1,0,0),(1985,'RF_Sheath','video','2011-12-07 21:45:04','2012-08-20 14:41:09','RF-Sheath','Recorded from within the right atrium, the radio frequency (RF) sheath can be seen cutting through the fibrosed encapsulation surrounding the lead body.  The sheath is rotated around the perimeter of the lead in order to free the lead from the heart wall.  The rhythmic, orange flashes of light occur when the device is firing. <br /><br />[Love CJ, et al.: Novel visualization of intracardiac pacing lead extractions: methodologies performed within isolated canine hearts. Journal of Interventional Cardiac Electrophysiology 24: 27-31, 2009.]',0,1,1,0,0),(1986,'Manual_Dislodgement','video','2011-12-07 21:45:04','2012-08-20 14:41:09','Manual-Dislodgement','This movie demonstrates the direct traction method of removing a lead from the heart wall, as recorded from within the right atrium.  The helix of the lead can be seen â€œpullingâ€ at the encapsulation surrounding it.  Also seen in this clip, just distal to the lead, is an encapsulation from a previous extraction. <br /><br />[Love CJ, et al.: Novel visualization of intracardiac pacing lead extractions: methodologies performed within isolated canine hearts. Journal of Interventional Cardiac Electrophysiology 24: 27-31, 2009.]',0,1,1,0,0),(1987,'Remaining_encapsulation','video','2011-12-07 21:45:04','2012-08-20 14:41:09','Remaining-encapsulation-from-implant','This clip, recorded from within the right atrium, illustrates the level of encapsulation that is left behind on the endocardial surface (in this example, specifically, on the crista terminalis) following a lead extraction procedure.<br /><br />[Love CJ, et al.: Novel visualization of intracardiac pacing lead extractions: methodologies performed within isolated canine hearts. Journal of Interventional Cardiac Electrophysiology 24: 27-31, 2009.]',0,1,1,0,0),(1988,'Heart0035','video','2011-12-08 20:15:19','2012-09-19 20:58:36','Heart0035-3D-Modeling-Cardiac-Veins','This is a heart with no known cardiac conditions.  The AIV, LLV, and PIV are present in this heart, and the ALV, PLV, and PV veins are absent.  The AIV has 1 main branch, LLV has 4 main branches, and PIV has no main branches.  See the Heart Database for further data.',1,0,1,0,0),(1989,'Heart0060','video','2011-12-08 20:15:19','2012-09-19 20:58:36','Heart0060-3D-Modeling-Cardiac-Veins','This is a heart with no known cardiac conditions.  The PV is the only vein absent in this heart.  There are two individual, branchless ALVs.  The AIV has 5 branches, LLV has 3 branches, PLV has no branches, and PIV has four main branches.  See the Heart Database for further data.',1,0,1,0,0),(1990,'Heart0063','video','2011-12-08 20:15:19','2012-09-05 21:30:27','Heart0063-3D-Modeling-Cardiac-Veins','This is a heart with no known cardiac conditions.  The ALV is the only vein absent in this heart.  There are two LLVs and two PLVs, and the PV is uniquely connected to the PIV near the apex of the heart.  The AIV has 5 main branches, PV has 3 branches, and PIV has 7 branches.',1,0,1,0,0),(1991,'Heart0072','video','2011-12-08 20:15:19','2012-09-19 20:58:36','Heart0072-3D-Modeling-Cardiac-Veins','This is a heart with no known cardiac conditions.  The AIV, LLV, PV, and PIV are present in this heart, and the ALV and PLV are absent.  The AIV has 2 main branches, LLV has 2 branches, PV has no branches, and PIV has 5 branches.  See the Heart Database for further data.',1,0,1,0,0),(1992,'Heart0083','video','2011-12-09 20:27:32','2012-09-19 20:58:36','Heart0083-3D-Modeling-Cardiac-Veins','This is a heart with no known cardiac conditions.  The PLV is the only vein absent in this heart, and the ALV is directly connected to the PV, which is also connected to the PIV near the apex.  The AIV has 3 main branches, ALV has 3 branches, LLV has 2 branches, PV has 5 branches, and PIV has 6 branches.  See the Heart Database for further data.',1,0,1,0,0),(1993,'Heart0109','video','2011-12-09 20:27:32','2012-09-05 21:30:27','Heart0109-3D-Modeling-Cardiac-Veins','This is a heart with no known cardiac conditions.  The PLV is the only vein absent in this heart.  The AIV has 4 main branches, ALV has 4 main branches, LLV has 1 branch, PV has 7 main branches, and PIV has 4 main branches.',1,0,1,0,0),(1994,'Heart0139','video','2011-12-09 20:27:32','2012-09-19 20:58:36','Heart0139-3D-Modeling-Cardiac-Veins','This is a heart with no known cardiac conditions.  The PLV is the only vein absent in this heart, and there are two PVs present.  The AIV has a unique branch that drains from the left atrium, and the LLV directly connects to the PIV on the lateral side of the left ventricle.   The AIV has 8 main branches, ALV has 1 branch, LLV has no branches, and PIV has 4 main branches.  See the Heart Database for further data.',1,0,1,0,0),(1995,'Heart0140','video','2011-12-09 20:27:32','2012-09-19 20:58:36','Heart0140-3D-Modeling-Cardiac-Veins','This is a heart with no known cardiac conditions.  The AIV, ALV, and PIV are present in this heart, and the LLV, PLV, and PV are absent.  The AIV has 1 branch, the ALV has two branches, and the PIV has 2 main branches.  See the Heart Database for further data.',1,0,1,0,0),(1996,'Heart0201','video','2011-12-09 20:27:32','2012-09-05 21:30:27','Heart0201-3D-Modeling-Cardiac-Veins','This is a heart with no known cardiac conditions.  The AIV, 2 LLVs, PLV, and PIV are present in this heart, and the ALV and PV are absent.  One of the LLVs is directly connected to the PIV near the apex.  The AIV has 5 main branches, LLV 1 has no branches, LLV 2 has 3 branches, PLV has 4 branches, and PIV has no branches.',1,0,1,0,0),(1997,'6944-Defib','video','2012-01-05 17:51:56','2013-03-21 22:29:26','6944DEF1','Shown here is a implantable defibrillator lead (Medtronic 6944) placed within the right ventricle.  The insert on the lower left, shows the electrical sensing by this lead (upper trace, the electrocardiogram) and the relative pressures being generated by the left ventricle within this same heart (lower trace).  Initially a normal sinus rhythm (or heart rate) is being recorded, then the heart is activated by the system/electrode (T-shock) to induce an arrhythmia: i.e., ventricular tachycardia (VT) was induced which subsequently degraded to ventricular fibrillation (VF).  The implanted defibrillator system then continuously was sensing this induced change in the electrical activity of the heart, subsequently and automatically, the system delivered a high energy shock to the heart; which then defibrillated it, and a normal sinus rhythm was re-established.  One should note that during the induce arrhythmia(s), left ventricular pressures essentially went to zero and then subsequently rose when a more normal heart rate was re-established. Note, that such a sequence of events is induced clinically, to to properly set both the sensing and shock voltages of such implantable defibrillator systems.\n',0,0,1,0,0),(1998,'Heart0171','video','2012-01-10 14:47:26','2012-09-05 21:44:34','Heart0171-Functional-Right-Atrium-Right-Atrial-Appendage','Right atrial appendage.  Note how thin the tissue is in the upper left.\n',0,0,1,0,0),(1999,'Heart0175','video','2012-01-10 14:47:26','2012-12-27 17:03:26','Heart0175-Functional-Right-Atrium-Right-Atrial-Appendage','The right atrial appendage can be seen in this footage with the crista terminalis to the base of the shot. Note the pectinate muscles of the endocardial surface of the right atrial free wall.\n',0,1,1,0,0),(2000,'Heart0171-abnormal','video','2012-01-10 14:47:26','2012-09-05 21:44:34','Heart0171-Functional-Right-Atrium-Right-Atrial-Appendage-ab','Abnormal rhythm in the right atrial appendage.  View of a chiari network on the left of the screen.\n',0,0,1,0,0),(2001,'Heart0191','video','2012-01-10 14:47:26','2012-09-05 21:44:34','Heart0191-Functional-Right-Atrium-Right-Atrial-Appendage','This is a video of the right atrial appendage. The crista terminalis is along the very bottom of the screen and the tricuspid valve is to the upper right in this video.',0,0,1,0,0),(2002,'Heart0191-1','video','2012-01-10 14:47:26','2012-09-05 21:44:34','Heart0191-Functional-Right-Atrium-Coronary-Sinus-Ostium-1','This video shows the inside of the coronary sinus ostium. The camera then backs up to show the opening of the CS ostium and the Thebesian valve. The holes on the side of the coronary sinus ostium are other ostium of viens including the posterior interventricular vein. \n',0,0,1,0,0),(2003,'Heart0175-1','video','2012-01-10 14:47:26','2012-12-27 17:03:26','Heart0175-Functional-Right-Atrium-Coronary-Sinus-Ostium-1','Close up shot of the coronary sinus ostium showing some of the venous branches that return blood to the coronary sinus near to the right atrium.\n',0,1,1,0,0),(2004,'Heart0175-2','video','2012-01-10 14:47:26','2012-09-05 21:44:34','Heart0175-Functional-Right-Atrium-Coronary-Sinus-Ostium-2','Shot of the whole coronary sinus ostium.  Note the lack of any thebesian valve and the multiple venous branches returning blood to the coronary sinus.\n',0,0,1,0,0),(2005,'Heart0191-2','video','2012-01-10 14:47:26','2012-09-05 21:44:34','Heart0191-Functional-Right-Atrium-Coronary-Sinus-Ostium-2','This video is taken within the coronary sinus. \n',0,0,1,0,0),(2006,'Heart0171','video','2012-01-10 14:47:26','2012-09-05 21:44:34','Heart0171-Functional-Right-Atrium-Coronary-Sinus-Ostium-straight','A view of the coronary sinus ostium.  The camera is actually inside the ostia, which is why the thebesian valve is not visible.\n',0,0,1,0,0),(2007,'Heart0191-ThV','video','2012-01-10 14:47:26','2012-09-05 21:44:34','Heart0191-Functional-Right-Atrium-Coronary-Sinus-Ostium-Thebesian-Valve','The video begins by examining the coronary sinus ostium. Then it pans down past the Thebesian valve and shows the Eustachian ridge before returning to the conronary sinus ostium.',0,0,1,0,0),(2008,'Heart0171','video','2012-01-10 14:47:26','2012-09-05 21:44:34','Heart0171-Functional-Right-Atrium-Crista-Terminalis','Image of the christa terminalis as seen from the right atrium.  The camera moves from the lateral portion to the septal portion.  A fenustrated thebesian valve can be seen near the end of the clip on the left side of the image.\n',0,0,1,0,0),(2009,'Heart0191','video','2012-01-10 14:47:26','2012-09-05 21:44:34','Heart0191-Functional-Right-Atrium-Crista-Terminalis','The camera follows the crista terminalis from the superior to the inferior until it stops short of viewing the tricuspid valve. ',0,0,1,0,0),(2010,'Heart0171','video','2012-01-10 14:47:26','2012-09-05 21:44:34','Heart0171-Functional-Right-Atrium-Fossa-Ovalis','View of the interatrial septum, with the fossa ovalis in the upper left of the screen.  The fossa can be seen moving with each contraction.\n',0,0,1,0,0),(2011,'Heart0175','video','2012-01-10 14:47:26','2012-12-27 17:03:26','Heart0175-Functional-Right-Atrium-Fossa-Ovalis','The fossa ovalis can be seen in this footage from the right atrium. It billows into the right atrium is due to the higher pressure on the left side of the heart.\n',0,1,1,0,0),(2012,'Heart0191','video','2012-01-10 14:47:26','2012-09-05 21:44:34','Heart0191-Functional-Right-Atrium-Fossa-Ovalis','The fossa ovalis is seen from the right atrium. The fossa is completely sealed in this specimine and there is no indication of a PFO. ',0,0,1,0,0),(2013,'Heart0171','video','2012-01-10 14:47:26','2012-09-05 21:44:34','Heart0171-Functional-Right-Atrium-Inferior-Vena-Cava-Ostium','A view of the cannula that replaced the IVC.  The original IVC was damaged during explant, so a cannula had to be sewn in to provide flow into the right atrium.',0,0,1,0,0),(2014,'Heart0175','video','2012-01-10 14:47:26','2012-12-27 17:03:26','Heart0175-Functional-Right-Atrium-Inferior-Vena-Cava-Ostium','The valve of the inferior vena cava can be seen to the right of the footage with the chiari network, a fetal remnant, to the left.',0,1,1,0,0),(2015,'Heart0191','video','2012-01-10 14:47:27','2012-09-20 16:36:08','Heart0191-Functional-Right-Atrium-Lateral-Wall','The lateral wall of the right atrium is viewed from the superior vena cava ostium. The tricuspid valve is to the right and the right atrial appendage is below the shot. The pectinate muscles of the lateral wall are clearly visible in this footage.',0,0,1,0,0),(2016,'Heart0175','video','2012-01-10 14:47:27','2012-12-27 17:03:26','Heart0175-Functional-Right-Atrium-Triangle-of-Koch','The triangle of Koch, used to locate the atrio-ventricular node, can be seen in this footage. The anatomical landmark is bordered by the coronary sinus, the tricuspid valve and the tendon of Todaro.',0,1,1,0,0),(2017,'Heart0171','video','2012-01-10 14:47:27','2012-09-05 21:44:34','Heart0171-Functional-Right-Atrium-Tricuspid-Valve','The tricuspid valve as seen from the right atrium.  Chordae tendinae can be seen through the valve when it opens.  \n',0,0,1,0,0),(2018,'Heart0175','video','2012-01-10 14:47:27','2012-12-27 17:03:26','Heart0175-Functional-Right-Atrium-Tricuspid-Valve','Footage of the tricuspid valve from the right atrium showing the three leaflets of the valve. The septal leaflet can be seen to the right, the anterosuperior to the upper left and the inferior to the lower left.',0,1,1,0,0),(2020,'Heart0175','video','2012-01-10 14:47:27','2012-12-27 17:03:26','Heart0175-Functional-Right-Ventricle-Apex','Shot of the right ventricular apex.  Note the deep trabeculation of the endocardial surface and the many tendinous conduction chords.  The environment needs to be considered when developing active and passive fixation RV pacing leads.\n',0,1,1,0,0),(2021,'Heart0191','video','2012-01-10 14:47:27','2012-09-05 21:44:34','Heart0191-Functional-Right-Ventricle-Apex','The right ventricular apex is seen here. There are visible conduction bands that can be seen spaning across the apex. After the close up the camera pans back to see a portion of the moderator band in the upper right corner and a larger view of the apex. ',0,0,1,0,0),(2022,'Heart0191','video','2012-01-10 14:47:27','2012-09-05 21:44:34','Heart0191-Functional-Right-Ventricle-Inflow-Tract-Right-Ventricle-Outflow-Tract','The camera is positioned in the right ventricular outflow tract looking at the inflow tract, particularly the tricuspid valve. Then the camera pans down to see the rest of the inflow tract and backs up and almost completely out of the right ventricular outflow tract.',0,0,1,0,0),(2023,'Heart0171','video','2012-01-10 14:47:27','2012-09-05 21:44:34','Heart0171-Functional-Right-Ventricle-Moderator-Band','A view of the moderator band.  The septum is on the left, and the anterior papillary muscle is in the upper right.  At the end of the shot the view widens to show more of the papillary muscle.',0,0,1,0,0),(2024,'Heart0175','video','2012-01-10 14:47:27','2012-12-27 17:03:27','Heart0175-Functional-Right-Ventricle-Moderator-Band','In this footage the moderator band, a muscular conduction band, can be seen toward the right of the shot connecting the anterior papillary muscle to the septal wall near the posterior papillary muscle of the tricuspid valve.\n',0,1,1,0,0),(2025,'Heart0191','video','2012-01-10 14:47:27','2012-09-05 21:44:34','Heart0191-Functional-Right-Ventricle-Moderator-Band','The moderator band is seen on the right side of the video. In this heart the band is very thick compared to other moderator bands shown on this site. ',0,0,1,0,0),(2026,'Heart0171-Anterior','video','2012-01-10 14:47:28','2012-09-05 21:44:34','Heart0171-Functional-Right-Ventricle-Anterior-Papillary-Muscle','The anterior papillary muscle as seen from the right ventricle.   The posterior papillary muscle complex can be seen in the background on the right.\n',0,0,1,0,0),(2027,'Heart0175-Anterior','video','2012-01-10 14:47:28','2012-12-27 17:03:26','Heart0175-Functional-Right-Ventricle-Anterior-Papillary-Muscle','In this footage the anterior papillary muscle of the right ventricle can be seen connecting the tricuspid valve, toward the base of the shot, to the ventricular wall.  Note the chordae attaching the valve to the muscle head.\n',0,1,1,0,0),(2028,'Heart0191-Anterior','video','2012-01-10 14:47:28','2012-09-05 21:44:34','Heart0191-Functional-Right-Ventricle-Anterior-Papillary-Muscle','A view of the anterior papillary muscle is seen from above in this video. The papillary muscle looks to be almost bifrucated. In the background conduction bands can be seen, and the muscular tissue that projects to the left attach to the posterior papillary muscle. \n',0,0,1,0,0),(2029,'Heart0191-Anterior-Posterior','video','2012-01-10 14:47:28','2012-09-05 21:44:34','Heart0191-Functional-Right-Ventricle-Anterior-Papillary-Muscle-Right-Ventricle-Posterior-Papillary-Muscle','The anterior papillary muscle can be seen from within the tricuspid valve. After examining the anterior papilary muscle the camera pans down to inspect the posterior papilary muscle. The chordae tendoneae connections can be seen attaching to the tricuspid valve. \n',0,0,1,0,0),(2030,'Heart0171-Posterior','video','2012-01-10 14:47:28','2012-09-05 21:44:34','Heart0171-Functional-Right-Ventricle-Posterior-Papillary-Muscle','The posterior papillary muscle complex.  There are at least three visible discrete muscles visible.\n',0,0,1,0,0),(2031,'Heart0175-Posterior','video','2012-01-10 14:47:28','2012-12-27 17:03:27','Heart0175-Functional-Right-Ventricle-Posterior-Papillary-Muscle','The posterior papillary muscle of the right ventricle is shown from the papillary muscle head with the chordae attachments to the base.  Note the conduction bands connecting the muscle to the ventricular wall and the unique muscular band stretching from the papillary head to the ventricular wall in the upper left of the shot.\n',0,1,1,0,0),(2032,'Heart0171-Septal','video','2012-01-10 14:47:28','2012-09-05 21:44:34','Heart0171-Functional-Right-Ventricle-Septal-Papillary-Muscle','The septal papillary muscle is briefly visible in this shot.  The majority of the clip shows the chordae tendinae that connect the septal papillary muscle to the leaflet of the tricuspid valve.\n',0,0,1,0,0),(2033,'Heart0175-Septal','video','2012-01-10 14:47:28','2012-12-27 17:03:27','Heart0175-Functional-Right-Ventricle-Septal-Papillary-Muscle','The septal and nodal papillary muscle complexes of the tricuspid valve are shown here.  Interstingly in this specimen, the complexes show no discernible papillary head with all the chordae tendinae branching directly from the septal wall.\n',0,1,1,0,0),(2034,'Heart0191-Posterior-Anterior','video','2012-01-10 14:47:28','2012-09-05 21:44:34','Heart0191-Functional-Right-Ventricle-Posterior-Papillary-Muscle-Right-Ventricle-Anterior-Papillary-Muscle','Here the posterior papillary muscle is seen initially in the video. The camera then pans across to the anterior papillary muscle and the free wall of the right ventricle is seen in the background.',0,0,1,0,0),(2035,'Heart0175','video','2012-01-10 14:47:28','2012-12-27 17:03:27','Heart0175-Functional-Right-Ventricle-Outflow-Tract','Shot of the right ventricular outflow tract showing the pulmonary valve, note the trabeculation of the Right ventricle all the way up to the pulmonary annulus. The function of the valve diminishes due to a reduction in the afterload pressure.\n',0,1,1,0,0),(2036,'Heart0191','video','2012-01-10 14:47:28','2012-09-05 21:44:34','Heart0191-Functional-Right-Ventricle-Outflow-Tract','Here we can see the right ventricular outflow tract and the trabeculae lining it. The pulmonary valve can be seen opening and closing from below the valve. Lastly the leaflet that flashes in and out of the video\'s upper right hand corner is the anterior leaflet of the tricuspid valve.\n',0,0,1,0,0),(2037,'Heart0191-Papilary','video','2012-01-10 14:47:28','2012-09-05 21:44:34','Heart0191-Functional-Right-Ventricle-Outflow-Tract-Right-Ventricle-Septal-Papillary-Muscle','Here the septal papilary complex is shown with the right ventricular outflow tract. The papillary complex is on the right where the chordae attaches to the mycocardium. The pulmonary valve can also be seen in the background where the RVOT leads to.',0,0,1,0,0),(2038,'Heart0171','video','2012-01-10 14:47:28','2012-09-05 21:44:34','Heart0171-Functional-Right-Ventricle-Tricuspid-Valve','The tricuspid valve as seen from the right ventricle.  The white bands are chordae tendinae.  The chordae in the foreground on the right side are coming off the septal papillary muscle, the chordae on the left are coming off the anterior papillary muscles, and the chordea intermittently visible in the background on the right are attached to the posterior papillary muscle complex.\n',0,0,1,0,0),(2039,'Heart0191','video','2012-01-10 14:47:28','2012-09-05 21:44:34','Heart0191-Functional-Right-Ventricle-Tricuspid-Valve','The tricuspid valve is seen from the right ventricular outflowtract. The valve leaflet in the foreground on the left is the anterior leaflet and behind it is the posterior leaflet. Across from both of those leaflets on the right side of the video is the septal leaflet. With that, the free wall of the RV is seen on the left and the septal wall is on the right. ',0,0,1,0,0),(2040,'Heart0171','video','2012-01-10 14:47:28','2012-09-05 21:44:34','Heart0171-Functional-Pulmonary-Artery-Pulmonary-Valve','View of the pulmonary valve from above.  The valve is not functioning properly due to a decreased pressure in the pulmonary tract.\n',0,0,1,0,0),(2041,'Heart0175','video','2012-01-10 14:47:28','2012-12-27 17:03:26','Heart0175-Functional-Pulmonary-Artery-Pulmonary-Valve','Close up of the pulmonary valve taken from the pulmonary artery.  Note the tri-leaflet structure of the valve.\n',0,1,1,0,0),(2042,'Heart0191','video','2012-01-10 14:47:28','2012-09-05 21:44:34','Heart0191-Functional-Pulmonary-Artery-Pulmonary-Valve','The pulmonary valve is seen here opening and closing. The pulmonary cusps are thiner and more compliant than those of the aortic valve due to the pressures that each are exposed to. The thin leaflets are seen here as they billow with the back flow during diastole. ',0,0,1,0,0),(2043,'Heart0171','video','2012-01-10 14:47:28','2014-07-24 18:21:52','Heart0171-Functional-Left-Atrium-Fossa-Ovalis','The foramen ovale and fossa can be seen in the center of the picture.  \n',0,0,1,0,0),(2044,'Heart0191','video','2012-01-10 14:47:28','2014-07-24 18:21:52','Heart0191-Functional-Left-Atrium-Fossa-Ovalis','The fossa ovalis is seen from the left atrium. During them middle of the video the fossa is illuminated from a camera in the right atrium. The fossa is nicely outlined in the image. ',0,0,1,0,0),(2045,'Heart0191','video','2012-01-10 14:47:28','2012-09-05 21:44:34','Heart0191-Functional-Left-Atrium-Left-Atrial-Appendage','The left atrial appendage is seen in this video. There are a few bubbles seen in the video which in a body could potentially cause problems for the patient. \n',0,0,1,0,0),(2046,'Heart0171','video','2012-01-10 14:47:29','2012-09-05 21:44:34','Heart0171-Functional-Left-Atrium-Left-Atrial-Appendage','This video starts with a close-up inside the left atrial appendage.  The camera then backs out of the appendage, and the opening is apparent.  The mitral valve can be seen on the left of the frame near the end of the clip.\n',0,0,1,0,0),(2047,'Heart0175','video','2012-01-10 14:47:29','2012-12-27 17:03:26','Heart0175-Functional-Left-Atrium-Left-Atrial-Appendage','The footage shows the ostium of the left atrial appendage with the mitral valve to the top of the shot. Note the pectinate muscles of the endocardial surface of the appendage.',0,1,1,0,0),(2048,'Heart0171','video','2012-01-10 14:47:29','2012-09-05 21:44:34','Heart0171-Functional-Left-Atrium-Mitral-Valve','View of the mitral valve from the left atrium.  The largest leaflet, visible in the lower left of the video, is the anterior leaflet.  The smaller one directly across from it is on the posterior side.\n',0,0,1,0,0),(2049,'Heart0175','video','2012-01-10 14:47:29','2012-12-27 17:03:26','Heart0175-Functional-Left-Atrium-Mitral-Valve','Footage of the mitral valve from the left atrium. The aortic, or anterior, leaflet can be seen to the left and the mural, or posterior, leaflet can be seen to the lower right. Note the scallops in the mural leaflet, divided by a deep cleft, giving the impression of more than one leaflet.',0,1,1,0,0),(2050,'Heart0171','video','2012-01-10 14:47:29','2012-09-05 21:44:34','Heart0171-Functional-Left-Atrium-Pulmonary-Vein-Ostia','Two of the pulmonary veins.  These are the right superior (on the top/right of the frame) and the right inferior (on the bottom/left of the frame) pulmonary veins.\n',0,0,1,0,0),(2051,'Heart0191-1','video','2012-01-10 14:47:29','2012-09-05 21:44:34','Heart0191-Functional-Left-Atrium-Pulmonary-Vein-Ostia-1','The right superior (right) and inferior (left) pulmonary veins are seen in this video. The superior pulmonary vein has been cannulated and the inferior vein tied off.\n',0,0,1,0,0),(2052,'Heart0191-2','video','2012-01-10 14:47:29','2012-09-05 21:44:34','Heart0191-Functional-Left-Atrium-Pulmonary-Vein-Ostia-2','The left superior pulmonary vein is seen after viewing tracking from the mitral valve, past the left atrial appendage and finally focusing on the pulmonary vein. ',0,0,1,0,0),(2053,'Heart0175','video','2012-01-10 14:47:29','2012-12-27 17:03:26','Heart0175-Functional-Left-Ventricle-Aortic-Valve','Footage of the aortic valve from the left ventricle, i.e. below the valve. The leaflet of the non-coronary cusp is to the upper left of the shot, with the leaflet of the right coronary cusp is to the upper right and the left coronary cusp to the base of the footage. The mitral valve is situated to the left of the shot (off screen).',0,1,1,0,0),(2054,'Heart0171','video','2012-01-10 14:47:29','2012-09-05 21:44:34','Heart0171-Functional-Left-Ventricle-Apex','View of the trabeculation and conduction bands in the apex of the left ventricle.\n',0,0,1,0,0),(2055,'Heart0191','video','2012-01-10 14:47:29','2012-09-05 21:44:34','Heart0191-Functional-Left-Ventricle-Apex','The left ventricular apex is seen here. The free wall of the ventricle is on the right side and septal wall is on the left.',0,0,1,0,0),(2056,'Heart0171','video','2012-01-10 14:47:29','2012-09-05 21:44:34','Heart0171-Functional-Left-Ventricle-Left-Ventricle-Bands','View of multiple conduction bands in the left ventricular apex',0,0,1,0,0),(2057,'Heart0171','video','2012-01-10 14:47:29','2012-09-05 21:44:34','Heart0171-Functional-Left-Ventricle-Mitral-Valve','This clip shows the mitral valve as viewed from the left ventricle.  Note the abundance of chordae tendinae.  The structure in the foreground in the upper right of the frame is a papillary muscle.\n',0,0,1,0,0),(2058,'Heart0175','video','2012-01-10 14:47:29','2012-12-27 17:03:26','Heart0175-Functional-Left-Ventricle-Mitral-Valve','Footage of the mitral valve taken from the left ventricular apex, i.e. from below.  The aortic valve can be seen toward the end of the footage in the upper right of the shot.  Knowing this we can confidently label the leaflet in the upper portion of the footage as the anterior, or aortic, leaflet and the leaflet in the lower portion of the footage as the posterior, or mural, leaflet. The posteromedial, or posterior, papillary complex can be seen to the bottom right of the footage and the edge of the, anterior, anterolateral papillary muscle complex can be seen to the left of the shot. It can clearly be seen that chordae tendinae from both papillary muscle complexes attach to both leaflets of the valve.',0,1,1,0,0),(2059,'Heart0171-Anterior','video','2012-01-10 14:47:30','2012-09-05 21:44:34','Heart0171-Functional-Left-Ventricle-Anterior-Papillary-Muscle','This clip shows a brief view of the left anterior papillary muscles.  Note that it is bifurcated/complex.\n',0,0,1,0,0),(2060,'Heart0175-Anterior','video','2012-01-10 14:47:30','2012-12-27 17:03:26','Heart0175-Functional-Left-Ventricle-Anterior-Papillary-Muscle','The anterolateral papillary muscle complex can be seen through the leaflets of the mitral valve. This particular complex shows an extraordinary number of chordae tendinae branching from the top of the main papillary head.  Additionally, some of the tendinous connections branch from the papillary muscle complex directly to the ventricular wall.\n',0,1,1,0,0),(2061,'Heart0191-Anterior','video','2012-01-10 14:47:30','2012-09-05 21:44:34','Heart0191-Functional-Left-Ventricle-Anterior-Papillary-Muscle','The anterior papillary muscle is seen from the view of the mitral valve. The connections that the cordae make to the papilary muscle are clearly visible in this video and show at least four distinct connections.\n',0,0,1,0,0),(2062,'Heart0171-Posterior','video','2012-01-10 14:47:30','2012-09-05 21:44:34','Heart0171-Functional-Left-Ventricle-Posterior-Papillary-Muscle','The camera starts in the atrium, travels through the mitral valve, and provides a close up view of the posterior papillary muscle.  In the background to the left is a pressure transducer.\n',0,0,1,0,0),(2063,'Heart0175-Posterior','video','2012-01-10 14:47:30','2012-12-27 17:03:26','Heart0175-Functional-Left-Ventricle-Posterior-Papillary-Muscle','The posteromedial papillary muscle complex can be seen through the mitral valve to the top right of the image.  There are an extensive number of chordae tendinae branching from the papillary muscle head to the postero-inferior and antero-superior leaflets in addition to tendinous chords between the papillary muscle complexes and the ventricular walls.\n',0,1,1,0,0),(2064,'Heart0191-Posterior','video','2012-01-10 14:47:30','2012-09-05 21:44:34','Heart0191-Functional-Left-Ventricle-Posterior-Papillary-Muscle','The posterior papillary muscle is seen here. The connections to the top of the muscle are chordae tendonae coming from the mitral valve.\n',0,0,1,0,0),(2065,'Heart0191-Posterior-Mitral','video','2012-01-10 14:47:30','2012-09-05 21:44:34','Heart0191-Functional-Left-Ventricle-Anterior-Papillary-Muscle-Left-Ventricle-Mitral-Valve','This video shows the anterior papillary muscle. It pans from the base of the muscle up to the top where you can see the chordae connections from the mitral valve and finally shows the bottom of the leaflets of the mitral valve.',0,0,1,0,0),(2066,'Heart0171','video','2012-01-10 14:47:30','2012-09-05 21:44:34','Heart0171-Functional-Aorta-Aortic-Valve','View of the aortic valve from above.  Calcification can be seen on the leaflets\n',0,0,1,0,0),(2067,'Heart0175','video','2012-01-10 14:47:30','2012-12-27 17:03:26','Heart0175-Functional-Aorta-Aortic-Valve','Footage of the aortic valve from the ascending aorta. The non-coronary cusp can be seen to the lower right of the shot, the right above and the smaller left cusp to the lower left.',0,1,1,0,0),(2068,'Heart0171-Left','video','2012-01-10 14:47:30','2012-09-05 21:44:34','Heart0171-Functional-Aorta-Left-Coronary-Artery-Ostia','Vies of the left coronary ostia.  The aortic valve on to the upper right of the screen.\n',0,0,1,0,0),(2069,'Heart0171-Right','video','2012-01-10 14:47:30','2012-09-05 21:44:34','Heart0171-Functional-Aorta-Right-Coronary-Artery-Ostia','View of the right coronary ostia.  The aortic valve is to the right of the image.\n',0,0,1,0,0),(2070,'Heart0175-Left','video','2012-01-10 14:47:30','2012-12-27 17:03:26','Heart0175-Functional-Aorta-Left-Coronary-Artery-Ostia','The left coronary artery ostium can be seen in this footage with the aortic valve to the top of the shot. Note the fenestration of the left coronary cusp leaflet along the commissure of the valve.\n',0,1,1,0,0),(2071,'Heart0175-Right','video','2012-01-10 14:47:30','2012-12-27 17:03:26','Heart0175-Functional-Aorta-Right-Coronary-Artery-Ostia','The right coronary artery ostium can be seen in this footage. Note the unusual early branches from the main artery.\n',0,1,1,0,0),(2072,'Heart0191-Left','video','2012-01-10 14:47:30','2012-09-05 21:44:34','Heart0191-Functional-Aorta-Left-Coronary-Artery-Ostia','Here is the left coronary artery ostia. The ostia opening creates almost a shelf compared to the right coronary ostia of this same heart. \n',0,0,1,0,0),(2073,'Heart0191-Right-Left','video','2012-01-10 14:47:30','2012-09-05 21:44:34','Heart0191-Functional-Aorta-Right-Coronary-Artery-Ostia-Aorta-Left-Coronary-Artery-Ostia','The video begins at the right coronary sinus ostium then slowly pans to the left coronary sinus ostium.\n',0,0,1,0,0),(2074,'Heart0191-Right','video','2012-01-10 14:47:30','2012-09-05 21:44:34','Heart0191-Functional-Aorta-Right-Coronary-Artery-Ostia','The right coronary ostium is seen here. The opening is  close the the base of the aortic valve leaflets.\n',0,0,1,0,0),(2075,'Heart0171','video','2012-01-10 14:47:31','2012-09-05 21:44:34','Heart0171-Functional-Cardiac-Veins-Coronary-Sinus','View of the inside of the coronary sinus.  A branch to the posterior vein of the left ventricle can be seen on the left saide of the image.',0,0,1,0,0),(2076,'Heart0171','video','2012-01-10 14:47:31','2012-09-05 21:44:34','Heart0171-Functional-Cardiac-Veins-Posterior-Interventricular-Vein','External footage of the fiberscope introduced into the posterior interventricular vein from the coronary sinus. It\'s position is marked by the illumination near the apex of the heart.',0,0,1,0,0),(2077,'Heart0191','video','2012-01-10 14:47:31','2012-09-05 21:44:34','Heart0191-Functional-Cardiac-Veins-Posterior-Interventricular-Vein','There is a valve on the posterior interventricular vein ostium next to the coronary sinus ostium.',0,0,1,0,0),(2078,'Heart0171','video','2012-01-10 14:47:31','2012-09-05 21:44:34','Heart0171-Functional-Cardiac-Veins-Great-Cardiac-Vein','View of the inside of the middle of the great cardiac vein.',0,0,1,0,0),(2079,'Heart0175-1','video','2012-01-10 14:47:32','2012-12-27 17:03:26','Heart0175-Functional-External-Anterior-1','An anterior view of the heart in the apparatus. Note the strong atrial contractions and the ventricular fibrillation at the start of the video.  The heart is then defibrillated with an electrical shock through the coil (later removed) causing the atria and ventricles to beat in a coordinated manner. An echo probe is then positioned at the apex to record cardiac ultrasound images.\n',0,1,1,0,0),(2080,'Heart0175-2','video','2012-01-10 14:47:32','2012-12-27 17:03:26','Heart0175-Functional-External-Anterior-2','An anterior view of the heart beating in the apparatus.  Note the light from the endoscopic camera within the right atrium shining through the thin tissue of the atrial free wall.  This heart displays no conduction abnormalities and the pressure generated in the ventricles of the heart are being monitored by the pressure sensors (white wires) exiting the RVOT and the LV apex.\n',0,1,1,0,0),(2081,'Heart0191','video','2012-01-10 14:47:32','2012-09-05 21:44:34','Heart0191-Functional-External-Anterior','The heart is seen from the anterior. The heart can be seen quivering from dissynchronus myocardial activation. A defibrillation patch over the heart delivers a shock to re-synchronize the heart. Once the shock is delivered the heart remains in asystole until the heart\'s stretch receptors are activated mechanically. Then the heart regains function and normal contractions.',0,0,1,0,0),(2082,'Heart0175','video','2012-01-10 14:47:32','2012-12-27 17:03:26','Heart0175-Functional-External-Right-Margin','External footage of the heart taken from the right anterior oblique (RAO) aspect.  This approximates the view of the heart when imaged from the RAO aspect during a fluoroscopy exam. Note the right atrium contracting strongly in the upper left of the footage and the relatively flat shape to the diaphragmatic surface to the lower left of the footage.',0,1,1,0,0),(2083,'Heart0175','video','2012-01-10 14:47:32','2012-12-27 17:03:26','Heart0175-Functional-External-Left-Margin','External footage of the heart taken from the left anterior oblique (LAO) aspect.  This approximates the view of the heart when imaged from the LAO aspect during a fluoroscopy exam.',0,1,1,0,0),(2084,'Heart0106','still','2012-01-12 22:31:14','2012-12-27 16:34:34','Heart0106-Perfusion-Fixed-Right-Atrium-Right-Atrial-Appendage','A close-up view of the right atrial appendage.  Inside is a clear view of pectinate muscle.                                  \n',0,1,0,0,0),(2085,'Heart0193','still','2012-01-12 22:31:14','2012-09-05 21:47:45','Heart0193-Perfusion-Fixed-Right-Atrium-Right-Atrial-Appendage','A closeup view of the pectinate muscle within the right atrial appendage. The pectinate muscle is often described as resembling the teeth of a comb. \n',0,1,0,0,0),(2086,'Heart0195','still','2012-01-12 22:31:14','2012-09-05 21:47:45','Heart0195-Perfusion-Fixed-Right-Atrium-Right-Atrial-Appendage','Here the right atrial appendage is seen with a number of pectinate muscles throughout the structure. The without the pectinate musculature is a thin membranous structure that in some cases can be transulcent or almost transparent.\n',0,1,0,0,0),(2087,'Heart0196','still','2012-01-12 22:31:14','2012-09-05 21:47:45','Heart0196-Perfusion-Fixed-Right-Atrium-Right-Atrial-Appendage','The thin-walled right atrial appendage is seen in this photo.  The bands crossing the wall are the pectinate muscle, and the sagittal band is the thick muscle in the center of the image.\n',0,1,0,0,0),(2088,'Heart0197','still','2012-01-12 22:31:14','2012-09-05 21:47:45','Heart0197-Perfusion-Fixed-Right-Atrium-Right-Atrial-Appendage','A close-up view of the right atrial appendage. A good image of the pectinate muscle of the appendage.\n',0,1,0,0,0),(2089,'Heart0198','still','2012-01-12 22:31:14','2012-09-05 21:47:45','Heart0198-Perfusion-Fixed-Right-Atrium-Right-Atrial-Appendage','A view of the right atrial appendage. A close-up view of the pectinate muscle.\n',0,1,0,0,0),(2090,'Heart0199','still','2012-01-12 22:31:14','2012-09-05 21:47:45','Heart0199-Perfusion-Fixed-Right-Atrium-Right-Atrial-Appendage','The right atrial appendage is seen here. There are lots of pectinate muscle throughout the appendage. Where the pectinate muscle is not visible, the very thin walls of the right atrium are visible and almost transparent to the outside of the heart.  \n',0,1,0,0,0),(2091,'Heart0206','still','2012-01-12 22:31:14','2012-09-05 21:47:45','Heart0206-Perfusion-Fixed-Right-Atrium-Right-Atrial-Appendage','A view into the right atrial appendage showing the normally comb shaped pectinate muscles.  The crista terminalis is the ridge where the the pectinate muscle terminates.',0,1,0,0,0),(2092,'Heart0195','still','2012-01-12 22:31:14','2012-09-05 21:47:45','Heart0195-Perfusion-Fixed-Right-Atrium-Coronary-Sinus-Ostium','The coronary sinus ostium can be seen in relation to the fossa ovalis within this heart. The whole to the right of the fossa is the inferior vena cava, and  is not natural in shape due to the fixation method used.  \n',0,1,0,0,0),(2093,'Heart0196','still','2012-01-12 22:31:14','2012-09-05 21:47:45','Heart0196-Perfusion-Fixed-Right-Atrium-Coronary-Sinus-Ostium','The coronary sinus (center) is bordered by the thebesian valve.  The IVC in the lower right is bordered by ridge referred to as the valve of the IVC or Eustachian valve.  This valve or ridge is thought to help direct blood flow into the foramen ovale during fetal development. \n',0,1,0,0,0),(2094,'Heart0197','still','2012-01-12 22:31:14','2012-09-05 21:47:45','Heart0197-Perfusion-Fixed-Right-Atrium-Coronary-Sinus-Ostium','A view of the coronary sinus ostium. The opening in the lower left of the image indicates where the inferior vena cava entered the right atrium. The tricsupid valve is located at the upper right of the image.\n',0,1,0,0,0),(2095,'Heart0198','still','2012-01-12 22:31:14','2012-09-05 21:47:45','Heart0198-Perfusion-Fixed-Right-Atrium-Coronary-Sinus-Ostium','A view of the coronary sinus ostium with a Thebesian valve.\n',0,1,0,0,0),(2096,'Heart0206','still','2012-01-12 22:31:14','2012-09-05 21:47:45','Heart0206-Perfusion-Fixed-Right-Atrium-Coronary-Sinus-Ostium','A close up view of the coronary sinus ostium from withing the right atrium. A thebesian valve is seen near the ostium.',0,1,0,0,0),(2097,'Heart0106','still','2012-01-12 22:31:14','2012-09-05 21:47:45','Heart0106-Perfusion-Fixed-Right-Atrium-Crista-Terminalis','Showing the crista terminalis, defined as the ridge between the pectinate and smooth muscle inside the right atrium.  The pectinate muscle is seen branching out in the lower half of the image with smooth muscle above it.                                                     \n',0,1,0,0,0),(2098,'Heart0193','still','2012-01-12 22:31:14','2012-09-05 21:47:45','Heart0193-Perfusion-Fixed-Right-Atrium-Crista-Terminalis','A closeup view of the structure where the pectinate muscles terminate, which is called the crista terminalis.\n',0,1,0,0,0),(2099,'Heart0195','still','2012-01-12 22:31:14','2012-09-05 21:47:45','Heart0195-Perfusion-Fixed-Right-Atrium-Crista-Terminalis','The crista terminalis is pointed out here next to the right atrial free wall. The pectinate muscle is seen here. The thin structure of the right atrial wall is illustrated well with this image, in some cases it is possible to read business cards through the wall of the right atrium due to its thickness. \n',0,1,0,0,0),(2101,'Heart0197','still','2012-01-12 22:31:14','2012-09-05 21:47:45','Heart0197-Perfusion-Fixed-Right-Atrium-Crista-Terminalis','A view of the free wall of the right atrium. A good view of the pectinate muscle and crista terminalis.\n',0,1,0,0,0),(2102,'Heart0198','still','2012-01-12 22:31:14','2012-09-05 21:47:45','Heart0198-Perfusion-Fixed-Right-Atrium-Crista-Terminalis','A view of the crista terminalis is shown at the upper right of the image. The pectinate muscle of the right atrial appendage can be seen at the lower left of the image\n',0,1,0,0,0),(2103,'Heart0199','still','2012-01-12 22:31:14','2012-09-05 21:47:45','Heart0199-Perfusion-Fixed-Right-Atrium-Crista-Terminalis','The crista terminalis is seen here, note how it is very smooth and yet right below the crista terminalis is the free wall of the right atrium that has lots of pectinate muscle on it. \n',0,1,0,0,0),(2104,'Heart0206','still','2012-01-12 22:31:15','2012-09-05 21:47:45','Heart0206-Perfusion-Fixed-Right-Atrium-Crista-Terminalis','A close up view of the right atrial appendage that is an excellent example of the termination of the pectinate muscles at the crista terminalis.',0,1,0,0,0),(2106,'Heart0195','still','2012-01-12 22:31:15','2012-09-05 21:47:45','Heart0195-Perfusion-Fixed-Right-Atrium-Fossa-Ovalis','The fossa ovalis is seen here from the right atrium. The portion of the fossa in the lower left protion of the image is the superior aspect of the fossa ovalis. \n',0,1,0,0,0),(2107,'Heart0196','still','2012-01-12 22:31:15','2012-09-05 21:47:45','Heart0196-Perfusion-Fixed-Right-Atrium-Fossa-Ovalis','This is a close up view of the fossa ovalis from the right atrium.\n',0,1,0,0,0),(2108,'Heart0197','still','2012-01-12 22:31:15','2012-09-05 21:47:45','Heart0197-Perfusion-Fixed-Right-Atrium-Fossa-Ovalis','A close-up view of the fossa ovalis from the right atrium.\n',0,1,0,0,0),(2109,'Heart0198','still','2012-01-12 22:31:15','2012-09-05 21:47:45','Heart0198-Perfusion-Fixed-Right-Atrium-Fossa-Ovalis','A view of the fossa ovalis from the right atrium.\n',0,1,0,0,0),(2110,'Heart0206','still','2012-01-12 22:31:15','2012-09-05 21:47:45','Heart0206-Perfusion-Fixed-Right-Atrium-Fossa-Ovalis','A close up view of the membraneous fossa ovalis from the right atria. ',0,1,0,0,0),(2111,'Heart0196','still','2012-01-12 22:31:15','2012-09-05 21:47:45','Heart0196-Perfusion-Fixed-Right-Atrium-Inferior-Vena-Cava-Ostium','The IVC in this heart is bordered by a prominent ridge called the valve of the IVC or the Eustachian valve.  The coronary sinus is also visible on the left edge of the screen.\n',0,1,0,0,0),(2112,'Heart0198','still','2012-01-12 22:31:15','2012-09-05 21:47:45','Heart0198-Perfusion-Fixed-Right-Atrium-Inferior-Vena-Cava-Ostium','The inferior vena cava ostium can be seen at the bottom center of the image. The coronary sinus ostium and thebesian valve can also be seen at the upper left of the image.',0,1,0,0,0),(2113,'Heart0195','still','2012-01-12 22:31:15','2012-09-05 21:47:45','Heart0195-Perfusion-Fixed-Right-Atrium-Triangle-of-Koch','Here are the primary landmarks of the triangle of koch, the coronary sinus following the eustachian ridge up until it almost intersects the edge of the tricuspid valve then finally returns to the coronary sinus along the edge of the tricuspid valve posterior leaflet. \n',0,1,0,0,0),(2114,'Heart0196','still','2012-01-12 22:31:15','2012-09-05 21:47:45','Heart0196-Perfusion-Fixed-Right-Atrium-Triangle-of-Koch','The triangle of Koch is defined by the tricuspid valve (top), coronary sinus (center in the lower third), and the Eustachian ridge and tendon of Todaro (the continuation of the Eustachian ridge).  \n',0,1,0,0,0),(2116,'Heart0198','still','2012-01-12 22:31:15','2012-09-05 21:47:45','Heart0198-Perfusion-Fixed-Right-Atrium-Triangle-of-Koch','A view of the triangle of koch defined by the tendon of Todaro (an extension of the Eustacian ridge) towards the bottom right of the image, the coronary sinus ostium, and the tricuspid valve located towards the upper left of the image.\n',0,1,0,0,0),(2117,'Heart0206','still','2012-01-12 22:31:15','2012-09-05 21:47:45','Heart0206-Perfusion-Fixed-Right-Atrium-Triangle-of-Koch','A view looking down on to the triangle of koch with two of the defining anatomical landmarks: the tendon of todaro and the septal annulus of the tricuspid valve.  The coronary sinus can also be seen.',0,1,0,0,0),(2118,'Heart0193','still','2012-01-12 22:31:15','2012-09-05 21:47:45','Heart0193-Perfusion-Fixed-Right-Atrium-Tricuspid-Valve','A closeup view of the tricuspid valve from the right atria. The chordae tendinae can be seen through the valve. The anterior leaflet is toward the top right.\n',0,1,0,0,0),(2119,'Heart0195','still','2012-01-12 22:31:15','2012-09-05 21:47:45','Heart0195-Perfusion-Fixed-Right-Atrium-Tricuspid-Valve','Here the tricuspid valve can be seen from the right atrium. The upper most leaflet that is clearly seen in the anterior leaflet of the tricuspid valve and below that is the posterior leaflet. The leaflet that cannot be seen as clearly is the septal. Through the valve you can see a little bit of the right ventriclar apex\n',0,1,0,0,0),(2120,'Heart0198','still','2012-01-12 22:31:15','2012-09-05 21:47:45','Heart0198-Perfusion-Fixed-Right-Atrium-Tricuspid-Valve','A view of the tricuspid valve from above.\n',0,1,0,0,0),(2121,'Heart0199','still','2012-01-12 22:31:15','2012-09-05 21:47:45','Heart0199-Perfusion-Fixed-Right-Atrium-Tricuspid-Valve','The tricuspid valve is seen from the right atrium. The septal wall is to the lower right hand side of the image and the free wall is to the upper left of the image. Through the valve the right ventricular apex can also be seen. \n',0,1,0,0,0),(2122,'Heart0206','still','2012-01-12 22:31:15','2012-09-05 21:47:45','Heart0206-Perfusion-Fixed-Right-Atrium-Tricuspid-Valve','A close up of the tricuspid valve looking down from the right atrium with each leaflet labelled.',0,1,0,0,0),(2123,'Heart0193','still','2012-01-12 22:31:15','2012-09-05 21:47:45','Heart0193-Perfusion-Fixed-Right-Ventricle-Apex','A closeup view of the right ventricle apex clearly showing the high degree of trabeculations and conduction bands attaching adjoining trabeculae.\n',0,1,0,0,0),(2124,'Heart0195','still','2012-01-12 22:31:15','2012-09-05 21:47:45','Heart0195-Perfusion-Fixed-Right-Ventricle-Apex','Within the right ventriclar apex is the moderator band which can be seen spanning across the image and looks exactly like the other trabeculations within the ventricle.\n',0,1,0,0,0),(2125,'Heart0198','still','2012-01-12 22:31:16','2012-09-05 21:47:45','Heart0198-Perfusion-Fixed-Right-Ventricle-Apex','A view of the right ventricular apex. The white tissue bands are conduction bands.\n',0,1,0,0,0),(2126,'Heart0199','still','2012-01-12 22:31:16','2012-09-05 21:47:45','Heart0199-Perfusion-Fixed-Right-Ventricle-Apex','Here is the right ventricular apex. White conduction bands can be seen against the walls of the ventricle and they look like white strings connecting various trabeculae. \n',0,1,0,0,0),(2127,'Heart0206','still','2012-01-12 22:31:16','2012-09-05 21:47:45','Heart0206-Perfusion-Fixed-Right-Ventricle-Apex','A close up view deep within the right ventricular apex showing conduction bands attaching adjoining trabeculae.',0,1,0,0,0),(2128,'Heart0193','still','2012-01-12 22:31:16','2012-09-05 21:47:45','Heart0193-Perfusion-Fixed-Right-Ventricle-Moderator-Band','A view looking down into the apex of the right ventricle. Notice the complex network of trabeculations and conduction bands.\n',0,1,0,0,0),(2129,'Heart0195','still','2012-01-12 22:31:16','2012-09-05 21:47:45','Heart0195-Perfusion-Fixed-Right-Ventricle-Moderator-Band','The moderator can be seen here spanning across the right ventricle. It carries condution fibers within the structure and can transduce a stimulus signal from the septal to the free wall. \n',0,1,0,0,0),(2130,'Heart0196','still','2012-01-12 22:31:16','2012-09-05 21:47:45','Heart0196-Perfusion-Fixed-Right-Ventricle-Moderator-Band','The moderator band in the right ventricle connects the septal and free wall.  The band carries conduction fibers from the right bundle branch from the septum and typically connects at or near the base of the anterior papillary muscle.  It is thought that this electrical shortcut helps synchronize and coordinate contraction.\n',0,1,0,0,0),(2131,'Heart0197','still','2012-01-12 22:31:16','2012-09-05 21:47:45','Heart0197-Perfusion-Fixed-Right-Ventricle-Moderator-Band','A good view of the moderator band in the right ventricle. The anterior papillary muscle can also been seen at the bottom right of the screen.\n',0,1,0,0,0),(2132,'Heart0198','still','2012-01-12 22:31:16','2012-09-05 21:47:45','Heart0198-Perfusion-Fixed-Right-Ventricle-Moderator-Band','A view of a moderator band in the right ventricle.\n',0,1,0,0,0),(2133,'Heart0199','still','2012-01-12 22:31:16','2012-09-05 21:47:45','Heart0199-Perfusion-Fixed-Right-Ventricle-Moderator-Band','The moderator band is seen here branching from the septal wall. This structure is commonly known for its function to transduce the conduction signal across the ventricle to the free wall. \n',0,1,0,0,0),(2134,'Heart0206','still','2012-01-12 22:31:16','2012-09-05 21:47:45','Heart0206-Perfusion-Fixed-Right-Ventricle-Moderator-Band','A view within the right ventricle of a moderator band and trabeculae.',0,1,0,0,0),(2135,'Heart0193','still','2012-01-12 22:31:16','2012-09-05 21:47:45','Heart0193-Perfusion-Fixed-Right-Ventricle-Outflow-Tract','A view of the pulmonary valve looking along the right ventricular outflow tract. \n',0,1,0,0,0),(2136,'Heart0195','still','2012-01-12 22:31:16','2012-09-05 21:47:45','Heart0195-Perfusion-Fixed-Right-Ventricle-Outflow-Tract','Within the right ventriclar outflow tract (RVOT) you can see the path that carries the blood to the lungs. The pulmonary valve in this image is stuck open due to the fixation method. The three leaflets would generally be clearly visible from this view.\n',0,1,0,0,0),(2137,'Heart0196','still','2012-01-12 22:31:16','2012-09-05 21:47:45','Heart0196-Perfusion-Fixed-Right-Ventricle-Outflow-Tract','The right ventricular outflow tract leads to the pulmonary valve.  The pulmonary artery is visible through the valve.\n',0,1,0,0,0),(2138,'Heart0197','still','2012-01-12 22:31:16','2012-09-05 21:47:45','Heart0197-Perfusion-Fixed-Right-Ventricle-Outflow-Tract','A view of the right ventricular outflow tract (RVOT). A view of the pulmonary valve from below is presented in the center of the image. The interventricular wall is to the left of the valve.\n',0,1,0,0,0),(2139,'Heart0198','still','2012-01-12 22:31:16','2012-09-05 21:47:45','Heart0198-Perfusion-Fixed-Right-Ventricle-Outflow-Tract','A view of the right ventricular outflow tract (RVOT). The pulmonary valve is shown at the bottom center of the image.\n',0,1,0,0,0),(2140,'Heart0199','still','2012-01-12 22:31:16','2012-09-05 21:47:45','Heart0199-Perfusion-Fixed-Right-Ventricle-Outflow-Tract','The right ventricular outflow tract (RVOT) is seen from the right ventricle. The pulmonary valve (PV) can also be seen with the three cusps of the semi lunar valve. The white mass beyond the PV is a portion of the pulmonary artery that has collapsed slightly due to lack of fluid in the heart.\n',0,1,0,0,0),(2141,'Heart0206','still','2012-01-12 22:31:16','2012-09-05 21:47:45','Heart0206-Perfusion-Fixed-Right-Ventricle-Outflow-Tract','A view looking from the apex of the right ventricle up on to the right ventricular outflow tract.',0,1,0,0,0),(2142,'Heart0193','still','2012-01-12 22:31:16','2012-09-05 21:47:45','Heart0193-Perfusion-Fixed-Right-Ventricle-Tricuspid-Valve','A closeup view of the tricuspid valve seen from below from the right ventricle. \n',0,1,0,0,0),(2143,'Heart0195','still','2012-01-12 22:31:16','2012-09-05 21:47:45','Heart0195-Perfusion-Fixed-Right-Ventricle-Tricuspid-Valve','Here the tricuspid valve is seen from the apex of the right ventricle. The anterior papillary muscle is seen and pointed out in the image and you can visulize the attachment of the chordae tendineae to the papillary muscle as well as the leaflets of the tricuspid valve. \n',0,1,0,0,0),(2144,'Heart0196','still','2012-01-12 22:31:16','2012-09-05 21:47:45','Heart0196-Perfusion-Fixed-Right-Ventricle-Tricuspid-Valve','The tricuspid valve has three cusps.  The anterior cusp (right, foreground), septal cusp (bottom), and posterior cusp (top of valve in photo).  The anterior papillary muscle runs across the top of the photo.\n',0,1,0,0,0),(2145,'Heart0197','still','2012-01-12 22:31:16','2012-09-05 21:47:45','Heart0197-Perfusion-Fixed-Right-Ventricle-Tricuspid-Valve','A view of the tricuspid valve from below. The posterior cusp is at the top of the image, the anterior cusp is to the right, and the septal cusp is to the left.\n',0,1,0,0,0),(2146,'Heart0198','still','2012-01-12 22:31:16','2012-09-05 21:47:45','Heart0198-Perfusion-Fixed-Right-Ventricle-Tricuspid-Valve','A view of the tricuspid valve from below. The anterior paplliary muscle is in the top foreground. The posterior papillary muscle can be seen in the background.\n',0,1,0,0,0),(2147,'Heart0199','still','2012-01-12 22:31:16','2012-09-05 21:47:45','Heart0199-Perfusion-Fixed-Right-Ventricle-Tricuspid-Valve','This is the tricuspid valve. The anterior leaflet is on the right side of the image and the posterior leaflet is towards the back of the chamber in this image and the septal leaflet on the left side. The papillary muscle and how it attaches to the valvular apparatus via the chordae tendineae is clearly seen here.\n',0,1,0,0,0),(2148,'Heart0206','still','2012-01-12 22:31:16','2012-09-05 21:47:45','Heart0206-Perfusion-Fixed-Right-Ventricle-Tricuspid-Valve','A view of the tricuspid valve from the right ventricle apex. The pectinate muscle of the right atrium can be seen through the valve.',0,1,0,0,0),(2149,'Heart0193','still','2012-01-12 22:31:17','2012-09-05 21:47:45','Heart0193-Perfusion-Fixed-Pulmonary-Artery-Pulmonary-Valve','A closeup view of a partially open pulmonary valve with the camera in the pulmonary trunk.\n',0,1,0,0,0),(2150,'Heart0195','still','2012-01-12 22:31:17','2012-09-05 21:47:45','Heart0195-Perfusion-Fixed-Pulmonary-Artery-Pulmonary-Valve','The pulmonary artery is seen here. Deep down beyond the artery the pulmonary valve can be seen. \n',0,1,0,0,0),(2151,'Heart0198','still','2012-01-12 22:31:17','2012-09-05 21:47:45','Heart0198-Perfusion-Fixed-Pulmonary-Artery-Pulmonary-Valve','A view of an openned pulmonary valve from above. The camera is located in the pulmonary artery trunk.\n',0,1,0,0,0),(2152,'Heart0199','still','2012-01-12 22:31:17','2012-09-05 21:47:45','Heart0199-Perfusion-Fixed-Pulmonary-Artery-Pulmonary-Valve','The pulmonary valve is seen from the pulmonary artery. The valve is a thin structure that allows for one way flow out of the ventricle to the lungs via the pulmonary artery. \n',0,1,0,0,0),(2153,'Heart0206','still','2012-01-12 22:31:17','2012-09-05 21:47:45','Heart0206-Perfusion-Fixed-Pulmonary-Artery-Pulmonary-Valve','A view of a partially opened pulmonary valve from the pulmonary trunk.',0,1,0,0,0),(2154,'Heart0196','still','2012-01-12 22:31:17','2014-07-24 18:21:52','Heart0196-Perfusion-Fixed-Left-Atrium-Fossa-Ovalis','A view of the atrial septum, in which the fossa ovalis is the thinnest portion.  This fibrous layer is the point of entry for many left-sided catheter procedures.  The valve of the foramen ovale, or limbus, is the remnant of the valve that exists during fetal development.  This valve typically closes at birth.\n',0,1,0,0,0),(2155,'Heart0197','still','2012-01-12 22:31:17','2014-07-24 18:21:52','Heart0197-Perfusion-Fixed-Left-Atrium-Fossa-Ovalis','A view of the fossa ovalis from the left atrium.\n',0,1,0,0,0),(2156,'Heart0198','still','2012-01-12 22:31:17','2014-07-24 18:21:52','Heart0198-Perfusion-Fixed-Left-Atrium-Fossa-Ovalis','A view of the fossa ovalis from the left atrium.\n',0,1,0,0,0),(2157,'Heart0199','still','2012-01-12 22:31:17','2014-07-24 18:21:52','Heart0199-Perfusion-Fixed-Left-Atrium-Fossa-Ovalis','The fossa ovalis is seen from the left atrium. The valve of foramen ovale is a portion of the fetal foramen ovale that is generally sealed up within the first year of birth. \n',0,1,0,0,0),(2158,'Heart0206','still','2012-01-12 22:31:17','2014-07-24 18:21:52','Heart0206-Perfusion-Fixed-Left-Atrium-Fossa-Ovalis','A closeup view of the remnant, membranous structure termed the fossa ovalis. The valve of the foramen ovale is also remnant of one of the two shunts found in the fetal cardiac circulation to essentially bypass the heart.',0,1,0,0,0),(2159,'Heart0106','still','2012-01-12 22:31:17','2012-09-05 21:47:45','Heart0106-Perfusion-Fixed-Left-Atrium-Left-Atrial-Appendage','Pectinate muscle is visible within the interior of the left atrial appendage.  \n',0,1,0,0,0),(2160,'Heart0193','still','2012-01-12 22:31:17','2012-09-05 21:47:45','Heart0193-Perfusion-Fixed-Left-Atrium-Left-Atrial-Appendage','A view looking along the posterior wall of the left atria into the left atrial appendage and left superior pulmonary vien. The left lateral ridge is the structure dividing the two. Towards the top right suture can be seen where the left inferior pulmonary vein would be, but it was removed at havest.\n',0,1,0,0,0),(2161,'Heart0196','still','2012-01-12 22:31:17','2012-09-05 21:47:45','Heart0196-Perfusion-Fixed-Left-Atrium-Left-Atrial-Appendage','The left atrial wall is partially smooth and partially covered with pectinate muscle, as can bee seen on two different sides of the opening to the left atrial appendage.\n',0,1,0,0,0),(2162,'Heart0197','still','2012-01-12 22:31:17','2012-09-05 21:47:45','Heart0197-Perfusion-Fixed-Left-Atrium-Left-Atrial-Appendage','A view of the left atrial appendage. The 2 left pulmonary vein ostia can be seen in the lower right of the image.\n',0,1,0,0,0),(2163,'Heart0198','still','2012-01-12 22:31:17','2012-09-05 21:47:45','Heart0198-Perfusion-Fixed-Left-Atrium-Left-Atrial-Appendage','A view of the left atrial appendage.\n',0,1,0,0,0),(2164,'Heart0199','still','2012-01-12 22:31:17','2012-09-05 21:47:45','Heart0199-Perfusion-Fixed-Left-Atrium-Left-Atrial-Appendage','The left atrial appendage is a part of the left atrium. It is seen here from within the left atrium. ',0,1,0,0,0),(2165,'Heart0106','still','2012-01-12 22:31:17','2012-09-05 21:47:45','Heart0106-Perfusion-Fixed-Left-Atrium-Mitral-Valve','A view of the mitral valve from the left atrium looking into the left ventricle.  The chordae tendinae are shown attaching the valves leaflets to the papillary muscles within the left ventricle.  \n',0,1,0,0,0),(2166,'Heart0193','still','2012-01-12 22:31:17','2012-09-05 21:47:45','Heart0193-Perfusion-Fixed-Left-Atrium-Mitral-Valve','Looking down on to the mtiral valve from the left atrium. Through the valve the chordae tendinae can be seen attaching to the head of a papillary muscle.\n',0,1,0,0,0),(2167,'Heart0195','still','2012-01-12 22:31:17','2012-09-05 21:47:45','Heart0195-Perfusion-Fixed-Left-Atrium-Mitral-Valve','The mitral valve is seen here. The two leaflets are labeled here. The posterior leaflet can have two commisures within the valve that separate the P1, P2 and P3 regions of the leaflet as seen here.\n',0,1,0,0,0),(2168,'Heart0198','still','2012-01-12 22:31:17','2012-09-05 21:47:45','Heart0198-Perfusion-Fixed-Left-Atrium-Mitral-Valve','A view of the mitral valve from above. The posterior leaflet is located to the lower right and the anterior leaflet is at the upper left.\n',0,1,0,0,0),(2169,'Heart0199','still','2012-01-12 22:31:17','2012-09-05 21:47:45','Heart0199-Perfusion-Fixed-Left-Atrium-Mitral-Valve','The mitral valve is seen from the left atrium.  The posterior leaflet is made up of two leaflets within the heart, the P1 and P2 leaflets are fused together but the P3 region is free for movement.',0,1,0,0,0),(2170,'Heart0197-1','still','2012-01-12 22:31:17','2012-09-05 21:47:45','Heart0197-Perfusion-Fixed-Left-Atrium-Pulmonary-Vein-Ostia-1','A view of the 2 right pulmonary vein ostia.\n',0,1,0,0,0),(2171,'Heart0198-1','still','2012-01-12 22:31:17','2012-09-05 21:47:45','Heart0198-Perfusion-Fixed-Left-Atrium-Pulmonary-Vein-Ostia-1','A view of the one of the pulmonary vein ostia from the left atrium.\n',0,1,0,0,0),(2172,'Heart0199-1','still','2012-01-12 22:31:17','2012-09-05 21:47:45','Heart0199-Perfusion-Fixed-Left-Atrium-Pulmonary-Vein-Ostia-1','The left pulmonary veins are seen here. The left superior pulmonary vein is the left most vein, where the inferior is the right most vein. The left atrial appendage is located to the upper right of the image. Note that the veins look rather rounded, this is uncharacteristic of normal pulmonary viens and is an artifact due to the method of perfusion fixation.\n',0,1,0,0,0),(2173,'Heart0197-2','still','2012-01-12 22:31:17','2012-09-05 21:47:45','Heart0197-Perfusion-Fixed-Left-Atrium-Pulmonary-Vein-Ostia-2','A view of the 2 left pulmonary vein ostia. The left atrial appendage can be seen at the top of the image.\n',0,1,0,0,0),(2174,'Heart0198-2','still','2012-01-12 22:31:17','2012-09-05 21:47:45','Heart0198-Perfusion-Fixed-Left-Atrium-Pulmonary-Vein-Ostia-2','A view of the two left pulmonary vein ostia. The left atrial appendage can be seen above the ostia.\n',0,1,0,0,0),(2175,'Heart0199-2','still','2012-01-12 22:31:17','2012-09-05 21:47:45','Heart0199-Perfusion-Fixed-Left-Atrium-Pulmonary-Vein-Ostia-2','The right pulmonary veins are seen here with the left most vein being the inferior pulmonary vein. Note that the veins are almost perfectly rounded. This is not anatomically correct, but rather it is most likely due to the perfusion fixation method of the hearts. \n',0,1,0,0,0),(2176,'Heart0106','still','2012-01-12 22:31:17','2012-09-05 21:47:45','Heart0106-Perfusion-Fixed-Left-Atrium-Pulmonary-Vein-Ostia','Pulmonary vein ostia as seen from within the left atrium.  The pulmonary veins bring oxygen rich blood from the lungs to the left atrium, which will then be pumped out of the left ventricle to circulate throughout the body.                                \n',0,1,0,0,0),(2177,'Heart0196-1','still','2012-01-12 22:31:17','2012-09-05 21:47:45','Heart0196-Perfusion-Fixed-Left-Atrium-Pulmonary-Vein-Ostia-1','The right pulmonary veins are shown here.  The endocardium in the left atrium is typically smooth, except the pectinated left atrial appendage.\n',0,1,0,0,0),(2178,'Heart0196-2','still','2012-01-12 22:31:17','2012-09-05 21:47:45','Heart0196-Perfusion-Fixed-Left-Atrium-Pulmonary-Vein-Ostia-2','The left pulmonary veins are show here.  The left superior pulmonary vein is higher in the photo than the inferior vein.  The mitral valve is just visible in the upper right corner.\n',0,1,0,0,0),(2179,'Heart0193-Left','still','2012-01-12 22:31:17','2012-09-05 21:47:45','Heart0193-Perfusion-Fixed-Left-Atrium-Pulmonary-Vein-Ostia-L','A view of the left pulmonary vein antrum and ostia. The arrow on the left is pointing to the left superior pulmonary vein and the arrow on the right is pointing to where the inferior vein would be.  The inferior vein was damaged during harvest and sutured close. The left atrial appendage can also be seen and the structure between the appendage and left superior pulmonary vein is called the left lateral ridge.',0,1,0,0,0),(2180,'Heart0106-1','still','2012-01-12 22:31:17','2012-09-05 21:47:45','Heart0106-Perfusion-Fixed-Left-Ventricle-Aortic-Valve-1','The aortic valve as seen from within the left ventricular outflow tract.  This picture was captured just as the cusps were starting to open.                                                           \n',0,1,0,0,0),(2181,'Heart0106-2','still','2012-01-12 22:31:17','2012-09-05 21:47:45','Heart0106-Perfusion-Fixed-Left-Ventricle-Aortic-Valve-2','A view of the closed aortic valve from the left ventricle.  You can see light shining through the thin layer of the membranous septum on the bottom.  \n',0,1,0,0,0),(2182,'Heart0193','still','2012-01-12 22:31:17','2012-09-05 21:47:45','Heart0193-Perfusion-Fixed-Left-Ventricle-Aortic-Valve','A view looking up on to the bottom of the aortic valve from the left ventricle.\n',0,1,0,0,0),(2183,'Heart0195','still','2012-01-12 22:31:17','2012-09-05 21:47:45','Heart0195-Perfusion-Fixed-Left-Ventricle-Aortic-Valve','The aortic valve is seen in this image with the leaflets fully coapting. The musculature of the left ventricular outflow tract here is fairly smooth which is seen within a number of hearts. It is significantly less trabeculated than the apex or the free wall of the left ventricle. \n',0,1,0,0,0),(2184,'Heart0197','still','2012-01-12 22:31:17','2012-09-05 21:47:45','Heart0197-Perfusion-Fixed-Left-Ventricle-Aortic-Valve','A view of the aortic valve obtained from an andoscope in the ascending aorta.\n',0,1,0,0,0),(2185,'Heart0198','still','2012-01-12 22:31:17','2012-09-05 21:47:45','Heart0198-Perfusion-Fixed-Left-Ventricle-Aortic-Valve','A view of the aortic valve from below.\n',0,1,0,0,0),(2186,'Heart0199','still','2012-01-12 22:31:17','2012-09-05 21:47:45','Heart0199-Perfusion-Fixed-Left-Ventricle-Aortic-Valve','The aortic valve is seen from the left ventricle. The left ventricular outflow tract leads out of the left ventricle to the aortic valve. The three cusps of the aortic valve can be clearly seen here. ',0,1,0,0,0),(2187,'Heart0106','still','2012-01-12 22:31:18','2012-09-05 21:47:45','Heart0106-Perfusion-Fixed-Left-Ventricle-Apex','Showing a close view of the trabeculae carneae in the apex of the left ventricle                                          \n',0,1,0,0,0),(2188,'Heart0193','still','2012-01-12 22:31:18','2012-09-05 21:47:45','Heart0193-Perfusion-Fixed-Left-Ventricle-Apex','A view looking down into the apex of the left ventricle. Notice the complex network of trabeculations and conduction bands.\n',0,1,0,0,0),(2189,'Heart0195','still','2012-01-12 22:31:18','2012-09-05 21:47:45','Heart0195-Perfusion-Fixed-Left-Ventricle-Apex','The apex of the left ventricle is seen here. Trabeculations can be seen on all sides of the heart and almost seem to mimic a spider web. Also within these muscular bands are conduction bands which are the thin, white string connections that are seen within this image.\n',0,1,0,0,0),(2190,'Heart0198','still','2012-01-12 22:31:18','2012-09-05 21:47:45','Heart0198-Perfusion-Fixed-Left-Ventricle-Apex','A view of the apex of the left ventricle. Note the LV bands and trabeculations present.\n',0,1,0,0,0),(2191,'Heart0199','still','2012-01-12 22:31:18','2012-09-05 21:47:45','Heart0199-Perfusion-Fixed-Left-Ventricle-Apex','This is a view of the left ventricular apex. The trabeculae can be seen on all sides of the ventricle and portions spanning the ventricle as well. The smaller white connections are conduction bands that also are abundant within the ventricles. \n',0,1,0,0,0),(2192,'Heart0206','still','2012-01-12 22:31:18','2012-09-05 21:47:45','Heart0206-Perfusion-Fixed-Left-Ventricle-Apex','A view looking into the apex of the left ventricle that clearly demonstrates the high degree of networked trabeculations and conduction bands.',0,1,0,0,0),(2193,'Heart0106','still','2012-01-12 22:31:18','2012-09-05 21:47:45','Heart0106-Perfusion-Fixed-Left-Ventricle-Free-Wall','Shows the free wall of the left ventricle with trabeculae carneae and conduction bands.             \n',0,1,0,0,0),(2194,'Heart0193','still','2012-01-12 22:31:18','2012-09-05 21:47:45','Heart0193-Perfusion-Fixed-Left-Ventricle-Free-Wall','A closeup view of the highly trabeculated free wall of the left ventricle. A papillary muscle can be seen to the left and right.\n',0,1,0,0,0),(2195,'Heart0195','still','2012-01-12 22:31:18','2012-09-05 21:47:45','Heart0195-Perfusion-Fixed-Left-Ventricle-Free-Wall','Here the freewall of the left ventricle can be seen with two papillary muscles originating in the apex and extending towards the mitral valve which would be beyond the bottom of the image. \n',0,1,0,0,0),(2196,'Heart0197','still','2012-01-12 22:31:18','2012-09-05 21:47:45','Heart0197-Perfusion-Fixed-Left-Ventricle-Free-Wall','A view of the free wall of the left ventricle. Trebeculations and LV bands can be seen on the free wall. The camera is oriented such that the left atria is located past the bottom of the image.\n',0,1,0,0,0),(2197,'Heart0198','still','2012-01-12 22:31:18','2012-09-05 21:47:45','Heart0198-Perfusion-Fixed-Left-Ventricle-Free-Wall','A view of the free wall of the left ventricle. Trebeculations can be seen on this wall.\n',0,1,0,0,0),(2198,'Heart0199','still','2012-01-12 22:31:18','2012-09-05 21:47:45','Heart0199-Perfusion-Fixed-Left-Ventricle-Free-Wall','The free wall of the left ventricle is seen with its trabeculations and conduction bands across the entire wall. The papillary muscles can be seen on either side of the image as we look past them to see the free wall. \n',0,1,0,0,0),(2199,'Heart0206','still','2012-01-12 22:31:18','2012-09-05 21:47:45','Heart0206-Perfusion-Fixed-Left-Ventricle-Free-Wall','A closeup view of an anterior papillary muscle within the left ventricle looking toward the chamber free wall.',0,1,0,0,0),(2200,'Heart0106','still','2012-01-12 22:31:18','2012-09-05 21:47:45','Heart0106-Perfusion-Fixed-Left-Ventricle-Left-Ventricle-Bands','A clear view of a conduction band on the wall of the left ventricle.  These bands speed conduction and excitation of the myocardium to create a coordinated ventricular contraction.            \n',0,1,0,0,0),(2201,'Heart0193','still','2012-01-12 22:31:18','2012-09-05 21:47:45','Heart0193-Perfusion-Fixed-Left-Ventricle-Left-Ventricle-Bands','A closeup view of trabeculae within the left ventricle and a few conduction bands can be seen connecting adjoining trabeculae. These conduction bands help with electrical synchronicity of the heart.\n',0,1,0,0,0),(2202,'Heart0195','still','2012-01-12 22:31:18','2012-09-05 21:47:45','Heart0195-Perfusion-Fixed-Left-Ventricle-Left-Ventricle-Bands','Conduction bands within the left ventricle are seen here. They connet different trabeculae to one another and in some instances can conduct signals through them.\n',0,1,0,0,0),(2203,'Heart0197','still','2012-01-12 22:31:18','2012-09-05 21:47:45','Heart0197-Perfusion-Fixed-Left-Ventricle-Left-Ventricle-Bands','A view of conduction bands within the left ventricle.\n',0,1,0,0,0),(2204,'Heart0198','still','2012-01-12 22:31:18','2012-09-05 21:47:45','Heart0198-Perfusion-Fixed-Left-Ventricle-Left-Ventricle-Bands','A view of conduction bands within the left ventricle.\n',0,1,0,0,0),(2205,'Heart0199','still','2012-01-12 22:31:18','2012-09-05 21:47:45','Heart0199-Perfusion-Fixed-Left-Ventricle-Left-Ventricle-Bands','Here is seen some conduction bands within the left ventricle. These bands are integrated into the inner wall of the ventricle.\n',0,1,0,0,0),(2206,'Heart0206','still','2012-01-12 22:31:18','2012-09-05 21:47:45','Heart0206-Perfusion-Fixed-Left-Ventricle-Left-Ventricle-Bands','A closeup view of conduction bands within the left ventricle that aid in synchronized contraction of the entire chamber.',0,1,0,0,0),(2207,'Heart0106','still','2012-01-12 22:31:18','2012-12-27 16:34:34','Heart0106-Perfusion-Fixed-Left-Ventricle-Mitral-Valve','A view of the mitral valve from inside the left ventricle.  The leaflets of the mitral valve are open and the chordae tendinae can be seen hanging loosely from their edges.  As the valve closes the chordae tendinae will be drawn taunt to prevent valve prolapse during systole.                               \n',0,1,0,0,0),(2208,'Heart0193','still','2012-01-12 22:31:18','2012-09-05 21:47:45','Heart0193-Perfusion-Fixed-Left-Ventricle-Mitral-Valve','A closeup view of the mitral valve that clearly displays the manner in which chordae attach to the valve leaflets.\n',0,1,0,0,0),(2209,'Heart0195','still','2012-01-12 22:31:18','2012-09-05 21:47:45','Heart0195-Perfusion-Fixed-Left-Ventricle-Mitral-Valve','The mitral valve here shows the connection of the chordae tendineae to the valve leaflest. Numerous chordae are required per leaflet for proper function of the valve.\n',0,1,0,0,0),(2210,'Heart0196','still','2012-01-12 22:31:18','2012-09-05 21:47:45','Heart0196-Perfusion-Fixed-Left-Ventricle-Mitral-Valve','The open mitral valve is shown from the left ventricle.  The leaflets are against the muscle wall and cascade into the chordae tendinae\n',0,1,0,0,0),(2211,'Heart0197','still','2012-01-12 22:31:18','2012-09-05 21:47:45','Heart0197-Perfusion-Fixed-Left-Ventricle-Mitral-Valve','A view of the mitral valve from the left ventricle. The anterior papillary muscles can be seen on the right of the image and the posterior papillary muscles are on the left. The camera is oriented such that the left atrium is just beyond the bottom of the image.\n',0,1,0,0,0),(2212,'Heart0198','still','2012-01-12 22:31:18','2012-09-05 21:47:45','Heart0198-Perfusion-Fixed-Left-Ventricle-Mitral-Valve','A view of the mitral valve from below. Note that the camera is oriented so that the left atrium is located below the image.\n',0,1,0,0,0),(2213,'Heart0199','still','2012-01-12 22:31:18','2012-09-05 21:47:45','Heart0199-Perfusion-Fixed-Left-Ventricle-Mitral-Valve','Here the mitral valve is seen from the apex of the left ventricle. The way that the chordae tendineae attach to the valve leaflets can be seen. ',0,1,0,0,0),(2214,'Heart0106','still','2012-01-12 22:31:18','2012-09-05 21:47:45','Heart0106-Perfusion-Fixed-Left-Ventricle-Interventricular-Septum','Showing smooth muscle in the septal wall of the left ventricle.                    \n',0,1,0,0,0),(2215,'Heart0193','still','2012-01-12 22:31:18','2012-09-05 21:47:45','Heart0193-Perfusion-Fixed-Left-Ventricle-Interventricular-Septum','A view looking down along the spetal wall of the left ventricle. The apex is toward the top of the image and the trabeculation can be seen toward the top as well.\n',0,1,0,0,0),(2216,'Heart0195','still','2012-01-12 22:31:18','2012-09-05 21:47:45','Heart0195-Perfusion-Fixed-Left-Ventricle-Interventricular-Septum','Here can be seen the septal wall of the left ventricle. Note how smooth the wall is compare to the apex of the left ventricular apex. Even a portion of the free wall can be seen in this image on the right side, which is where a number of trabeculae can be visulized.\n',0,1,0,0,0),(2217,'Heart0197','still','2012-01-12 22:31:18','2012-09-05 21:47:45','Heart0197-Perfusion-Fixed-Left-Ventricle-Interventricular-Septum','A view of the interventricular wall from the left ventricle.\n',0,1,0,0,0),(2218,'Heart0198','still','2012-01-12 22:31:18','2012-09-05 21:47:45','Heart0198-Perfusion-Fixed-Left-Ventricle-Interventricular-Septum','A view of the septal wall of the left ventricle. Some trebeculations can be seen towards the top of the image.\n',0,1,0,0,0),(2219,'Heart0199','still','2012-01-12 22:31:18','2012-09-05 21:47:45','Heart0199-Perfusion-Fixed-Left-Ventricle-Interventricular-Septum','The septal wall of the left ventricle is seen here. The septal wall is generally less trabeculated than the free wall of the left ventricle. \n',0,1,0,0,0),(2220,'Heart0206','still','2012-01-12 22:31:18','2012-09-05 21:47:45','Heart0206-Perfusion-Fixed-Left-Ventricle-Interventricular-Septum','A close up of the left ventricular septal wall with trabeculations seen to the right.',0,1,0,0,0),(2221,'Heart0196','still','2012-01-12 22:31:19','2012-09-05 21:47:45','Heart0196-Perfusion-Fixed-Aorta-Aortic-Valve','Closed aortic valve from inside the aortic root.\n',0,1,0,0,0),(2222,'Heart0193','still','2012-01-12 22:31:19','2012-09-05 21:47:45','Heart0193-Perfusion-Fixed-Aorta-Aortic-Valve','A view looking down on to the aortic valve with the camera in the aorta.\n',0,1,0,0,0),(2223,'Heart0198','still','2012-01-12 22:31:19','2012-09-05 21:47:45','Heart0198-Perfusion-Fixed-Aorta-Aortic-Valve','A view of the aortic valve from above. So calcifications can be seen on the valve leaflets. The camera is positioned in the ascending aorta.\n',0,1,0,0,0),(2224,'Heart0199','still','2012-01-12 22:31:19','2012-09-05 21:47:45','Heart0199-Perfusion-Fixed-Aorta-Aortic-Valve','The aortic valve is seen from the aorta looking retrograde towards the heart. The leaflets look pliable and healthy. A coronary artery ostium is seen in the top right corner of the image\n',0,1,0,0,0),(2225,'Heart0206','still','2012-01-12 22:31:19','2012-09-05 21:47:45','Heart0206-Perfusion-Fixed-Aorta-Aortic-Valve','A closeup view of the aortic valve from the aortic root with all three cusps clearly visible. Notice that the valve itself is so thin that it is semi-transparent.',0,1,0,0,0),(2226,'Heart0106-Left','still','2012-01-12 22:31:19','2012-12-27 16:34:34','Heart0106-Perfusion-Fixed-Aorta-Left-Coronary-Artery-Ostia-1','Showing the left coronary artery ostium on the wall of the aortic root.  It sits within the left sinus of Valsalva with the sinutubular ridge underneath.  The aortic sinuses serves as a reservoir for the blood needed to feed the coronary arteries when the valve is closed during diastole.  \n',0,1,0,0,0),(2227,'Heart0193','still','2012-01-12 22:31:19','2012-09-05 21:47:45','Heart0193-Perfusion-Fixed-Aorta-Left-Coronary-Artery-Ostia','Close-up view of the left coronary artery ostium. The bifurcation of the left main into the left circumflex and left anterior descending can be seen. The aortic valve is toward the bottom of the image.\n',0,1,0,0,0),(2228,'Heart0195','still','2012-01-12 22:31:19','2012-09-05 21:47:45','Heart0195-Perfusion-Fixed-Aorta-Left-Coronary-Artery-Ostia','The left coronary ostium is seen in this image within the sinus of valsava next to the aortic valve. The valve commasures can be seen directly to the left and up from the ostium in this image. This is the location where the left coronary artery connects to the aorta to perfuse the left side of the heart. \n',0,1,0,0,0),(2229,'Heart0196','still','2012-01-12 22:31:19','2012-09-05 21:47:45','Heart0196-Perfusion-Fixed-Aorta-Left-Coronary-Artery-Ostia','The view from inside the aortic root shows the left coronary cusp of the aortic valve and the ostium to the left coronary artery.\n',0,1,0,0,0),(2230,'Heart0197','still','2012-01-12 22:31:19','2012-09-05 21:47:45','Heart0197-Perfusion-Fixed-Aorta-Left-Coronary-Artery-Ostia','A view of the left coronary artery ostium. The aortic valve is located to the upper right of the image.\n',0,1,0,0,0),(2231,'Heart0198','still','2012-01-12 22:31:19','2012-09-05 21:47:45','Heart0198-Perfusion-Fixed-Aorta-Left-Coronary-Artery-Ostia','A view of the left aortic coronary artery ostium. The aortic valve is located above the ostium in the image.\n',0,1,0,0,0),(2232,'Heart0199','still','2012-01-12 22:31:19','2012-09-05 21:47:45','Heart0199-Perfusion-Fixed-Aorta-Left-Coronary-Artery-Ostia','Left Coronary Artery Ostium is seen and the leaflets of the aortic valve is seen on the left side. This is where the left coronary artery attaches to the aorta to feed the heart.\n',0,1,0,0,0),(2233,'Heart0206-Left','still','2012-01-12 22:31:19','2012-12-27 16:29:53','Heart0206-Perfusion-Fixed-Aorta-Left-Coronary-Artery-Ostia','A closeup view of the left coronary artery ostium with the aortic valve left cusp towards the top of the photo.\n',0,1,0,0,0),(2234,'Heart0106-Right-1','still','2012-01-12 22:31:19','2012-12-27 16:34:34','Heart0106-Perfusion-Fixed-Aorta-Right-Coronary-Artery-Ostia-1','The right coronary artery ostium sits within the right sinus of Valsalva with the sinutubular ridge shown below it.  Blood pooling in the sinus will then travel through the right coronary artery to deliver oxygen to the myocardium.  \n',0,1,0,0,0),(2235,'Heart0106-Right-2','still','2012-01-12 22:31:19','2012-12-27 16:34:34','Heart0106-Perfusion-Fixed-Aorta-Right-Coronary-Artery-Ostia-2','The right coronary artery ostium within the right sinus of Valsalva.  \n',0,1,0,0,0),(2236,'Heart0193','still','2012-01-12 22:31:19','2012-09-05 21:47:45','Heart0193-Perfusion-Fixed-Aorta-Right-Coronary-Artery-Ostia','A view of the right coronary artery ositum with the right coronary cusp of the aortic valve towards the top of the image.\n',0,1,0,0,0),(2237,'Heart0195','still','2012-01-12 22:31:19','2012-09-05 21:47:45','Heart0195-Perfusion-Fixed-Aorta-Right-Coronary-Artery-Ostia','The right coronary artery ostium is seen here. This is where the right coronary artery attaches to the aorta to allow for blood flow to the right side of the heart.\n',0,1,0,0,0),(2238,'Heart0198','still','2012-01-12 22:31:19','2012-09-05 21:47:45','Heart0198-Perfusion-Fixed-Aorta-Right-Coronary-Artery-Ostia','A view of the right aortic coronary artery ostium.\n',0,1,0,0,0),(2239,'Heart0199','still','2012-01-12 22:31:19','2012-09-05 21:47:45','Heart0199-Perfusion-Fixed-Aorta-Right-Coronary-Artery-Ostia','The right coronary artery ostium is seen with the aortic valve leaflet seen  at  the top of the image. This is where the right coronary artery attaches to the aorta to feed the heart.\n',0,1,0,0,0),(2240,'Heart0206-Right','still','2012-01-12 22:31:19','2012-12-27 16:29:53','Heart0206-Perfusion-Fixed-Aorta-Right-Coronary-Artery-Ostia','An upclose view of the right coronary artery ostium.',0,1,0,0,0),(2241,'Heart0008','video','2012-01-23 20:33:03','2013-03-05 16:24:45','Heart0008-3D-Modeling-Cardiac-Veins','This is a heart with history of mild hypertrophy, and the enlarged shape expresses evidence of this condition.  The ALV is the only vein absent in this heart.  The AIV has 16 main branches, LLV has 2 main branches, PLV has 2 branches, PV has 2 branches, and PIV has 6 main branches.  See the Heart Database for further data.\n',1,0,1,0,0),(2242,'Heart0026','video','2012-01-23 20:33:04','2013-03-05 16:24:45','Heart0026-3D-Modeling-Cardiac-Veins','This is a heart with history of both hypertension and hypertrophy, which can be identified by the rounded curvature of the veins.  The AIV, LLV, 2 PVs, and PIV are present in this heart, and the ALV and PLV are absent.  On the lateral side of the left ventricle, one of the PVs is connected to the LLV.  The AIV has 3 main branches, LLV has 9 main branches, PV 1 has 5 branches, PV 2 has no branches, and PIV has 8 main branches.  See the Heart Database for further data.\n',1,0,1,0,0),(2243,'Heart0034','video','2012-01-23 20:33:04','2013-03-05 16:24:45','Heart0034-3D-Modeling-Cardiac-Veins','This is a heart with cardiac conditions that do not affect the venous anatomy.  The AIV, LLV, 2 PVs, and PIV are present in this heart, and the ALV and PLV are absent.  The AIV has 9 main branches, LLV has 9 branches, PV 1 has 2 branches, PV 2 has 1 branch, and PIV has 4 main branches.  See the Heart Database for further data.',1,0,1,0,0),(2244,'Pulmonary Artery Catheter','video','2012-07-16 05:00:00','2012-08-20 20:43:07','Swan-Ganz-Anatomy','The video shown here starts with the placement of a pulmonary artery catheter (also known as the Swan-Ganz catheter) in a patient in the operating suite. The video then transitions to footage within a reanimated human heart in the Visible Heart Laboratory.<p>\n\nThe pulmonary artery (PA) catheter is a highly useful multi-lumen, balloon tipped diagnostic catheter. The balloon on the tip helps to guide the catheter, acting as a sail in the flow of blood and also reduces injury to the tissue by acting as a cushion. PA catheters can measure pressures of the heart in multiple chambers of heart, cardiac output via thermodilution, and blood oxygen saturation or tissue oxygen saturation.<p>\n\nThe pressure monitoring of the catheter is of particular benefit due to the fact that multiple chambers can be monitored simultaneously. The right atrial, right ventricular, pulmonary artery, and indirect left atrial (wedge pressure) pressures can all be monitored. Due to the fact that there is a pressure lumen distal to the balloon on the tip of the catheter, the catheter can be wedged into a small pulmonary artery. When the balloon occludes the artery, the tip sensor is essentially detecting the pressure of the left atria because the lungs are a low resistance path of blood flow. This measurement is particularly useful in assessing fluid status, function of the right and left heart, or the presence of ventricular failure or pulmonary edema to guide therapeutic measures.<p>\n\nA similar video was published in 2012 in the American Journal of Respiratory and Critical Care Medicine titled The Path of a Pulmonary Artery Catheter Visualized through a Beating Human Heart.',0,0,1,0,0),(2245,'Heart0156','video','2012-07-18 16:31:28','2012-09-05 21:38:14','Heart0156-3D-Modeling-Blood-Volume-Pediatric','A 3D reconstruction of the blood volume from a specimen exhibiting the characteristics of a pediatric patient with mild dilated cariomyopathy.   It can be clearly seen that the blood volumes shown here exclude the papilary muscles and trabeculation.  The model is color coded for the blood flow through the heart showing the de-oxygenated blood in blue and the oxygenated blood in red.',0,0,1,0,0),(2246,'Heart0156-Tissue','video','2012-07-18 16:31:28','2012-09-05 21:37:45','Heart0156-3D-Modeling-Blood-Volume-Tissue-Pediatric','A 3D reconstruction of the whole heart displaying the blood volume of each chamber through the transparent model of the cardiac tissue. The specimen is surprisingly large for a pediatric patient of this age and although not diagnosed, the enlarged organ could also be the result of cardiomyopathy or a symptom of the patient\'s history of lung disease.',0,0,1,0,0),(2247,'Heart0156','video','2012-07-18 16:31:28','2012-09-05 21:39:25','Heart0156-3D-Modeling-Tissue-Pediatric','A 3D reconstruction of the cardiac tissue showing the whole heart. The heart is slightly enlarged for a pediatric patient of this age, potentially due to a history of pulmonary disease.  It should be noted that although this model does not differentiate between myocardial and adipose tissue the specimen displayed very little epicardial fat.',0,0,1,0,0),(2249,'Heart0062','video','2012-07-25 19:25:50','2012-09-05 21:38:14','Heart0062-3D-Modeling-Blood-Volume-Hypertrophic','A 3D reconstruction of the blood volume from a specimen exhibiting the characteristics of a patient with left ventricular hypertrophy. Note the small volume of the left ventricle in relation to the right ventricle. The model exemplifies the blood flow through the heart showing the de-oxygenated blood in blue and the oxygenated blood in red.',0,0,1,0,0),(2250,'Heart0062-Tissue','video','2012-07-25 19:25:50','2012-09-05 21:37:45','Heart0062-3D-Modeling-Blood-Volume-Tissue-Hypertrophic','A 3D reconstruction of the whole heart displaying the blood volume of each chamber through the transparent model of the cardiac tissue. This video exemplifies the small left ventricular chamber volume and large left ventricular wall thickness that characterizes the anatomical dimensions of a patient with ventricular hypertrophy.',0,0,1,0,0),(2251,'Heart0062-1','video','2012-07-25 19:25:50','2012-09-05 21:39:25','Heart0062-3D-Modeling-Tissue-Hypertrophic-1','A 3D reconstruction of the cardiac tissue showing the whole heart. This particular model has the superior section of the right atrium missing. ',0,0,1,0,0),(2252,'Heart0062-2','video','2012-07-25 19:25:50','2012-09-05 21:39:25','Heart0062-3D-Modeling-Tissue-Hypertrophic-2','A video showing the combined cardiac tissue and blood volume reconstructions.  The video exemplifies the blood flow through the heart showing the de-oxygenated blood in blue and the oxygenated blood in red.',0,0,1,0,0),(2253,'Heart0062-Hemi','video','2012-07-25 19:25:50','2012-09-05 21:41:15','Heart0062-3D-Modeling-Tissue-Hemi-Section-Hypertrophic','A 5 chamber hemi-section of the whole heart tissue model exemplifying the differences in the left and right ventricular wall thickness and chamber volumes. This view is similar to the images captured when recording echocardiographic images of the heart from the apical window.',0,0,1,0,0),(2254,'Heart0094','video','2012-07-25 20:29:21','2012-09-05 21:38:14','Heart0094-3D-Modeling-Blood-Volume-Normal','A 3D reconstruction of the blood volume from a specimen that displays a relatively normal blood volume to wall thickness ratio for both sides of the heart. The colors of the model exemplify the blood flow through the heart showing the de-oxygenated blood in blue and the oxygenated blood in red. Note the unique anatomy of the left atrial appendage.',0,0,1,0,0),(2255,'Heart0094-Tissue','video','2012-07-25 20:29:21','2012-09-05 21:37:45','Heart0094-3D-Modeling-Blood-Volume-Tissue-Normal','A 3D reconstruction of the whole heart displaying the blood volume of each chamber through the transparent model of the cardiac tissue.',0,0,1,0,0),(2256,'Heart0094-1','video','2012-07-25 20:29:21','2012-09-05 21:39:25','Heart0094-3D-Modeling-Tissue-Normal-1','A 3D reconstruction of the cardiac tissue showing the whole heart in an approximation of how the organ would be positioned in the body. Note the size and complex anatomical shape of the left atrial appendage. It should be noted that this model does not differentiate between myocardial and adipose tissue.',0,0,1,0,0),(2257,'Heart0094-2','video','2012-07-25 20:29:21','2012-09-05 21:39:25','Heart0094-3D-Modeling-Tissue-Normal-2','A video showing the combined cardiac tissue and blood volume reconstructions.  The video exemplifies the blood flow through the heart showing the de-oxygenated blood in blue and the oxygenated blood in red.',0,0,1,0,0),(2258,'Heart0094-Hemi','video','2012-07-25 20:29:21','2012-09-05 21:41:15','Heart0094-3D-Modeling-Tissue-Hemi-Section-Normal','A 5 chamber hemi-section of the whole heart tissue model exemplifying the ventricular wall thickness and chamber volumes. This view is similar to the images captured when recording echocardiographic images of the heart from the apical window. It should be noted that this model does not differentiate between myocardial and adipose tissue.',0,0,1,0,0),(2259,'Heart0142','video','2012-07-25 20:49:40','2012-09-05 21:38:14','Heart0142-3D-Modeling-Blood-Volume-Dilated-Cardiomyopathy','A 3D reconstruction of the blood volume from a specimen exhibiting the characteristics of a patient with dilated cariomyopathy. Note the comparatively large volume of the ventricles and atria and the more rounded shape to the left ventricular apex. The model exemplifies the blood flow through the heart showing the de-oxygenated blood in blue and the oxygenated blood in red.',0,0,1,0,0),(2260,'Heart0142-Tissue','video','2012-07-25 20:49:40','2012-09-05 21:37:45','Heart0142-3D-Modeling-Blood-Volume-Tissue-Dilated-Cardiomyopathy','A 3D reconstruction of the whole heart displaying the blood volume of each chamber through the transparent model of the cardiac tissue. This video exemplifies the large ventricular chamber volumes and relatively small wall thickness that characterizes the anatomical dimensions of a patient with dilated cardiomyopathy.',0,0,1,0,0),(2261,'Heart0142-1','video','2012-07-25 20:49:40','2012-09-05 21:39:25','Heart0142-3D-Modeling-Tissue-Dilated-Cardiomyopathy-1','A 3D reconstruction of the cardiac tissue showing the whole heart. It should be noted that this model does not differentiate between myocardial and adipose tissue.',0,0,1,0,0),(2262,'Heart0142-2','video','2012-07-25 20:49:40','2012-09-05 21:39:25','Heart0142-3D-Modeling-Tissue-Dilated-Cardiomyopathy-2','A video showing the combined cardiac tissue and blood volume reconstructions.  The video exemplifies the blood flow through the heart showing the de-oxygenated blood in blue and the oxygenated blood in red. It should be noted that this model does not differentiate between myocardial and adipose tissue.',0,0,1,0,0),(2263,'Heart0142-Hemi','video','2012-07-25 20:49:40','2012-09-05 21:41:15','Heart0142-3D-Modeling-Tissue-Hemi-Section-Dilated-Cardiomyopathy','A 5 chamber hemi-section of the whole heart tissue model exemplifying the thin walls of a dilated cardiomyopathy patient. This view is similar to the images captured when recording echocardiographic images of the heart from the apical window.',0,0,1,0,0),(2264,'Heart0059','video','2012-07-26 20:19:28','2012-09-05 21:38:14','Heart0059-3D-Modeling-Blood-Volume-Hypertrophic','A 3D reconstruction of the blood volume from a specimen exhibiting the characteristics of a patient with left ventricular hypertrophy. Note the small volume of the left ventricle in relation to the right ventricle and the constricted right ventricular outflow tract. The model exemplifies the blood flow through the heart showing the de-oxygenated blood in blue and the oxygenated blood in red.',0,0,1,0,0),(2265,'Heart0059-Tissue','video','2012-07-26 20:19:28','2012-09-05 21:37:45','Heart0059-3D-Modeling-Blood-Volume-Tissue-Hypertrophic','A 3D reconstruction of the whole heart displaying the blood volume of each chamber through the transparent model of the myocardial tissue and epicardial adipose tissue. This video exemplifies the small left ventricular chamber volume and large left ventricular wall thickness that characterizes the anatomical dimensions of a patient with ventricular hypertrophy.  Note the increased wall thickness of the right ventricular outflow tract causing constriction of the infundibulum.',0,0,1,0,0),(2266,'Heart0059-1','video','2012-07-26 20:19:28','2012-09-05 21:39:25','Heart0059-3D-Modeling-Tissue-Hypertrophic-1','A 3D reconstruction of the myocardial and epicardial adipose tissue of the heart. The video exhibits how the adipose tissue acts as a protective layer by concentrating within the sulci between the chambers and cover the major arteries and veins of the heart.',0,0,1,0,0),(2267,'Heart0059-2','video','2012-07-26 20:19:28','2012-09-05 21:39:25','Heart0059-3D-Modeling-Tissue-Hypertrophic-2','A video showing the reconstructed cardiac tissue and blood volumes together.  The video exemplifies the blood flow through the heart showing the de-oxygenated blood in blue and the oxygenated blood in red.',0,0,1,0,0),(2268,'Heart0216-AV-1','video','2012-08-09 23:36:04','2012-09-07 20:59:13','Heart0216-Functional-Comparative-Imaging-Aortic-Valve-1','The aortic valve being simultaneously imaged from:<br>-The aorta with a videoscope (top left),<br>-The left ventricle with a videoscope (top right),<br>-On ultasound using a transducer placed epicardially (bottom left),<br>-On fluoroscopy in the anterior/posterior position (bottom right).',0,0,1,0,0),(2269,'Heart0216-AV-2','video','2012-08-09 23:36:04','2012-09-07 20:59:13','Heart0216-Functional-Comparative-Imaging-Aortic-Valve-2','A pigtail catheter is placed distal to the aortic valve in the aorta and allows for one to see the level of the valve on fluoroscopy. The aortic valve being simultaneously imaged from:<br>-The aorta with a videoscope (top left),<br>-The left ventricle with a videoscope (top right),<br>-On ultasound using a transducer placed epicardially (bottom left),<br>-On fluoroscopy in the anterior/posterior position (bottom right).',0,0,1,0,0),(2270,'Heart0216-AV-Contrast','video','2012-08-09 23:36:04','2012-09-07 21:07:27','Heart0216-Functional-Comparative-Imaging-Aortic-Valve-Contrast','A pigtail catheter is placed distal to the aortic valve in the aorta and contrast is then injected through the catheter. This clearly shows the aortic root and coronary arteries on fluoroscopy. The aortic valve being simultaneously imaged from:<br>-The aorta with a videoscope (top left),<br>-The left ventricle with a videoscope (top right),<br>-On ultasound using a transducer placed epicardially (bottom left),<br>-On fluoroscopy in the anterior/posterior position (bottom right).',0,0,1,0,0),(2271,'Heart0216-MV','video','2012-08-09 23:36:04','2012-09-07 20:58:53','Heart0216-Functional-Comparative-Imaging-Mitral-Valve','The mitral valve being simultaneously imaged from:<br>-The left atria with a videoscope (top left),<br>-The left ventricle with a videoscope (top right),<br>-On ultasound using a transducer placed epicardially (bottom left),<br>-On fluoroscopy in the anterior/posterior position (bottom right).',0,0,1,0,0),(2273,'Heart0216-PV','video','2012-08-09 23:36:04','2012-12-13 23:00:58','Heart0216-Functional-Comparative-Imaging-Pulmonary-Valve','The pulmonary valve being simultaneously imaged from:<br>-The pulmonary artery with a videoscope (top left),<br>-The right ventricle with a videoscope looking at the right ventricular outflow tract (top right),<br>-On ultasound using a transducer placed epicardially (bottom left),<br>-On fluoroscopy in the anterior/posterior position (bottom right).',0,0,1,0,0),(2274,'Heart0216-TriV-1','video','2012-08-09 23:36:04','2012-09-07 21:01:19','Heart0216-Functional-Comparative-Imaging-Tricuspid-Valve-1','The tricuspid valve being simultaneously imaged from:<br>-The right atria with a videoscope (top left),<br>-The right ventricle with a videoscope using a right angle lens (top right),<br>-On ultasound using a transducer placed epicardially (bottom left),<br>-On fluoroscopy in the anterior/posterior position (bottom right).',0,0,1,0,0),(2275,'Heart0216-TriV-2','video','2012-08-09 23:36:04','2012-09-07 21:01:19','Heart0216-Functional-Comparative-Imaging-Tricuspid-Valve-2','The tricuspid valve being simultaneously imaged from:<br>-The right atria with a videoscope (top left),<br>-The right ventricle with a videoscope (top right),<br>-On ultasound using a transducer placed epicardially (bottom left),<br>-On fluoroscopy in the anterior/posterior position (bottom right).',0,0,1,0,0),(2276,'Provisional Stenting-1','video','2012-08-15 15:53:11','2013-10-03 17:36:31','provisional-stenting-1','Provisional stenting is the generally accepted technique for treatment of bifurcations.   In the video, a stent is used to simulate the provisional technique in treating a bifurcation in a coronary artery.  The main branch is stented first, with the stent deployed to a diameter matching the distal side of the target vessel.  This was then followed by a Proximal Optimization Technique (POT), which addresses the malapposition of stent struts resulting from sizing the stent using the distal side of the target vessel.  Lastly, the use of a final Kissing Balloon Technique (KBT), in which two balloons are simultaneously deployed into the main branch and side branch, is used in order to restore patency to the jailed side branch and obtain better strut apposition at the bifurcation.',0,0,1,0,0),(2277,'Heart0073','video','2012-09-06 20:52:59','2012-09-06 21:00:38','Heart0073-3D-Modeling-Blood-Volume-Pediatric','A 3D reconstruction of the blood volume from a specimen from a healthy pediatric patient.  Blood volumes here exclude the papilary muscles and trabeculation and are color coded for the blood flow through the heart showing the de-oxygenated blood in blue and the oxygenated blood in red.',0,0,1,0,0),(2278,'Heart0073-Tissue','video','2012-09-06 20:53:00','2012-09-06 21:00:38','Heart0073-3D-Modeling-Blood-Volume-Tissue-Pediatric','A 3D reconstruction of the whole heart displaying the blood volume of each chamber through the transparent model of the cardiac tissue.  This specimen was reanimated using Visible Heart methodologies and hence displays a slightly hypertrophic blood volume to muscle wall thickness ratio for a pediatric patient.  It should be noted that the obviously tortuous segment of the Aorta is an artifact of the fixation process and interference with the Pulmonary Trunk whose volume is not displayed.',0,0,1,0,0),(2279,'Heart0073-1','video','2012-09-06 20:53:00','2012-09-06 21:00:38','Heart0073-3D-Modeling-Tissue-Pediatric-1','A 3D reconstruction of the cardiac tissue showing the whole heart.  The specimen has a large section missing from the inferior part of the right atrium due to removal of the IVC. Although the model does not differentiate between the adipose and myocardial tissue it should be noted that the specimen exhibits miniimal epicardial fat.',0,0,1,0,0),(2280,'Heart0073-2','video','2012-09-06 20:53:00','2012-09-06 21:00:38','Heart0073-3D-Modeling-Tissue-Pediatric-2','A 3D reconstruction of the cardiac tissue showing the whole heart.  The specimen has a large section missing from the inferior part of the right atrium due to removal of the IVC. Although the model does not differentiate between the adipose and myocardial tissue it should be noted that the specimen exhibits miniimal epicardial fat.',0,0,1,0,0),(2281,'Heart0019','video','2012-09-19 21:08:49','2012-09-19 21:12:07','Heart0019-3D-Modeling-Coronary-Arteries','This is a heart with history of aortic plaques, located near the aortic branches and arch. The Cx has six marginal branches and RCA has three main branches. The LAD branches from the LCA and is present; however, it descends shorter than typical. See the Heart Database for further data.',1,0,1,0,0),(2282,'Heart0022','video','2012-09-19 21:08:49','2012-09-19 21:12:07','Heart0022-3D-Modeling-Coronary-Arteries','This is a heart with no known cardiac conditions. All cardiac arteries are present. The RCA has 5 main branches, LAD has one main branch, and Cx has one main branch. See the Heart Database for further data.',1,0,1,0,0),(2283,'Heart0035','video','2012-09-19 21:08:49','2012-09-19 21:12:07','Heart0035-3D-Modeling-Coronary-Arteries','This is a heart with no known cardiac conditions. All cardiac arteries are present. The LAD has four main branches, Cx has no branches, LCA has one main branch, and RCA has also one main branch. See the Heart Database for further data.',1,0,1,0,0),(2284,'Heart0036','video','2012-09-19 21:08:49','2012-09-19 21:12:07','Heart0036-3D-Modeling-Coronary-Arteries','This is a heart with no known cardiac conditions. All cardiac arteries are present. The RCA has two main branches, LAD has four branches, Cx has two branches, and the LCA is branchless. See the Heart Database for further data.',1,0,1,0,0),(2285,'Heart0049','video','2012-09-19 21:08:49','2012-09-19 21:12:07','Heart0049-3D-Modeling-Coronary-Arteries','This is a heart with history of malignant hypertension, which can be identified by the round curvature of the larger arteries. All cardiac arteries are present. The RCA has five main branches, LAD has six main four main branches, and both Cx and LCA has one branch each. See the Heart Database for further data.',1,0,1,0,0),(2286,'Heart0055','video','2012-0