n cardiac conditions. All arteries are present. The RCA has three main branches, LAD has one branch, Cx has one main branch, and LCA is branchless. See the Heart Database for further data.',1,0,1,0,0),(2292,'Heart0069','video','2012-09-19 21:08:49','2012-09-19 21:12:07','Heart0069-3D-Modeling-Coronary-Arteries','This is a heart with no known cardiac conditions. All arteries are present. The RCA has three main branches, LAD has two main branches, Cx has three main branches, and LCA has one branch. See the Heart Database for further data.',1,0,1,0,0),(2293,'Heart0088','video','2012-09-19 21:08:49','2012-09-19 21:12:07','Heart0088-3D-Modeling-Coronary-Arteries','This is a heart with medical history not affecting its cardiac anatomy. All arteries are present. The RCA has nine branches, LAD has two branches, Cx has three main branches, and LCA is branchless. See the Heart Database for further data.',1,0,1,0,0),(2294,'Heart0097','video','2012-09-19 21:08:49','2012-09-19 21:12:07','Heart0097-3D-Modeling-Coronary-Arteries','This is a heart with medical history of hypertension. The RCA has five branches, the LAD has five branches, and Cx has two main branches. The LCA is branches. See the Heart Database for further data.',1,0,1,0,0),(2295,'Heart0099','video','2012-09-19 21:08:49','2012-09-19 21:12:07','Heart0099-3D-Modeling-Coronary-Arteries','This is a heart with medical history of hypertension, which is identifiable by the round curvature and abnormality of the arteries.  All arteries are present. The RCA has two main branches, LAD has four branches, Cx has one main branch, and the LCA is branchless. See the Heart Database for further data.',1,0,1,0,0),(2296,'Heart0102','video','2012-09-19 21:08:49','2012-09-19 21:12:07','Heart0102-3D-Modeling-Coronary-Arteries','This is a heart with no known cardiac conditions. All major arteries are present. The RCA has three main branches, LAD has four branches, Cx has three branches, and LCA has two branches. See the Heart Database for