rdisBx Velocity Rx balloon expandable stent was advanced over a guidewire to the desired position within the LAD. The balloon was inflated to the manufacturers recommended pressure and then deflated. The catheter was then withdrawn and the fiberscope, which was positioned distal to the stent, was advanced retrograde through the expanded stent for inspection. This video and description can be found in Eggum JH, Howard SA, Goff RP, & Iaizzo PA. Imaging of a Coronary Artery Stent Implantation Within an Isolated Human Heart. J Cardiovasc Transl Res. 2012 Feb; 5(1):73-4.',0,0,1,0,0),(2346,'Heart0216-1','video','2012-10-31 14:42:03','2012-10-31 17:31:00','Heart0216-Functional-Aorta-Aortic-Valve-1','View of the aortic valve cusps panning from the right, to left, to non coronary cusp, and ending back on the right coronary cusp.',0,1,1,0,0),(2347,'Heart0216-2','video','2012-10-31 14:42:03','2012-10-31 17:31:00','Heart0216-Functional-Aorta-Aortic-Valve-2','View of the non-coronary cusp from the aorta distal the the valve.',0,1,1,0,0),(2348,'Heart0216-Left','video','2012-10-31 14:42:03','2012-10-31 17:31:00','Heart0216-Functional-Aorta-Left-Coronary-Artery-Ostia','View of the left coronary ostia. The aortic valve is toward the top of the screen.',0,1,1,0,0),(2349,'Heart0216-Right','video','2012-10-31 14:42:03','2012-10-31 17:31:00','Heart0216-Functional-Aorta-Right-Coronary-Artery-Ostia','View of the left coronary ostia. The aortic valve is seen on the top left of the screen.',0,1,1,0,0),(2350,'Heart0216-1','video','2012-10-31 14:42:03','2012-10-31 17:31:00','Heart0216-Functional-External-Anterior-1','External anterior view of the heart. Note the very large aorta.',0,1,1,0,0),(2351,'Heart0216-2','video','2012-10-31 14:42:03','2012-10-31 17:31:00','Heart0216-Functional-External-Anterior-2','External anterior view of the heart with a videoscope in the very large aorta providing back lighting.',0,1,1,0,0),(2352,'Heart0216-Temporary','video','2012-10-31 14:42:03','2012-10-31 17:31:00','Heart0216-Functional-External-Anterior-Temporary-Pacing-Lead','External anterior view of the heart during insertion of a temporary pacing lead. Note that as soon as the lead electrode contacts the tissue the heart begins beating from the pacing stimulus.',0,1,1,0,0),(2353,'Heart0216','video','2012-10-31 14:42:03','2012-10-31 17:31:00','Heart0216-Functional-External-Left-Margin','External left anterior oblique view with clear view of the enlarged aorta being backlit by an inernal videoscope.',0,1,1,0,0),(2354,'Heart0216','video','2012-10-31 14:42:03','2012-10-31 17:31:00','Heart0216-Functional-External-Right-Margin','External right anterior oblique view with clear view of the enlarged aorta being backlit by an inernal videoscope.',0,1,1,0,0),(2355,'Heart0216-1','video','2012-10-31 14:42:03','2014-07-24 18:21:52','Heart0216-Functional-Left-Atrium-Fossa-Ovalis-Transeptal-Puncture-1','A view of the fossa ovalis from the left atria while being backlit from the right atria. One can see by backlighting how thin this structure is. Note that this heart has a double transeptal puncture from a previously performed ablation. ',0,1,1,0,0),(2356,'Heart0216-2','video','2012-10-31 14:42:03','2014-07-24 18:21:52','Heart0216-Functional-Left-Atrium-Fossa-Ovalis-Transeptal-Puncture-2','A view of the fossa ovalis from the left atria. Note that this heart has and iatrogenic atrial septal defect from a double transeptal puncture from a previously performed ablation procedure. The right inferior pulmonary vein can be seen just out of view toward the top right.',0,1,1,0,0),(2357,'Heart0216','video','2012-10-31 14:42:04','2012-10-31 17:31:00','Heart0216-Functional-Left-Atrium-Left-Atrial-Appendage','Internal view of the left atrial appendage. Note the pectinate muscles of the endocardial surface of the appendage.',0,1,1,0,0),(2358,'Heart0216','video','2012-10-31 14:42:04','2012-10-31 17:31:00','Heart0216-Functional-Left-Atrium-Mitral-Valve','Mitral valve as seen from the left atrium, with the anterior leaflet toward the left of the screen.',0,1,1,0,0),(2359,'Heart0216','video','2012-10-31 14:42:04','2012-10-31 17:31:00','Heart0216-Functional-Left-Atrium-Pulmonary-Vein-Ostia-Catheter','A view from the left atria of an electrophysiologic catheter being introduced through an iatrogenic atrial septal defect from a double transseptal puncture that was performed during an ablation treatment. The right pulmonary veins are seen to the right of the screen with the superior vein toward the top.',0,1,1,0,0),(2360,'Heart0216','video','2012-10-31 14:42:04','2012-10-31 17:31:00','Heart0216-Functional-Left-Atrium-Pulmonary-Vein-Ostia-Transeptal-Puncture','A view from the left atria showing the fossa ovalis with a double transseptal puncture that was performed during an ablation treatment. The right pulmonary veins are seen to the right of the screen with the superior vein toward the top.',0,1,1,0,0),(2361,'Heart0216','video','2012-10-31 14:42:04','2012-10-31 17:31:00','Heart0216-Functional-Left-Ventricle-Apex','View of apex of the left ventricle showing the trabeculations and conduction bands.',0,1,1,0,0),(2362,'Heart0216-PM','video','2012-10-31 14:42:04','2012-10-31 17:31:00','Heart0216-Functional-Left-Ventricle-Apex-Papillary-Muscle','A view showing the papillary muscles of the mitral valve with the camera through the aortic valve. The anterior papillary complex is toward the right of the screen and the posterior papillary complex is toward the left.',0,1,1,0,0),(2363,'Heart0216-Posterior','video','2012-10-31 14:42:04','2012-10-31 17:31:01','Heart0216-Functional-Left-Ventricle-Posterior-Papillary-Muscle','A view of the posterior papillary muscle complex from a camera positioned through the mitral valve.',0,1,1,0,0),(2364,'Heart0216','video','2012-10-31 14:42:04','2012-10-31 17:31:01','Heart0216-Functional-Pulmonary-Artery-Pulmonary-Valve','The pulmonary valve seen from the pulmonary artery.',0,1,1,0,0),(2365,'Heart0216','video','2012-10-31 14:42:04','2012-10-