ng echocardiography (bottom left)<br>-using fluoroscopy (bottom right).<br>Note that the view of the valve from below is obscured by a papillary muscle.',0,0,1,0,0),(3279,'Heart0268-MV','video','2013-03-05 23:04:10','2013-03-05 23:08:55','Heart0268-Functional-Comparative-Imaging-Mitral-Valve','A quad split view of a functioning mitral valve imaged simultaneously from the:<br>-left atrium using an endoscope (top left),<br>-left ventricle using an endoscope (top right),<br>-using echocardiography (bottom left)<br>-using fluoroscopy (bottom right).<br>Note that the view of the valve from below also shows of the aortic valve to left of the mitral valve.',0,0,1,0,0),(3280,'Heart0268-AV','video','2013-03-05 23:04:10','2013-03-05 23:08:55','Heart0268-Functional-Comparative-Imaging-Aortic-Valve','A quad split view of a functioning aortic valve imaged simultaneously from the:<br>-ascending aorta using an endoscope (top left),<br>-left ventricle using an endoscope (top right),<br>-using echocardiography (bottom left)<br>-using fluoroscopy (bottom right).<br>A pigtail catheter is placed in the ascending aorta. A few seconds into the video, contrast is injected through the catheter. This visualizes the aorta on fluoroscopy, but blurs the endoscopic views from above and below.',0,0,1,0,0),(3281,'Heart0102','video','2013-03-19 17:48:45','2013-05-07 18:09:52','Heart0102-Perfusion-Fixed-Cardiac-Veins-Venogram','A venogram of human heart 102. A venogram balloon catheter is placed in the coronary sinus. A blue contrast dye is injected into the coronary venous system. The video displays external and fluoroscopic views of the veins. The view begins with an anterior view pans to the left, posterior, right and back to anterior. As the video plays, there is some contrast leakage in the right ventricle seen on fluoroscopy.',0,0,1,0,0),(3282,'Heart0109','video','2013-03-19 17:48:45','2013-05-07 18:09:52','Heart0109-Perfusion-Fixed-Cardiac-Veins-Venogram','A venogram of human heart 109. Two venogram balloon catheters are placed in the coronary sinus and posterior interventricular vein. A blue contrast dye is injected into the coronary venous system. The video displays external and fluoroscopic views of the veins. The view begins with an anterior view pans to the left, posterior, right and back to anterior. In this specimen, many of the right sided anterior veins have collateralization with the posterior internventricular vein.',0,0,1,0,0),(3283,'Heart0111','video','2013-03-19 17:48:45','2013-05-07 18:09:52','Heart0111-Perfusion-Fixed-Cardiac-Veins-Venogram','A venogram of human heart 111. A venogram balloon catheter is placed in the coronary sinus. A blue contrast dye is injected into the coronary venous system. The video displays external and fluoroscopic views of the veins. The view begins with an anterior view pans to the left, posterior, right and back to anterior. The dye is injected more slowly due to air bubble blockages. The anterior interventricular vein is difficult to see on the external view due to a large amount of adipose tissue.',0,0,1,0,0),(3284,'Heart0118','video','2013-03-19 17:48:45','2013-05-07 18:09:52','Heart0118-Perfusion-Fixed-Cardiac-Veins-Venogram','A venogram of human heart 118. A venogram balloon catheter is placed in the coronary sinus. A blue contrast dye is injected into the coronary venous system. The video displays external and fluoroscopic views of the veins. The view begins with an antero-lateral view and pans to the left, posterior, right and back to anterior. There is collateralization between the right marginal vein and mid-posterior interventricular vein. Some pooling of the constrast can be seen in the right ventricle on fluoroscopy.',0,0,1,0,0),(3285,'Heart0132','video','2013-03-20 20:14:51','2013-05-07 18:09:52','Heart0132-Perfusion-Fixed-Cardiac-Veins-Venogram','A venogram of human heart 132. A venogram balloon catheter is placed in the coronary sinus. A blue contrast dye is injected into the coronary venous system. The video displays external and fluoroscopic views of the veins. The view begins with a posterior view. Unlike the rest of the great cardiac veins, the posterior interventricular vein is filled antegrade by the dye. The heart is rotated from the posterior view to the right to the anterior to the left and back to the original view.',0,0,1,0,0),(3286,'Heart0136','video','2013-03-20 20:14:51','2013-05-07 18:09:52','Heart0136-Perfusion-Fixed-Cardiac-Veins-Venogram','A venogram of human heart 136. A venogram balloon catheter is placed in the coronary sinus. A blue contrast dye is injected into the coronary venous system. The video displays external and fluoroscopic views of the veins. The view begins with a left lateral view and rotates to the posterior side of the specimen. The posterior interventricular vein is filled antegrade half-way. The specimen continues to rotate to its right and anterior side.',0,0,1,0,0),(3287,'Heart0134','video','2013-03-20 20:14:51','2013-05-07 18:09:52','Heart0134-Perfusion-Fixed-Cardiac-Veins-Venogram','A venogram of human heart 134. A venogram balloon catheter is placed in the coronary sinus. A blue contrast dye is injected into the coronary venous system. The video displays external and fluoroscopic views of the veins. The view begins with a right lateral view and rotates to the anterior side of the specimen. Some of the anterior interventricular vein and great cardiac vein are covered by adispose tissure in the external view. The specimen continues to rotate, which provides a good view of the coronary veins on the left ventricle.',0,0,1,0,0),(3288,'Heart0146','video','2013-03-20 20:14:51','2013-05-07 18:09:52','Heart0146-Perfusion-Fixed-Cardiac-Veins-Venogram','A venogram of human heart 146. A venogram balloon catheter is placed in the coronary sinus. A blue contrast dye is injected into the coronary venous system. The video displays external and fluoroscopic views of the veins. The view begins with a postero-lateral view and rotates to the posteior side of the specimen. The posterior/inferior vein of the left ventricle and the posterior interventricular vein fill immediately. The heart does a 360 rotation and ends with good posterior view of the coronary veins.',0,0,1,0,0),(3289,'Heart0138','video','2013-03-20 20:14:51','2013-05-07 18:09:52','Heart0138-Perfusion-Fixed-Cardiac-Veins-Venogram','A venogram of human heart 138. A venogram balloon catheter is placed in the coronary sinus. A blue contrast dye is injected into the coronary venous system. The video displays external and fluoroscopic views of the veins. The view begins with a left lateral view and rotates to the posteior side of the specimen. The left lateral vein fills immediately and the posterior interventricular vein is slowly filled antegrade. The heart does a 360 rotation and ends with good view of the left lateral vein.',0,0,1,0,0),(3290,'Heart0126','video','2013-05-07 18:08:36','2013-05-07 18:10:14','Heart0126-Perfusion-Fixed-Cardiac-Veins-Venogram','A venogram of human heart 126. A venogram balloon catheter is placed in the coronary sinus. A blue contrast dye is injected into the coronary venous system. The video displays external and fluoroscopic views of the veins. The view begins with an anterior view and rotates to the left side of the specimen, provides a nice view of the 2 major left lateral veins. The view continues to rotate to the posterior side of the specimen where the posterior/inferior vein of the left ventricle and the posterior internventricular vein are slowly filling antegrade. On the right side, several anterior veins are filled antegrade from collateralizations from the great cardiac veins.',0,0,1,0,0),(3291,'Heart0139','video','2013-05-07 18:08:36','2013-05-07 18:10:14','Heart0139-Perfusion-Fixed-Cardiac-Veins-Venogram','A venogram of human heart 139. A venogram balloon catheter is placed in the coronary sinus. A blue contrast dye is injected into the coronary venous system. The video displays external and fluoroscopic views of the veins. The view begins with a left lateral view where two left lateral veins are filled with the dye. The view continues to rotate to the posterior side of the specimen where the posterior internventricular vein is filling antegrade.',0,0,1,0,0),(3292,'Heart0098','video','2013-05-07 18:08:36','2013-05-07 18:10:14','Heart0098-Perfusion-Fixed-Cardiac-Veins-Venogram','A venogram of human heart 98. A venogram balloon catheter is placed in the coronary sinus. A blue contrast dye is injected into the coronary venous system. The video displays external and fluoroscopic views of the veins. The view begins with a antero-lateral view and rotates posteriorly, which provides a good view of the posterior/inferior vein of the left ventricle and the posterior interventricular. The small cardiac vein is quite large on this specimen and can also be seen wrapping around the right atrioventricular groove.',0,0,1,0,0),(3293,'Heart0128','video','2013-05-07 18:08:36','2013-05-07 18:10:14','Heart0128-Perfusion-Fixed-Cardiac-Veins-Venogram','A venogram of human heart 128. A venogram balloon catheter is placed in the coronary sinus. A blue contrast dye is injected into the coronary venous system. The video displays external and fluoroscopic views of the veins. The view begins with a antero-lateral view, which provides a good view of a large antero-lateral vein that fills immediately. As the heart rotates posteriorly, the posterior/inferior vein of the left ventricle and posterior interventricular vein fill antegrade. The veins on the left side are well visualized considering the large amount of adipose tissue.',0,0,1,0,0),(3294,'Heart0127','video','2013-05-07 18:08:36','2013-05-07 18:10:14','Heart0127-Perfusion-Fixed-Cardiac-Veins-Venogram','A venogram of human heart 127. A venogram balloon catheter is placed in the coronary sinus. A blue contrast dye is injected into the coronary venous system. The video displays external and fluoroscopic views of the veins. The view begins with a lateral view, which provides a good view of a left lateral vein that fills immediately. As the heart rotates posteriorly, the posterior/inferior vein of the left ventricle and posterior interventricular vein fill antegrade.',0,0,1,0,0),(3295,'Heart0140','video','2013-05-07 18:08:36','2013-05-07 18:10:14','Heart0140-Perfusion-Fixed-Cardiac-Veins-Venogram','A venogram of human heart 140. A venogram balloon catheter is placed in the coronary sinus. A blue contrast dye is injected into the coronary venous system. The video displays external and fluoroscopic views of the veins. The view begins with a posterior view, where the CS and left lateral veins fill immediately. As the heart rotates posteriorly, the posterior interventricular vein fills antegrade. The specimen continues to rotate to the anterior side, which provides of view of a particularly tortuous antero-lateral vein.',0,0,1,0,0),(3296,'Heart0111','video','2013-05-09 20:37:40','2013-05-09 21:12:17','Heart0111-3D-Modeling-Cardiac-Veins','This is a heart with no known cardiac conditions. The AIV, LLV, PLV, PVLV, and PIV are all present in this heart. The ALV is the only vein absent in this heart. The AIV has 9 branches. There are 3 main LLVs: one has no branches, one has 2 branches, and the third has 2 branches. The PLV has 4 branches. The PVLV has 11 branches. The PIV has 12 branches and is connected to the AIV. See the Heart Database for further data.',1,0,1,0,0),(3297,'Heart0112','video','2013-05-09 20:37:40','2013-05-09 21:12:17','Heart0112-3D-Modeling-Cardiac-Veins','This is a heart with a history of unrelated cardiac conditions, including myocardial infarction and atherosclerotic heart disease. The ALV and PVLV are absent in this heart. The AIV, LLV, PLV, and PIV are all present. The AIV has 20 branches. The LLV has 3 branches and is connected to the PLV. The PLV has 3 branches and is connected to both the LLV and PIV. The PIV has 8 branches. See the Heart Database for further data.',1,