on-Fixed-Right-Atrium-Fossa-Ovalis','View of the fossa ovalis along the interatrial septum as seen from inside the chamber of the right atrium. ',0,1,0,0,0),(3400,'Heart0054','still','2013-08-26 19:51:36','2013-08-27 14:55:46','Heart0054-Perfusion-Fixed-Right-Atrium-Tricuspid-Valve','View of the tricuspid valve from within the right atrium. The three leaflets are more difficult to differentiate in this specimen.',0,1,0,0,0),(3401,'Heart0054','still','2013-08-26 19:51:36','2013-08-27 14:55:46','Heart0054-Perfusion-Fixed-Right-Ventricle-Apex','View looking into the apex of the right ventricle with labeled papillary muscles and associated chordae tendineae. Conduction bands are also seen amongst the trabeculae carneae. ',0,1,0,0,0),(3402,'Heart0054','still','2013-08-26 19:51:36','2013-08-27 14:55:46','Heart0054-Perfusion-Fixed-Right-Ventricle-Inflow-Tract','View of the right ventricle inflow tract from within the right ventricle. The tricuspid valve can be seen as well as the papillary muscles and associated chordae tendineae. ',0,1,0,0,0),(3403,'Heart0054','still','2013-08-26 19:51:36','2013-08-26 19:52:51','Heart0054-Perfusion-Fixed-Right-Ventricle-Moderator-Band','Looking down into the apex of the right ventricle, the moderator band can be seen spanning the chamber from the right ventricle from the free wall to the interventricular septum. ',0,1,0,0,0),(3404,'Heart0054-Posterior','still','2013-08-26 19:51:37','2013-08-27 14:55:46','Heart0054-Perfusion-Fixed-Right-Ventricle-Posterior-Papillary-Muscle','View of the posterior papillary muscle from within the right ventricle. Chordae tendineae are seen extending from the papillary muscle to the posterior leaflet located in the bottom right of the image. ',0,1,0,0,0),(3405,'Heart0054-Septal','still','2013-08-26 19:51:37','2013-08-27 14:55:46','Heart0054-Perfusion-Fixed-Right-Ventricle-Septal-Papillary-Muscle','The septal papillary muscle of the right ventricle is located along the interventricular septum. Note the multiple heads from which the chordae tendineae orginate. The septal papillary muscle and associated chordae tendineae connect to the septal leaflet of the tricuspid valve. ',0,1,0,0,0),(3406,'Heart0144','still','2013-08-26 20:48:30','2013-08-26 20:49:14','Heart0144-Perfusion-Fixed-Aorta-Aortic-Valve','A view of the aortic valve from within the aortic root. When the left ventricle relaxes during diastole, flow of blood back into the left ventricle is prevented by the aoric semilunar valve. The three cusps of the valve are anchored to the fibrous skeleton within the root of the aorta. ',0,1,0,0,0),(3407,'Heart0144','still','2013-08-26 20:48:30','2013-08-26 20:49:14','Heart0144-Perfusion-Fixed-Aorta-Ascending-Aorta','A view of the ascending aorta which carries the oxygenated blood from the left ventricle to rest fo the body. A closed aortic semilunar valve is seen in this image. The aortic valve will be closed during diastole, when the ventricles of the heart are filling with blood. ',0,1,0,0,0),(3408,'Heart0144-Left','still','2013-08-26 20:48:30','2014-11-17 20:45:27','Heart0144-Perfusion-Fixed-Aorta-Left-Coronary-Artery-Ostia','A close-up view of the left coronary artery ostium, located in close proximity to the cusps of the aortic valve. During diastole the cusps of the aortic valve close up allowing for distention of the aortic wall and pressurized filling coronary arteries. Thsi allows oxygenated blood to be sent to the myocardium tissue of the heart.  ',0,1,0,0,0),(3409,'Heart0144','still','2013-08-26 20:48:30','2013-08-26 20:49:14','Heart0144-Perfusion-Fixed-Cardiac-Veins-Coronary-Sinus','Close-up view of the coronary sinus ostium from within the right atrium. The coronary sinus returns deoxygenated blood used by the myocardial tissue back to the right side of the heart. ',0,1,0,0,0),(3410,'Heart0144','still','2013-08-26 20:48:30','2014-07-24 18:21:52','Heart0144-Perfusion-Fixed-Left-Atrium-Fossa-Ovalis','View of the foramen ovale from within the left atrium. During 