ew of the apex of the left ventricle which aids in the pumping of the blood from the left ventricle to the aorta. ',0,1,0,0,0),(3417,'Heart0144','still','2013-08-26 20:48:30','2013-08-26 20:49:14','Heart0144-Perfusion-Fixed-Left-Ventricle-Free-Wall','Beyond the cusp of the mitral valve, the free wall of the left ventricle can be seen. The free wall is composed of trabeculae carneae, thick but fine muscular bundles which aid in the contraction of the left ventricle. ',0,1,0,0,0),(3418,'Heart0144','still','2013-08-26 20:48:30','2013-08-26 20:49:14','Heart0144-Perfusion-Fixed-Left-Ventricle-Interventricular-Septum','A view of the smooth surface of the interventricular septum. This septum separates the two ventricular chambers of the heart and appears from within the left ventricle to buldge into the right ventricle. ',0,1,0,0,0),(3419,'Heart0144','still','2013-08-26 20:48:30','2013-08-26 20:49:14','Heart0144-Perfusion-Fixed-Left-Ventricle-Left-Ventricle-Bands','Ventricle bands can be seen connecting muscle bundles of the trabeculae carneae. These bands aid in the coordination of contraction within the left ventricle. ',0,1,0,0,0),(3420,'Heart0144-Posterior','still','2013-08-26 20:48:30','2013-08-26 20:49:14','Heart0144-Perfusion-Fixed-Left-Ventricle-Posterior-Papillary-Muscle','The posterior papillary muscle of the left ventricle pictured here with the associated chordae tendineae extending superiorly to attach to the posterior leaflet of the mitral valve. ',0,1,0,0,0),(3421,'Heart0144','still','2013-08-26 20:48:30','2013-08-26 20:49:14','Heart0144-Perfusion-Fixed-Pulmonary-Artery-Pulmonary-Valve','Close-up view of an open pulmonary valve from within the pulmonary artery. The semilunar pulmonary valve opens during systole to allow blood flow from the right ventricle to the lungs. ',0,1,0,0,0),(3422,'Heart0144','still','2013-08-26 20:48:30','2013-08-26 20:49:14','Heart0144-Perfusion-Fixed-Right-Atrium-Coronary-Sinus-Ostium','A view of the coronary sinus ostium from within the chamber of the right atium. The Thesbian valve is partially seen to be covering the coronary sinus, which prevents backflow of blood into the coroanry sinus.',0,1,0,0,0),(3423,'Heart0144','still','2013-08-26 20:48:30','2013-08-26 20:49:14','Heart0144-Perfusion-Fixed-Right-Atrium-Crista-Terminalis','View of the crista terminalis from within the right atrium. The crista terminalis is a smooth ridge separating the pectinate muscle and appendage from the smooth wall of the atrium. ',0,1,0,0,0),(3424,'Heart0144','still','2013-08-26 20:48:30','2013-08-26 20:49:14','Heart0144-Perfusion-Fixed-Right-Atrium-Fossa-Ovalis','View of the ovale shaped foramen ovalis from the right atrium. The foramen ovalis remains patent during fetal development to shunt blood from the right to the left atrium thereby bypassing the developing lungs. The foramen ovalis is part of the interatrial septum.  ',0,1,0,0,0),(3425,'Heart0144','still','2013-08-26 20:48:30','2014-07-18 15:30:16','Heart0144-Perfusion-Fixed-Right-Atrium-Inferior-Vena-Cava-Ostium','View of the opening of the inferior vena cava from the right atrium. The inferior vena cava returns deoxygenated blood from the inferior body back to the right heart.',0,1,0,0,0),(3426,'Heart0144','still','2013-08-26 20:48:30','2013-08-26 20:49:14','Heart0144-Perfusion-Fixed-Right-Atrium-Interatrial-Septum','View of the interatrial septum from the right atrium. The smooth surface of septumdevelops during the first and second months of fetal development. Atrial septal defects are a common heart malformation occurring when the interatrial septum fails to properly close in development. ',0,1,0,0,0),(3427,'Heart0144','still','2013-08-26 20:48:30','2013-08-26 20:49:14','Heart0144-Perfusion-Fixed-Right-Atrium-Lateral-Wall','View of the lateral wall of the right atrium. The pectinate muscles of the wall help in contraction of the chamber during diastole.',0,1,0,0,0),(3429,'Heart0144','still','2013-08-26 20:48:30','2013-08-26 20:49:14','Heart0144-Perfusion-Fixed-Right-Atrium-Triangle-of-Koch','The Triangle of Koch is defined spatially by the coronary sinus ostium, anterior border of the tricuspid valve, and the Eustachian ridge. The triangle of Koch is used to approximate the location of the AV node. ',0,1,0,0,0),(3430,'Heart0144','still','2013-08-26 20:48:30','2014-05-23 15:10:07','Heart0144-Perfusion-Fixed-Right-Atrium-Tricuspid-Valve','A close-up view of the tricuspid valve from the right atrium. The three leaflets of the valve can be seen - anterior, posterior, and septal. ',0,1,0,0,0),(3431,'Heart0144-Anterior','still','2013-08-26 20:48:30','2013-08-26 20:49:14','Heart0144-Perfusion-Fixed-Right-Ventricle-Anterior-Papillary-Muscle','A view of the anterior papillary muscle from within the right ventricle. The anterior papillary is found along the free wall of the ventricle and attaches to the anterior leaflet of the tricuspid valve through chordae tendineae.',0,1,0,0,0),(3432,'Heart0144','still','2013-08-26 20:48:30','2013-08-26 20:49:14','Heart0144-Perfusion-Fixed-Right-Ventricle-Apex','View of the right ventricular apex. The apex aids in pumping of blood from the ventricle to pulmonary artery.',0,1,0,0,0),(3433,'Heart0144','still','2013-08-26 20:48:30','2013-08-26 20:49:14','Heart0144-Perfusion-Fixed-Right-Ventricle-Moderator-Band','A view of the moderator band in the right ventricle connecting the septal wall to the anterior papillary muscle. The moderator band aids in conduction and coordination of contraction of the papillary muscles within the right ventricle. ',0,1,0,0,0),(3434,'Heart0144-1','still','2013-08-26 20:48:30','2013-08-26 21:14:11','Heart0144-Perfusion-Fixed-Right-Ventricle-Outflow-Tract-1','A view of the right ventricular outflow tract from the right ventricle. The outflow track leads to the pulmonic valve, seen here in its open configuration, which serves as a gate to the pulmonary artery. ',0,1,0,0,0),(3435,'Heart0144-Posterior','still','2013-08-26 20:48:30','2013-08-26 20:49:14','Heart0