eously deployed into the main branch and side branch, is used in order to restore patency to the jailed side branch and obtain better strut apposition at the bifurcation.',0,0,1,0,0),(3440,'Culotte Technique','video','2013-10-03 18:00:05','2013-10-03 19:08:29','culotte-technique','In this video a main branch coronary artery was stented and a side branch vessel was opened (provisional technique).  Next, a side-branch stent was crossed into the branch and then placed (balloon inflated to expand stent): wires are still placed and visible in each branch.',0,0,1,0,0),(3441,'Heart0295-1','video','2013-11-12 19:11:37','2013-11-14 23:58:05','Heart0295-Functional-Left-Atrium-Pulmonary-Vein-Distal-Pulmonary-Branches-1','An endocardial view of the right superior pulmonary veins directly visualized with a 4 mm videoscope on the left and the fluoroscopic position on the right. The videoscope is advanced as far as possible and then retracted and advanced into other branches of the venous system.',0,0,1,0,0),(3442,'Heart0295-2','video','2013-11-12 19:11:37','2013-11-15 15:55:48','Heart0295-Functional-Left-Atrium-Pulmonary-Vein-Distal-Pulmonary-Branches-2','An endocardial view of the right superior pulmonary veins directly visualized with a 4 mm videoscope on the left and the fluoroscopic position on the right. The videoscope begins advanced far into the lung and then retracted and advanced into other branches of the venous system. At the end of the video the pulmonary vein antrum can be visualized with a complex branching structure.',0,0,1,0,0),(3443,'Heart0146','video','2013-11-15 18:11:10','2013-11-15 18:12:31','Heart0146-Functional-Aorta-Ascending-Aorta','A view of the ascending aorta. The aortic valve can be seen in the background',0,0,1,0,0),(3444,'Heart0146-Left','video','2013-11-15 18:11:10','2013-11-15 18:34:00','Heart0146-Functional-Aorta-Left-Coronary-Artery-Ostia','A view of the left main coronary ostium. The left coronary cusp can be seen below the ostium.',0,0,1,0,0),