r>-right ventricle using an endoscope (top right),<br>-echocardiography using a transducer placed epicardially (bottom left),<br>-and anterior/posterior aspect using fluoroscopy (bottom right).',0,0,1,0,0),(3450,'Heart0146','video','2013-11-15 18:11:10','2013-11-15 18:12:32','Heart0146-Functional-Coronary-Arteries-Right-Coronary-Artery','A fiberscope is inserted into the right coronary artery, and is slowly pulled back out. ',0,0,1,0,0),(3451,'Heart0146-1','video','2013-11-15 18:11:10','2013-11-15 18:34:00','Heart0146-Functional-External-Anterior-1','An external view of the heart.  The fibrillating heart is shocked with epicardial paddles. There is an unusually long pause between the shock delivery and ventricular contraction.  The contractions seen toward the end of the video are contracting at an irregular rate. ',0,0,1,0,0),(3452,'Heart0146-2','video','2013-11-15 18:11:10','2013-11-15 18:34:00','Heart0146-Functional-External-Anterior-2','An external view of the heart.  The pressure transducers can be seen going in through the walls of the left and right ventricles, and the ultrasound probe is visible against the right ventricle.',0,0,1,0,0),(3453,'Heart0146-3','video','2013-11-15 18:11:10','2013-11-15 18:34:00','Heart0146-Functional-External-Anterior-3','An overhead view of the heart in working mode. The buffer is being pumped through all four chambers.',0,0,1,0,0),(3454,'Heart0146','video','2013-11-15 18:11:10','2013-11-15 18:12:32','Heart0146-Functional-External-Left-Margin','A left anterior oblique angled view of the heart.',0,0,1,0,0),(3455,'Heart0146','video','2013-11-15 18:11:10','2013-11-15 18:12:32','Heart0146-Functional-External-Right-Margin','An external view of the heart from the right anterior oblique position.',0,0,1,0,0),(3456,'Heart0146','video','2013-11-15 18:11:10','2013-11-15 18:12:32','Heart0146-Functional-Left-Atrium-Left-Atrial-Appendage','This video starts out in the left atrium looking at the left atrial appenage.  The mitral valve is just 