The PIV could only be partially regenerated from this hearts CT scan, and has no branches. The PLV has 1 branch, the LLV has 0 branches, and the AIV has 3 primary branches.  The coronary arteries of this heart are clearly visible, with a highly branched RCA (13 branches) and LAD (7 branches), and a partial LCX branching off from the LCA. The LCX has 0 branches and crosses under the LLV. See the Heart Database for further information.',1,0,1,0,0),(3479,'Heart0188','video','2013-11-21 22:44:13','2013-12-09 22:38:38','Heart0188-3D-Modeling-Combined-Coronary-Arteries-Cardiac-Veins','This is a heart with an unrelated cardiac condition that does not affect the coronary vasculature. The PIV, LLV, ALV and AIV are present in this heart; absent are a PVLV, and PLV. The PIV has 3 main branches, the LLV has 5 main branches, the ALV has 0 branches and the AIV has 2 main branches. The RCA has high tortuosity and 3 main branches. An apical extending LCX is present in this heart with 3 main branches, and crosses underneath the LLV. The LAD also has increasing tortuosity at its distal end. See the Heart Database for further information.',1,0,1,0,0),(3480,'Heart0237','video','2013-11-21 22:44:13','2013-12-09 22:38:38','Heart0237-3D-Modeling-Combined-Coronary-Arteries-Cardiac-Veins','This is a heart with no known cardiac conditions. The PIV, 2 PVLVs, a PLV, and AIV are present in this heart, with an LLV and ALV absent. The PIV has 5 main branches, PVLV1 has 8 main branches, PVLV2 has 0 branches, the PLV has 1 main branch, and the AIV has 9 branches. The RCA has 4 main branches. There is no observable LCX in this heart, but the LCA branches into the LAD and 2 other main branches. The LAD itself has 4 main branches. See the Heart Database for further information.',1,0,1,0,0),(3481,'Heart0241','video','2013-11-21 22:44:13','2013-12-09 22:38:38','Heart0241-3D-Modeling-Combined-Coronary-Arteries-Cardiac-Veins','This is a heart with a history of hypertension. The PIV, PVLV, and AIV are present with the PLV, LLV, and ALV absent. The PIV has 4 main branches, the PVLV has 5 branches, and the AIV has 5 main branches. The RCA has 4 main branches, the LCX is absent, the LCA branches into the LAD and one other branch, and the LAD has 3 branches. See the Heart Database for further information.',1,0,1,0,0),(3482,'Heart0248','video','2013-11-21 22:44:13','2013-12-09 22:38:38','Heart0248-3D-Modeling-Combined-Coronary-Arteries-Cardiac-Veins','This is a heart with no known cardiac conditions. The PIV, PVLV, PLV, LLV, 2 ALVs, and AIV are all present in this heart. The PIV has 8 branches, the PVLV has 9 branches, the PLV has 1 main branch, the LLV has 1 main branch, ALV1 has 1 branch, ALV2 has 0 branches, and the AIV has 3 branches. The RCA has 8 main branches, each of which have relatively high tortuosity. The LCX in this heart is also more tortuous than others, crosses underneath ALV1, LLV, and overlaps PVLV. The LCA branches into the LCX and LAD, and the LAD has 1 main branch.',1,0,1,0,0),(3483,'Heart0251','video','2013-11-21 22:44:13','2013-12-09 22:38:38','Heart0251-3D-Modeling-Combined-Coronary-Arteries-Cardiac-Veins','This is a heart with an unrelated cardiac condition that does not affect the coronary vasculature. The PIV, 2 PVLVs, a PLV, LLV, and AIV are present with the ALV absent. The PIV has 5 branches, PVLV1 has 0 branches, PVLV2 has 1 branch, PLV has 3 branches, the LLV has 2 main branches, and the AIV has 6 branches. Additional marginal veins not appearing to branch from the coronary sinus were modeled in this heart. The RCA has 6 main branches. The LCA branches into the LCX and LAD. The LCX has 0 branches and the LAD has 1 main branch. The LCX in this heart courses near the coronary sinus and the LLV. See the Heart Database for further information.',1,0,1,0,0),(3484,'Heart0255','video','2013-11-21 22:44:13','2013-12-09 22:38:38','Heart0255-3D-Modeling-Combined-Coronary-Arteries-Cardiac-Veins','This is a heart with an unrelated cardiac condition that does not affect the coronary vasculature. The PIV, 4 PVLVs, LLV and AIV are present with a PLV and ALV absent. The PIV has 6 short branches, PVLV1 has 1 branch, PVLV2 has 3 branches, PVLV3 has 0 branches, and PVLV4 has 2 branches. The LLV has 10 branches, and the AIV has 7 main branches. The RCA has 3 main branches, none of which are highly tortuous. The LCA is highly branched in this heart, with the LCX branching from the LCA and the LCA turning into the LAD. The LCX has 3 main branches, and the LAD has 11 branches, each of which branches into smaller arterial vessels. See the Heart Database for further information.',1,0,1,0,0),(3485,'Heart0256','video','2013-11-21 22:44:13','2013-12-09 22:38:38','Heart0256-3D-Modeling-Combined-Coronary-Arteries-Cardiac-Veins','This is a heart with a history of hypertension. The PIV, 2 PVLVs, LLV, and AIV are present with a PLV and ALV absent. The PIV has 2 main branches, PVLV1 has 0 branches, PVLV2 has 9 branches, LLV has 2 main branches, and the AIV has 9 branches. The RCA has 5 main branches, the LCA branches into the LCX and LAD. The LCX has 3 main branches and extends apically. The LAD has 8 main branches. None of the arterial branches are particularly tortuous. The LCX overlaps the AIV and the LLV, with its main descending portion in between branches of the LLV. See the Heart Database for further information.',1,0,1,0,0),(3486,'Heart0259','video','2013-11-21 22:44:13','2013-12-09 22:38:38','Heart0259-3D-Modeling-Combined-Coronary-Arteries-Cardiac-Veins','This is a heart with a history of hypertension. The PIV, 2 PVLVs, a PLV, LLV, ALV, and AIV are present. The PIV has 10 branches, PVLV1 has 0 branches, PVLV2 has 1 branch, PLV has 1 main branch, LLV has 4 main branches, ALV has 2 small branches, and the AIV has 8 main branches. The RCA has 2 main branches. The LCA branches into the LCX and LAD. The LCX has 2 main branches, courses very near the coronary sinus and branches crossing underneath the ALV, LLV, PLV, PVLV2, and the PIV. The LAD has 1 major branch, with 4 other small branches near its distal end. The LAD crosses under the AIV. See the Heart Database for further information.',1,0,1,0,0),(3487,'Heart0261','video','2013-11-21 22:44:13','2013-12-09 22:38:38','Heart0261-3D-Modeling-Combined-Coronary-Arteries-Cardiac-Veins','This is a heart with a history of hypertension. The PIV, 2 PVLVs, LLV, and AIV are present with a PLV and ALV absent. The PIV has 1 small branch, PVLV1 has 1 small branch, PVLV2 has 0 branches, LLV has 5 main branches, the AIV has 0 branches in this model. The RCA has 1 branch. The LCA branches into the LCX and LAD. The LCX has 0 branches, courses near the coronary sinus and crosses under the LLV. The LAD in this heart extends diagonally toward the apex and crosses under the distal end of the LLV. The LAD has 0 branches. Reconstruction of branches in this heart model was challenging; in some vessel areas, only partial reconstructions of branches could be generated from the CT scan. See the Heart Database for further information.',1,0,1,0,0),(3488,'Heart0274','video','2013-11-21 22:44:13','2013-12-09 22:38:38','Heart0274-3D-Modeling-Combined-Coronary-Arteries-Cardiac-Veins','This is a heart with a history of hypertension. The PIV, PVLV, PLV, LLV, 3 ALVs, and AIV are all present. The PIV has 7 main branches, PVLV has 11 branches, PLV has 0 branches, LLV has 1 branch, ALV1, ALV2 and ALV3 all have 0 branches, AIV has 5 main branches. The RCA has 5 main branches. The LCX and LAD branch off from the LCA. The LCX has 1 main branch, and the LAD has 8 main branches. The LCX courses near the coronary sinus and crosses underneath the LLV and PVLV2. See the Heart Database for further information.',1,0,1,0,0),(3489,'Transcatheter Leadless Pacemaker','video','2014-06-17 19:16:37','2014-08-14 17:08:17','Heart0216-transcatheter-pacemaker-implantation','Transcatheter Leadless Pacemaker - Human Heart 0216<p>Multimodal imaging of a transcatheter pacemaker implantation within a reanimated human heart<p>With the development of transcatheter pacemakers, new transcatheter delivery systems and implantation techniques are also necessary. In order to further understand the interaction of a transcatheter pacing system (TPS) with functional anatomy and to provide important insights into the device-tissue interface, a transcatheter pacemaker was implanted in a reanimated human heart using both direct visualization and fluoroscopy.<p>This video was originally published in <a href=http://www.heartrhythmjournal.com/article/S1547-5271(14)00388-9/abstract target=_blank>Heart Rhythm</a>, and is made available here with their permission. ',0,0,1,0,0),(3490,'CoreValve','video','2014-09-03 18:40:46','2014-09-03 18:42:09','Heart0136-CoreValve','CoreValve Implantation - Human Heart 0136<p>Multimodal Imaging of a Transcatheter Aortic Valve Implantation Within an Isolated Heart<p>NOVEL IMAGING OF FUNCTIONAL CARDIAC ANATOMY is possible in isolated heart preparations when a clear perfusate is used; which, in turn, provides important insights into the device-tissue interface of implanted devices such as transcatheter valves. The implantation of a transcatheter aortic valve (TAV) (CoreValve System, Medtronic, Inc., Mounds View, Minnesota) within an isolated human heart was performed using echocardiography, fluoroscopy, and direct visualization to compare imaging modalities for better understanding of the implantation procedure.<p>This video was originally published in <a href=http://imaging.onlinejacc.org/article.aspx?articleID=1097023 target=_blank>JACC: Cardiovascular Imaging</a>, and is made available here with their permission.',0,0,1,0,0),(3491,'Heart0235-Cryoballoon-PV','video','2014-09-25 19:38:09','2014-09-25 19:51:32','Heart0235-Cryoballoon-Pulmonary-Vein','Following a transseptal puncture of the fossa ovalis, the pulmonary vein is cannulated with a guidewire. The delivery catheter containing the cryoablation balloon is advanced to the left inferior pulmonary vein. The balloon is inflated and positioned in the pulmonary vein ostia. Cryoablation starts and initiates ice formation/cell death. After the 4 minute ablation, the thaw process begins and the balloon is deflated when it warms up to 20C. Subsequently, the catheter is removed from the pulmonary vein of interest.',0,0,1,0,0),(3492,'Heart0153','video','2014-12-30 18:07:31','2014-12-30 18:42:12','Heart0153-3D-Modeling-Coronary-Arteries','This is a heart with no known cardiac conditions. The coronary arteries of this heart is composed of a highly branched RCA (13 branches) and LAD (7 branches), and a partial LCX branching off from the LCA. See the Heart Database for further information.',1,0,1,0,0),(3493,'Heart0237','video','2014-12-30 18:07:31','2014-12-30 18:42:12','Heart0237-3D-Modeling-Coronary-Arteries','This is a heart with no known cardiac conditions.  The RCA has 4 main branches. There is no observable LCX in this heart, but the LCA branches into the LAD and 2 other main branches. The LAD itself has 4 main branches. See the Heart Database for further information.',1,0,1,0,0),(3494,'Heart0241','video','2014-12-30 18:07:31','2014-12-30 18:42:12','Heart0241-3D-Modeling-Coronary-Arteries','This is a heart with a history of hypertension. The RCA has 4 main branches, the LCX is absent, the LCA branches into the LAD and one other branch, and the LAD has 3 branches. See the Heart Database for further information.',1,0,1,0,0),(3495,'Heart0255','video','2014-12-30 18:07:31','2014-12-30 18:42:12','Heart0255-3D-Modeling-Coronary-Arteries','This is a heart with an unrelated cardiac condition that does not affect the coronary vasculature. The RCA has 3 main branches, none of which are highly tortuous. The LCA is highly branched in this heart, with the LCX branching from the LCA and the LCA turning into the LAD. The LCX has 3 main branches, and the LAD has 11 branches, each of which branches into smaller arterial vessels. See the Heart Database for further information.',1,0,1,0,0),(3496,'Heart0256','video','2014-12-30 18:07:31','2014-12-30 18:42:12','Heart0256-3D-Modeling-Coronary-Arteries','This is a heart with a history of hypertension. The RCA has 5 main branches, the LCA branches into the LCX and LAD. The LCX has 3 main branches and extends apically. The LAD has 8 main branches. None of the arterial branches are particularly tortuous. See the Heart Database for further information.',1,0,1,0,0),(3497,'Heart0259','video','2014-12-30 18:07:31','2014-12-30 18:42:13','Heart0259-3D-Modeling-Coronary-Arteries','This is a heart with a history of hypertension. The RCA has 2 main branches. The LCA branches into the LCX and LAD. The LCX has 2 main branches. The LAD has 1 major branch, with 4 other small branches near its distal end. See the Heart Database for further information.',1,0,1,0,0),(3498,'Heart0274','video','2014-12-30 18:07:31','2014-12-30 18:42:13','Heart0274-3D-Modeling-Cardiac-Veins','This is a heart with a history of hypertension. The PIV, PVLV, PLV, LLV, 3 ALVs, and AIV are all present. The PIV has 7 main branches, PVLV has 11 branches, PLV has 0 branches, LLV has 1 branch, ALV1, ALV2 and ALV3 all have 0 branches, AIV has 5 main branches. See the Heart Database for further information.',1,0,1,0,0),(3499,'Heart0274','video','2014-12-30 18:07:31','2014-12-30 18:42:13','Heart0274-3D-Modeling-Coronary-Arteries','This is a heart with a history of hypertension.  The RCA has 5 main branches. The LCX and LAD branch off from the LCA. The LCX has 1 main branch, and the LAD has 8 main branches. See the Heart Database for further information.',1,0,1,0,0),(3500,'Heart0222-1','video','2015-05-26 18:56:29','2015-05-26 19:00:25','Heart0222-Functional-External-Anterior-1','External view of the heart before re-animation.',0,0,1,0,0),(3501,'Heart0222-2','video','2015-05-26 18:56:29','2015-05-26 19:00:25','Heart0222-Functional-External-Anterior-2','External view of the anterior heart . The Defib Pads are located on the atria, instead of the ventricles due to the thick fat pad insulating the ventricular walls.',0,0,1,0,0),(3502,'Heart0222','video','2015-05-26 18:56:29','2015-05-26 19:00:25','Heart0222-Functional-Right-Atrium-Tricuspid-Valve','The Tricuspid Valve is seen from the Superior Vena Cava in the Right Atrium. Beyond the thin white leaflets the chordae tendineae can be seen extending into the Right Ventricle.',0,0,1,0,0),(3503,'Heart0222','video','2015-05-26 18:56:29','2015-05-26 19:00:25','Heart0222-Functional-Right-Atrium-Right-Atrial-Appendage','Functional view of the Right Trial Appendage. Around 15 seconds the external lights are shut off and there is a change in the brightness seen through the Pectinate Muscle due to the thin nature of the appendage wall.',0,0,1,0,0),(3504,'Heart0222','video','2015-05-26 18:56:29','2015-05-26 19:00:25','Heart0222-Functional-Right-Atrium-Inferior-Vena-Cava-Ostium','Functional view of the Inferior Vena Cava Ostium. The IVC has been canulated in order to allow flow during the re-animation process. The Eustachian Ridge is on the  left most side of the image.',0,0,1,0,0),(3505,'Heart0222','video','2015-05-26 18:56:29','2015-05-26 19:00:25','Heart0222-Functional-Right-Atrium-Fossa-Ovalis','The Fossa Ovalis for is masked by a fibrotic growth, similar to a myxoma. At the end of the video the Inferior Vena Cava Ostium is visible one the right edge of the screen and the Coronary Sinus Ostium is located hear the top of the video.',0,0,1,0,0),(3506,'Heart0222','video','2015-05-26 18:56:29','2015-05-26 19:00:25','Heart0222-Functional-Right-Atrium-Coronary-Sinus-Ostium','The Coronary Sinus Ostium is viewed in the center of the image. The Tricuspid valve is to the viewers left.',0,0,1,0,0),(3507,'Heart0222','video','2015-05-26 18:56:29','2015-05-26 19:00:25','Heart0222-Functional-Right-Atrium-Crista-Terminalis','The Crista Terminalis is viewed with the Right Atrial Appendage in the background. It acts as a ridge between the body of the Right Atrium and the Appendage',0,0,1,0,0),(3508,'Heart0222','video','2015-05-26 18:56:29','2015-05-26 19:00:25','Heart0222-Functional-Right-Atrium-Triangle-of-Koch','Triangle of Koch as viewed from the superior vena cava. The triangles sides are made up by the septal leaflet of the tricuspid valve (upper left), the coronary sinus ostium (lower right), and the Eustachian ridge (bottom).',0,0,1,0,0),(3509,'Heart0222','video','2015-05-26 18:56:29','2015-05-26 19:00:25','Heart0222-Functional-Right-Ventricle-Apex','Functional video of the Right Ventricular Apex. The yellow areas on the trabeculae are fat nodules. ',0,0,1,0,0),(3510,'Heart0222-Posterior','video','2015-05-26 18:56:29','2015-05-26 19:00:26','Heart0222-Functional-Right-Ventricle-Posterior-Papillary-Muscle','Functional view of the posterior papillary muscle. The orientation is such that the apex is to the left while the valve is to the right. As the ventricles contract the leaflets close around the camera lens.',0,0,1,0,0),(3511,'Heart0222-Anterior-1','video','2015-05-26 18:56:29','2015-05-26 19:00:26','Heart0222-Functional-Right-Ventricle-Anterior-Papillary-Muscle-1','View of the anterior papillary muscle in the right ventricle from the tricuspid valve. Note the multiple heads and chordae leaving the muscle and attaching to the anterior leaflet of the valve.',0,0,1,0,0),(3512,'Heart0222-Septal','video','2015-05-26 18:56:29','2015-05-26 19:00:26','Heart0222-Functional-Right-Ventricle-Septal-Papillary-Muscle','View of the septal papillary muscle from the right ventricular outflow tract (RVOT). In the background the posterior papillary muscle is also visible (back left). There are also several yellow colored fat deposits throughout the right ventricle.',0,0,1,0,0),(3513,'Heart0222','video','2015-05-26 18:56:29','2015-05-26 19:00:26','Heart0222-Functional-Right-Ventricle-Right-Ventricular-Outflow-Tract','Right ventricular outflow tract (RVOT) as viewed from the pulmonary valve. Note the high degree of trabeculations in the free wall (left) and the fat deposits on the tissue. Also as the ventricle contracts the contraction can be seen origination in the apex (top of screen) and traveling up towards the pulmonary artery (bottom of screen).',0,0,1,0,0),(3514,'Heart0222','video','2015-05-26 18:56:29','2015-05-26 19:00:26','Heart0222-Functional-Right-Ventricle-Tricuspid-Valve','Tricuspid valve as viewed from the right ventricular outflow tract. The anterior leaflet is in the front right of the image with the posterior on the left and septal in the background.  ',0,0,1,0,0),(3515,'Heart0222-Anterior-2','video','2015-05-26 18:56:29','2015-05-26 19:00:26','Heart0222-Functional-Right-Ventricle-Anterior-Papillary-Muscle-2','View of the anterior papillary muscle in the right ventricle from the right ventricular outflow tract (RVOT). The chordae tendoneae attaching to the septal leaflet and papillary are also visible on the right of the image.',0,0,1,0,0),(3516,'Heart0222','video','2015-05-26 18:56:29','2015-05-26 19:00:26','Heart0222-Functional-Pulmonary-Artery-Pulmonary-Valve','Functional view of the Pulmonary Valve from the top.',0,0,1,0,0),(3517,'Heart0222','video','2015-05-26 18:56:29','2015-05-26 19:00:26','Heart0222-Functional-Left-Ventricle-Apex','View of the left ventricular apex from the aortic valve. Note the high degree of trabeculations as well as the large number of left ventricular (LV) and conduction bands throughout.',0,0,1,0,0),(3518,'Heart0222-Posterior','video','2015-05-26 18:56:29','2015-05-26 19:00:26','Heart0222-Functional-Left-Ventricle-Posterior-Papillary-Muscle','View of the left ventricular posterior papillary muscle. Notice how the papillary is divided into more than one head, attaching to many chordae tendoneae.',0,0,1,0,0),(3519,'Heart0222-Anterior','video','2015-05-26 18:56:29','2015-05-26 19:00:26','Heart0222-Functional-Left-Ventricle-Anterior-Papillary-Muscle','View of the Anterior papillary muscle in the left ventricle. There are several LV bands behind the papillary (right) that can be seen attaching it to the  wall of the left ventricle.',0,0,1,0,0),(3520,'Heart0222','video','2015-05-26 18:56:29','2015-05-26 19:00:26','Heart0222-Functional-Left-Ventricle-Aortic-Valve','View of the aortic valve (top right) and the mitral valve (middle left) from the left ventricular apex. The anterior leaflet of the mitral valve borders the left and non-coronary cusps of the aortic valve with the right coronary cusp being in the top right corner.',0,0,1,0,0),(3521,'Heart0222','video','2015-05-26 18:56:29','2015-05-26 19:00:26','Heart0222-Functional-Left-Ventricle-Mitral-Valve','Mitral valve as viewed from the left ventricular apex. The anterior leaflet is towards the top of the image while the posterior leaflet is towards the bottom. The posterior papillary is on the right of the image while the anterior papillary muscle is on the left.',0,0,1,0,0),(3522,'Heart0222','video','2015-05-26 18:56:29','2015-05-26 19:00:26','Heart0222-Functional-Left-Atrium-Mitral-Valve','View of the mitral valve through a cameral inserted in one of the right pulmonary veins. The anterior cusp is located on the bottom right and the posterior cusp is on the upper left.',0,0,1,0,0),(3523,'Heart0222','video','2015-05-26 18:56:29','2015-05-26 19:00:26','Heart0222-Functional-Left-Atrium-Left-Atrial-Appendage','View of the left atrial appendage from the left atrium. The tricuspid valve is off the  left portion of this video while the pulmonary veins are to the right.',0,0,1,0,0),(3524,'Heart0222','video','2015-05-26 18:56:29','2015-05-26 19:00:26','Heart0222-Functional-Left-Atrium-Fossa-Ovalis','View of the fossa ovalis from the left atrium. The fossa appears thick and fibrosed which is likely due to a growth similar to a myxoma which can be seen in the right atrium.',0,0,1,0,0),(3525,'Heart0222','video','2015-05-26 18:56:29','2015-05-26 19:00:26','Heart0222-Functional-Aorta-Aortic-Valve','Aortic valve as viewed from inside the aorta. The left coronary cusp is on the lower right, with the right coronary coronary cusp and the non-coronary cusp respectively when rotating clockwise.',0,0,1,0,0),(3526,'Heart0222-Left','video','2015-05-26 18:56:30','2015-05-26 19:00:26','Heart0222-Functional-Aorta-Left-Coronary-Artery-Ostium','View of the left coronary artery ostium. As the camera zooms out the right coronary cusp is visible on the left of the screen and the non-coronary cusp is located in the upper right.',0,0,1,0,0),(3527,'Heart0222-Right','video','2015-05-26 18:56:30','2015-05-26 19:00:26','Heart0222-Functional-Aorta-Right-Coronary-Artery-Ostium','View of the right coronary artery ostium.  Notice that there are two ostia for the right side instead of one as is normal. As the camera zooms out the non-coronary cusp (top) and left coronary cusp (bottom right) are also visible.',0,0,1,0,0),(3528,'Heart0222-TriV','video','2015-06-10 14:18:51','2015-06-12 21:35:50','Heart0222-Comparative-Imaging-Tricuspid-Valve','Comparative view of the tricuspid valve from an endoscope in the right atrium (top left), an endoscope placed through the pulmonary valve (top right), echo (bottom left), and fluoroscopy (bottom right).',0,0,1,0,0),(3529,'Heart0222-PV','video','2015-06-10 14:18:51','2015-06-10 14:19:42','Heart0222-Comparative-Imaging-Pulmonary-Valve','View of the pulmonary valve from the pulmonary artery (top left) and right ventricular outflow tract (top right). In addition the pulmonary valve is imaged via echo (bottom left) and fluoroscopy (bottom right). The aortic valve is also visible in the echo image.',0,0,1,0,0),(3530,'Heart0222-MV','video','2015-06-10 14:18:51','2015-06-10 14:19:42','Heart0222-Comparative-Imaging-Mitral-Valve','View of the mitral valve imaged through an endoscope in the left atrium (top left), an endoscope in the left ventricle (top right), 4 chamber long axes view on echo (bottom left), and using fluoroscopy (bottom right). The anterior leaflet is located on the top left in the atrial image and the top in the ventricular image.',0,0,1,0,0);
INSERT INTO `Item` VALUES (3531,'Heart0222-AV','video','2015-06-10 14:18:51','2015-06-10 14:19:42','Heart0222-Comparative-Imaging-Aortic-Valve','Comparative view of the aortic valve from an endoscope placed in the aorta (top left), an endoscope in the left ventricle (top right), echo (bottom left), and fluoroscopy (bottom right). The location of the cameras and echo probe can be seen on fluoroscopy.',0,0,1,0,0),(3532,'Heart0222-Fossa','video','2015-06-10 14:18:51','2015-06-10 14:19:43','Heart0222-Comparative-Imaging-Fossa-Ovalis','Comparative view of the fossa ovalis. In the right atrium (top left) the fossa is masked by a fibrotic growth, similar to a myxoma. The top right shows the fossa ovalis from the left atrium and the bottom left shows the fossa imaged via echo. Note that because of the growth on the fossa the area appears much thicker than normal when viewed on echo.',0,0,1,0,0),(3533,'Heart0046','video','2015-06-12 17:57:26','2015-07-14 18:31:27','Heart0046-3D-Modeling-Tissue-Hypertrophic','This is a 3D tissue reconstruction of a heart from a 62 year old male. This individual had a history of cardiac arrest, hypertension, and hyperlipidemia. They also had a 15 year smoking history which can lead to right ventricular enlargement due to increased vasculature resistance.',0,0,1,0,0),(3534,'Heart0235','video','2015-06-12 19:43:45','2015-06-12 19:44:28','Heart0235-Functional-Left-Atrium-Foramen-Ovale','View of the fossa ovalis from the left atrium.  The Left superior pulmonary vein is cannulated (top left) while the left inferior pulmonary vein is tied off with suture (top right).',0,0,1,0,0),(3535,'Heart0235','video','2015-06-12 19:43:45','2015-06-12 19:44:28','Heart0235-Functional-Left-Ventricle-Aortic-Valve','View of the aortic and mitral valve as seen from the left ventricle.  The aortic valve is seen on the left and the mitral valve is seen on the right.  The anterior leaflet of the mitral valve is closest to the aortic valve. The right coronary cusp of the aortic valve is on the far left, with the left coronar cusp on the top left and the non-coronary cusp on the bottom.',0,0,1,0,0),(3536,'Heart0235-1','video','2015-06-12 19:43:45','2015-06-12 19:44:28','Heart0235-Functional-Left-Atrium-Pulmonary-Vein-Ostium-1','View of the left pulmonary vein ostia as seen from the left atrium.  The left superior pulmonary vein is cannulated and has a light illuminating it; the left inferior pulmonary vein is not illuminated.',0,0,1,0,0),(3537,'Heart0235-2','video','2015-06-12 19:43:45','2015-06-12 19:44:28','Heart0235-Functional-Left-Atrium-Pulmonary-vein-Ostium-2','The Left superior pulmonary vein is cannulated (top left) while the left inferior pulmonary vein is tied off with suture (top right). The fossa ovalis is also visible at the bottom of the screen.',0,0,1,0,0),(3538,'Heart0235-1','video','2015-06-12 19:43:45','2015-06-12 19:44:28','Heart0235-Functional-Left-Ventricle-Mitral-Valve-1','View of the mitral valve as seen from the left ventricle.  The anterior leaflet of the mitral valve is on the left and the posterior leaflet is on the right.  The cordae tendinae connecting theanterior papullary muscle are also visible at the top of the screen.',0,0,1,0,0),(3539,'Heart0235-Right','video','2015-06-12 19:43:45','2015-06-12 19:44:28','Heart0235-Functional-Aorta-Right-Coronary-Artery-Ostium','View of the right coronary ostium from above the aortic valve. A branch can be splitting off almost immedieately at the ostium. The division between the right and non-coronary cusp is visible on the left of the image.',0,0,1,0,0),(3540,'Heart0235-Left','video','2015-06-12 19:43:45','2015-06-12 19:44:28','Heart0235-Functional-Aorta-Left-Coronaty-Artery-Ostium','View of the left coronary ostium from above the aortic valve.  The left coronary cusp shows several small yellow calcium deposits, as does the right coronary cusp towards the end of the video (on the left).',0,0,1,0,0),(3541,'Heart0235-1','video','2015-06-12 19:43:45','2015-06-12 19:44:28','Heart0235-Functional-Left-Ventricle-Apex-1','View of the left ventricular apex with trabeculations and left ventricular (LV) bands in white, can be seen here.  ',0,0,1,0,0),(3542,'Heart0235-2','video','2015-06-12 19:43:45','2015-06-12 19:44:28','Heart0235-Functional-Left-Ventricle-Apex-2','View of the left ventricular apex with trabeculations and conduction bands can be seen here.  The base of the papillary muscles can be seen at the top of the video (anterior on the left, posterior on the right).',0,0,1,0,0),(3543,'Heart0235','video','2015-06-12 19:43:45','2015-06-12 19:44:28','Heart0235-Functional-Right-Ventricle-Right-Ventricular-Outflow-Tract','View of the right ventricular outflow tract; trabeculations line it and the pulmonary valve can be seen above. The anterior cusp is on the upper left portion with the right cusp on the upper right and the left cusp on the bottom. The septal wall is located on the right of this image.',0,0,1,0,0),(3544,'Heart0235','video','2015-06-12 19:43:45','2015-06-12 19:44:28','Heart0235-Functional-Pulmonary-Trunk-Pulmonary-Valve','View of the pulmonary valve; no calcifications are present suggesting a healthy valve.',0,0,1,0,0),(3545,'Heart0235','video','2015-06-12 19:43:45','2015-06-12 19:44:28','Heart0235-Functional-Right-Atrium-Tricuspid-Valve','View of the tricuspid valve as seen from the right atrium.  The chordae tendineae are visible when the valve is open. The septal leaflet is located at the bottom of the screen with the anterior leaflet on the left, and the posterior leaflet on the top right. The lateral wall of the right atrium can also be seen wrapping around the anterior to posterior leaflets.',0,0,1,0,0),(3546,'Heart0235','video','2015-06-12 19:43:45','2015-06-12 19:44:28','Heart0235-Functional-Right-Ventricle-Tricuspid-Valve','View of the tricuspid valve as seen from the right ventricle.  The chordae tendinae connect the tricuspid valve to the papillary muscles. The septal leaflet is on the left portion of the screen with the ',0,0,1,0,0),(3547,'Heart0235-2','video','2015-06-12 19:43:45','2015-06-12 19:44:28','Heart0235-Functional-Left-Ventricle-Mitral-Valve-2','View of the aortic and mitral valve as seen from the left ventricle.  The aortic valve is seen on the left and the mitral valve is seen on the right.  The anterior leaflet of the mitral valve is closest to the aortic valve.',0,0,1,0,0),(3548,'Heart0235-Posterior','video','2015-06-12 19:43:45','2015-06-12 19:44:28','Heart0235-Functional-Left-Ventricle-Posterior-Papillary-Muscle','The posterior papillary muscle can be seen attaching to the chordae tendoneae of the mitral valve. There is a large degree of trabeculation as well as a large number of left ventricular bands visible in this clip.',0,0,1,0,0),(3549,'Heart0235-Anterior','video','2015-06-12 19:43:45','2015-06-12 19:44:28','Heart0235-Functional-Left-Ventricle-Anterior-Papillary-Muscle','The anterior papillary muscle can be seen attaching the chordae tendoneae to the mitral valve. There is a large degree of trabeculation as well as a large number of left ventricular bands visible in this clip. The free wall is located to the left of the papillary muscle with the septal wall on the right.',0,0,1,0,0),(3550,'Heart0235-1','video','2015-06-12 19:43:45','2015-06-12 19:44:28','Heart0235-Functional-Right-Atrium-Right-Atrial-Appendage-1','View of the right atrial appendage from the superior vena cava. The crista terminalis is located along the top of the screen, the  tricuspid valve annulus is at the bottom. Note how then the appendage is and the ability to see through the area between the pectinate muscle.',0,0,1,0,0),(3551,'Heart0235-2','video','2015-06-12 19:43:45','2015-06-12 19:44:28','Heart0235-Functional-Right-Atrium-Right-Atrial-Appendage-2','View of the right atrial appendage from the superior vena cava. The crista terminalis is loacted along the lop of the screen, the the tricuspid valve annulus is at the bott. Note how then the appendage is and the ability to see through the areasa between the pectinate muscle as a business card is placed on the outer surface of the appendage.',0,0,1,0,0),(3552,'Heart0235','video','2015-06-12 19:43:45','2015-06-12 19:44:28','Heart0235-Functional-Right-Atrium-Lateral-Wall','The lateral wall of the right atrim as viewed from the superior vena cava. The posterior leaflet of the tricuspid valve is also visible in the lower right corner of the image.',0,0,1,0,0),(3553,'Heart0235','video','2015-06-12 19:43:45','2015-06-12 19:44:28','Heart0235-Functional-Right-Atrium-Crista-Terminalis','View of the crista terminalis from the superior vena cava. The crista terminalis is the ridge along the top of the image which seperates the pectinate muscle of the appendage from the rest of the heart.',0,0,1,0,0),(3554,'Heart0235','video','2015-06-12 19:43:45','2015-06-12 19:44:28','Heart0235-Functional-Right-Atrium-Coronary-Sinus-Ostium','The is a view of the coronary sinus from the superior vena cava. There is a large amount of red damaged tissue surrounding the coronary sinus likely due to removal of the heart.',0,0,1,0,0),(3555,'Heart0235','video','2015-06-12 19:43:45','2015-06-12 19:44:28','Heart0235-Functional-Right-Atrium-Triangle-of-Koch','This is the triangle of koch as viewd from the superior vena cava.  The septal leaflet of the tricuspid valve (bottom left) makes up one side of the triangle with the coronary sinu (top middle) and the eustachian ridge (right) making up the other two sides.',0,0,1,0,0),(3556,'Heart0235-Anterior','video','2015-06-12 19:43:45','2015-06-12 19:44:28','Heart0235-Functional-Right-Ventricle-Anterior-Papillary-Muscle','View of the anterior (middle) and septal (right) papillary muscles connecting to the chordae tendoneae of the Tricuspid valve. There is a high degree of trabeculation throughout the ventricle.',0,0,1,0,0),(3557,'Heart0235-Posterior-1','video','2015-06-12 19:43:45','2015-06-12 19:44:28','Heart0235-Functional-Right-Ventricle-Posterior-Papillary-Muscle-1','The posterior papillary muscle can be seen attaching to the chordae tendoneae which continue to the tricuspid valve. A second camera is visible in the upper right corner imaging the paipllary from a second angle.',0,0,1,0,0),(3558,'Heart0235-Posterior-2','video','2015-06-12 19:43:45','2015-06-12 19:44:28','Heart0235-Functional-Right-Ventricle-Posterior-Papillary-Muscle-2','The posterior papillary muscle, as viewed from the right ventricular outflow tract, can be seen attaching to the chordae tendoneae which continue to the tricuspid valve. A second camera is visible in the upper right corner imaging the paipllary from a second angle.',0,0,1,0,0),(3559,'Heart0235-Septal','video','2015-06-12 19:43:45','2015-06-12 19:44:28','Heart0235-Functional-Right-Ventricle-Septal-Papillary-Muscle','View of the septal (right) papillary muscle and the chordae tendoneae of the Tricuspid valve. The anterior papillary muscle (middle) is also visible.',0,0,1,0,0),(3560,'Heart0235','video','2015-06-12 19:43:45','2015-06-12 19:44:28','Heart0235-Functional-Right-Ventricle-Moderator Band','View of the moderator band in the right ventricle. The septal papillary muscle and attaching chordae tendoneae can be seen on the bottom of the screen with the anterior papillary muscle on the top of the screen.',0,0,1,0,0),(3561,'Heart0235','video','2015-06-12 19:43:45','2015-06-12 19:44:28','Heart0235-Functional-Right-Ventricle-Apex','Trabeculation is viewed in the right ventricular apex. There are many conduction bands (white) throughout the apex.',0,0,1,0,0),(3562,'Heart0235-AV','video','2015-06-12 19:43:45','2015-06-12 21:15:11','Heart0235-Comparative-Imaging-Aortic-Valve','This video shows the aortic valve imaged simultaneously from the aorta (top left), the left ventricle (top right), echo (bottom left), and fluoroscopy (bottom right). In the view from the aorta (top left) small yellow calcium deposits are visible on the cusps of the valve.  The view from the left ventricle (top right) also shows us the mitral valve alternating opening with the aortic valve.',0,0,1,0,0),(3563,'Heart0235-MV','video','2015-06-12 19:43:45','2015-06-12 21:15:11','Heart0235-Comparative-Imaging-Mitral-Valve','This video shows 4 different views of the mitral valve. The top left shows the mitral valve from the left atrium, where the anterior leaflet is on the left of the image. The top right shows both the mitral and aortic valve as imaged from the left ventricular apex. The bottom left shows the mitral valve using echo and the bottom right shows the location of the valve via fluoroscopy.',0,0,1,0,0),(3564,'Heart0235-TriV','video','2015-06-12 19:43:45','2015-06-12 21:15:11','Heart0235-Comparative-Imaging-Tricuspid-Valve','Tricuspid Valve as viewed simultaneously from the right atrium (top left), right ventricular apex (top right), echo (bottom left) and fluroscopy (bottom right). In the top left image the tricuspid valve annulus can be seen as a white or lighter ring of tissue surrounding the leaflets of the valve.  In the top right image you can clearly see the conduction bands in the ventricle along with the papillary muscles.',0,0,1,0,0),(3565,'Heart0235-PV','video','2015-06-12 19:43:45','2015-06-12 21:15:11','Heart0235-Comparative-Imaging-Pulmonary-Valve','Pulmonary valve as viewed from the Pulmonary trunk (top left), the right ventricular outflow tract (RVOT) (top right), echo (bottom left), and fluoroscopy (bottom right).',0,0,1,0,0),(3566,'Heart0235','video','2015-06-12 19:43:45','2015-06-12 19:44:28','Heart0235-Functional-External-Anterior','External view of the heart before sinus rhythm is obtained. There is an initial shock which triggeres the heart to start contracting (instead of fibrillation) in a more sinus rhythm. After a few arrhythmias the heart begins to function in a normal sinus rhythm.',0,0,1,0,0),(3567,'Heart0235','video','2015-06-12 19:43:45','2015-06-12 19:44:28','Heart0235-Functional-External-Left-Margin','External view of the left margin. A pressure catheter can be seen coming out of the left ventricular apex. Note the amount of fat (yellow) on the epicardial surface of the heart.',0,0,1,0,0),(3568,'Heart0235','video','2015-06-12 19:43:45','2015-06-12 19:44:28','Heart0235-Functional-External-Right-Margin','External view of the right margin. A few seconds in the lights are turned of and the light from an endoscope in the right atrium is clearly visible from the outside of the heart.',0,0,1,0,0),(3569,'Heart0271','video','2015-06-15 21:38:56','2015-06-15 21:39:42','Heart0271-Functional-Aorta-Aortic-Valve','Aortic Valve as viewed from the Aorta. The non coronary cusp is located at the bottom of the screen with the left coronary cusp and right coronary cusp respectively when rotating clockwise.',0,0,1,0,0),(3570,'Heart0271-Left','video','2015-06-15 21:38:56','2015-06-15 21:39:42','Heart0271-Functional-Aorta-Left-Coronary-Artery-Ostia','A close up view of the left coronary artery ostia. The left cusp of the aorta is also viewed from the aorta. As the camera backs up at the end of the clip calcium deposits can be seen on the cusp.',0,0,1,0,0),(3571,'Heart0271-Right','video','2015-06-15 21:38:56','2015-06-15 21:39:42','Heart0271-Functional-Aorta-Right-Coronary-Artery-Ostia','A close up view of the right coronary artery ostia. The right cusp of the aorta is also viewed from the aorta.',0,0,1,0,0),(3572,'Heart0271-AV','video','2015-06-15 21:38:56','2015-06-15 22:01:36','Heart0271-Functional-Comparative-Imaging-Aortic-Valve','The aortic valve is imaged simultaneously from the ascending aorta using an endoscope (top left), left ventricle using an endoscope (top right), ventricles using a long-axis view with echocardiography (bottom left), and anterior/posterior position using fluoroscopy (bottom right).',0,0,1,0,0),(3573,'Heart0271-Fossa','video','2015-06-15 21:38:56','2015-06-15 22:01:36','Heart0271-Functional-Comparative-Imaging-Fossa-Ovalis','A view of the fossa ovalis from the left atrium using an endoscope in the left and right atrium, along with echo. The right pulmonary veins can be seen to the right of the fossa. The superior vein is towards the top of the clip and the inferior towards the bottom.',0,0,1,0,0),(3574,'Heart0271-MV-1','video','2015-06-15 21:38:56','2015-06-15 21:39:42','Heart0271-Functional-Comparative-Imaging-Mitral-Valve-1','The mitral valve is imaged simultaneously from the left atrium using an endoscope with a right-angle lens (top left), -left ventricle using an endoscope with straight lens (top right), apex using echocardiography (4-chamber long-axis view) (bottom left), and anterior/posterior aspect using fluoroscopy (bottom right).',0,0,1,0,0),(3575,'Heart0271-MV-2','video','2015-06-15 21:38:56','2015-06-15 21:39:42','Heart0271-Functional-Comparative-Imaging-Mitral-Valve-2','A mapping catheter is placed in the left atrium to clearly show the relative position of the left atrium on fluoroscopy. The mitral valve is imaged simultaneously from the left atrium using an endoscope with a right-angle lens (top left), -left ventricle using an endoscope with straight lens (top right), apex using echocardiography (4-chamber long-axis view) (bottom left), and anterior/posterior aspect using fluoroscopy (bottom right).',0,0,1,0,0),(3576,'Heart0271-PV','video','2015-06-15 21:38:56','2015-06-15 21:39:42','Heart0271-Functional-Comparative-Imaging-Pulmonary-Valve','Pulmonary valve as viewed an endoscope in the Right Ventricular Outflow Tract (RVOT), through echo, and using fluoroscopy.',0,0,1,0,0),(3577,'Heart0271-TriV-1','video','2015-06-15 21:38:56','2015-06-15 21:39:42','Heart0271-Functional-Comparative-Imaging-Tricuspid-Valve-1','The tricuspid valve is imaged simultaneously from the right atrium using an endoscope with a right-angle lens, right ventricle using an endoscope with straight lens apex using echocardiography (4-chamber long-axis view) (bottom left), and anterior/posterior aspect using fluoroscopy (bottom right).',0,0,1,0,0),(3578,'Heart0271-TriV-2','video','2015-06-15 21:38:56','2015-06-15 21:39:42','Heart0271-Functional-Comparative-Imaging-Tricuspid-Valve-2','A decapolar mapping catheter is placed at the level of the tricuspid valve annulus to show its position on fluoroscopy. The tricuspid valve is imaged simultaneously from the right atrium using an endoscope with a right-angle lens, right ventricle using an endoscope with straight lens, apex using echocardiography (4-chamber long-axis view) (bottom left), and anterior/posterior aspect using fluoroscopy (bottom right).',0,0,1,0,0),(3579,'Heart0271-1','video','2015-06-15 21:38:56','2015-06-15 22:00:05','Heart0271-Functional-Coronary-Arteries-Right-Coronary-Artery-1','This video begins with the endoscope deep within the right coronary artery and is slowly retracted. The position of the scope can be seen on fluoroscopy (right).',0,0,1,0,0),(3580,'Heart0271-2','video','2015-06-15 21:38:56','2015-06-15 22:00:05','Heart0271-Functional-Coronary-Arteries-Right-Coronary-Artery-2','A video showing a distal branching point deep inside the right coronary artery. The position of the endoscope can be seen on fluoroscopy (right).',0,0,1,0,0),(3581,'Heart0271','video','2015-06-15 21:38:56','2015-06-15 21:39:42','Heart0271-Functional-Coronary-Veins-Coronary-Sinus','This video shows the inside of the coronary sinus. The endoscope is position just within the coronary sinus ostia. Note the remaining valve like structure proximal to the camera referred to as the thebesian valve.',0,0,1,0,0),(3582,'Heart0271','video','2015-06-15 21:38:56','2015-06-15 21:39:42','Heart0271-Functional-Coronary-Veins-Great-Cardiac-Vein',' This video starts with the endoscope (left)  in the great cardiac vein as seen on fluoroscopy (right).  The endoscope is then backed out of the circumflex artery. The degree of  side branches coming off of the vein is clearly shown in the video. At the end the Coronary sinus ostium is viewed along with the thebesian valve.',0,0,1,0,0),(3583,'Heart0271-1','video','2015-06-15 21:38:56','2015-06-15 21:39:42','Heart0271-Functional-Coronary-Veins-Posterior-Interventricular-Vein-1','This video shows the camera being retracted through the posterior interventricular vein. The fluoroscopy view shows the position of the camera as it is retracted through the vasculature, while the endoscope shows the numerous side branches extending from the main vessel.',0,0,1,0,0),(3584,'Heart0271-2','video','2015-06-15 21:38:56','2015-06-15 21:39:42','Heart0271-Functional-Coronary-Veins-Posterior-Interventricular-Vein-2','This video shows the advancement of the endoscope down the posterior interventricular vein. To the right, on fluoroscopy, the position of the scope can be seen advancing.',0,0,1,0,0),(3585,'Heart0271','video','2015-06-15 21:38:56','2015-06-15 21:39:42','Heart0271-Functional-External-Anterior','An anterior clip of the heart shown with pressure monitoring catheters located in the LV and high RVOT. An ultrasound transducer is seen pressing against the LV Apex. The heart is functioning in an unpaced rhythm with approximately 4:1 AV block.',0,0,1,0,0),(3586,'Heart0271','video','2015-06-15 21:38:56','2015-06-15 21:39:42','Heart0271-Functional-Left-Atrium-Foramen-Ovale','A view of the fossa ovalis from the left atrium. The right pulmonary veins can be seen to the right of the fossa. The superior vein is towards the top of the clip and the inferior towards the bottom.',0,0,1,0,0),(3587,'Heart0271','video','2015-06-15 21:38:56','2015-06-15 21:39:42','Heart0271-Functional-Left-Atrium-Left-Atrial-Appendage','This video shows a view looking into the left atrial appendage. Pectinate muscle can be seen stretching from the superior to the inferior portion of the appendage. ',0,0,1,0,0),(3588,'Heart0271-1','video','2015-06-15 21:38:56','2015-06-15 21:39:42','Heart0271-Functional-Left-Atrium-Pulmonary-Vein-Ostia-1','This video shows the ostia of the left common pulmonary vein. Most human hearts have superior and inferior left pulmonary veins whereas this heart has only a left common. The plastic cannula can be seen with some debris from cannulation around the plastic.',0,0,1,0,0),(3589,'Heart0271-2','video','2015-06-15 21:38:56','2015-06-15 21:39:42','Heart0271-Functional-Left-Atrium-Pulmonary-Vein-Ostia-2','This video shows the ostia of the right pulmonary veins with the plastic cannulas within them. The superior vein is seen to the top right and the inferior below it. The fossa ovalis can be seen to the left of the veins.',0,0,1,0,0),(3590,'Heart0271','video','2015-06-15 21:38:56','2015-06-15 21:39:42','Heart0271-Functional-Left-Ventricle-Apex','View of apex of the left ventricle showing the trabeculation and LV bands. It should be noticed that the Apex contracts first and that the contraction moves towards the atria.',0,0,1,0,0),(3591,'Heart0271','video','2015-06-15 21:38:56','2015-06-15 21:39:42','Heart0271-Functional-Left-Ventricle-Bands','A close-up view of the bands of the left ventricle attaching directly to a papillary muscle.',0,0,1,0,0),(3592,'Heart0271','video','2015-06-15 21:38:56','2015-06-15 21:39:42','Heart0271-Functional-Left-Ventricle-Free-Wall','A close-up view of the free wall of the left ventricle. Note the high degree of trabeculation as well as the Anterior Papillary muscle and attached chordae tendoneae.',0,0,1,0,0),(3593,'Heart0271-Posterior','video','2015-06-15 21:38:56','2015-06-15 21:39:42','Heart0271-Functional-Left-Ventricle-Posterior-Papillary-Muscle','View of the posterior papillary complex showing how the trabeculation of the left ventricular free wall often integrates with the papillary complex. Towards the end of the video clip the chordae tendoneae can be seen which attach the papillary muscle to the posterior leaflet of the mitral valve.',0,0,1,0,0),(3594,'Heart0271','video','2015-06-15 21:38:56','2015-06-15 21:39:42','Heart0271-Functional-Pulmonary-Trunk-Pulmonary-Valve','A view of the pulmonary valve from the pulmonary trunk. The Anterior cusp is located on the top of the screen with the right cusp and left cusp respectively moving clockwise.',0,0,1,0,0),(3595,'Heart0271','video','2015-06-15 21:38:56','2015-06-15 21:39:42','Heart0271-Functional-Right-Atrium-Coronary-Sinus-Ostium','A close-up view of the coronary sinus ostium. A posterior interventricular vein ostium can be seen branching off just inside the coronary sinus ostium. Not the Coronary sinus contracting with the right atrium.',0,0,1,0,0),(3596,'Heart0271','video','2015-06-15 21:38:56','2015-06-15 21:39:42','Heart0271-Functional-Right-Atrium-Crista-Terminalis','A close-up view of the right atrial appendage. The tricuspid valve is seen in the lower left corner of the screen. The sagittal band can be seen extending from the top left corner and branching into many smaller pectinate muscles.',0,0,1,0,0),(3597,'Heart0271','video','2015-06-15 21:38:56','2015-06-15 21:39:42','Heart0271-Functional-Right-Atrium-Fossa-Ovalis','A view of the fossa ovalis from the right atrium. Note the abnormal chord like structures around the rim. As the atria contract the fossa can be seen bulging into the right atrium.',0,0,1,0,0),(3598,'Heart0271','video','2015-06-15 21:38:56','2015-06-15 21:39:42','Heart0271-Functional-Right-Atrium-Right-Atrial-Appendage','A close-up view of the right atrial appendage. The tricuspid valve is seen in the lower left corner of the screen. The sagittal band can be seen extending from the top left corner and branching into many smaller pectinate muscles.',0,0,1,0,0),(3599,'Heart0271','video','2015-06-15 21:38:56','2015-06-15 22:00:05','Heart0271-Functional-Right-Atrium-Interatrial-Septum','A view of the intra-arterial septum as seen from the Superior Vena Cava. The fossa ovalis is on the left of the screen with then canulated inferior vena cava ostium on the right. The coronary sinus is also viewed in the upper left portion of the screen.',0,0,1,0,0),(3600,'Heart0271','video','2015-06-15 21:38:56','2015-06-15 21:39:42','Heart0271-Functional-Right-Atrium-Triangle-of-Koch','A close-up view of the triangle of Koch. The septal leaflet of the Tricuspid Valve (top of screen) forms one side with the Coronary Sinus Ostium (bottom right) and Eustachian ridge (bottom left) forming the other two borders.',0,0,1,0,0),(3601,'Heart0271','video','2015-06-15 21:38:56','2015-06-15 21:39:42','Heart0271-Functional-Right-Atrium-Tricuspid-Valve','A view of the tricuspid valve from the right atrium. The septal leaflet is seen to the bottom left with the Anterior leaflet on the top right and the posterior leaflet on the bottom right.',0,0,1,0,0),(3602,'Heart0271-Anterior','video','2015-06-15 21:38:56','2015-06-15 21:39:42','Heart0271-Functional-Right-Ventricle-Anterior-Papillary-Muscle','Right ventricular anterior papillary muscle. Here the endoscope is placed through the pulmonary valve, with the chordae tendoneae seen attaching the papillary muscle to the anterior leaflet of the Tricuspid Valve.',0,0,1,0,0),(3603,'Heart0271','video','2015-06-15 21:38:56','2015-06-15 21:39:42','Heart0271-Functional-Right-Ventricle-Apex','A close-up view of the right ventricle apex. Note the high degree of trabeculation and conduction bands present. Small yellow fat deposits an also be seen buried within the trabeculeae.',0,0,1,0,0),(3604,'Heart0271','video','2015-06-15 21:38:56','2015-06-15 21:39:42','Heart0271-Functional-Right-Ventricle-Moderator-Band','A view of the moderator band of the right ventricle. The moderator band attaches the interventricular septum to the  anterior papillary muscle. The tricuspid valve is located just off the right of the screen.',0,0,1,0,0),(3605,'Heart0271','video','2015-06-15 21:38:56','2015-06-15 21:39:42','Heart0271-Functional-Right-Ventricle-Outflow-Tract','A view of the right ventricle outflow tract (RVOT) as seen by a camera placed through the tricuspid valve and looking upward towards the pulmonary valve. At the beginning of the video we see RV apex and the extreme low portion of the RVOT. The camera then advances and angels towards the pulmonary valve.',0,0,1,0,0),(3606,'Heart0271-PV','video','2015-06-15 21:38:56','2015-06-15 22:00:05','Heart0271-Functional-Right-Ventricle-Pulmonary-Valve','A view of the pulmonary valve from the right ventricle being visualized by a scope placed through the tricuspid valve. The Anterior Cusp is located in the top right corner, with the Left Cusp and Right Cusp respectively when moving clockwise. The Septal papillary muscle and septal leaflet of the tricuspid can also be seen on the bottom half of the screen.',0,0,1,0,0),(3607,'Heart0271-Septal','video','2015-06-15 21:38:56','2015-06-15 21:39:42','Heart0271-Functional-Right-Ventricle-Septal-Papillary-Muscle','A close-up view of the septal papillary muscle visualized by an endoscope placed through the pulmonary valve. The chordae can be seen going from the papillary muscle to the septal leaflet of the tricuspid valve.',0,0,1,0,0),(3608,'Heart0291-Left','video','2015-06-16 19:24:27','2015-06-16 19:31:18','Heart0291-Functional-Aorta-Left-Coronary-Artery-Ostia','View of the left coronary artery ostia. The left cusp of the aortic valve is visible on the upper left portion of the image.',0,0,1,0,0),(3609,'Heart0291-Right','video','2015-06-16 19:24:27','2015-06-16 19:31:18','Heart0291-Functional-Aorta-Right-Coronary-Artery-Ostia','View of the right coronary ostia where the right coronary cusp is located to the upper right portion of the screen. A pigtail catheter can be seen in the lower left corner of the video.',0,0,1,0,0),(3610,'Heart0291','video','2015-06-16 19:24:27','2015-06-16 19:31:18','Heart0291-Functional-Cardiac-Veins-Coronary-Sinus','View of the coronary sinus ostium and the thebesian valve. The tricuspid valve annulus is visible in the upper right portion of the screen along with the septal leaflet of the tricuspid valve.',0,0,1,0,0),(3611,'Heart0291-Fossa','video','2015-06-16 19:24:27','2015-06-16 19:31:18','Heart0291-Functional-Comparative-Imaging-Fossa-Ovalis','Fossa Ovalis imaged simultaneously from the left atriu