an lead to difficulty maintaining location during transseptal punctures.',0,0,1,0,0),(3617,'Heart0291-Anterior','video','2015-06-16 19:24:27','2015-06-16 19:31:18','Heart0291-Functional-Left-Ventricle-Anterior-Papillary-Muscle','View of the left ventricular anterior papillary muscle. Note the number of chordae leaving the papillary to attach to the mitral valve.',0,0,1,0,0),(3618,'Heart0291','video','2015-06-16 19:24:27','2015-06-16 19:31:19','Heart0291-Functional-Left-Ventricle-Apex','View of the left ventricular apex from the tricuspid valve. Many conduction and LV bands are present through the ventricle as well as a high degree of trabeculations. Also note the arrhythmia of contractions as the heart beats normally, skips a few beats, and then begins contracting again.',0,0,1,0,0),(3619,'Heart0291','video','2015-06-16 19:24:27','2015-06-16 19:31:19','Heart0291-Functional-Left-Ventricle-Interventricular-Septum','View of the interventricular septum from the left ventricle. The anterior leaflet of the mitral valve can be seen attaching to the anterior papillary muscle. There is a large amount of calcium deposits on the leaflets of the mitral valve. ',0,0,1,0,0),(3620,'Heart0291','video','2015-06-16 19:24:27','2015-06-16 19:31:19','Heart0291-Functional-Left-Ventricle-Mitral-Valve','Here the mitral valve is imaged via an endoscope passed through the left ventricular apex. The posterior leaflet is located on the upper part of the image, while the anterior leaflet is towards the bottom.',0,0,1,0,0),(3621,'Heart0291-Posterior','video','2015-06-16 19:24:27','2015-06-16 19:31:19','Heart0291-Functional-Left-Ventricle-Posterior-Papillary-Muscle','View of the posterior papillary muscle attaching to the mitral valve. The anterior leaflet is along the top of the valve and the posterior leaflet is along the bottom. Note the yellow colored deposits on the leaflets of the valve.',0,0,1,0,0),(3622,'Heart0291','video','2015-06-16 19:24:27','2015-06-16 19:31:19','Heart0291-Functional-