eart. The right atrial appendage is at the top of the screen and has very little fat (yellow). A camera can be seen lighting the appendage from inside of the heart demonstrating how thin the tissue is.',0,0,1,0,0),(3644,'Heart0317','video','2015-06-16 21:49:01','2015-06-16 21:49:51','Heart0317-Functional-Left-Atrium-Fossa-Ovalis','Fossa Ovalis as viewed from the left atrium. The thin nature of the fossa is demonstrated by placing a light in the right atrium and it can be visualized through the fossa ovalis.',0,0,1,0,0),(3645,'Heart0317','video','2015-06-16 21:49:01','2015-06-16 21:49:51','Heart0317-Functional-Left-Atrium-Left-Atrial-Appendage','View of the left atrial appendage as seen through the right pulmonary veins. Note that the left atrial appendage is both smaller and appears thicker than the right atrial appendage.',0,0,1,0,0),(3646,'Heart0317','video','2015-06-16 21:49:01','2015-06-16 21:49:51','Heart0317-Functional-Left-Atrium-Mitral-Valve','View of the mitral valve from the left atrium. The anterior leaflet is located on the bottom/right of the image while the posterior leaflet is located on the left of the valve. The valve is lit by a camera placed in the left ventricle through the apex.',0,0,1,0,0),(3647,'Heart0317-1','video','2015-06-16 21:49:01','2015-06-16 21:49:51','Heart0317-Functional-Left-Atrium-Pulmonary-Vein-Ostia-1','View of the right pulmonary vein ostia. The superior ostium is located at the top of the image. As the video progresses the right inferior pulmonary vein ostium comes into view at the bottom left of the screen. The fossa ovlais is also visible on the right of the image.',0,0,1,0,0),(3648,'Heart0317-2','video','2015-06-16 21:49:01','2015-06-16 21:49:51','Heart0317-Functional-Left-Atrium-Pulmonary-Vein-Ostia-2','View of the left pulmonary vein ostia. The left superior pulmonary vein ostium is located in the bottom right portion of the screen while the inferior pulmonary vein ostium is located in the top right. The mitral valve is also visible in the top left corner and left atrial appendage is in the bottom middle of the image.',0,0,1,0,0),(3649,'Heart0317-Anterior','video','2015-06-16 21:49:01','2015-06-16 21:49:51','Heart0317-Functional-Left-Ventricle-Anterior-Papillary-Muscle','Functional view of the anterior papillary complex in the left ventricle. Note that the complex is made of a single muscle that separates into two distinct heads which then attach to the chordae tendoneae.',0,0,1,0,0),(3650,'Heart0317','video','2015-06-16 21:49:01','2015-06-16 21:49:51','Heart0317-Functional-Left-Ventricle-Aortic-Valve','View of the aortic valve from an endoscope placed through the left ventricular apex. The right coronary cusp is located in the bottom right of the image, with the left coronary cusp and non-coronary cusp respectively clockwise.',0,0,1,0,0),(3651,'Heart0317','video','2015-06-16 21:49:01','2015-06-16 21:49:51','Heart0317-Functional-Left-Ventricle-Apex','View of the left ventricular apex from a camera placed through the mitral valve. There is a large amount of trabeculation throughout the apex. Also note the amount of contraction that the apex experiences with each contraction of the heart.',0,0,1,0,0),(3652,'Heart0317','video','2015-06-16 21:49:01','2015-06-16 21:49:51','Heart0317-Functional-Left-Ventricle-Left-Ventricular-Bands','View of the left ventricular bands in the apex from a camera placed through the mitral valve. There is a large amount of trabeculation throughout the apex. Also note the amount of contraction that the apex experiences with each contraction of the heart.',0,0,1,0,0),(3653,'Heart0317','video','2015-06-16 21:49:01','2015-06-16 21:49:51','Heart0317-Functional-Left-Ventricle-Mitral-Valve','View of the mitral valve from the left ventricular apex. The anterior leaflet is on the right and the posterior leaflet is on the left. The aortic valve is also visible at the far right of the image.',0,0,1,0,0),(3654,'Heart0317-Posterior','video','2015-06-16 21:49:01','2015-06-16 21:49:51','Heart0317-Functional-Left-Ventricle-Posterior-Papillary-Muscle','View of the posterior papillary complex from the mitral valve. The papillary extends from the apex towards the camera before bifurcating into three separate heads. ',0,0,1,0,0),(3655,'Heart0317','video','2015-06-16 21:49:01','2015-06-16 21:49:51','Heart0317-Functional-Pulmonary-Artery-Pulmonary-Valve','View of the pulmonary valve from the pulmonary trunk. A pressure catheter can be seen in the right ventricular outflow tract directly behind the anterior cusp of the pulmonary valve. The right cusp is located on the bottom left of the screen and the left cusp is on the top left.',0,0,1,0,0),(3656,'Heart0317','video','2015-06-16 21:49:01','2015-06-16 21:49:51','Heart0317-Functional-Right-Atrium-Coronary-Sinus-Ostium','View of the coronary sinus ostium and the thebesian valve. The thebesian valve is the thin white tissue that covers the opening of the ostium. As the video progresses the Septal and anterior leaflets of the tricuspid valve are visible in the lower right corner.',0,0,1,0,0),(3657,'Heart0317','video','2015-06-16 21:49:01','2015-06-16 21:49:51','Heart0317-Functional-Right-Atrium-Crista-Terminalis','View of the crista terminalis and the right atrial appendage. The crista terminalis is the smooth ridge that separates the pectinate muscle of the appendage from the smoother muscle of the atrium (top right).  This video also demonstrates how thin the tissue of the appendage is as a business card is passed over the outer surface and the \"University of Minnesota\" is clearly visualized through the tissue.',0,0,1,0,0),(3658,'Heart0317-1','video','2015-06-16 21:49:01','2015-06-16 21:49:51','Heart0317-Functional-Right-Atrium-Right-Atrial-Appendage-1','View of the right atrial appendage fibrillating before whole heart reanimation. The pathway of conduction can be seen propagating through the tissue and the changing as beats are triggered from various locations throughout the atrial appendage.',0,0,1,0,0),(3659,'Heart0317-2','video','2015-06-16 21:49:02','2015-06-16 21:49:51','Heart0317-Functional-Right-Atrium-Right-Atrial-Appendage-2','View of the crista terminalis and the right atrial appendage. The crista terminalis is the smooth ridge that separates the pectinate muscle of the appendage from the smoother muscle of the atrium (top right).  This video also demonstrates how thin the tissue of the appendage is as a business card is passed over the outer surface and the \"University of Minnesota\" is clearly visualized through the tissue.',0,0,1,0,0),(3660,'Heart0317','video','2015-06-16 21:49:02','2015-06-16 21:49:51','Heart0317-Functional-Right-Atrium-Tricuspid-Valve','Tricuspid Valve as viewed from the right atrium. The septal leaflet is located on the left of the screen with the anterior leaflet in the top right and the posterior leaflet on the bottom right.',0,0,1,0,0),(3661,'Heart0317-Anterior','video','2015-06-16 21:49:02','2015-06-16 21:49:51','Heart0317-Functional-Right-Ventricle-Anterior-Papillary-Muscle','View of the anterior papillary muscle of the tricuspid valve.  Several conduction bands can be seen extending perpendicular to the papillary muscle while the chordae tendoneae extend out the top of the papillary and eventually connect to the tricuspid valve leaflets.',0,0,1,0,0),(3662,'Heart0317','video','2015-06-16 21:49:02','2015-06-16 21:49:51','Heart0317-Functional-Right-Ventricle-Apex','View of the right ventricular apex. There is a large amount of trabeculation that can be seen throughout the apex. There are also a large number of conduction bands throughout the apex.',0,0,1,0,0),(3663,'Heart0317','video','2015-06-16 21:49:02','2015-06-16 21:49:51','Heart0317-Functional-Right-Ventricle-Inflow-Tract','View of the right ventricular inflow tract from an endoscope placed through the pulmonary valve. The septal leaflet is visible on the lower portion of the screen.',0,0,1,0,0),(3664,'Heart0317','video','2015-06-16 21:49:02','2015-06-16 21:49:51','Heart0317-Functional-Right-Ventricle-Moderator-Band','View of the moderator band the  right ventricle. The intraventricular septum is seen on the left and the moderator (thick muscular band) is seen connecting to the base of the anterior papillary muscle on the right of the screen.',0,0,1,0,0),(3665,'Heart0317','video','2015-06-16 21:49:02','2015-06-16 21:49:51','Heart0317-Functional-Right-Ventricle-Outflow-Tract','View of the right ventricular outflow tract from an endoscope placed through the tricuspid valve, then angled back towards the pulmonary valve. The septal papillary muscle is viewed on the middle right portion of the screen and the pulmonary valve is in the top right corner.',0,0,1,0,0),(3666,'Heart0317-Septal','video','2015-06-16 21:49:02','2015-06-16 21:49:51','Heart0317-Functional-Right-Ventricle-Septal-Papillary-Muscle','View of the septal papillary muscle. The septal papillary muscle is much smaller than the anterior or posterior papillary muscle and is located right at the base of the right ventricular outflow tract. ',0,0,1,0,0),(3667,'Heart0317','video','2015-06-16 21:49:02','2015-06-16 21:49:51','Heart0317-Functional-Right-Ventricle-Tricuspid-Valve','Tricuspid valve as viewed from the right ventricular outflow tract. The septal papillary muscle is in the front of this image (top), while the anterior papillary (bottom) and attaches directly to the anterior leaflet of the tricuspid valve. The posterior leaflet and papillary are visible in the background of the image.',0,0,1,0,0),(3668,'Heart0046','video','2015-07-14 18:34:39','2015-07-14 18:35:31','Heart0046-3D-Modeling-Blood-Volume-Hypertrophic','A 3D reconstruction of the blood volume of heart 0046 is visualized here. The right side volume is modeled in blue, and the left side is modeled in red. The proximal portions of the right and left coronary arteries are visible. The cusps of the pulmonary valve are aslo seen in the blue mask.',0,0,1,0,0),(3669,'Heart0046-Tissue','video','2015-07-14 18:34:39','2015-07-14 18:35:31','Heart0046-3D-Modeling-Blood-Volume-Tissue-Hypertrophic','This is a 3D reconstruction of the tissue and blood volume for Heart 0046.  In the blood volume mask the right and left blood volumes are seen along with proximal portions of the coronary sinus and coronary arteries. The tissue mask is overlayed to provide a reference to overall heart shape and size.',0,0,1,0,0),(3670,'Heart0111','video','2015-07-14 18:34:39','2015-07-14 18:35:31','Heart0111-3D-Modeling-Blood-Volume-Normal','This is a 3D blood volume reconstruction of a heart from a 25 year old male. In this reconstruction one can clearly visualize the shape of the left and right atrial appendages, along with the right ventricular outflow tract.',0,0,1,0,0),(3671,'Heart0111-Tissue','video','2015-07-14 18:34:39','2015-07-14 18:35:31','Heart0111-3D-Modeling-Blood-Volume-Tissue-Normal','This is a 3D tissue and blood volume reconstruction of a heart from a 25 year old male. In this reconstruction one can clearly visualize the shape of the left and right atrial appendages, along with the right ventricular outflow tract. The tissue mask is overlayed to provide a reference for overall heart shape and size.',0,0,1,0,0),(3672,'Heart0137','video','2015-07-14 18:34:39','2015-07-14 18:35:31','Heart0137-3D-Modeling-Blood-Volume-Hypertrophic','Shown is a 3D reconstruction of a heart from a 47 year old female with PAD and chronic hypertension.  The pulmonary valve can be visualized via indentations in the right side (blue) blood volume mask. The amount of trabeculation can also be seen in both the left and right ventricular blood volumes.',0,0,1,0,0),(3673,'Heart0137-Tissue','video','2015-07-14 18:34:39','2015-07-14 18:35:32','Heart0137-3D-Modeling-Blood-Volume-Tissue-Hypertrophic','Shown is a 3D reconstruction of a heart from a 47 year old female with PAD and chronic hypertension.  The pulmonary valve can be visualized via indentations in the right side (blue) blood volume mask. The amount of trabeculation can also be seen in both the left and right ventricular blood volumes. The tissue is overlayed to show the degree of left ventricular wall thinkening and provide a reference for overall size and shape.',0,0,1,0,0),(3674,'Heart0148','video','2015-07-14 18:34:39','2015-07-14 18:35:32','Heart0148-3D-Modeling-Blood-Volume-Normal','This is a 3D blood volume reconstruction of the heart of a 73 year old female with a history of Atrial Fibrillation. The aortic valve is prominently fratured in this model and its location is marked via indentations in the left (red) sided blood volume.',0,0,1,0,0),(3675,'Heart0148-Tissue','video','2015-07-14 18:34:39','2015-07-14 18:35:32','Heart0148-3D-Modeling-Blood-Volume-Tissue-Normal','This is a 3D blood and tissue volume reconstruction of the heart of a 73 year old female with a history of Atrial Fibrillation. The aortic valve is prominently fratured in this model and its location is marked via indentations in the left (red) sided blood volume.  The overlayed tissue mask shows a large degree of left ventricular wall thinkening.',0,0,1,0,0),(3676,'Heart0188','video','2015-07-14 18:34:39','2015-07-14 18:35:32','Heart0188-3D-Modeling-Blood-Volume-Normal','Shown here is a 3D blood volume reconstruction of a heart from a 61 year old female. The left atrium of this heart has been removed likely due to lung transplantation. The aortic valve is prominently featured in this model and its location is marked via indentations in the left (red) sided blood volume.',0,0,1,0,0),(3677,'Heart0188-Tissue','video','2015-07-14 18:34:39','2015-07-14 18:35:32','Heart0188-3D-Modeling-Blood-Volume-Tissue-Normal','Shown here is a 3D blood volume reconstruction of a heart from a 61 year old female. The left atrium of this heart has been removed likely due to lung transplantation. The aortic valve is prominently featured in this model and its location is marked via indentations in the left (red) sided blood volume. The tissue mask is overlayed to provide a reference for overall heart shape and size.',0,0,1,0,0),(3678,'Heart0111','video','2015-07-14 18:34:39','2015-07-14 18:35:32','Heart0111-3D-Modeling-Tissue-Normal','This is a 3D tissue reconstruction of a heart from a 25 year old male. This individual had an extensive history of drug and alcohol abuse however their cardiac history was relatively normal.',0,0,1,0,0),(3679,'Heart0126','video','2015-07-14 18:34:39','2015-07-14 18:35:32','Heart0126-3D-Modeling-Tissue-Hypertrophic','This video shows a 3D reconstruction of a heart generated from a CT scan. The heart is from a 50 year old male with hypertension, hypercholesterolemia, and a 25 year smoking history. In this reconstruction the right ventricular outflow tract (RVOT) is prominently featured extenind across the anterior surface of the heart.',0,0,1,0,0),(3680,'Heart0137','video','2015-07-14 18:34:39','2015-07-14 18:35:32','Heart0137-3D-Modeling-Tissue-Hypertrophic','Shown below is a 3D reconstruction of a heart from a 47 year old female with PAD and chronic hypertension.  The aorta and superior vena are prominently featured in this reconstruction. A band of fat can also be seen covering the coronary sinus as it wraps around the left atrium. Another prominent feature of this heart is the single common left pulmonary vein.',0,0,1,0,0),(3681,'Heart0148','video','2015-07-14 18:34:39','2015-07-14 18:35:32','Heart0148-3D-Modeling-Tissue-Normal','This is a 3D reconstruction of the heart of a 73 year old female with a history of Atrial Fibrillation. The Inferior Vena Cava ostium on the posterior surface of the hearts allows us to see a marker placed at thelevel of the Tricuspid valve annulus.',0,0,1,0,0),(3682,'Heart0188','video','2015-07-14 18:34:39','2015-07-14 18:35:32','Heart0188-3D-Modeling-Tissue-Normal','Shown here is a 3D reconstruction of a heart from a 61 year old female. The left atrium of this heart hasa been removed likely due to lung transplantation. Because the left atrium is not present the Mitral Valve is easily visible as the heart rotates.',0,0,1,0,0),(3683,'Heart0002','still','2015-07-16 21:36:18','2015-07-17 21:33:34','Heart0002-ECG','HR: 75<br />PR Interval: 124<br />QRS: 108<br />QT/QTC: 424/473<br />PRT axes: 69-50-40<br /><br />Cardiologist Interpretation: Abnormal ECG, Normal sinus rhythm, LVH voltage in AVL, Left anterior fascicular block, Prolonged QT wave.',0,0,0,0,0),(3684,'Heart0004','still','2015-07-16 21:36:19','2015-07-17 21:33:34','Heart0004-ECG','HR: 88<br />PR Interval: 160<br />QRS: 96<br />QT/QTC: 500/600<br />PRT axes: 53-11-55<br /><br />Automated Interpretation: Normal sinus rhythm, prolonged QT, Abnormal ECG.<br /><br />Cardiologist Interpretation: Normal sinus rhythm, 90 bpm.',0,0,0,0,0),(3685,'Heart0085','still','2015-07-17 15:22:36','2015-07-17 21:28:53','Heart0085-ECG','HR: 69<br />PR Interval: 200<br />QRS: 98<br />QT/QTC: 442/452<br />PRT axes: -<br /><br />Automated Interpretation: Normal sinus rhythm, Moderate voltage criteria for LVH, may be normal variant, Boderline ECG, No previous ECGs available.',0,0,0,0,0),(3686,'Heart0131','video','2015-07-20 18:41:17','2015-07-20 18:41:53','Heart0131-3D-Modeling-Blood-Volume-Normal','Blood volume model from a 51 year old male with a history of hypertension. The blood volume of the left atrial appendage is nicely reconstructed here.',0,0,1,0,0),(3687,'Heart0131-Tissue','video','2015-07-20 18:41:17','2015-07-20 18:41:54','Heart0131-3D-Modeling-Blood-Volume-Tissue-Normal','Combined blood and tissue model from a 51 year old male with a history of hypertension. The transpartent tissue model allows visualization of the wall thickness, note how the RV and LV wall thinkness is very similar in this particular heart.',0,0,1,0,0),(3690,'Heart0131','video','2015-07-20 18:41:17','2015-07-20 18:41:54','Heart0131-3D-Modeling-Tissue-Normal','Combined blood and tissue model from a 51 year old male with a history of hypertension. The coronary vasculature is visible on the anterior surface of this 3D reconstruction.',0,0,1,0,0),(3692,'Heart0222','video','2015-07-21 16:17:03','2015-07-21 16:17:26','Heart0222-Functional-Cardiac-Veins-Venogram','',0,0,1,0,0),(3693,'Heart0083','video','2015-08-04 23:02:01','2015-08-04 23:02:49','Heart0083-3D-Modeling-Blood-Volume-Hypertrophic','Shown here is a blood volume  model of Heart0083 from a 56 year old male with no known cardiac history.  This model shows a slight degree of left ventricular hypertrophy.',0,0,1,0,0),(3694,'Heart0083-Tissue','video','2015-08-04 23:02:01','2015-08-04 23:02:49','Heart0083-3D-Modeling-Blood-Volume-Tissue-Hypertrophic','Shown here is a combined blood and tissue  model of Heart0083 from a 56 year old male with no known cardiac history.  This model shows a slight degree of left ventricular hypertrophy.',0,0,1,0,0),(3695,'Heart0096','video','2015-08-04 23:02:01','2015-08-04 23:02:49','Heart0096-3D-Modeling-Blood-Volume-Normal','This model represents the combined blood and tissue  model of Heart0096 from a 54 year old male with a history of hypertension and semilunar valve regurgitation. This shows the bifrication of the pulmonary artery in the blue, or right side, blood volulme.',0,0,1,0,0),(3696,'Heart0096-Tissue','video','2015-08-04 23:02:01','2015-08-04 23:02:49','Heart0096-3D-Modeling-Blood-Volume-Tissue-Normal','This model represents the combined blood and tissue  model of Heart0096 from a 54 year old male with a history of hypertension and semilunar valve regurgitation. The left atrium and pulmonary veins are visualized in this model.',0,0,1,0,0),(3697,'Heart0110','video','2015-08-04 23:02:01','2015-08-04 23:02:49','Heart0110-3D-Modeling-Blood-Volume-Normal','This model represents the blood model of Heart0110 from a 61 year old female with no known cardiac history. All three of the branches off the aortic arch are visible in this model. ',0,0,1,0,0),(3698,'Heart0110-Tissue','video','2015-08-04 23:02:01','2015-08-04 23:02:49','Heart0110-3D-Modeling-Blood-Volume-Tissue-Normal','This model represents the combined blood and tissue model of Heart0110 from a 61 year old female with no known cardiac history. The increased thickness of the left ventricular wall is nicely reconstructed here. ',0,0,1,0,0),(3699,'Heart0141','video','2015-08-04 23:02:01','2015-08-04 23:02:49','Heart0141-3D-Modeling-Blood-Volume-Normal','Shown here is a blood model of Heart0141 from a 24 year old female with no known cardiac history. This model is an accurate representation of an approximately normal heart. ',0,0,1,0,0),(3700,'Heart0141-Tissue','video','2015-08-04 23:02:01','2015-08-04 23:02:49','Heart0141-3D-Modeling-Blood-Volume-Tissue-Normal','Shown here is a combined blood and tissue model of Heart0141 from a 24 year old female with no known cardiac history. This model is an accurate representation of an approximately normal heart. ',0,0,1,0,0),(3701,'Heart0145','video','2015-08-04 23:02:01','2015-08-04 23:02:49','Heart0145-3D-Modeling-Blood-Volume-Normal','Shown here is a blood model of Heart0145 from a 53 year old male with no known cardiac history. The proximal portion of the coronary sinus is reconstructed here. The blood volume of the left atrium is nicely recomstructed.',0,0,1,0,0),(3702,'Heart0145-Tissue','video','2015-08-04 23:02:01','2015-08-04 23:02:49','Heart0145-3D-Modeling-Blood-Volume-Tissue-Normal','Shown here is a combined blood and tissue model of Heart0145 from a 53 year old male with no known cardiac history. The left ventricular blood volume and wall thickness are an accurate representation of an average heart. ',0,0,1,0,0),(3703,'Heart0157','video','2015-08-04 23:02:01','2015-08-04 23:02:49','Heart0157-3D-Modeling-Blood-Volume-Normal','This model represents the blood model of Heart0157 from a 78 year old female with no known cardiac history. The coronary arteries and their proximal branches are nicely visualized here. ',0,0,1,0,0),(3704,'Heart0157-Tissue','video','2015-08-04 23:02:01','2015-08-04 23:02:49','Heart0157-3D-Modeling-Blood-Volume-Tissue-Normal','This model represents the combined blood and tissue model of Heart0157 from a 78 year old female with no known cardiac history.The coronary artries can be seen extending from the just about the susps of the aortic valve.',0,0,1,0,0),(3705,'Heart0215','video','2015-08-04 23:02:01','2015-08-04 23:02:49','Heart0215-3D-Modeling-Blood-Volume-Normal','Shown here is a blood model of Heart0215 from a 57 year old female with a 40+ year smoking history and COPD. This is an accurate representation of an approximately normal heart. ',0,0,1,0,0),(3706,'Heart0215-Tissue','video','2015-08-04 23:02:01','2015-08-04 23:02:49','Heart0215-3D-Modeling-Blood-Volume-Tissue-Normal','Shown here is a combined blood and tissue model of Heart0215 from a 57 year old female with a 40+ year smoking history and COPD. This model nicely visualizes the differences in wall thickness between the left and right ventricles. Note the thinkness of the right ventricle can be increased due to high pulmonary resistance.',0,0,1,0,0),(3707,'Heart0229','video','2015-08-04 23:02:01','2015-08-04 23:02:49','Heart0229-3D-Modeling-Blood-Volume-Hypertrophic','Shown here is a blood model of Heart0229 from a 44 year old female with a history of hypertension. The left ventricular volume is not significantly decreased, contrary to what is normally seen in patients with hypertension. ',0,0,1,0,0),(3708,'Heart0229-Tissue','video','2015-08-04 23:02:01','2015-08-04 23:02:49','Heart0229-3D-Modeling-Blood-Volume-Tissue-Hypertrophic','Shown here is a combined tissue and blood model of Heart0229 from a 44 year old female with a history of hypertension. The left ventricular wall is slightly thicker than normal.',0,0,1,0,0),(3709,'Heart0083','video','2015-08-04 23:02:01','2015-08-04 23:02:49','Heart0083-3D-Modeling-Tissue-Hypertrophic','Shown here is a tissue model of Heart0083 from a 56 year old male with no known cardiac history.  This model represents an approximately normal tissue model with slight left ventricular hypertrophy.',0,0,1,0,0),(3710,'Heart0096','video','2015-08-04 23:02:01','2015-08-04 23:02:49','Heart0096-3D-Modeling-Tissue-Normal','This model represents the tissue  model of Heart0096 from a 54 year old male with a history of hypertension and semilunar valve regurgitation. The left and right atria shown in this model are an accurate representation for an approximately normal heart.',0,0,1,0,0),(3711,'Heart0110','video','2015-08-04 23:02:01','2015-08-04 23:02:49','Heart0110-3D-Modeling-Tissue-Normal','This model represents the tissue model of Heart0110 from a 61 year old female with no known cardiac history. The model is an accurate representation of an approximately normal heart. ',0,0,1,0,0),(3712,'Heart0141','video','2015-08-04 23:02:01','2015-08-04 23:02:49','Heart0141-3D-Modeling-Tissue-Normal','Shown here is a tissue model of Heart0141 from a 24 year old female with no known cardiac history. There is a layer of fat surrounding the coronary sinus which can be seen on the posterior surface of the heart.',0,0,1,0,0),(3713,'Heart0145','video','2015-08-04 23:02:01','2015-08-04 23:02:49','Heart0145-3D-Modeling-Tissue-Normal','Shown here is a tissue model of Heart0145 from a 53 year old male with no known cardiac history. A slight depression is visible in the pulmonary artery, which probably occurred during plastination.',0,0,1,0,0),(3714,'Heart0157','video','2015-08-04 23:02:01','2015-08-04 23:02:49','Heart0157-3D-Modeling-Tissue-Normal','This model represents the tissue model of Heart0157 from a 78 year old female with no known cardiac history. A large amount of epicardial fat accounts for the distortion around the superior vena cava and pulmonary artery. ',0,0,1,0,0),(3715,'Heart0215','video','2015-08-04 23:02:01','2015-08-04 23:02:49','Heart0215-3D-Modeling-Tissue-Normal','Shown here is a tissue model of Heart0215 from a 57 year old female with no known cardiac history. Both branches of the pulmonary artery are visible in this model. Note the thinkness of the right ventricle and right ventricular outflow tract can be increased due to high pulmonary resistance.',0,0,1,0,0),(3716,'Heart0229','video','2015-08-04 23:02:01','2015-08-04 23:02:49','Heart0229-3D-Modeling-Tissue-Hypertrophic','Shown here is a tissue model of Heart0229 from a 44 year old female with a history of hypertension. All four pulmonary veins can be seen on the posterior surface of the left atrium.',0,0,1,0,0);
